INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM1','FFPM 1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM1', 'Andriananahary masina indrindra!\nNy anjelinao izay mitoetra Aminao\nMifamaly hoe : Masina indrindra\nAndriananahary, Telo Izay Iray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM1', 'Andriananahary masina indrindra!\nNa tsy hita aza izao ny voninahitrao!\nMasina indrindra Hianao irery.\nAndriananahary, Telo Izay Iray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM1', 'Zava-manana aina samy mankalaza\nSady manambara Anao Izay Tompony izao;\nHianao irery no mitahy azy,\nAndriananahary, Telo Izay Iray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM1', 'Andriananahary feno hatsarana!\nHe ny fitahianao izay mpanomponao.\nTsara dia tsara ny omenao azy\nAndriananahary, Telo Izay Iray.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM1', 'Andriananahary masina indrindra!\nIzahay mpanomponao ta-hankalaza Anao;\nFeno fahendrena, feno fiantrana,\nAndriananahary, Telo Izay Iray.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM2','FFPM 2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM2', 'Misaora an''i Zanahary\n''Zao olona tontolo izao;\nDia mankalazà Azy,\nFa anton''izao rehetra izao', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM2', 'Izay zavatra nomeny\nMahafaly, mahasoa;\nToy ny andro fararano,\nToy ny andro mipoaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM2', 'Dia ampitomboy ny sainay\nHahalala ny teninao,\nHahafantatra marina\nIzay sitraky ny fonao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM3','FFPM 3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM3', 'Isaorana anie Andriamanitsika\nFa fitahiam-be Omeny ho antsika\nHatreo ambohoka\nKa mandraka antitra,\nIsika henika\nNy soan''ny lanitra', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM3', 'Tsy mety tapitra na lany ny hareny,\nTsy hita faritra ny sisa izay homeny;\nFanahy sambatra\nSy fo miadana\nNo efa santatra\nIzay ananana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM3', 'Ny Ray sy Zanaka sy ny Fanahy koa,\nDerain''ny masina ho Tompo iray tokoa;\nAndriamanitray\nBe fahasoavana\nNo anateranay\nIzay fisaorana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM4','FFPM 4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM4', 'Mamy ny fitianao,\nRy Jehovah Tomponay!\nFoinao ny Zanakao,\nHo Mpanavotra anay.\nTsy mba misy tokinay\nAfatsy ny Zanakao.\nKa misaotra Anao izahay\nNoho ny fitianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM4', 'Mamy ny fitianao,\nMahafaly fo tokoa;\nIzahay avelanao\nMba hibebaka avokoa.\nLasa lavitra izahay,\nNefa notadiavinao;\nEfa ratsy izahay,\nNefa tsy nafoinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM4', 'Mamy ny fitianao,\nIzay andraisanao anay\nHOnina ao an-dapanao\nRaha ho faty izahay\nNoho ny rastsy izay natao,\nLoza no anjaranay,\nNefa namboaranao\nParadisa izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM4', 'Mamy re, ry Tomponay!\nIzao fitianao izao,\nKa indreto izahay\nAvy mba hisaotra Anao.\nRaiso re izao saotra izao,\nFa fanati-tsitrapo;\nTsy mba mendrika ho Anao,\nNefa vokatry ny fo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM5','FFPM 5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM5', 'Jehovah, Ray an-danitra,\nMpamelona anay\nTsinjovy ny mpanomponao,\nTsarovy izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM5', 'Jehovah, Ray mamindra fo!\nHenoy ny hatakay;\nEkeo sy raso ho Anao\nNy dera entinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM5', 'Jehovah, Ray mahari-po!\nVonoy ny helokay;\nDiovy ny fanahinay,\nVelomy izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM5', 'Jehovah Ray! Ny antranao\nNo itokianay;\nAmbara-pahafatinay\nHisaoranay Hianao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM6','FFPM 6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM6', 'Avia, miondreha,\nRy vazan-tany ô!\nFa lehibe Jehovah,\nSy masina tokoa;\nMiankohofa tsara,\nManatona Azy ''zao\nHaneho fanajana\nILay Mpanao anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM6', 'Andriananahary,\nManaiky izahay\nFa Aminao ny hery\nTsy hay toherina.\nTsy misy maharara\nNy tianao hatao,\nFa Hianao Mpitondra\nIzao rehetra izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM6', 'Re any lavitra any\nIzao ny herinao,\nKa isam-bazan-tany\nHiondrika Aminao;\nMpanjaka sy Mpitsara\nMahery Hianao;\nMiadana ny tany\nMiankina aminao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM7','FFPM 7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM7', 'Misaora an''Andriamanitra\nIzay nanao ny lanitra.\nNamorona ny tany koa\nSy ''zay rehetra mahasoa', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM7', 'Derao ny voninahiny,\nAnkalazao ny heriny,\nJereo ny fitiavany\nTsy tambonao tononina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM7', 'Dia avy izahay izao,\nRy Tompo be fitia ô!\nMiondrika eo imasonao\nMidera ny Anaranao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM7', 'Isaorana mandrakizay\nHianao, Andriamanitray!\nNy haja be indrindra izao\nAtolotray mpanomponao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM8','FFPM 8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM8', 'Dera, Laza, Hery, Haja,\nHo an''Andriamanitra\nTompon''aina, Zanahary,\nRain''ny voninahitra,\nIzy no mpanao antsika,\nSady ivelomana;\nFototr''aina, foto-tsoa,\nIzy ivavahana.\nHihira isika hoe : Haleloia!\nDera ho an''Andriamanitra\n:,:Dia Haleloia! Haleloia! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM8', 'Ray Tsitoha, tsy miova,\nTia sy mamindra fo,\nMahasoa isan''andro,\nIzy no isaorana;\nVatolampy tsy mifindra,\nTokin''olombelona;\nFiarova-mahavonjy,\nIzy itokiana\nHihira isika hoe : Haleloia!\nDera ho an''Andriamanitra\n:,:Dia Haleloia! Haleloia! :,:', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM9','FFPM 9');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM9', 'Ry Tompo Zanaharinay!\nManati-tsaotra izahay,\nF''efa novelominao,\nKa tratr''izao maraina izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM9', 'Ny aizina efa lasa izao,\nmazava no naposakao;\nLevony koa ny otanay,\nKa hazavao ny hevitray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM9', 'Ny asanay hatao anio\nAtrehonao ka mba tahio,\nHatao ho voninahitrao,\nHandrasanay ny antranao', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM9', 'Derainay Hianao, ry Ray!\nDerainay Jeso Tomponay,\nDerainay ny Fanahy koa,\nDerainay fa mpanisy soa', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM10','FFPM 10');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Ry Tomponay Tsitoha ô!\nMpanao izao tontolo izao,\nAnkalazainay Hianao\nFa lehibe ny herinao,', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Ny hiran''ny anjelinao\nManerana ny lanitra,\nManehoeho fatratra\nNy hobin''ny voaavotra;', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Fa masina, fa masina,\nFa masina i Jehovah!\nKa heniky ny lazanao\nNy tany sy ny lanitrao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Ireo mpitory irakao\nMihoby eo anilanao,\nNahefa fanompoana,\nMihira ny fisaorana', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Izao olonao rehetra izao\nDia mino sy manaiky Anao\nHo Ray Tsy miova sady to,\nMahery ny mpamindra fo.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Ny Zanakao nirahinao\nSy ny Fanahy Masinao\nIsaoranay Anao, ry Ray,\nFa foto-pamonjena anay!', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM10', 'Ry Kristy ô, Mpanjakanay\nMitovy hery amin-dRay', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM11','FFPM 11');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Endrey ny voninahitrao\nRy Ray Tsitoha ô!\nEndrey ny fiandriananao\nHajainay eram-po.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Ny herinao, ny andronao,\nDia mandrakizay!\nNy lanitra mitsaoka Anao\nRy Andriamanitray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Ny tavanao mamiratra\nNy fahamasinanao\nSy hery tapitr’ohatra\nNy fahendrenao soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Endrey, matahotra aho izao,\nRy Tompo Masina ô!\nMangovitra eo imasonao\nSao dia lavinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Na dia ambony Hianao,\nDia nidina amiko\nNitondra fihavanana,\nKa dia mba tiako.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'Koa aiza re no misy ray\nMitovy Aminao :\nMikarakara tsara anay\nIzay natsanganao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM11', 'O, mahagaga Hianao,\nRy Tompo tia anay,\nNy fonay dia hatoky Anao\nAmbara-podinay.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM12','FFPM 12');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM12', 'Jehovah ô, derainay  Hianao!\nAnkalazainay ny Anaranao!\n:,: Izao rehetra izao manaja\nAnao\nFa Rainay ho mandrakizay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM12', 'Mpanjakanay sy Tompo\nMasina\nOmenay eram-po ny hasina\n:,: Izao rehetra izao mihoby\nAnao\nFa Rainay ho mandrakizay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM12', 'Ry Masina manerinerina,\nJehovah be fitia sy marina!\n:,: Izao rehetra izao misaotra\nAnao\nFa Rainay ho mandrakizay :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM12', 'Manerana izao tontolo izao\nNy laza sy ny voninahitrao,\n:,: Izao rehetra izao hanoa\nAnao\nFa Rainay ho mandrakizay :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM12', 'Andriananahary Masina ô!\nTanteraka ny fiandriananao,\n:,: Izao rehetra izao mitsaoka\nAnao\nFa Rainay ho mandrakizay :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM13','FFPM 13');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM13', 'Misaora ny Mpahary,\nTsarovinao ny asany\nMisaora ny Mpahary\nDerao ny soa vitany!\nNy helokao rehetra\nDia voavelany,\nFa tsy mba misy fetra\nNy fitiavany :\nNy Zanany nafoiny\nMba ho mpamonjinao,\nKa hianao nantsoiny\nHandray ny aim-baovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM13', 'Ny toky izay nomeny,\nSy ny fahasoavana,\nMaharitra ireny\nTsy manam-pahataperana,\nAvelany tokoa\nNy hatezerany,\nKa tsy mba hahavoa\nAntsika olony,\nFa Izy mahalala\nNy toetsika atý,\nKa tena Ray mandala\nAntsika zanany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM13', 'He, toy ny voninkazo\nNy ain’ny olombelona,\nTsy ela dia malazo\nKa tena mora levona,\nFa Jeso manan-kery\nHamoha fasana,\nTsy hisy izay ho very\nNy olo-masina;\nIsika vovotany\nNo namboariny\nHiombom-panjakana\nSy laza aminy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM13', 'Misaora ny Mpahary,\nRy tany sy ny lanitra!\nRy zava-boahary,\nDerao Andriamanitra!\nRy irany mahery\nManao ny sitrany,\nRy zanany izay very,\nKanefa hitany,\nMisaora Azy àry,\nFa heniky ny soa,\nMisaora ny Mpahary,\nO, ry fanahiko!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM14','FFPM 14');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM14', 'O, ry tany rehetra, avia izao\nHidera ny Tompo\nMpanavotra anao\nNy Tompo miantso\nantsika hankao\nAnatrehany, mba\nhohasoaviny ao :\nDera, laza anie\nVoninahi-dehibe,\nHo Anao, ry Tomponay\nTsitoha ô !\nAmen.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM14', 'He, Jehovah miantra \nantsika izao,\nKa dia manolotra\nantsika indray\nNy endriny mbamin’ny\naina vaovao;\nEny, Izy Manaiky\ntokoa ho Ray\nDera, laza anie\nVoninahi-dehibe,\nHo Anao, ry Tomponay\nTsitoha ô !\nAmen.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM14', 'Asandrato ny feo hihoby\nhoe :\nIsaorana mandrakizay\nHianao,\nRy Tompo Mahery,\nIzay manome\nHo anay olom-bery\nny aina vaovao;\nDera, laza anie\nVoninahi-dehibe,\nHo Anao, ry Tomponay\nTsitoha ô !\nAmen', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM15','FFPM 15');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM15', 'Avia hankalaza\nNy Tompo lehibe,\nFa feno hery, haja,\nJehovah Masina e\nAndeha mitambara,\nRy vazan-tany ô !\nMiankohofa tsara\nHanaja Azy izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM15', 'Ry Tomponay Tsitoha\nIndreto izahay,\nManondrika ny loha,\nMidera Anao, ry Ray\nNy fonay sy ny hery,\nFanahy, saina koa,\nOmena Anao irery,\nKa anjakao tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM15', 'Mpanjaka tena hendry\nHianao, ry Tomponay,\nKa tena mahakendry\nIzay hahasoa anay;\nNa misy toa mangidy\nNy fitondranao soa\nNy saina sy safidy\nManaiky Anao tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM15', 'Manerana ny tany\nIzao ny lazanao,\nKa be tsy hita lany\nNy voninahitrao;\nKoa hira fiderana\nVentesinay izao\nHaleloia, Hosana!\nMba raiso ho Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM16','FFPM 16');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM16', 'Avia ry vazan-tany ô!\nSy mponina ao an-danitra \nMiraisa feo ka mihirà\nNy fanavotan-dehibe,\n:,: Izay amonjena marobe,\nDia vita re ka miderà :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM16', 'Avia ry  fiangonana  ô!\nMba asandrato re ny feo\nHidera ny Mpanavotra;\nNa atý an-efitra aza izao,\n:,: Hirao am-pandehanana\nNy hira soan’i Ziona :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM16', 'Avia ry voavonjy ô!\nKa mifalia avokoa,\nFa afa-doza hianareo;\nMiraisa feo, ka mihirà,\n:,: Derao, derao, fa mendrika\nIlay nanavotra anareo :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM16', 'Avia ry olom-bery ô!\nIzay mandre ny teny soa\nHoe : « Manatòna Ahy izao »\nAnio ny Tompo mba fidio;\n:,: Ny fitiavany valio;\nNy fiderany koa hirao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM17','FFPM 17');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', 'Haja sy voninahitra\nOmena an’Andriamanitra,\nFa Izy ihany no mahefa\n:,: Izay sitrakin’ny fony :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', 'Masina, tsy azo haratsina,\nMahery, tsy azo resena ;\nMarina, tsy azo laingaina;\n:,: Hendry, tsy azo fitahina :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', 'Ny am-po toy ny am-bava;\nNy maizina toy ny mazava\nNy takona toy ny miseho;\n:,: Tsy misy àry tsy hitany :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', 'Tsy miova ny fombany;\nLehibe ka tsy oharina;\nTia, tsy azo arovana;\n:,: Miantra, tsy azo ferana :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM17', 'Saotra amam-bavaka atao\nDera sy laza ho Azy;\nIzy no ivavahana\n:,: Fa anton’izao tontolo\nizao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM18','FFPM 18');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM18', 'Ny feonay rehetra izao\nDia entinay midera Anao,\nRy Andriananaharinay!\nNa ambany aza izahay,\n:,: Dia tianao :,:\nRy Andriananaharinay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM18', 'Ny andronay rehetra izao\nDia entinay manoa Anao,\nRy Tompo sy Mpanjakanay!\nSatria izao dia fantatray\n:,: Fa tianao :,:\nRy Tompo sy Mpanjakanay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM18', 'Ny hevitray rehetra izao\nDia enti-mankalaza Anao,\nRy Tompo Mpanasoa anay!\nMpitahy ny fanahinay,\n:,: Fa tianao :,:\nRy Tompo Mpanasoa anay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM18', 'Ny herinay rehetra izao\nDia iasanay ho Anao,\nRy Aronay sy Tanjakay!\nMiezaka tokoa izahay,\n:,: Fa tianao :,:\nRy Aronay sy Tanjakay!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM18', 'Rehefa alainao izahay,\nKa tapitra ny andronay,\nHamantana any Aminao\nIzahay arý an-danitrao,\n:,: Fa tianao :,:\nHamantana any Aminao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM19','FFPM 19');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM19', 'Misaotra Anao izahay izao,\nJehovah Ray!\nFa efa notohizanao\nNy andronay,\nKa tonga atý an-tranonao\nIndray izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM19', 'Misaotra Anao izahay izao,\nRy Mpanome!\nNy soa avy Aminao\nTsy lany re,\nFa isan-andro misy izao\nKa maro be.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM19', 'Misaotra Anao ‘zahay izao,\nRy Rainay soa!\nNy helokay navelanao\nNefa iza moa\nNo mahalaza izay natao ?\nFa be tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM19', 'Misaotra Anao ‘zahay izao,\nRy mora fo!\nNy mafy tsy sakananao\nFa mba hanjo,\nFa be ny fanirianao\nAnay hadio.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM19', 'Misaotra Anao ‘zahay izao,\nRy Tomponay!\nAo aminao an-danitrao\nHonenanay,\nFa misy fitsaharana ao\nMandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM20','FFPM 20');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM20', 'Tsaroanay tokoa izao\nNy soa be noraisainay\nTsy tapaka avy taminao\nRy Andriananaharinay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM20', 'Ny lasa itodihana\nDia mampiseho avokao\nNy tanam-pitiavana\nMiahy sady manasoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM20', 'He! koa ity andronay ity,\nIzay diavinay izao,\nDia voahodidina erý\nNy fitahiana aminao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM20', 'Dia tokinay tokoa izao\nFa mbola ho arovanao\nAnio, ampitso, rahatrizay,\nIzay miankina Aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM20', 'Ka dia mba velomy re\nAtý anatinay ny fo\nHahay misaotra Anao anie\nRy Rainay be famindram-po!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM21','FFPM 21');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM21', 'Derao Andriamanitra\nRy vazan-tany efitra,\nFa izy no mamindra fo,\nKa mety manome ny zo,\nNaniraka ny Zanany\nHanavotra ny olony!\nNy sandriny tsy toha re,\nFa manan-kery lehibe.\nMalaza ny Anarany,\nFa lehibe ny asany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM21', 'Ny zavatra rehetra e\nNy ranomasin-dehibe,\nIreo tendrombohitra,\nNy saha feno ahitra,\nNy hazo sy ny vorona\nNy vato sy ny zavona,\nNy voninkazo manitra,\nNy endriky ny lanitra\nDia samy tsy mijanona\nMidera ny mpamorona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM21', 'Ry olona navotana\nMba mitsangàna faingana,\nKa miderà ny Tomponao,\nIzay nanavotra anao,\nFa he, ny voninahiny\nManerana ny taniny\nTendreo ny valihanao\nKa miventesa hira vao :\nRy voavonjy ô, derao ny Ray\nMpamorona anao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM22','FFPM 22');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM22', 'Ry Rainay Izay namorona\nIzao rehetra izao,\nNy hita sy ny takona\n:,: Dia asan-tananao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM22', 'Ny volana aman-kitana,\nNy biby marobe,\nNy ala maitso mavana\n:,: Hitsaoka Anao anie :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM22', 'Ny tany sy ny lanitra,\nNy ranomasina,\nIreo tendrombohitra\n:,: Manolo-kasina :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM22', 'Ny ory sy ny mpanana,\nDia fototra iray,\nFa samy asan-tanana\n:,: Nataonao Tomponay :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM22', 'Dia saotra no atolotray,\nAnao, ka raisonao,\nFa fanomezan-ko anay\n:,: Ny asan-tananao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM23','FFPM 23');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM23', 'Tsy misy zava-mahasoa,\nAndriamanitra ô!\nIzay tsy nataonao ho anay\nMba hifalianay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM23', 'Tsy misy singan’ahitra,\nNa ravin-kazo koa,\nIzay tsy amantaranay\nFa hendry Hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM23', 'Ny kintana mazava erý\nManeho avokoa\nFa sitrakao hanafaka\nNy aizina aminay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM23', 'Izay rehetra tazanay\nDia voninahitrao;\nIzay rehetra takona\nMilaza izany koa.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM23', 'Ny tany sy ny lanitra\nNataon’ny herinao\nDia azo ianarana\nNy famindramponao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM24','FFPM 24');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM24', 'Ny lanitra ao ambony ao,\n:,: Andriamanitra ô!\nIzay rehetra vitanao\nDia mahagaga anay. (in-3)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM24', 'Ny volana aman-kitana,\n:,: Ny masoandro koa,\nNy tany aman-danitra,\nMitory avokoa. (in-3)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM24', 'Ny andro amana alina,\n:,: Milaza aminay\nFa hendry Andriamanitra,\nJehovah Tomponay. (in-3)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM24', 'Ny tenanay, fanahy koa,\n:,: Dia avy taminao\nKa mampiseho tsara koa\nNy voninahitrao. (in-3)', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM24', 'Izay rehetra vitanao,\n:,: Atý sy any koa\nMiara mankalaza Anao\nFa Tompony tokoa. (in-3)', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM25','FFPM 25');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM25', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM25', 'Andriamanitra hendry,\n:,: Loharanon-tsaina  :,:\n:,: Ka manolo-pahendrena\nIzay manaiky Azy :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM25', 'Andriamanitra mahay,\n:,: Izao rehetra izao :,:\n:,: Ka Izy no akana saina\nHahahendry antsika :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM25', 'Ary isika mila saina,\n:,: Hanitsy antsika :,:\n:,: Amin’ny fianarana\nHanarahana Azy :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM25', 'Izy no ihavian’\n:,: Ny soa rehetra :,:\n:,: Hiainana mandrakizay,\nKa Izy no omen-tsaotra :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM26','FFPM 26');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM26', 'Jehovah tsy mba manadino\nNy mpanompony manoa,\nFa hotsarovany ireo mino\nNofidiny ho Azy koa.\nManerinerina ambony\nNy fiandrianany;\nKanefa kosa re ny fony\nMitsinjo izay ambany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM26', 'Izaho dia ravoravo\nKa midera Azy izao;\nFahasoavanao, Ry Avo,\nNo namonjy hatrizao,\nFahavokisan’ny fanahy\nAry fisandratana\nNo hotantaninao ho ahy :\nNy foko mankalaza.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM26', 'O, mifalia ry Israely,\nFa vonjen’ny sandriny;\nMba matokia dia hahery\nAntsoy ny Anarany :\nMpanomponao ity mitalaho,\nKa henoy ny hatako,\nO, ry Mahery, inty aho!\nNy sitrakao ekeko.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM27','FFPM 27');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM27', 'Fitiavana tokoa re,\nny Ray an-danitra\nFa manolo-java-tsoa\nTena mahasambatra\nHo antsika izay mpanota,\nOry, osa, rera-po,\nIzy masina sy to\nTa-hanaisotra ny ota\nNoho ny fanavotana\nVitan’i Jesosy e!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM27', 'Tsy ho very, ry mahantra\nSy miferin’aina izao,\nFa ny Ray Izay feno antra,\nAoka mba hinoanao.\nSambatra ny voavela\nHeloka tokoa re,\nFa Jesosy manome\nFanavaozam-po sy lela,\nHira fideram-baovao\nNo ho re an-dalalanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM27', 'O, ry Rainay be fitia,\nMba ampio izahay,\nTsy ho kivy, tsy hania\nAo am-pandehananay,\nFa handroso mba hankany\nAminao an-danitra.\nRy Andriamanitra,\nBe ny loza atý an-tany\nFa ny ranomasonay\nFaohinao rahatrizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM28','FFPM 28');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM28', 'Zanahary tsy mba tia\nNy fahaverezanao\nIzy, Rainao be fitia,\nTsy mba mahafoy anao.\nNy famoizam-po ario,\nFa Jesosy itokio,\nMba hatoninao anio\nIlay be fahasoavana!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM28', 'Izy dia nitady ela,\nVao nahita anao izao;\nMifalia, tsy ho ela\nDia hody hianao.\nHe, ry ondry saiky very,\nOry, osa, feno fery,\nNy Mpamonjy manan-kery\nHahasitrana anao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM28', 'Ny ao an-danitra mifaly,\nRaha misy miova fo,\nAry any ny anjely\nMiramirana avokoa.\nFo marary dia tsaboiny,\nAhiahim-po vonoiny,\nFiadanana lazainy;\nSambatra isika re!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM29','FFPM 29');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM29', '( Hira Paska )', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM29', 'Ry foko, mitsangàna izao\nKa miderà ny Tomponao,\nAndriamanitsika.\nNasehony ny heriny.\nNy fasana levoniny\nTsy hahatàna antsika.\nDerao! Hobio!\nHaleloia sy hosana,\nFanjakana :\nAzy Tompom-pahefana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM29', 'He! vitanao Mpanavotra\nNy lova mahasambatra :\nNy fasana resenao.\nMahazo toky fatratra,\nNy mitomany, sasatra :\nNy lanitra vohanao.\nJeso Kristy\nIzay nitsangana maraina\nTompon’aina :\nAndro Paska, arahabaina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM29', 'Derao ny voninahiny!\nAnkalazao ny heriny,\nFa resy re satana.\nRy tany sy ry lanitra,\nDerao Andriamanitra\nAkaro ny hosana.\nRaiso Tompo,\nRaisonao ny voninahitra\nAman-dera :\nHo anao, ry Zanakondry.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM30','FFPM 30');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM30', 'Paradisako ry Jeso,\nFifaliako Hianao;\nLanitry ny foko eto\nSy Edenako vaovao!\nParadisa soan’ny foko\nEto an-tany Hianao;\nEny, fanaperan-tsoako\nAo an-danitra vaovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM30', 'Volafotsy, volamena,\nVatosoako Hianao.\nZava-tsoako sy harena\nMiafina ao an-danitra ao.\nParadisa soan’ny foko\nEto an-tany Hianao;\nEny, fanaperan-tsoako\nAo an-danitra vaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM30', 'Zo sy hajako tokoa\nHianao Mpanavotro.\nHaingo sarobidy koa,\nSatro-boninahitro.\nParadisa soan’ny foko\nEto an-tany Hianao;\nEny, fanaperan-tsoako\nAo an-danitra vaovao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM30', 'Zavatra rehetra ho ahy\nHianao, ry Jeso tia;\nFianinan’ny fanahy,\nFiadanako doria.\nParadisa soan’ny foko\nEto an-tany Hianao;\nEny, fanaperan-tsoako\nAo an-danitra vaovao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM31','FFPM 31');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM31', 'Misaotra Anao izahay, ry Ray,\nFa sitrakao homena ho anay\nNy Zanakao malalanao;\nIlay tokanao no he natolotrao.\nAtolotray ny saotranay,\nO! Raisonao anie Jehovah\nRay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM31', 'Misaotra Anao, Jesosinay,\nNy fitiavanao tsarovanay :\nNalatsakao ny rànao soa\nHanavotra aina ny\nmpanota voa;\nAtolotray ny saotranay\nKa raisonao e, ry Jesosinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM31', 'Misaotra Anao, Fanahy koa,\nMamelona sy monina\nao am-po.\nHavaozy ao anaty ao\nHo tonga lapanao madio\nsy vao\nAtolotray ny saotranay\nKa raiso, ry Fanahy tokinay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM32','FFPM 32');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM32', 'Misaotra Anao izahay\nJehovah Tompo ô!\nFa efa naharay\nNy soa taminao.\nKa lalandava no\nIsaoranay Anao\nHo eo am-bavanay tokoa\nNy teninao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM32', 'Fa reharehanay\nSy famonjena koa\nNy Tompo tia anay,\nTsy manam-paharoa.\nNy fandresena soa,\nNy fiononam-po\nDia avy taminao,\nKa hery manavao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM32', 'Ny olo-mino Anao\nSy ireo mpanomponao\nNa velona na maty,\nDia misaotra Anao.\nKa sambatra tokoa\nFa manana Anao\nIzahay, ry reharehan’\nNy Fanahy ô!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM33','FFPM 33');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM33', 'Tompo ô, tsy takatray\nNy hasoan’ny antranao ;\nZava-mahagaga anay\nNy fitiavanao.\nHe, mpanota izahay,\nNefa hasoavinao;\nAvotr’aina azonay,\nMisaotra no atao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM33', 'Tompo ô, Mpanjakanay,\nFatratra ny herinao :\nTs’isy zavatra izay\nMahasakana Anao!\nNefa mora fo Hianao\nFa mandefitra aminay,\nKoa dia misaotra Anao\nFa afaka izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM33', 'Tompo Andriamanitray,\nAvy izahay izao :\nRaiso ny fiainanay;\nAnao, ka anjakao.\nTompo ô, tsy takatray\nNy hasoan’ny antranao;\nZava-mahagaga  anay\nNy fitiavanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM34','FFPM 34');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM34', 'Tompo ô, Tsitoha\nZanaharinay,\nAsan-tànanao re\nIzao rehetra izao.\nMahagaga indrindra\nNy fahaizanao\nEntinao mitondra\nSy miasa ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM34', 'Hianao, Jehovah\nAo mandrakizay\nNa miovaova\nIzao rehetra izao.\nMahagaga indrindra\nNy fitiavanao\nTsy mba mety miova\nNy mandao anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM34', 'Ray niandohana\nfony fahizay;\nMbola hiafarana \nkoa rahatrizay.\nRaiso moramora\nre ny Zanakao.\nRaha tonga ny ora\nhiantsoanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM35','FFPM 35');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM35', 'Isaoranay, ry Ray,\nNy fitiavanao ;\nFa indro azonay\n:,: Ny taombaovao :,:\nRy Tompo ô, ambeno,\nIzao fifaliana izao\nKa aoka re ho feno\nNy hasoavanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM35', 'Ny taona vao lasa\nNipaoka olon-tsoa\nIreny mba nikasa\n:,: Mba ho tafita koa :,:\nNy fitondràna anefa\nAfeninao, ry Ray!\nKa nony miantefa\nVao sina izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM35', 'Fanahy ô, avia\nHitari-dàlana e!\nMandroso izao ny dia\n:,: Hamaky rano be :,:\nNy herinao tsy lefy\nNo tanjaky ny fo\nKa ampy mba ho fefy,\nRaha avy ny manjo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM35', 'Itoero, Jeso tia\nNy sambonay re!\nNa tony na maria,\n:,: ‘Ty ranomasim-be :,:\nRaha Hianao no hita\nTsy fefika izahay\nAmbara-piampita\nArý an-tratran-dRay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM36','FFPM 36');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM36', 'Moa ho haiko tantaraina\nNy hasoavanao ?\nMifamatra tamin’aina\nNy fitiavanao.\nNy vahoaka sesehena.\nIzay nahazo famonjena\nNo hidera Ilay Mpamonjy soa.\nJeso no derao, Jeso no derao :\nIzay nataony ambarao :\nJeso no derao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM36', 'Fiadanana nafoin''i Jeso Tomponay,\nF''efa tonga ny fotoana,\nSitraky ny Ray\nOlom-bery nozahany\nNy fatorany vahany\nHajambana koa nalany\nTsy ho ao\nJeso no derao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM36', 'Hoderaina lalandava\nNy Anaranao,\nFa ny aizina nisava\nEo imasonao :\nNa tsy tian’ny sasany aza\nNy Anaranao malaza,\nIzaho kosa hankalaza Azy re.\nJeso no derao, Jeso no derao :\nIzay nataony ambarao :\nJeso no derao.\n\n\nJESOSY KRISTY\nTOMPO\n1. NY FIHAVIANY\nSY NY FIVERENANY', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM37','FFPM 37');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM37', 'Mihainoa, ry Ziona ô!\nAvy ny Mpanjakanao!\nRe hatrany lavitra\nFa hobin’ny olona.\nMifalia hianao\nIndro Izy, ka tsenao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM37', 'Indro Ilay miakatra\nMila tsy ho fantatra\nHo Mpanjaka marina,\nFa mietry lalina;\nIzy no Mpanjakanao,\nRy Ziona ka derao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM37', 'Mandrosoa, Tompo ô!\nMba hanjaka amiko !\nFaly re ny olonao\nRaha tonga Hianao,\nO, hosana, Tomponay!\nRy Ilay nandrasanay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM38','FFPM 38');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM38', 'He, hosana!\nIsaorana anie ny Mesia,\nIzay nalefan’ny Tompo,\nKa hosana no asandratray;\n:,: Ilay nirahinao, ry Tompo :,:\n:,: No derainay :,:\n:,: Ka hosana \nno asandratray :,:', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM39','FFPM 39');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM39', 'Faingàna, ry Mpanjaka!\nHandray ny lovanao;\nFaingàna re mba haka\nNy tany ho Anao;\nAvia hampifaly\nNy malahelo fo;\nAfaho ny mijaly\nSy azon’ny manjo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM39', 'Avia, fa misento\nAtý ny olonao;\nNy fanjakana ento,\nFa Tompo Hianao.\nTsy hisy hitomany\nEo anatrehanao.\nHiadana ny tany\nIzay alehanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM39', 'Ny tendrombohitra avo,\nNy lohasaha koa,\nHo tonga ravoravo\nSy tretrika avokoa;\nNy be tsy haka an-kery,\nNy kely afa-po;\nTsy hisy izay ho very\nTsy hisy izay hanjo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM39', 'Mpanjaka sy Mpiaro\nMahery Hianao;\nNy firenena maro\nHitoky Aminao;\nHo avy lalandava\nIzao rehetra izao\nHitondra harem-bevava\nHo eo an-tongotrao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM39', 'Faingàna, ry Mpamonjy,\nRy Tompo be fitia ,\nNy olonao tra-bonjy\nMiantso hoe : Avia!\nAnao ny fiderana,\nAnao ny laza be,\nAnao ny fanjakana\nSy arahaba e!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM40','FFPM 40');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM40', 'Tonga ny fahazavan’i Ziona,\nRavo ny tany izay maizina teo\nTapitra koa ny andro misaona,\nAry ny tany miadana izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM40', 'Tonga ny fahazavan’i Ziona,\nEfa nandrasana izay ela izay,\nIzao dia tapitra ny\nfanompoana,\nKa ampodina ny babo indray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM40', 'He misy rano izay miboiboika\nAny an-efitra maina sy lao,\nFeno ny hobiny ny lohasaha,\nManakoako ny hira vaovao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM40', 'Indro ny tany sy nosy rehetra\nDia mankalaza ny Tompo\nizao,\nNy fanjakany dia tsy\nmanam-petra,\nMiravoravo ny tany vaovao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM41','FFPM 41');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM41', 'Indro Jeso mandondona\nEo am-baravaram-po,\nInjao ny feony mifona\nMba haneho indrafo,\nAoka izy hovohàna,\nFa mitondra famelàna\nHampahery sy hitana\nNy fanahinao sy fo', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM41', 'Efa novidiny lafo\nMba ho afaka hianao;\nIzy hiara-misakafo\nSy hifaly aminao;\nFahasoavana zaraina,\nLova ampanantenaina,\nIray ny vatsy, iray ny aina\n‘Ndrey, ny hasambaranao!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM42','FFPM 42');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Vohay ny varavaram-po!\nIlay Mpanjaka manan-jo,\nMpamonjy izao tontolo izao\nNo tonga hanasoa anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Ny teny fanasana atao\nMitondra tena aim-baovao,\nNy fahoriana manjo\nAfahan’ny famindrampo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Mba mihainoa, maneke,\nFa sambatra izay mandre,\nKa anjakan’ny Tompo to,\nIzay feno antra, mora fo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Ny andron’aina mitatao\nNo mahafaly fo izao,\nMamiratra sy manome\nFanantenana lehibe.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Ny vavahady mba vohay!\nFinaritra izay mandray,\nFa tonga ilay Mpanjaka soa\nHanao ny asany tokoa.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Sokafany ny fo izao,\nRy Jeso, mba hidiranao,\nNy fahasoavano anie\nHananay harena be.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM42', 'Atolotray, ry Tompo ô!\nMba hahatamana Anao ny fo,\nNy famonjena vitanao\nNo iankinanay izao.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM43','FFPM 43');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM43', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM43', 'Manenoa, ry farara!\nHorohoroy, ry tany!\nKa miantsoa ny maty,\nFa akaiky ny Mpitsara;\n:,: Indro! Kristy :,:\nAvy amin-drahona!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM43', 'Ny feony no hampifoha\nNy any am-pasana;\nNy teniny no hamory\nNy velona rehetra;\n:,: Samy handray :,:\nNy valin’ny nataony.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM43', 'Ny tsy mino hilazany :\n“Mialà voaozona,\nMandehana, mitoera\nAo amin’ny maizina”\n:,: Ry mpanota :,:\nAny ny anjaranao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM43', 'Fa ny mino hilazany :\n“Avia, notahina,\nMandrosoa, mankanesa\nHo amin’ny mazava”\n:,: Io, ry mpino :,:\nIndro! ny anjaranao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM44','FFPM 44');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM44', 'Indro Jeso, mba vohay;\nMba vohay!\nAvy ho Sakaizanao;\nMba vohay!\nIlay Malala fahizay,\nSady sitraky ny Ray\nTonga ho anao indray\nKa vohay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM44', 'Indro Jeso, mba vohay;\nMba vohay!\nTompo tia ka mba hajao;\nMba vohay!\nHonina aminao etý,\nHo sakaiza hatrerý\nHo anao mandrakizay\nKa vohay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM44', 'Indro Jeso, mba vohay;\nMba vohay!\nMbola tia ka mba vohay;\nMba vohay!\nTena tia ka tsy mandao,\nRaha ela sao dia lao;\nMoa ho lavinao izao\nKa vohay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM44', 'Eo am-baravaranao;\nMba vohay!\nTsy manoa an-ditra izao;\nMba vohay!\nHe! mandona mora re,\nNa dia Tompo lehibe;\nEfa niandry ela be\nKa vohay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM45','FFPM 45');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM45', 'He, tonga ho antsika\nNy Tompo mora fo,\nMpamonjy, Havantsika,\nIlay mamindra fo;\nAndeha mba hifaly\nIsika, ry zareo!\nNahazo Mpampifaly,\nKa manandrata feo', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM45', 'Hajao ny Tompontsika,\nMpanjaka lehibe,\nAndriamanitsika,\nMpanala rofy be;\nAvia mba hidera,\nRy mino tsara fo!\nAvia manatera\nNy saotra ao am-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM45', 'Ry Tompo Zanahary!\nMihira izahay,\nFa teny mahafaly\nNo tonga ho anay;\nNy andro famonjena\nNo andro sitrakay;\nFanahy manantena\nNo ifalianay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM45', 'Ry Tomponay! mandraisa\nNy haja entinay;\nTsy volamena anefa,\nFa saotra aterinay;\nRy Jeso Tompo soa!\nIsaoranay Hianao,\nFa lehibe tokoa\nNy fitiavanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM46','FFPM 46');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', 'O, ry Mpanefa ny toky rehetra,\nMoa ho ela vao tonga ny\nfetra ?\nTena andrasanay ny\nfihavianao;\n:,: Aza ela, re :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', 'He! izahay fa vahiny mandala,\nIndro manenjika ny fahavalo;\nKoa henoy re ny senton’ny\nolonao;\n:,: Aza ela, re :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', 'He! ny voavotrao dia miandry,\nNa izahay na ireo nodimandry;\nTompo, Tsinjovy ny fasan’ny\nolonao;\n:,: Aza ela, re :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', 'Ary ny zavatra eto an-tany\nSamy miara-misento ihany,\nKa manantena ny mba \nhihavianao;\n:,: Aza ela, re :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', 'Mbola ho ela ve Ilay \nantenaina ?\nTsia, fa akaiky izao ny\nmaraina;\nKoa andrandrao sy antsoy\nny Tompo hoe :\n:,: Aza ela, re :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM46', '«Tsy mbola ho ela, fa faingana\nAho,\nAry hanafaka ny mitalaho».\n« Eny, avia, faingàna,\nry Tompo ô! »\n:,: Aza ela, re :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM47','FFPM 47');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM47', 'Ry Ziona, mihainoa!\nInjay feo mafy mampifoha\nNy ampakarina izao :\nMbola alim-be ihany,\nFa ny fotoana no lany,\nKa avy ny malalanao;\nAntsoiny hianao\nAlao ny jironao\nKa velomy;\nDia miaingà hivoaka,\nHitsena ny mpampakatra!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM47', 'He, Ziona ravoravo,\nFa reny izao ny antso avo\nKa velona ny hobiny :\nIndro, avy Kristy Tompo,\nHanafaka anay mpanompo,\nHalainy hampakariny.\nHe, faly re ny fo!\nAvia Tompo ô!\nO, hosana!\nMihaingo izao hitsena Anao,\nRy Kristy, ny malalanao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM47', 'Hira, hoby, fiderana\nAsandratray mba hitsenana\nAnao, Jesosy Tompo ô!\nTsy mba misy mitomany,\nFa mirana izay mankany\nAm-pampakaram-badinao;\nMahafinaritra ny hiran-danitra\nHaleloia!\nIlaozanay ny trano lay,\nMiakatra ny dianay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM48','FFPM 48');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM48', 'Hevero, ry mpanota ô,\nNy andro fitsarana!\nHiverina ny Tomponao\nHamaly fahotana;\nNy lanitra hahorona,\nNy tany dia hodorana,\nFa avy Ilay Mahery.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM48', 'Trompetra no ho levona\nHotsofin’ny anjely;\nHisokatra ny fasana,\nHivory izay niely;\nNy maty dia hatsangana,\nIsika koa hakarina\nHanatrika ny Tompo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM48', 'Ny boky hovelarina,\nFa io no manambara\nNy asa izay miafina,\nHandraisana anjara;\nKa aza mba mihevitra\nHahazo mihodivitra\nFa fantatry ny Tompo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM48', 'Ry Tompo ô! hazoninay\nNy tenim-panekena,\nKa mba arovy izahay\nHitana famonjena;\nNy ranao sy Fanahinao\nNo tokinay raha avy izao\nNy andro fitsarana.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM49','FFPM 49');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM49', 'Mba jereo ny Tompontsika\nAvy ao an-danitra,\nIndro, avy amin-kery\nAo amin’ny rahona\n:,: Haleloia :,:\nAmbarao ny heriny.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM49', 'Izay rehetra fahavalo\nEfa resiny tokoa;\nMifalia ry anjely!\nMihobia, ry olona!\n:,: Haleloia :,:\nAmbarao ny lazany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM49', 'Fony mbola teto Izy\nSatro-tsilo nentiny;\nIzao ny satro-bolamena\nMendrika ny lohany\n:,: Haleloia :,:\nAmbarao ny derany.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM49', 'Voaeso mafy Izy ,\nBe ny fahoriany;\nFa izao, asandratara Izy,\nAmbarao ny hajany!\n:,: Haleloia :,:\nHe, ny voninahiny!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM50','FFPM 50');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM50', 'Mifohaza, ry matory ,\nFa re ny feon’ny Mpamory\nMiantso izao tontolo izao!\nMiangà, ry vovontany,\nFa he! Jesosy avy any\nAn-danitra hitsara anao.\nRy mbola velona!\nRy ao am-pasana!\nMitsangàna!\nMiandrandra ny lanitra,\nFa ny atý dia tapitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM50', 'Kristy Tompo avy any,\nKa dia mangovitra ny tany\nFa be ny voninahiny.\nNa ny ratsy na ny tsara\nHanatrika ilay Mpitsara,\nMiandry ny anjarany\nZarainy roa izao\nNy tafavory ao;\nKa ny tsara\nHoraisiny ao Aminy,\nNy ratsy dia ariany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM50', 'Jeso ô! izahay mifaly,\nNa dia be ny mampijaly\nSy mahaketraka atý;\nHianao mahay manova\nNy fahorianay ho lova\nMahafinaritra erý.\nRy fasa-maizina ô!\nRy fahavaloko!\nAiza moa ny herinao,\nny sabatrao ?\nJesosy no Mpandresy izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM51','FFPM 51');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM51', 'Raha tonga anio ny Tompo,\nAmin-kery lehibe,\nKa arahin’ny mpanompo \nSy anjely marobe;\nMoa ho faly hianao\nKa hidera ny Mpamonjy\nIzay nanavotra aina anao ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM51', 'He! ho simba sy ho rava\nIzao rehetra àry izao,\nKa hifankahita tava\nNy natao sy ny Mpanao,\nMoa ho faly hianao\nKa hidera ny Mpamonjy\nIzay nanavotra aina anao ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM51', 'Maso maro no mijery\nIlay nijaly fahizay,\nFa ny mino Azy  ihany\nNo ho faly rahatrizay :\nMoa ho faly hianao\nKa hidera ny Mpamonjy\nIzay nanavotra aina anao ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM51', 'Rehefa tonga re ny Tompo\nMba hitsara izay natao,\nHitomany ny tsy mino,\nFa hanatrika Azy ao :\nMoa ho faly hianao\nKa hidera ny Mpamonjy\nIzay nanavotra aina anao ?', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM51', 'O! avia re, ry Tompo!\nMba hanjaka aminay,\nHahatonga anay mpanompo\nHiara-paly Aminao :\nO! avia, ô! avia,\nFa ny olonao rehetra\nDia maniry indrindra Anao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM52','FFPM 52');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM52', 'Efa akaiky Jeso Tompo\nIlay Mpamonjinao,\nIndro, tamy Kristy Tompo,\nAvy ho anao;\nDia tano mafy tsara\nIzay anananao;\nLova soa, tsara fara,\nIndro, ho anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM52', 'Efa akaiky ny Mpamonjy\nTa-handray anao;\nJeso Kristy mahavonjy\nNo sakaizanao;\nDia tano mafy tsara\nIzay anananao;\nLova soa, tsara fara,\nIndro, ho anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM52', 'Efa akaiky ny Mpitsara,\nIzay hitsara anao;\nJeso Kristy raiso tsara\nMba ho havanao;\nDia tano mafy tsara\nIzay anananao;\nLova soa, tsara fara,\nIndro, ho anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM52', 'Aza mba mangataka andro\nHibebahanao;\nHe, mazava anio ny andro\nMba hidiranao :\nDia tano mafy tsara\nIzay anananao;\nLova soa, tsara fara,\nIndro, ho anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM53','FFPM 53');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM53', 'Miposaka ny vonjy,\nEndrey ny hafaliana!\nJesosy no Mpamonjy,\nAndriam-piadanana\nIlay Zanaky ny Avo\nDia nidina tatý\nHahatonga antsika lavo\nHo Zanaka arý,\nManangana olom-bery\nHandova lanitra,\nKa dera, laza, hery\nHo an’Andriamanitra!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM54','FFPM 54');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM54', 'Jesosy Mpamonjy,\nIlay Tompon’ny aina, no hita\nNidina teto an-tany\nhamonjy antsika :\nO, mba derao!\nIzy Mpanavotra anao,\nKa mifalia, ry mino!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM54', 'Indro ny tenin’anjely \nmilaza ny soa!\nTeraka Jeso Mpamonjy\nantsika tokoa :\nO, mba derao!\nTonga ny andro vaovao,\nAndron’ny Filazantsara.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM54', 'Dia iventesonao hira\nvaovao re, izany!\nTonga Jesosy hamonjy\nizay mitomany :\nO, mba derao!\nAfaka isika izao!\nIzy Mpisolo antsika!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM54', 'Tonga ny Tompon’ny tompo\nhisolo ny ory,\nKa mifohaza, ry olona\nmbola matory :\nO, mba derao!\nAmin’ny feo vaovao,\nJeso, izay Tompo mahery!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM55','FFPM 55');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM55', 'Ny andron’ny fahasoavana\nMiposaka ho antsika\nManerana izao tontolo izao,\nNy tarany efa hita,\nKa ravo ny olombelona,\nFa lasa ny alintsika.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM55', 'Niova terý ny alina,\nFa teraka ny Mpamonjy,\nMamiratra re ny lanitra,\nMiseho izao ny vonjy,\nKa lasa tokoa ny aizina,\nMihoby ny voavonjy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM55', 'Na dia ho nahay nihira re\nNy hazo an-ala rehetra,\nKa afa-mikalo ny ravina\nHidera ny Avo indrindra,\nTsy ampy ho fanandratana\nNy Tompon’ny ain-drehetra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM55', 'Ny feon’ny olonao izao\nMisandratra, ry Jehovah,\nHidera ny fitiavanao\nSy ny indrafonao soa\nNiaro ny fiangonanao\nHatramin’ny fahagola.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM55', 'Ho an’ny tanindrazanay\nIzahay re, ry Ray Tsitoha,\nKa hiditra ao an-tranon-dRay\nNomanin’Ilay Mpialoha;\nNy olonao dia ho tafaray\nHidera Anao tokoa!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM56','FFPM 56');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Manatona Anao izao,\nRy Jeso, ny madinikao,\nAmpandrosoy ny dianay,\nFa ta-hahita Anao izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Hidera ny Anaranao\nNo zava-tianay hatao;\nMiravoravo izahay\nFa teraka ny Tomponay', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Ny lanitra nilaozanao,\nHanavotra ny olonao,\nHo zanak’Andriamanitra\nHifaly ao an-danitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Tsy takatray heverina\nNy fitiavan-dalina,\nIzay nitiavanao anay,\nKa dia misaotra Anao izahay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Tariho, Tompo, izahay,\nAmbinonao ny dianay,\nFa samy ta-handray Anao\nIzahay mivory eto izao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'O, ry Sakaiza maminay,\nMba te-ho olonao izahay\nHipetraka eo anilanao,\nFa mamy ny fitianao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Raha manana Anao izahay,\nTsy hisy hatahoranay,\nFa zaza voamarikao\nHo isan’ny arovanao.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM56', 'Raha ao an-danitra vaovao,\nIzahay sy ny anjelinao\nHisaotra sy hidera Anao\nHanatrika ny tavanao.', '8');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM57','FFPM 57');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM57', 'Izao Noely mamy izao\nNo ihobiantsika,\nFa noresen’ny aim-baovao\nNy fahafatesantsika :\nNy Zanak’Andriamanitra,\nIzay Tompom-boninahitra,\nNandao ny lapan-dRainy,\nNateraka ho olona\nHamonjy sy hamelona\nAntsika sombin’ainy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM57', 'Velomy ny fisaorana,\nNa kely monja aza,\nKa aoka izay navotana\nHiara-hankalaza\nNy Zanak’Andriamanitra,\nNiala tao an-danitra\nHanafaka alahelo;\nRy voavonjy ô! derao Jesosy\nIlay Mpanjakanao;\nHe, gaina izao ny helo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM57', 'Izao Andriamanitra\nDia faly amintsika :\nJesosy, Tompon-danitra,\nNo tonga namantsika;\nHo re hatrany lavitra\nFa foin’Andriamanitra\nIlay sitraky ny fony\nHitondra fahoriana,\nHiari-pijaliana\nHo solon’ny mpikomy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM57', 'Na dia tratry ny manjo,\nIzay mampiferin’aina,\nIzaho tsy hamoy fo,\nFa manna-kantenaina;\nJesosy dia Zokiko,\nKa tsy hohadinoiko,\nFa Izy tia ahy;\nNy tenim-piadanany\nNo hery anohanany\nNy foko, izay manahy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM57', 'Haleloia, fa tapitra\nNy fahoriantsika!\nDerao Andriamanitra,\nIzay efa tia antsika!\nO, ry fanahiko, derao\nJesosy, Izay Mpamonjinao,\nHarena tsy ho lany,\nHaleloia, Haleloia!\nFa azo ny Mpanavotra,\nAnao ny fanjakany!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM58','FFPM 58');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM58', 'Alina masina\nTonga ny Mpanavotra;\nIndro teraka ao Betlehema\nNy Mpanjakan’ny Jerosalema,\n:,: Izay Mpamonjy anao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM58', 'Alina masina\nNy anjely midina\nKa miara-mihoby hoe :\nIndro ny fiadanam-be,\n:,: Jeso teraka izao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM58', 'Alina masina\nNisehoan’ny Zanaka;\nNy mazava niposaka,\nKa ny tahotra afaka;\n:,: Mifalia izao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM59','FFPM 59');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM59', 'O! mihobia, fa teraka\nJesosy Tompo, Zanaka,\nMesia nantenaina,\nMpamonjy sitraky ny Ray\nHo avotra mandrakizay,\nKa mendri-koderaina!\nRenao izao\nNy anjely mampiely\nTeny soa :\nKristy teraka tokoa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM59', 'He! tonga ny Mpanavotra\nHanafaka ny tahotra\nMamatotra ny tany,\nMitondra fiadanana,\nKa tena mampihavana\nNy lanitra aman-tany.\nIndro tonga\nNy Mpamonjy mahavonjy\nNy mpanota,\nKa manaisotra ny ota.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM59', 'Omeo voninahitra\nNy Ray, Andriamanitra,\nIzay Tompom-pamonjena!\nNy Zanaka no raisonao,\nFa fananganana anao\nNy lova dia homena,\nAmen, Amen!\nTeny soa mamy koa,\nIsika lavo koa,\nTonga zanaky ny Avo!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM60','FFPM 60');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM60', 'He, faly ny fanahiko,\nFa avy Ilay Malalako,\nDia Jeso tonga zaza,\nKa mety ho Mpamonjiko,\nNa dia tsy mendrika aza\nIzaho, ry Jesosy ô!\n:,: Raiso ho Anao! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM60', 'Ry Jeso Zazakely ô,\nIriko mafy Hianao,\nAvia re, ry Zaza,\nNy foko itoeranao\nNa dia ratsy aza\nKa tsy mba mendrika Anao,\n:,: Ry Jesosy ô :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM60', 'Endrey ny fitiavanao,\nRy Ray, namoy ny Zanakao;\nIzahay, izay fahavalo\nKa ivesaran-keloka,\nAvelanao hivalo\nKa hiditra ao an-danitra.\n:,: Enga ka ho ao! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM60', 'Endrey ny fifaliana\nTsy tratry ny fisainana\nAtaon’ireo anjely\nManerana ny lanitra!\nFa any ny Noely\nHitohy tsy ho tapitra,\n:,: Enga ka ho ao! :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM61','FFPM 61');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM61', 'Tany Betlehema fahiny\nNisy Zaza teraka;\nTonga toy ny mpivahiny,\nNefa tena Zanaka,\nIzy no Jesosinay,\nKa mba raiso ho anao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM61', 'Ao ny lapa feno haja\nNisy Azy fahizay;\nSaotra, dera aman-daza\nTeo anatrehan-dRay,\nIzany no nilaozany\nHamonjena ny atý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM61', 'Zaza tsy nanota izy,\nNefa Zaza toa anao;\nKoa raisinao rankizy,\nMba ho tena havanao;\nAry mba arahonao\nIzay fanaony hitanao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM61', 'Raha hianao tomany,\nIzy hampangina anao,\nIzy koa hampahamamy\nIzay fifalianao;\nMatokia Hianao,\nIzy no Sakaizanao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM61', 'Nefa mba henoy, ry zaza!\nAo an-danitra Izy izao,\nFa ho avy  indray hitsara\nAn’izao tontolo izao;\nKoa mba fidionao\nIzy ho Mpamonjinao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM62','FFPM 62');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'He, teraka any Betlehema,\nAo Betlehema,\nNy Tompon’i Jerosalema.\n:,: Haleloia! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Ny vilona :,: nandriany :,:\nNihoby ny anjeliny.\n:,: Haleloia! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Ny magy dia :,: nanatitra :,:\nNy miora sy ny hanitra\n:,: Haleloia! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Voaisotra :,: ny helokao :,:\nFa tonga ny Mpanavotrao.\n:,: Haleloia! :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Isika dia :,: noraisiny :,:\nHiombon-dova aminy.\n:,: Haleloia! :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Isika koa :,: hianatra :,:\nNy fideran’ny lanitra.\n:,: Haleloia! :,:', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Isika ao :,: an-danitra :,:\nHo velona finaritra.\n:,: Haleloia! :,:', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Ho naman’ny :,: anjelinao :,:\nIzahay, ry Jeso Tompo ô!\n:,: Haleloia! :,:', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM62', 'Hidera ny :,: Anaranao :,:\nManatrika ny tavanao.\n:,: Haleloia! :,:', '9');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM63','FFPM 63');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM63', 'Tany finaritra,\nTarafin-danitra,\nIty tanin’ny mpivahiny ity\nKa fihobiana\nNo andehanana\nMankany Paradisa arý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM63', 'Andro mihelina\nIlay sasakalina,\nNefa tsarovan’ny olona\nSatria ny lanitra\nTsy lefy hanitra;\nMamelon-kira velona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM63', 'Anjely marobe\nNo indray mihira hoe :\n« O! mifalia ry reraka!\nFa fiadanana\nNo andehanana;\nKristy Mpamonjy teraka! »', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM64','FFPM 64');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM64', 'Injany hiran-danitra\nMisasak’alina;\nLokanga volamena e,\nTendren’ny masina!\nNy tany dia nangina re,\nNandre ny hira vao :\nHo an’ny olona anie\nNy fiadanana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM64', 'Ny hiran’ny anjely re\nTsy mba mitsahatra.\nAry ambony rahona\nIreo masina\nMitendry ny lokangany\nAm-pihobiana!\nHo an’ny olona anie \nNy fiadanana!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM64', 'O! ry mivesatra entana,\nRy malahelo ô!\nMba andrandrao ny lanitra,\nHenoy ny hira vao!\nNy hiran’ny anjely re\nDia mampiadam-po.\nO! mitsahara hianao\nHihaino azy izao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM64', 'Ny andron’olombelona,\nHe fandalovana!\nKanefa hisy tany vao\nIzay haharitra.\nEndrey ny fiadanana\nArý rahatrizay!\nNy hiran’ny anjely\nHiredona indray!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM65','FFPM 65');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM65', 'Ry Betlehema kely ô!\nSondrian-tory ve ?\nKanefa injay miseho ao\nNy hazavana be.\nNy toky sy ny tahotra\nMihaona ankehitrio,\nFa Kristy Ilay Mpanavotra\nNo teraka anio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM65', 'Ry kintana maraina ô!\nFitarik’andro soa.\nTorio fa tonga aty izao\nIlay Mpanjaka soa!\nKa he! ny voninahitra\nHo an’Andriamanitra!\nFiadanana tsy tapitra\nHo an’ny olona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM65', 'Endrey, mangina fatratra\nNy fampidinana\nNy fitahian-danitra\nAm-po ny olona!\nTsy misy tabataba re,\nFa horakoraka.\nKanefa Kristy tonga anie\nAm-po mangoraka!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM65', 'Rankizy hendry sy madio\nTsarovy Kristy izao\nFa izy tonga atý anio,\nMba ho Mpamonjinao.\nNa misy aza ny manjo.\nIzao Noely izao\nNo saino fatratra ao am-po\nHampionona anao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM65', 'Ry Zaza Masina sy soa,\nRy Zanak’i Maria,\nRy Tomponay, Mpamonjy\nkoa,\nMidina re atý.\nNy feon’ny lanitra no re,\nIndray Noely izay,\nNitondra teny soa hoe :\nHianao no avotray!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM66','FFPM 66');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM66', 'Ry olona ô, avia!\nRy tany, mifalia!\nMba henoy ny teninay;\nTeraka ny Tomponay;\nAo an-tranon’omby ao,\nHandeha, mitsaoka Azy izao\nTeraka ny Tompo!\nTeraka Jeso!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM66', 'Ry olona ô, avia!\nRy tany mifalia!\nMba henoy, ry havanay!\nMisy zaza hitanay\nZanak’Andriamanitra\nHamoha indray ny lanitra.\nTeraka ny Tompo!\nTeraka Jeso!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM66', 'Ry kristiana ô, hobio,\nFa afaka hianao anio;\nResy izao ny rafinao,\nAfaka ota hianao,\nFahasoavan-dehibe\nNo ho anjaranao anie;\nTeraka ny Tompo!\nTeraka Jeso.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM67','FFPM 67');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM67', 'Avia ry mino!\nHifaly sy hihoby,\nAvia, avia hankany\nBetlehema :\nTeraka Jeso,\nTompon’ny anjely;\nAvia hitsaoka Azy (in-3)\nIzay Tomponao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM67', 'Tompon’ny tompo,\nAndriananahary,\nNefa mba zana-behivavy koa;\nZanak’i Maria,\nNefa Zanahary;\nAvia hitsaoka Azy (in-3)\nIzay Tomponao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM67', 'Derao, ry anjely,\nMihobia mafy,\nRy mponina an-danitra ao\nAmbony ao!\nDera sy laza\nAtolory Azy;\nAvia hitsaoka Azy (in-3)\nIzay Tomponao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM67', 'He, arahaba,\nTonga aty an-tany\nNy Tompo, Mpamonjy sy\nMpanjaka koa,\nTenin’ny Rainy\nVoatafy nofo,\nAvia hitsaoka Azy (in-3)\nIzay Tomponao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM68','FFPM 68');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM68', 'Re tokoa ny feon’anjely,\nIrak’Andriamanitra;\nHe, ny teny mahafaly\nAvy ao an-danitra.\nEntiny ny teny tsara,\nHo ety an-tany izao;\nVoninahitra aman-dera,\nTompo, no omena Anao!\n(in-3)\nVoninahitra aman-dera,\nTompo no omena Anao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM68', 'Teraka any Betlehema\nIlay Mpanjaka manan-jo\nKa misatro-diadema,\nVoninahi-tsy ho lo,\nMisy ‘zao ety an-tany\nFihavanana tokoa,\nHafalian-tsy holany\nFitahia-mahasoa. (in-3)\nHafalian-tsy ho lany,\nFitahia-mahasoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM68', 'Be ny lazanao, ry Tompo!\nTsara ny Anaranao,\nZovy re no tsy hanompo ?\nIza no handà Anao ?\nHasina sy arahaba\nNo aterina aminao;\nFanjakana tsy ho rava,\nRy Mpanjaka! no Anao (in-3)\nFanjakana tsy ho rava\nRy Mpanjaka! no Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM69','FFPM 69');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM69', 'Zaza masina sy soa,\nNefa ory Hianao,\nKa nanetry tena koa\nSy nandao ny lapanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM69', 'Teraka ory sy nahantra,\nTrano tsy nandrianao,\nFa tsy nisy izay niantra,\nBe ny fahorianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM69', 'Fihinanam-bilon’omby\nNo natao fandrianao,\nFa ny trano be tsy omby,\nNisy olo-maro tao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM69', 'Nofonosin-damban-jaza,\nTonga zazabodo re,\nNefa Tompo manan-daza\nSy Mpanjaka lehibe.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM69', 'Efa halan’olo-maro,\nNefa kosa tiako;\nDia avia, ry Mpamonjy!\nHonina ato amiko.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM70','FFPM 70');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM70', 'Iza moa io Zazakely\n:,: Ao Betlehema :,:\nAnkalazain’ny anjely\nMisasaka alim-be ?\nInjao! Mihira avokoa\nRy mponina ao an-danitra,\nKa iza re io zaza soa ?\nMoa zanak’Andriamanitra\nIo no Mpanjaka voatendry,\nSady mahery no hendry\nZanak’Andriamanitsika,\nKoa hobio sy ifalio!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM70', 'Izy no Jeso Mpanjaka,\n:,: Ka mihobia! :,:\nIzy mamory sy maka,\nAvia, mihobia!\nOmeo voninahitra,\nKa mitehafa tanana;\nHobio ry tendrombohitra\nSy lohasaha mavana!\nIo no Mpanjaka voatendry,\nSady mahery no hendry\nZanak’Andriamanitsika,\nKoa hobio sy ifalio!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM70', 'Izy no Tompo nahary,\n:,: Ka maneke! :,:\nZanaky ny Zanahary,\nKa dia maneke!\nRy hazo ao an-ala ô!\nSamia re manandra-peo;\nRy voninkazo tsara ô!\nAtero fofo-manitra!\nIo no Mpanjaka voatendry,\nSady mahery no hendry\nZanak’Andriamanitsika,\nKoa hobio sy ifalio!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM70', 'Efitra sy tany foana!\n:,: O! mihirà! :,:\nLemaka ary havoana!\nFalia, mihirà;\nRy ranomasin-dehibe,\nRy voronkely tsara feo,\nIzao rehetra marobe,\nAvia mankalaza re!\nIo Mpanjaka voatendry,\nSady mahery no hendry\nZanak’Andriamanitsika,\nKoa hobio sy ifalio!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM71','FFPM 71');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM71', 'Mihainoa! Mihainoa!\nNy feon''anjely sambatra,\nMilaza fa vao teraka\nNy Zanak''Andriamanitra,\nMihainoa izao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM71', 'Mifalia! Mifalia!\nRy zanak''olombelona,\nFa tonga Ilay Mpanavotra\nAntsika izay nifatotra,\nMifalia izao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM71', 'Mba omeo! Mba omeo!\nNy fonao fa angatahiny;\nNy tenany natolony\nAnao izay malalany;\nMba omeo izao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM71', 'Matokia! Matokia!\nKa manaraha Azy izao;\nIlay Mpamonjy be fitia\nNanetry tena ho anao;\nMatokia izao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM72','FFPM 72');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM72', 'Teraka Jesosy Tomponay,\nTaitra ny olona fahizay,\nNisy anjely nihira teo,\nMahafinaritra, tsara feo,\nSady milaza soa aminay,\nDia hihira anio izahay\nFiv: Taona fahasambaranay,\nVolana fifalianay,\nAndro firavoravoana Anao,\nJesosy, Zanaka Masina ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM72', 'Teraka Jesosy be fitia,\nIndro kintana tonga teo,\nAvy hanoro ny Zaza soa:\nFaly ny Magy, fa Io tokoa,\nIo no Mpanjaka mandrakizay\nDia nanaja androtr''izay:\nFiv: Taona fahasambaranay,\nVolana fifalianay,\nAndro firavoravoana Anao,\nJesosy, Zanaka Masina ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM72', 'Teraka Jesosy Zaza soa,\nZaza Malalan''ny Ray tokoa;\nTonga hamonjy io Zaza io,\nTeraka ao Betlehema anio;\nEnto ''zahay, Fanahy, hankao.\nAndronay mahafaly izao:\nFiv: Taona fahasambaranay,\nVolana fifalianay,\nAndro firavoravoana Anao,\nJesosy, Zanaka Masina ô!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM72', 'Sambatra manana Anao ho Ray,\nFaly sy ravo tokoa izahay;\nJesosy Tompo nirahinao,\nTonga ho nofo ny Zanakao;\nTeraka ho Mpanavotra anay\nAvy hifaly eto ''zahay:\nFiv: Taona fahasambaranay,\nVolana fifalianay,\nAndro firavoravoana Anao,\nJesosy, Zanaka Masina ô!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM73','FFPM 73');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM73', 'Indro Zazakely\nZanak''i Maria,\nTompon''ny anjely,\nNefa nankaty,\nIo no Zazalahy,\nZanaky ny Ray.\nTonga mba hitahy:\nIzy no anay.\nFiv: Mihirà, ry tany,\nSy ny mponina eo.\nHafalian-tsy lany,\nManandrata feo!\nJeso no deraina,\nFa Mpanjaka soa;\nHe! Ny fanjakany\nLehibe tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM73', 'Zaza nantenaina\nFony ela be,\nSady Tompon''aina\nManan-kery be,\nMihirà, ry tany!\nEny, mifalia:\nHoy ny mpaminany,\nIzy no Mesia:\nFiv: Mihirà, ry tany,\nSy ny mponina eo.\nHafalian-tsy lany,\nManandrata feo!\nJeso no deraina,\nFa Mpanjaka soa;\nHe! Ny fanjakany\nLehibe tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM73', 'Jeso Zaza hendry,\nMasina sy to,\nTompo voatendry,\nMpanadio ny fo,\nAoka mba hijery\nZao tontolo izao,\nZaza manan-kery,\nIndro, mba hajao:\nFiv: Mihirà, ry tany,\nSy ny mponina eo.\nHafalian-tsy lany,\nManandrata feo!\nJeso no deraina,\nFa Mpanjaka soa;\nHe! Ny fanjakany\nLehibe tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM74','FFPM 74');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM74', 'Tany Betlehema fahiny,\nTao an-tranon''omby re;\nNisy Zazakely soa,\nTampofoan-dreniny,\nJeso Kristy Zaza io,\nZanak''i Maria madio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM74', 'Nahafoy ny Rainy Izy\nSy nandao ny lanitra,\nTsy nandà ny trano ratsy,\nNefa Andriamanitra:\nToe-pahantrana re\nAn''ny Tompo lehibe.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM74', 'Fony Izy mbola Zaza\nDia nanaiky sy nanoa,\nAry tia reny Izy,\nSy nanetry tena koa,\nZaza Kristiana e!\nManaraha Azy re!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM74', 'Ka ho hitantsika Izy\nNoho ny fitiavany:\nFa ''Lay Zazakely tsara\nNo mba Tompon-danitra,\nKa isika zanany\nDia hankany aminy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM74', 'Nefa tsy mba tranon''omby.\nItoerany izao,\nFa nankao an-danitra Izy.\nSy mitafy laza ao;\nKa ho sambatra any koa\nTahaka Azy ny zaza soa.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM75','FFPM 75');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM75', 'Andro malaza sady soa tokoa\n''Lay andro ''zay nisehoan''i Jeso:\n''Zay nantenain''ny mpaminany koa\nMba hampiseho fihavanana,\nFiv : Mifalia sy mihobia mafy,\nEfa tonga ny Mpanavotrao;\nAvia, ka miderà,\nDerao io Zaza io,\n;,: Hobio, hobio,\nFa Tompontsika io.:,;', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM75', 'Anjely maro no nihoby tao;\nMpiandry ondry nitsaoko Azy koa.\nNy olon-kendry koa nanasina Azy,\nAndeha mba hankalaza Azy izao:\nFiv : Mifalia sy mihobia mafy,\nEfa tonga ny Mpanavotrao;\nAvia, ka miderà,\nDerao io Zaza io,\n;,: Hobio, hobio,\nFa Tompontsika io.:,;', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM75', 'Dera sy haja no atolotray\nAnao, ry Jeso ''zay teraka anie:\nKa mba mandraisa ny fanatitray\nHo zava-mani-pofona tokoa:\nFiv : Mifalia sy mihobia mafy,\nEfa tonga ny Mpanavotrao;\nAvia, ka miderà,\nDerao io Zaza io,\n;,: Hobio, hobio,\nFa Tompontsika io.:,;', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM76','FFPM 76');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM76', 'Miderà anio, ry mino,\nNy Mpanavotra anareo!\nManandrata feo hidera\nAn’i Kristy, Tompo soa;\nZanaky ny vehivavy,\nNefa Andriananahary;\nTeraka ho olona,\nMba hanavotra anareo;\nTeraka any Betlehema\n‘Lay Mpanavotra anareo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM76', 'Taitra ny mpiandry ondry,\nAry koa nivadi-po,\nTamin’ny anjely maro\nTonga tany aminy.\nFa isika tsy ho taitra,\nFa ho faly sy ho ravo;\nSitraky ny Tompo soa\nNidina nankatý;\nTeraka any Betlehema\nJeso Kristy ,Tompo soa!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM76', 'Aza taitra, matokia,\nManatòna, mihainoa,\nMazotoa, ka avia,\nManeke ny Tompo soa,\nArahaba, Tomponay ô!\nTompom-pihavananay,\nTeraka ho Tomponay;\nTompon’ny fiainanay;\nArahaba, Tomponay!\nRy Mpanavo-dehibe!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM77','FFPM 77');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM77', 'Tonga indray re ny Noely,\nAndro tsara sady soa;\nJeso Tompon’ny anjely,\nNefa nietry tena koa.\nIndro tonga Zazakely,\nHo sakaizanay tokoa,\nSy hamory  ‘zay miely,\nHody amin-dRainy koa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM77', 'He, ny fonay ravoravo,\nRy Noely maminay,\nFa ny Zanaky ny Avo,\nNo nomeny ho anay,\nMba hanarina ny lavo,\nSady ho fiainanay;\nFeno sy mitafotafo\n‘Zany hasambaranay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM77', 'O! ry androm-pamonjena,\nArahaba, hianao!\nOlo-maro sesehena\nNo mifaly aminao,\nAvy koa mba hitsena\n‘Lay Mpamonjy soa ’zahay,\nKa ny fonay no homena\nAn’i Kristy Havanay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM78','FFPM 78');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM78', 'Be ny voninahitrao,\nJeso Kristy Tompo!\nLanitra nonenanao,\nMaro no nanompo,\nBe ny mahasambatra,\nFaly re ny fonao;\nNanam-boninahitra\nTao an-dapan-dRainao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM78', 'Fa ny voninahitra\nEfa nialanao;\nNy haren’ny lanitra\nTsy mba nojerenao,\nTeraka ho olona\nHianao nahery,\nKa avy mba hanavotra\nNy mpanota very.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM78', 'Eny, tonga Hianao\nHonina amin-tany,\nHahazoan ‘ny olonao\nSoa tsy ho lany.\nSarotra ny lalanao,\nBe ny zava-mafy,\nLoza no nanjo Anao,\nMaro no nandrafy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM78', 'Saotra no aterinay,\nVavaka aman-dera,\nRavo ny fanahinay,\nKa avy mba hihira,\nVitanao ny asanao\nNamonjenao aina,\nKa indro ny Anaranao\nVelona ao an-tsaina!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM79','FFPM 79');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM79', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM79', 'Sambasamba, Zanahary\nTamy ny nampidinanao\nNy Zanakao, malalanao,\nMba hisolo ny helokay.\n:,: Tamy ny nampidinanao\nNy Zanakao malalanao,\nMba hisolo ny helokay :,:', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM80','FFPM 80');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM80', 'He, ny hoby ao an-danitra,\nFa Mpamonjy re no teraka,\nIo no Zanak’Andriamanitra,\n‘Lay Tanteraka.\nMifalia, mihobia,\nFa tonga ho anao ny Tompo\ntia\nKa mba hirao sy lazao\nNy famonjena azonao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM80', 'Zava-mahagaga fatratra\nNy fitiavan’Andriamanitra,\nNy mpanota tafasaraka\nTonga sambatra!\nMifalia, mihobia,\nFa tonga ho anao ny Tompo\ntia\nKa mba hirao sy lazao\nNy famonjena azonao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM80', 'O! ry tany izay asandratra,\nKa vangian’ny Tompon-\ndanitra,\nInona ary no atolotra\nNy Mpanavotra ?\nMifalia, mihobia,\nFa tonga ho anao ny Tompo\ntia\nKa mba hirao sy lazao\nNy famonjena azonao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM81','FFPM 81');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM81', 'Tao an-tsahan’i Betlehema,\n‘Reo mpiandry ny ondry re,\nNo vangian’ny Serafima\nSy anjely maro be.\nVoninahitra ho an’\nAndriamanitra,\nHo an’Andriamanitra!\nVoninahitra ho an’\nAndriamanitra ,\nAmin’ny avo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM81', '‘Njany ny hiran’ny anjely,\n‘Zay niredona tokoa\nIndro tonga Imanoely\nZaza masina sy soa.\nVoninahitra ho an’\nAndriamanitra,\nHo an’Andriamanitra!\nVoninahitra ho an’\nAndriamanitra ,\nAmin’ny avo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM81', 'Nofo notafin’ny Teny,\nLanitra nilaozany;\n‘Ndao isika izao hankany,\nBe tokoa ny lazany.\nVoninahitra ho an’\nAndriamanitra,\nHo an’Andriamanitra!\nVoninahitra ho an’\nAndriamanitra ,\nAmin’ny avo!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM81', 'Voninahitra ao ambony\nHo an’Andriamanitra,\nKa ny hira no redony\nSolon-java-manitra.\nVoninahitra ho an’\nAndriamanitra,\nHo an’Andriamanitra!\nVoninahitra ho an’\nAndriamanitra ,\nAmin’ny avo!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM82','FFPM 82');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM82', 'He, Zaza mahasambatra\nNo omena ho antsika!\nVirjina no niteraka\nIlay Andriantsika\nIzay Zanak’Andriamanitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM82', 'Nandao ny voninahitra\nHanavotra ny very;\nKa saotra no aterinay,\nRy Jeso Kristy Tomponay,\nMpamonjy manan-kery!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM83','FFPM 83');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM83', 'Ry Jeso ô! Hianao no\nmahavonjy\nIzay rehetra hiankina aminao;\nTonga tatý hitady sy hamonjy\nIzay mpanota very Hianao.\nHe! ry mpanota very atý!\nÔ! mankanesa ho any aminy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM83', 'Na dia Zana-Janahary aza,\nNa dia Tompo aza Hianao,\nTsy mba nitandro hery\naman-daza,\nTonga olona ory Hianao\nHe! ry mpanota very atý!\nÔ! mankanesa ho any aminy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM83', 'Tamin’ny dianao nanaovan-\ntsoa,\nTsy nahalala sasatra Hianao;\nFa Hianao tsy nanana tokoa\n‘Zay nametrahanao ny lohanao\nHe! ry mpanota very atý!\nÔ! mankanesa ho any aminy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM83', 'Dia nolatsaina sy nalam-\nbaraka\nSy novonoin’olon-dozabe,\nKa dia maty Hianao Mpanjaka\nHo fanavotana olo-maro-be\nHe! ry mpanota very atý!\nÔ! mankanesa ho any aminy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM83', 'Ny fasanao nambenan’ny\nmahery,\nNefa tsy ela tao ny\nTomponay,\nVelona indray hamonjy\nolom-bery,\nVelon-kanao fifonan-ko anay.\nHe! ry mpanota very atý!\nÔ! mankanesa ho any aminy.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM84','FFPM 84');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM84', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM84', 'He! be ny hasoavana,\nFa tonga ny fotoana,\nKa Kristy Tompo teraka\nHamonjy sy hanavotra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM84', 'Ny fahotan’ny olona\nDia lova tamin-drazana :\nIsika trany avokoa,\nKa very re ny aina soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM84', 'Inty ny zaza masina e,\nIzay neken’ny Rainy hoe :\n“Ny Zanako Malalako,\n‘Zay mamiko sy sitrakao”', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM84', 'Ny dera eran-danitra\nOmeo an’Andriamanitra\n‘Zay nahafoy ny Zanany\nHanavotra ny olony.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM85','FFPM 85');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM85', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM85', 'Avelao isika\nIzay te ho tia\nNy Mpanavotra antsika\nHanaraka Azy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM85', 'Aoka ho fantatsika\nNy fitiavany\nSy ny anton’ny asany\nHiderantsika azy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM85', 'Be ny fiantrany,\nNijery ny ory,\nTratran-dRainy nialany\nHo teraka olona.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM85', 'Be ny fiantrany,\nNijaly ka maty\nHamonjeny ny mpanota,\nKa Izy hisaorana.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM86','FFPM 86');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM86', 'Jereo ny Mpamonjy\nIzay miakatra\nHo ao Jerosalema\nHanao ny avotra;\nNa dia be ny ratsy\nMikendry Azy ao,\nNy mba hamonjy azy\nNo tiany hatao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM86', 'Tsy biby manan-daza\nNo nitaingenany\nTsy ny hitady laza\nNo nihaviany,\nKanefa manan-kery\nHandresy ho anao.\nNy ratrany irery\nNo aina ho anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM86', 'Ilay voasatro-tsilo\nNoho ny helokao\nDia mety sy maniry\nMba ho Mpanjakanao\nNy rany sarobidy\nOmeny ho anao;\nNy lanitra nihidy\nMisokatra aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM86', 'Ampio mba ho haiko\nHatolotra Anao,\nJesosy ô ny aiko\nHo voninahitrao;\nVelariko ny foko\nEo anoloanao,\nTsy misy tsy ho foiko\nMba hodiovinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM86', 'Hosana! ry Mpamonjy,\nHiraiko ho Anao\nFa mamin’ny tra-bonjy\nNy fiderana Anao.\nHosana, Tompo tsara!\nSoava dia izao!\nHandresy ny devoly\nNo anton-dianao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM87','FFPM 87');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Nitomany ny Mpamonjy\nFa tsy nety ho tra-bonjy\nIsraely olony.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Izy dia nanambara\nTaminy ny teny tsara\nFeno fitiavana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Ka ny jamba, kilemaina\nMoana sy very saina,\nDia nositraniny.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'He! ny soa efa vita\nNefa nody tsy nahita\nNy ankamaroany.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Ary lotika ny fony,\nKoa halany ‘lay ony\nFeno rano velona.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Ry Mpamonjiko malala!\nAoka aho hahalala\nNy fitomanianao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM87', 'Ary hahalala koa\nFa ny soa mahavoa\nRaha tsy ho raisina.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM88','FFPM 88');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Ilay ora tao Getsemane\nTsy mba hadino re,\nRaha Hianao no tsembo-dra,\nRy Tompon’avotra\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Nafoin-dRay irery tao,\nNilaozan-kavanao\nHandraisana anay indray\nHo zanaky ny Ray.\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Nandroso mba hijaly tao,\nRy Tompo, Hianao;\nFadiranovana sy may\nHanavotra anay.\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Fa vinitra Jehovah Ray\nNoho ny ditranay;\nNinianay nolavina\nNy didy masina.\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Ka Hianao nasiana\nHo solo-voina;\nNy dinitrao, ry Tomponay,\nDia valin’otanay.\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Fa sitrakao ho afaka\nNy olo-meloka;\nEndrey ny fitiavanao\nAnay navotanao!\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM88', 'Raha mila hangatsia-po\nIzaho, Tompo ô,\nMba ampisaino aho re\nNy tao Getsemane!\n:,: Tsahiviko :,:\nNy fahorianao,\nRaha tsinjoko ny ady be,\nIlay tao Getsemane.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM89','FFPM 89');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM89', 'He, mijaly ny Mpamonjy\nAo Getsemane izao!\nO, ry te-ho voavonjy,\nManaraha Azy ao;\nIndro ny Mpanavotrao,\nFa mitady ho anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM89', 'Ory ao ny Tompon’aina\nMafy re ny adiny\nKa misento mitaraina,\nToy ny ra ny dininy.\nRy mpanota mijere,\nMihevera ka hendre!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM89', 'Indro tonga ny anjely,\nMba hampahatanjaka\nAn’i Jeso, Izay nijaly\nAmim-panaintainana.\nRy Mpamonjy tia ô!\nMamindrà fo amiko.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM90','FFPM 90');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM90', 'Tsy haiko ny milaza re,\n‘Lay fahorianao\nIrery tao Getsemane\nRy Tompo masina ô!\nTarihonao ny saiko e\nHo ao Getsemane.\nHahita ny fitiavanao\nIzao tontolo ‘zao.\nFitiavana ahy re,\nRy Tompo masina ô!\nNo niaretanao\nIzao mangidy ‘zao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM90', 'Nangorohoro mafy re,\nNy fonao, Jeso tia!\nNy tsembokao’zay nitete,\nNanjary toy ny ra!\nEndrey, ny fahorianao\nNangotraka tokoa!\nTsy maintsy nosotroinao\nIlay kapoaka tao!\nFitiavana ahy re,\nRy Tompo masina ô!\nNo niaretanao\nIzao mangidy ‘zao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM90', 'Ho ahy re, ho ahy re,\nNo niaretanao\nIrery tao Getsemane\nJeso malala ô!\nSintoninao ny foko ê\nHo ao Getsemane.\nHahita izay niaretanao.\nHo tena tia Anao!\nFitiavana ahy re,\nRy Tompo masina ô!\nNo niaretanao\nIzao mangidy ‘zao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM91','FFPM 91');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'O, fitiavan-dalina,\nNasehonao ilay alina\nIzay namadihana Anao,\nRy Jeso, fototr’aim-baovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Mangoraka erý ny fo,\nSy ory ny fanahiko ,\nRaha mba tsaroako izao\nNy loza izay nanjo Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Fadiranovana Hianao,\nNangotraka ny adinao;\nNy dinitrao nanjary ra\nNoho ny fahoriana.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Izany niaretanao\nNoho ny fitiavanao,\nKa nentinao ny heloko,\nIzay tokony ho nentiko.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Namita fanekem-baovao\nHo famonjena Hianao ,\nNasianao kase izay\nMaharitra mandrakizay.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Misaotra Anao ry Tompo ô!\nFa ravo ny fanahiko\nHandray ny fanomezanao\nEo amin’ny latabatrao.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Ny teninao inoako,\nKa raisiko ho ao am-po;\nNy zava tsoa atolotrao\nDia ranao sy ny tenanao.', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM91', 'Ry Jeso, amboaronao\nNy fonay ho fonenanao,\nKa Hianao ho tianay\nIzao sy ho mandrakizay.', '9');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM92','FFPM 92');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM92', 'Ry voasatro-tsilo,\nRy voakapoka!\nIndrisy be ny loza\nManafotra Anao!\nNitsaohan’ny anjely\nFahiny Hianao.\nFa henatra sy latsa\nAnjaranao izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM92', 'Atolotro, ry Jeso,\nNy foko ho Anao,\nHiaraka hitondra\nNy fahorianao.\nRaha henatra sy loza\nNo ho anjarako,\nDia Hianao Mpamonjy,\nNo ifaliako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM92', 'Tsarovy aho, Tompo,\nRaha tratry ny manjo!\nTsy mendrika aho, nefa\nMba amindraonao fo!\nNy ratranao no misy\nFanasitranana.\nNy ranao ahitana\nNy fiadanana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM93','FFPM 93');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM93', 'Nampalahelo mafy re\nNy fahorian-dehibe\n‘Zay niaretanao.\nNalaim-baraka Hianao,\nNiaritra ka tsy nandao\n‘Lay asa masinao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM93', 'Ny henatra aman-tahotra\nMangeja anay voavotra,\nFa diso izahay.\nAvia, Tompo , mamonje\nMeteza izao ka maneke\nHanavotra indray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM93', 'Ampio ny olonao, Jeso\nHahay handray Anao am-po\nFa mila vonjy izao.\nMonena hanatanjaka\nNy ory sy ny reraka,\nIzay manantena Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM94','FFPM 94');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM94', 'Gologota no jereo,\nAo ny hazo fijaliana;\nIndro re, mihantona eo\nJeso, sady harabiana.\nMoa mba fantatrao, ry fo,\nNy fitiavan’i Jesosy,\n‘Zay nandefitra tokoa,\nAry koa ninia ho resy ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM94', 'Famonjena ho anao\nNo netezany hihafy,\nKa hijaly toa izao\nSy hiharitra ny mafy.\nHe, ny rany nitete\nVokatry ny fanomboana;\nVetivety foana re\nDia ho faty ao ny Tompo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM94', 'Mitsangana, miaingà,\nNdeha mankany Gologota;\nAo no latsaka ny ra\nHamonjena ny mpanota;\nIo no hany mahadio,\nAntoka tsy hay ravàna\nEny, samy afak’io\n‘Zay rehetra fahotàna!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM95','FFPM 95');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM95', 'Ny hazo nijalianao,\nRy Jeso Tomponay!\nManeho ny fitianao.\nDia iankinanay, (in-3) | *\nManeho ny fitiavanao.  |', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM95', 'Mitazana ny masonay,\nMangoraka ny fo;\nNa meloka aza izahay.\nNy teninao ho to. (in-3) | *\nNa meloka aza izahay.     |', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM95', 'Ny avotr’aina vitanao\nNo itokianay;\nNy entanay voaesotrao.\nKa afaka izahay. (in-3) | *\nNy entanay voaesotrao. |', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM95', 'Ny hazo nihomboanao\nDia voninahitray;\nNy nanalam-baraka Anao\nNo isandratanay! (in-3)   | *\nNy nanalam-baraka Anao. |\n\n*) Ho an’ny feony (1) ihany', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM96','FFPM 96');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM96', 'Ilay havoana\nNatao hoe Kalvary,\nNo tany namonoana,\nNy Tompo Jesosy;\nO! tsarovy re!\nMaty ory tao\nJeso Tompo lehibe\nHanavotra anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM96', 'Jereo ny Tomponao,\nTazanonao irý,\nKa andrandrao ny masonao,\nFa io no Kalvary!\nO! tsarovy re!\nMaty ory tao\nJeso Tompo lehibe\nHanavotra anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM96', 'Hevero Kalvary,\nFa tao ny Tomponao;\nTsarovinao ny nentiny\nMba hamonjena anao!\nO! tsarovy re!\nMaty ory tao\nJeso Tompo lehibe\nHanavotra anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM96', 'Tsinjovy Kalvary,\nFa Jeso Tomponao,\nNijaly tany raha tetý,\nKa maty Izy tao!\nO! tsarovy re!\nMaty ory tao\nJeso Tompo lehibe\nHanavotra anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM97','FFPM 97');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM97', '‘Lay fonao tia tao Gologota\nNo velona ao an-tsaiko izao.\nNy fonao ‘zay mitady\nmpanota,\nNo voaratra indrindra tao.\nRy fo malala, nihafy loatra,\nLavitra ny mpangoraka Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM97', 'Indro ny lefona koa mamely\nKa notrobarana Hianao!\nHe! malahelo ireo anjely,\nFa naharary re ny fonao!\nIo no fitia tsy misy toa azy,\nZaran’izao rehetra izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM97', 'Efa hisoka ny antoandro,\nMenatra izao tontolo izao;\nTsy ela intsony dia maizina\nandro\nKalvary ‘zay nihantonanao!\nFa izaho tsy mba hangataka\nandro\nHampiantrano ny tenanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM97', 'Tsy sasatra na valaka koa,\nNy fonao tia, ry Tompo ô;\nMenatra izao ity foko tsy soa.\nTsy hahavaly tokoa Anao;\nNefa ampio aho hanaiky,\nHanatontosa ‘zay sitrakao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM98','FFPM 98');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM98', 'Indro ny Tompo Jesosy,\njereo,\nTena nihafy tokoa!\nHe! fa nivesatra eso, jereo,\nMba hamonjena anao!\nIndro Jeso, jereo Jeso.\nIzy izao dia mihevitra anao,\nIndro Jeso, jereo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM98', 'Indro ny Tompo Jesosy,\njereo,\nEfa voahombo tokoa!\nHe! fa nijaly tsy meloka teo,\nMba hamonjena anao!\nIndro Jeso, jereo Jeso.\nIzy izao dia mihevitra anao,\nIndro Jeso, jereo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM98', 'Indry ny lefo-mandoza\njereo,\nNenti-namely ny Tompo!\nHe! fa ny rany nirotsaka teo,\nMba hamonjena anao!\nIndro Jeso, jereo Jeso.\nIzy izao dia mihevitra anao,\nIndro Jeso, jereo!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM99','FFPM 99');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM99', 'Ry fitiavan’i Jesosy!\n‘Zay voahombo ho anay,\nOny be sy mahavonjy,\nAoka ho lasanao ‘zahay!\nTompo, Zanakondry tsara,\nAmpy re ilay ranao,\nTsy helohin’ny Mpitsara\n‘Zay mpanota afakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM99', 'Fa misento ny fanahy,\n‘Zay etý an-tany ‘zao;\nMalahelo sy manahy,\nSao ho voan’izay natao.\nTompo, Zanakondry tsara,\nAmpy re ilay ranao,\nTsy helohin’ny Mpitsara\n‘Zay mpanota afakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM99', 'Ny mpanota dia ho very,\nRaha tsy mba miova izao.\nFa hahazo tena hery,\nRaha mino tsara Anao!\nTompo, Zanakondry tsara,\nAmpy re ilay ranao,\nTsy helohin’ny Mpitsara\n‘Zay mpanota afakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM99', 'Enga anie ka mba hiely\nHo an’izao tontolo izao\nIlehy Ony mahafaly,\nManadio sy manavao!\nTompo, Zanakondry tsara,\nAmpy re ilay ranao,\nTsy helohin’ny Mpitsara\n‘Zay mpanota afakao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM100','FFPM 100');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM100', 'Moa mba efa misy va\nFahoriana toy izao!\nJeso ‘Lay Mpanisy soa,\nTompo sy Mpanjaka koa\nEntina tsy meloka,\nEntina any Kalvary ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM100', 'He, ny lanivoany\nVoatsindron-defona!\nTongotra aman-tanany\nVoafantsika avokoa,\nEny, fa ny ainy koa,\nFoiny tany Kalvary.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM100', 'Mafy ‘zay ry Jeso ô!\nMafy nefa zakanao,\nNy fitiavanao anay!\nNo niaretanao izay\nMenatra aho, Jeso ô\nRaha hadino Kalvary.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM100', 'Taomy aho Jeso ô!\nMba ho any Kalvary,\nKa ny foko tsy madio\nMba diovinao anio!\nEnto aho, Jeso ô!\nEnto any Kalvary.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM101','FFPM 101');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM101', 'Ny hazo fijaliana,\nRy Jeso Tomponay,\nDia tena fitoriana\nFa tianao ’zahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM101', 'Ny hazo fijaliana\nDia manambara izao\nFa be ny fahoriana\nNihatra taminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM101', 'Ny hazo fijaliana\nNo mampiseho koa\nFa tokony hariana\nNy ota mahavoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM101', 'Isaoranay dia isaoranay\nHianao, ry Tomponay,\nFa be ny fitiavana\nNataonao taminay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM102','FFPM 102');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM102', 'Reharehako ny hazo\nNijalian’i Kristy;\nManda fiarovana avo\nIalofako atý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM102', 'Azon-doza maro aho\nTery koa ny làlana;\nTsy ilaozan’i Jesosy\nMpanome fiadanana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM102', 'Raha lany re ny andro\nMampiadana indray,\nTsy hadinoko ny hazo\nNentin’ny Mpamonjinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM102', 'Ny anjara atý an-tany\nTsy mba mahavesatra\nNoho ny hazo fijalianao\nHazo mahasambatra.\nAmen!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM103','FFPM 103');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ny hazo-fijaliana\nTsy maintsy hotsarovana;\nHenoy, ry fanahiko,\nNy tenin’ny Mpamonjinao!\n\nVakiteny 1', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ny teny voalohany\nMihevitra ny rafiny :\n« Mba mamelà ny helony,\nFa jamba ny fanahiny! »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Izaho koa Jeso ô!\nDia jamba sady ratsy fo;\nKa mba jereo sy iantrao,\nFa te ho tonga olonao.\n\nVakiteny 2', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ilay meloka tanilany\nNaniry mba ho raisiny,\nNomeny toky tsara io :\n« Ho any Paradisa anio! »', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Raha avy ny anjarako,\nKa tapitra ny androko,\nMba raiso aho Tompo ô,\nHo any Paradisanao!\n\nVakiteny 3', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Dia hitany ny reniny\nTomany teo akaikiny,\nToy ny tsindronin-defona\nKa feno fisentoana.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Dia Jaona no natolony\nHo zanany ho solony :\n« Mba raisonao, ry Jaona ô\nHo reninao ny reniko! »', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Tsarovy aho, Tompo ô!\nRaha ao am-pahoriako,\nIraho ny mpianatrao\nHanampy ny mpanomponao!\n\nVakiteny 4', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ny teniny fahefatra\nNo tena mampangovitra;\nNiantso Izy, hoe : « Ry Ray,\nNahoana Aho no afoy ? »', '9');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Izao no dia nandaozana\nAnao tam-pahoriana;\nHahafaka ny tahotro,\nRaha tonga ny fotoako.\n\nVakiteny 5', '10');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ny otako izay nentiny\nNahory ny fanahiny,\nKa nitarainany hoe :\n« Mangetaheta Aho re! »', '11');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Mangidy, ry Jesosy ô,\nNy loza niaretanao,\nKa aoka mba ho mamiko\nNy avotra, izay vitanao!\n\nVakiteny 6', '12');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Hoy  Izy indray :\n« Tanteraka! »\nHe! teny mahasambatra.\nTanteraka ny asany,\nVoavotra ny olony.\n\nVakiteny 7', '13');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Ny teny farany indray\nNilaza ny rahatrizay :\n« Atolotro ny aiko izao,\nRy Ray, ho eo an-tànanao! »', '14');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM103', 'Izany dia mamiko\nHiorina ao anatiko,\nKa teny hotononiko\nEo amim-pahafatesako!', '15');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM104','FFPM 104');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', 'Raha mijery ny hazo\nNijalian’i Jesosy,\nTsy misy izay malaza\nNa izay mirehareha.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', 'Aza miavonavona,\nFa indro ny Mpanavotra;\nNy dian’i Jesosy Kristy\nNo arahina isan-andro.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', 'Indro! ny rany mandeha,\nVoahombo ny tànany,\nNijaly, ka dia maty\nNisolo olo-meloka.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', 'Raha ahy ‘zao tany izao\nSy ny aminy rehetra,\nTsy ho azoko havaly\nNy fitiavan’i Jeso.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM104', 'Ny foko omeko Azy,\nFanahiko hatolotro;\nTsy mba mendrika Azy ‘zany\nFa Jeso no mety mandray.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM105','FFPM 105');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM105', 'Tsinjovy   ilay havoana\nArý Jerosalema,\nFa io Golgota!\nMba tadidio ange!\nFa tao, nivesatra ny ota\nNy Tompo Masina\nNijaly sy nolavina\nKa novonoina!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM105', 'Tsy takatra heverina\nNy entan-dehibe,\nIzay nentin’ny Mpisolo\nKa mba diniho re!\nFa nentiny daholo\nNy heloka natao\nFa tonga Izy hanavao\nIzao tontolo izao', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM105', 'Ny helotsika koa izao\nDia nivesarany,\nKa manaraha Azy,\nMba ho mpianany!\nRaha tao Golgota Izy,\nNy rany nitete,\nKa vita ho antsika re\nNy vonjy lehibe!\nNy Ho resy sy ho faty.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM106','FFPM 106');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM106', 'Indro, ny Fitiavana nijaly\nTeo amin’ny hazo-fijaliana;\nAry ny ratsy nivonona hifaly,\nHandresy ny Zanaka-lahy\nTokana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM106', 'Indro, ny Fitiavana mahery,\nNitondra ny heloky ny olony;\nIzy niady hanafaka ny very,\nNy ainy no avotra ka natolony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM106', 'Izy nijaly mafy tao Golgota,\nVoahombo ny tongotra\naman-tanany;\nIzy nisolo antsika izay\nmpanota\nKa fadiranovana ny fanahiny.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM106', 'O, ry Mpamonjy, mba hazony\naho\nHijery ny hazo-fijaliana!\nOlona meloka aho ka afaho,\nHialoka amin’ny fitiavanao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM107','FFPM 107');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM107', 'Maniry mafy aho ry Jeso\nTompo ô,\nHialoka eo ambany hazo-\nfijalianao;\nTsy misy toeran-kafa re izay\ntena mamiko,\nNy hazo-fijalianao no\nfiarovako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM107', 'Ny hazo-fijalianao no\nitazanako\nNy tenanao Izay nijaly mba\nho avotro;\nKa dia kotsan-dranomasom-\npitiavana\nNy tavako, ry Tompo ô, fa\nafa-keloka!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM107', 'Am-pototry ny hazo izay\nnijalianao\nNo itoerako hohazavain’ny\ntavanao;\nAtaoko fatiantoka ny zava-\nmora lo,\nNy hazo-fijalianao no\ntombon-dahiko!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM108','FFPM 108');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'Ny hazo-fijalianao,\nRy Jeso Tompo maminay,\nDia an’izao tontolo izao\nKa famonjena ho anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'Mivelatra eo ka hitanay\nIzany fitiavana;\nKa ampianaro izahay\nHo be fitia toa   Anao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'He! latsaka eo ho avotray\nNy ranao masina sy soa;\nKa mba sasao re izahay\nHo olonao madio tokoa!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'Voatolotra eo mba ho anay\nNy famonjena vitanao;\nKa mba tariho izahay\nHandray ny fahasoavanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'Mamiratra eo ka tazanay\nNy lanitra fonenanao;\nKa mba tantano izahay\nHo mendrika ho mponina ao!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM108', 'Ndrey, tena mahafinaritra\nNy miara-monina   aminao;\nKa ampio izahay hiaritra\nNy hazo-fijalianao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM109','FFPM 109');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM109', 'Nahafoy ny aiko Aho,\nHanavotako anao,\nKa nalatsako ny rako,\nNisoloako anao;\nHe! ny aiko no nomeko,\nRy mpanota very e!\nAiza   izay afoinao re,\nMba ho Ahy Tomponao ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM109', 'Lapan-dRaiko ao ambony,\nVoninahi-dehibe,\nNo nilaozako hamonjy\nSy hanafa-doza anao,\n‘Zay voafitak’i Satana\nSy nozoin-doza be!\nAiza   izay afoinao re,\nMba ho Ahy Tomponao ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM109', 'Soa be sy mahagaga\nNo atolotro anao;\nFamonjena tsy vidina,\nFamelana otanao.\nFitiavan-tsy voafetra\nLova ao an-danitra ao!\nAiza   izay afoinao re,\nMba ho Ahy Tomponao ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM109', 'Indro, Tompo! fa omeko\nHo Anao ny tenako,\nKa tsy misy ‘zay tsy foiko\n‘Zay rehetra tianao!\nEso, latsa, tsy ahoako\nFa ny ho mpanomponao\nNo ho zavatra kendreko,\nRaiso re ny zanakao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM110','FFPM 110');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Nomeko ho anao\nNy rako masina,\nHanavotra anao,\nIzay tsy marina!\n:,: Ka dia mba inona izao\nNo Ahy taminao ? :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Nafoiko ho anao\nNy zava-tsoa be,\nMba hanatonanao\nNy Raiko lehibe!\n:,: Ka dia mba inona izao\nNo Ahy taminao ? :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Izaho Tomponao\nNijaly mafy re,\nHanafaka anao,\nMpanota lehibe!\n:,: Ka dia mba inona izao\nNo Ahy taminao ? :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Ny vonjy lehibe\nNataoko ho anao,\nNy rako nitete\nHandio ny otanao!\n:,: Ka dia mba inona izao\nNo Ahy taminao ? :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Jesosy Tompo ô!\nIzao no teniko :\nAtolotro Anao\nNy aiko sy ny fo!\n:,: Izany no isaorako\nAnao Mpamonjiko! :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM110', 'Ny foko raisonao,\nOneno hatretý,\nAtaovy lapanao\nNa eto na arý!\n:,: Dia tano aho, Tompo ô,\nMba ho fanananao! :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM111','FFPM 111');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', 'Indro ny Mpamonjy,\nMpanavotra antsika,\nIzy no manontany hoe :\n“ Tianao va Aho ? ”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', 'Izaho no Mpamonjy\nSy mpisolo anao;\nNy rako manontany hoe :\n“ Tianao va Aho ? ”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', 'Ny fitiavako\nTsy mety miova\nKa mba manontany hoe :\n“ Tianao va Aho ? ”', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', 'Ry Jeso Tompoko!\nMalahelo ‘zahay,\nNy fitiavanay Anao\nMbola tsy toy inona.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM111', 'Aelezo ao am-po\nNy fitiavanao,\nHahazoanay hamaly :\n“ Tianay Hianao ”', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM112','FFPM 112');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Tsy dia ny hahazo soa\nArý an-danitra\nNo itiavako Anao,\nRy Andriamanitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Tsy noho ny atahorako\nNy fijaliana,\nFa noho ny fitiavanao,\nNo itiavako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Voahombo, voalefona,\nVoalatsa Hianao;\nNahinjitra ny tànanao\nTambony hazo teo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Izaho no niaretanao\nNy fijaliana;\nNy ranao nanavotana ahy\nIzay fahavalonao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Ka moa tsy fitiavana\nHavaliko Anao ?\nNy foko no atolotro\nAnao, ry Tompo ô!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM112', 'Ry Jeso Kristy masina  ô!\nDeraiko Hianao,\nFa Hianao Mpanjakako\nSy Andriamanitro!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM113','FFPM 113');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Jeso, Zanahary!\nMasina sy to,\nNanome ny ainao\nNoho ny olonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Tsy niaro loza\nTamin-tenanao,\nFa mba tonga ory\nNoho ny olonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Nentinao ny ratsy,\nSoa nolavinao,\nLapa nialanao,\nNoho ny olonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Jeso Tomponay ô!\nTompo masina,\nManomezà soa\nNy mpanomponao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Mamelà ny ota,\nManovà ny fo,\nDiovy ny maloto;\nAoka ho olonao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM113', 'Tompo ô, Tsitoha\nVatolampinay!\nSaotra aman-dera\nRaiso ho Anao!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM114','FFPM 114');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM114', 'Jeso no niala aina\nHanavotany anao,\n:,: Iza re no tsy hanaiky\nAzy izao ? :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM114', 'Fa ny lapany ambony\nNialany fahizay,\n:,: Hamonjeny olom-bery,\nVery tokoa :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM114', 'Fa izay manatona  Azy,\nKa mibebaka ao am-po\n:,: Tsy hariany akory,\nKa matokia! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM114', 'Mba avia, ry havanay ô!\nManeke ny Tomponao,\n:,: Maneke ny Tompon’aina\nHo Tomponao! :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM114', 'Iantrao, ry Tomponay ô!\nNy mialoka aminao,\n:,: Raisonao ‘zahay mpanota\nHo olonao! :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM115','FFPM 115');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM115', 'Jeso Tompo lehibe,\nIraky ny Rainy,\nNolatsain’ny maro be,\nTsy mba nohajainy!\nJeso tia, Jeso tia,\nMaty voahombo;\nMaty tany Kalvary,\nMaty re ny Tompo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM115', 'Ory loatra fahizay,\nZanak’ondry mora,\nMaty mba ho solonay,\nSady voakora!\nJeso tia, Jeso tia,\nMaty voahombo;\nMaty tany Kalvary,\nMaty re ny Tompo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM115', 'Nalahelo, be nanjo,\nNefa tsy nanota,\nFa nijaly sitrapo\nTany Gologota!\nJeso tia, Jeso tia,\nMaty voahombo;\nMaty tany Kalvary,\nMaty re ny Tompo!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM115', 'Jeso no Mpamonjy tia,\nNahafoy ny ainy,\nMba hamory ‘zay mania,\nHody amin-dRainy!\nJeso tia, Jeso tia,\nMaty voahombo;\nMaty tany Kalvary,\nMaty re ny Tompo!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM116','FFPM 116');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM116', 'Miaingà, ry fo sy saina,\nMba ho any Golgota,\nMaty tao ny Tompon’aina,\nVita tao ny avotra.\nRy mahantra, ry mania,\nSady raiki-tahotra,\nNy Mpamonjy be fitia\nHahitanao avotra!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM116', 'Fa ny ainao ry Mpamonjy,\nNisoloanao anay\nHahazoanay ny vonjy\nSy hahafa-trosa anay!\nVatofantsiky ny aiko,\nHianao, Mpamonjy ô!\nRavoravo izao ny saiko\nAfakao ny heloko!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM116', 'Ny manjo atý an-tany,\nTsy mba hatahorako,\nFa izaho dia ho any\nAmin’ny Mpanavotro,\nTombon-dahiko tokoa\nNy fahafatesana,\nHahatrarako ny soa,\nDia ny fiainana!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM117','FFPM 117');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM117', '(Hiraina in-3 no fanao ity)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM117', 'O, ry Zanakondry,\nHe! Hianao nijaly;\nOry, voahombo,\nAnefa tsy namaly;\nNy helokay nalainao,\nKa maty re ny ainao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM117', 'Mba iantrao izahay, ry Jeso!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM117', 'Ampiadanonao izahay re!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM118','FFPM 118');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM118', 'Mba jereo ny Zanakondry\nVoahombo sady ory,\nNefa Tompo masina.\nHe! ny Rainay tsy namaly,\nRaha ny Zanany nijaly\nTamim-panaintainana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM118', 'He! ny Marina nijaly!\nMba hahaizako mifaly,\nIzay no niaretany.\nO! ry foko, mangovita,\nManatòna mba hahita\nNy fahafatesany!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM118', 'Eny, ry Mpamonjy tsara\nMba meteza hanambara\nNy harem-pitiavanao;\nDia hafanao ny foko.\nMba hahaizako hanompo\nSy hanaraka Anao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM118', 'Aoka aho hitomany,\nRaha mihevitra izany\nFahoriana nentinao.\nAzoko ny famonjena;\nO! ry foko, manenena\nNoho ny ratsy vitanao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM118', 'Tompo, manampia ahy,\nMba harisika am-panahy,\nHanompoako Anao\nRaha mbola atý an-tany\nAza afoy fa mba tohany\nTsy hisaraka aminao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM119','FFPM 119');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM119', 'Hianao, ry Tompon’aiko,\nMaty noho ny otako,\nTsy mba takatry ny saiko\nIzany fijalianao\nNefa sitrakao nijaly\nHahazoako mifaly;\nRy Jesosy, Hianao\nNo isaorako izao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM119', 'Safotry ny fandatsana\nHianao, Mpanavotra\nHandovako fanjakana\nFeno voninahitra.\nVoaratra, voaeso,\nAry voasatro-tsilo\nNoho ny hadisoako,\nKoa dia isaorako!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM119', 'Tianao izahay mpanota,\nHelokay no nentinao;\nResinao ny tambin’ota\nIzahay nafahanao;\nVoaloanao ny trosa.\nIzahay mpanota kosa,\nTonga olom-potsinao,\nKa derainay Hianao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM120','FFPM 120');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Ry mino ô, avia re!\nHiara-mankalaza\nIlay Mpanjaka lehibe,\nFa tena mahagaga\nSy sarobidy anie\nNy fahasoavan-dehibe\nNomeny ho antsika.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Tsy asa soa vitako\nNo tokiko anefa,\nFa ny Andriamanitro\nNo tsy nisalasala\nHanafaka ny otako,\nNomeny mba ho avotro\nNy Zanany malala!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Jesosy faly eram-po\nHamonjy ahy very,\nKa azoko ny indrafo.\nIzay vitan’Izy irery\nIzaho tena afa-po.\nTsy misy atahorako,\nIzaho tsy ho very.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Jesosy Kristy Tompo ô!\nIzaho ta-hamaly\nNy teny fiantsoanao :\n« Mba manatòna Ahy!\nIzaho dia ho anao,\nHo Ahy kosa hianao »\nKa manampia ahy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Ny ranao soa nitete\nNo nanadio ahy\nNy ainao sarobidy re\nNo nanavotana ahy\nMba hitokiako anie\nNy famonjena lehibe\nNatolotrao ho ahy.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM120', 'Isaorana  eram-po anie\nNy Tompo Zanahary,\nFa Izy efa nanome\nNy Zanany nijaly,\nKa ny devoly lozabe,\nNy Ho resy sy ho faty.\n\n\nota sy ny heloka', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM121','FFPM 121');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM121', 'Ry Jesosy, ampombay\nFiadanana maharo\nFo sy saina izahay,\nKa mba ampahafantaro,\nRaha ny holatrao jerena,\nFa Anao ny fandresena!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM121', 'Ry Mpandresy, ambarao\nAminay ny vokatr’ady :\nFamonjena, aim-baovao\nNo andramany sahady :\nRaha ny tafika miseho,\nFiadanam-po omeo!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM122','FFPM 122');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM122', 'Hitako izao, sakaiza,\nNy fahasambarana,\nKa ny foko faly, ravo,\nManam-piadanana.\nTeo am-pototry ny hazo\nNijalian’ny Tompoko,\nTeo aho no nahazo\nFamelana heloka.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM122', 'He! ny indrafo niriko,\nEfa azoko tokoa,\nKa Jesosy no fidiko,\nFa  Izy fototry ny soa,\nHe! ny rany sarobidy,\nNanadio ny otako\nIzaho efa voavidy.\nLanitra no lovako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM122', 'Tena soa mahagaga\nIzao nomenao ahy izao,\nFa izaho izay mpanota,\nDia nohavaninao;\nKa izaho dia hidera\nIzato fitiavanao\nAry koa hanambara,\nJeso ô! ny herinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM122', 'Ry Mpamonjy ô! mba raiso\nIzao fisaorako izao;\nKa izay rehetra ahy\nDia atolotro Anao,\nRaha tonga re ny fetra\nHialako sasatra,\nEnto aho hitoetra,\nEo anilanao arý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM123','FFPM 123');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM123', 'Velona Jesosy,\nNitsangana tokoa;\nNy kristiana marobe,\nMihoby sy mihira hoe!\n:,: Dera ho Anao,\nry Mpandresy! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM123', 'Velona Jesosy,\nNy helo dia resy,\nTanteraka ny avotra,\nKa afaka ny heloka!\n:,: Dera ho Anao,\nry Mpandresy! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM123', 'Velona Jesosy,\nKa velona isika,\nHiara-monina  Aminy,\nHohazavain’ny tavany!\n:,: Dera ho Anao,\nry Mpandresy! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM124','FFPM 124');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM124', 'Nitsangana ny Tompo,\nNeken’ny Ray ny avotra,\nKa ravo ny mpanompo :\nMisokatra ny lanitra!\nIlay Tompom-pandresena\nNandrava fasana,\nAndriam-pamonjena,\nTolory hasina!\nJesosy no Mpanjaka\nAm-boninahitra,\nHiarahako mizaka\nNy zon’ny lanitra!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM125','FFPM 125');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM125', 'Indro, Jeso velona,\nAfaka ny olom-bery,\nRava re ny fasana,\nDia nivoaka Ilay Mahery;\nKa ny horohorontany\nDia nahato izany!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM125', 'Resinao ny rafinay,\nRy Jesosy manan-kery,\nKa mpandresy izahay,\nVoavonjinao ny very,\nMatinao ny helok’ota,\nVelona izahay mpanota!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM126','FFPM 126');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM126', 'Endrey, izato fahasambarana :\nJesosy dia  velona  indray!\nNy foko mandre fitsaharana\nNoho Izy natsangan’ny Ray,\nTsy any am-pasana  intsony\nFa hitako velona koa\n:,: Ilay Tompon’ny hery\nambony\nMamiratra sy manan-jo! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM126', 'He, velona Izy! Hafarany\nIzaho izao hampandre\nIreo izay tia  ny Anarany\nNy fampiononana be,\nAnjely no mendri-kilaza;\nIzaho, mpanompo tsy soa,\n:,: Nirahin’ny Tompo malaza,\nKa ravo sy tretrika koa! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM126', 'Endrey, izato fahasambarana,\nFa velona mandrakizay\nNy Tompo Izay nifankazarana,\nKa faly ny foko indray!\nNy fasana izay nampisaona\nNo fampiononana koa,\n:,: Fa tao izahay tafahaona\nKa ravo dia  ravo ny fo! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM127','FFPM 127');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM127', 'Tahaka ny masoandro miseho\nToy ny heriny izay mahaleo,\nNa dia takon’ny rahona tao;\nTahaka izany Jesosy\nMpamonjy,\nIzy nitsangana velona indray\nRy olombelona, izay voavonjy\nMba miderà Azy \nmandrakizay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM127', 'Saotra aman-dera sy laza sy\nhery,\nAoka ho Azy hatramin’izao\nIzay nanafaka ny olom-bery,\nIndro ny fasana vaky sy lao.\nIzy nanafaka ny vavahady :\nAiza, ry fahafatesana ô!\nAiza ny herinao sahy miady\nAmin’ny mino sy amin’ny to ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM127', 'Jeso Mpamonjy ô! mba\nhasoavy\nKa mba arovy ny mino Anao,\nKa ny Fanahinao aoka ho avy,\nMba hanazava ny fonay izao;\nAry tantano izahay tsy hania,\nFa Hianao no Mpiaro anay!\nO! ry Mpamonjy anay, mba\navia,\nKa mba vonjeo, fa miandry\nizahay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM127', 'Jeso, izahay te-hisaotra tokoa\nNoho ny soa nomenao anay;\nTeraka teto nitondra ny soa,\nDia  ny fiainana  mandrakizay\nSaotra omenay Anao izay\nnijaly,\nNefa natsangan’ny Rainao\nindray;\nRahatrizay izahay dia  hifaly\nAny an-danitra mandrakizay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM128','FFPM 128');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM128', 'Efa velona ny Tompo\nFa nitsangana tokoa;\nResiny ny fahavalo\nIlay mpihaza aina soa;\nVelona ny Tomponao,\nResiny ny rafinao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM128', 'Matokia, ry mpanota,\nAn’i Jeso Avotrao,\nFa ny ota nahadiso\nAfaka tokoa izao;\nVelona ny Tomponao,\nAfany ny helokao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM128', 'Eny, fa nitsangana ela\nJeso Kristy Tomponao,\nKa mamoha vavahady\nAny mba hidiranao,\nVelona ny Tomponao,\nKa  efa nialoha anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM129','FFPM 129');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM129', 'Any naraina\n:,: Ilay Avotr’aina :,:\nNatsangan-dRay;\nResy ny ota\n:,: Ka ny mpanota :,:\nMihoby indray.\nAny naraina, …sns.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM129', 'Hira hiraina\n:,: ny Tompon’aina :,:\nIsaoranay;\nOry ny fony\n:,: mba hamitony :,:\nNy sentonay.\nHira hiraina, …sns.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM129', 'Faly ny very\n:,: tsy manan-kery :,:\nNy helokay;\nJesosy Tompo\n:,: dia mampanompo :,:\nNy rafinay.\nFaly ny very, …sns.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM129', 'Hisy maraina\n:,: ny Tompon’aina :,:\nHo avy indray;\nIzy hizara\n:,: ny lova tsara :,:\nHomena anay.\nHisy maraina, …sns.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM130','FFPM 130');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM130', 'Hobio, ry olombelona!\nJesosy dia velona,\nNy fasana dia rava;\nMisokatra ny lanitra,\nDia resin’ny mazava.\nJeso Kristy\nNo deraina sy hajaina.\nFa Mpamonjy,\nTompon’aina mahavonjy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM130', 'He! misy làlana indray\nHo ao an-danitra, izay\nMiandry ao ambony;\nFa vitan’ny Mpanavotra\nNy vonjy mahasambatra,\nKa sitraky ny fony\nHandray izay\nMitomany, mba ho any\nAmin-dRainy;\nFa izany dia hainy!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM131','FFPM 131');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM131', 'Tonga ny andro malaza,\nizay mahafaly,\nIndro nandresy Jesosy\nIlay vao nijaly;\nVelona indray Izy,\nnatsangan’ny Ray,\nAoka isika hifaly!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM131', 'Efa nahery Jesosy,\nka resy Satana;\nMenatra mafy ireo\nfahavalo nitana;\nKa mba zahao :\nrava ny fasana izao,\nRava, fa tsy nahatana!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM131', 'Helo sy fahafatesana,\nresy tokoa,\nary ny tambin’ny ota\ndia efa naloa;\nJeso, Izay maty ka\nvelona indray,\nTompon’ny aina tokoa!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM131', 'Mba mihobia,\nry olona mino rehetra;\nAn’i Jesosy ny hery\nizay tsy voafetra;\nIzy nanao làlana tsara\nvaovao\nResy ny ratsy rehetra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM131', 'Faly Isika fa manana\nfanantenana,\nMbola hiantso Jesosy hoe :\n« Mitsangàna! »\nAmin’izay, velona\nmandrakizay\nNy nodimandry tra-bonjy.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM132','FFPM 132');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM132', 'Indro, fa velona\nJesosy Tompon’aina!\nFoana ny fasana\nResy izao Satana.\nIza  indray no hitomany,\nRaha nahare izany ?\nRy foko sasatra\nManahy fatratra,\nHeveronao izao;\nHo afaka ny sentonao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM132', 'Indro, fa velona\nJesosy Tompon’aina!\nIzy nitsangana;\nRavo ny fo sy saina.\nJeso Tompo nolatsaina\nTonga loharanon’aina,\nRy havana, andrandrao\nNy lanitra izao :\nJesosy velona,\nKa azo ny fiainana!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM133','FFPM 133');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Efa namangy ny olony\nJeso, izay Tompon’ny aina\nLasa ny alina maizina,\n:,: Tonga indray ny maraina :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Maty ny Tompo, nalevina\nNidina nita ny ony,\nNefa nitsangana velona\n:,: Koa tsy maty intsony :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Ory ny fon’ny sakaizany,\nAiza Ilay nantenaina ?\nHitany nefa tsy fantany,\n:,: Jeso, Izay \nTompon’ny aina :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Teniny tsy mba mivadika\nAmin’ny olona ory.\nTonga ny Tompo mitsidika\n:,: Ireo mpianany vory :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Tonga ny taom-pamangiana,\nTondraka ny famonjena.\nVelona ny fihobiana,\n:,: Aina vaovao no nomena :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM133', 'Teraka ny fifaliana,\nTonga ny Filazan-tsara,\nAndron’ny fitomaniana\n:,: Mody ho Pasaka tsara :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM134','FFPM 134');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'Mifaly tokoa ny foko izao\nFa misy manambara\nNy Filazantsara,\n:,: O, mba raisonao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'Nitsangana Jeso,\nHaleloia re!\nHenoy teny soa\nKa dia minoa\n:,: Fa marina re! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'He ! rava ny fasana, ka mijere,\nFa efa niala\nNy Tompo malala,\n:,: Fa velona e! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'Ny fahafatesana resy tokoa,\nKa tsy mba mijaly\nNy mino, fa faly\n:,: Sy tretrika am-po :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'Misaotra, midera Anao\nizahay\nRy Jeso Mpamonjy,\n:,: Ho mandrakizay :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM134', 'Haleloia!\nTsara ny Pasaka e!\nNy Tompon’ny aina\nIzao hoderaina,\n:,: Haleloia re! :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM135','FFPM 135');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM135', 'Foana ny fasanao,\nJeso Tompon’aina;\nTo tokoa ny teninao\nKa notontosaina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM135', 'Foana ny fasanao,\nTompo mana-kery,\nGaga teo ny rafinao,\nResy ‘lay Mahery!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM135', 'Foana ny fasanao,\nFa efa novohana;\nMaito ny fatoranao,\nTsy mba nahatana!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM135', 'Foana ny fasanao,\nZanaky ny Avo!\nAina no nasehonao,\nZava-maharavo!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM136','FFPM 136');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM136', 'Ry Jeso, Tompon’aina!\nNalevina Hianao,\nKanefa he, deraina,\nFa velona ao izao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM136', 'Ny fasana nivoha\nNoho ny herinao,\nFa tsy mba nahatoha\nNy voninahitrao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM136', 'Ireo miaramila\nNahery sy nahay\nDia tsy mba nahatana\nAnao Mpanjakanay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM136', 'Nitsangana tokoa,\nHo tena santatray,\nHianao, ry Tompo soa\nSy Kapiteninay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM137','FFPM 137');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM137', 'Vita  izao ny fandresena :\nHaleloia, haleloia!\nAzo koa ny famonjena :\nHaleloia!\nResy re ny fasana\nSy ny fahafatesana\nFahavalo farany;\nFa Jeso nitsangana\nTonga fanafahana :\nHaleloia! (in-3)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM137', 'To izao izay nambara :\nHaleloia! haleloia!\nFa ny fototra nivaha\nHaleloia!\nFoana ny fasana,\nJeso re nitsangana\nTamin-kery lehibe,\nKa torio ry mino e!\nEran-tany, mba ho re :\nHaleloia! (in-3)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM137', 'Dia venteso ny hosana :\nHaleloia! haleloia!\nAoka tsy hihambahamba\nHaleloia!\nFa  efa velona tokoa\nIlay Mpamonjy\ntsy mba roa,\n‘Zay nisolo voina anao;\nIzy no nisantatra\nNy fiainan-tsambatra :\nHaleloia! (in-3)', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM138','FFPM 138');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM138', '‘Ty ny andro maharavo,\nOra fifalianay;\n‘Lay Mpanarina ny lavo\nNo niady ho anay.\nHaleloia!\nHo Anao Mpanjakanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM138', 'Azonao ny fandresena,\nRy Mpamonjy velona!\nVitanao ny famonjena.\nTafantsagana Hianao.\nHaleloia!\nHo Anao Mpanjakanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM138', 'Resinao ny fahotana;\nVoavoha ny fasanao\nTorotoro re Satana;\nAfaka ny olonao.\nHaleloia!\nHo Anao Mpanjakanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM138', 'Ry Mpandresy\nfandozana!\nRaisonao ny hajanay\nRy Mpamonjy,\nmitantàna,\nTano ho Anao ‘zahay!\nHaleloia!\nHo Anao Mpanjakanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM139','FFPM 139');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM139', 'Haleloia! haleloia!\nHaleloia!\nHe! vita re ny ady izao!\nNy ota efa resy re,\nNy feo mifaly no atao,\nHaleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM139', 'Fahafatesana no tao\nFa Kristy naharesy izao,\nNy fandreseny no derao,\nHaleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM139', 'Ny andro nijaliana e!\nNisolo fifaliam-be,\nKa mihirà izay mandre :\nHaleloia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM139', 'Ny gadra voatapany,\nNy efitra efa ravany;\nKa miderà ny heriny\nHaleloia!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM139', 'Ry Tompo ô! ny fiainanao,\nMamelona ny olonao,\nKa hoderaina Hianao :\nHaleloia!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM140','FFPM 140');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM140', 'Haleloia! haleloia!\nMiderà ny Tomponao,\nManandratra feo hidera\nAn’i Jeso Kristy ‘zao\nFa nijaly mafy Izy,\nNefa indro velona Izy\nAo an-danitra tokoa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM140', 'Eny, velona  ny Tompo,\nMba ho santatsika koa\nKa ho velona ny mino\nSy hitsangana tokoa;\nDia  handray ny lova soa\nSatro-bolamena koa,\nKa hidera ny Mpamonjy\nSy ho sambatra avokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM140', 'Haleloia! haleloia!\nHaja, hery, saotra anie\nNo hatolotra ny Tompo,\n‘Zay Mpandresy lehibe,\nHoderaina lalandava\nFa Mpanjaka manan-jo,\nHaleloia! haleloia!\nHoderaina eram-po!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM141','FFPM 141');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM141', 'Efa resy izao na dia ny fasana\naza\nKa asandrato re ny hira sy ny\nfeo\nJesosy nampikoy ‘lay rafy \n‘zay nandoza,\n“Ry fahafatesana ô! aiza\nmoa ny herinao ?”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM141', 'Lasa ilay tahotrao, ry foko\n‘zay malemy\nFa torotoro ‘zao ny\nfahavalonao,\nTsy nahatohitra ny sandrin’i\nJesosy\n“Ry fahafatesana ô! aiza\nmoa ny herinao ?”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM141', 'Efa lasa tokoa ny ozona\nrehetra,\nNasehon’i Jeso miharihary\nizao,\nNy fitiavany izay tsy misy\nfetra!\n“Ry fahafatesana ô! aiza\nmoa ny herinao ?”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM141', 'Kristy no santatra : ny làlana\nmankany\nHo ao an-tranon-dRay,\nmivoha tsara izao,\nNy fifaliana manerana ny\ntany!\n“Ry fahafatesana ô! aiza\nmoa ny herinao ?”', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM141', 'Kristy no fiainana : izay\nmatahotra Azy\nOmeny tanjaka, fanahy, fo\nvaovao,\nKa atony velona, Mpandresy\ntahaka Azy.\n“Ry fahafatesana ô! aiza\nmoa ny herinao ?”', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM142','FFPM 142');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM142', 'Tafatsangana tokoa,\nHaleloia!\nJeso Kristy Tomposoa,\nHaleloia!\nMaty nefa velona\nHaleloia! \nMihirà, ry olona,\nHaleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM142', 'Foana ny fasana,\nHaleloia!\nIndro, Jeso velona,\nHaleloia!\nToky tsy mamitaka,\nHaleloia! \nMihirà, ry olona,\nHaleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM142', 'Andro lehibe tokoa,\nHaleloia!\nAndro fihobiana,\nHaleloia!\nAfaka ny tahotra,\nHaleloia! \nMihirà, ry olona,\nHaleloia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM142', 'Haja, laza, aterinay\nHaleloia!\nJeso ô, Mpanjakanay,\nHaleloia!\nRaiso re ny saotranay,\nHaleloia! \nRaiso koa ny tenanay\nHaleloia!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM143','FFPM 143');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM143', 'Vita izao ny fandresena,\nHaleloia!\nJeso Kristy no hobiana,\nHaleloia!\nAzo re famonjena,\nHaleloia! \nVerinay tarý Edena\nHaleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM143', 'Ka izao dia arahabaina,\nHaleloia!\n‘Lay Mpanjakanay\nhajaina,\nHaleloia!\nKa na zovy mitaraina\nHaleloia! \nMisy vonjy azo maina\nHaleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM143', 'Betlehema niandohana,\nHaleloia!\nKalvary niafarana,\nHaleloia!\nFasana tsy nahatana,\nHaleloia!\nToro teo ‘lay menarana\nHaleloia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM143', 'Saro-bidy re ny rany!\nHaleloia!\nNy fitiavany tsy lany\nHaleloia!\nNy fatoranay vahany,\nHaleloia! \nKa hobionareo, ry tany\nHaleloia!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM144','FFPM 144');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM144', 'O! avia, mba hidera,\nAndro jobily anio;\nKa faingàna, manatera\nSaotra, laza, ka hobio\nIndro, tonga ny anjely\nKa ny vato mikodia!\nTantaraina mba hiely :\nVelona (in-3)\nNy Tomponao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM144', 'Ifalio ny famonjena,\nAndro jobily anio;\nAfaka ny firenena,\nVoavonjy androtr’io\nGaga teo ny mpanakora\nSy ny rafy marobe\nKa miaiky moramora :\nVelona (in-3)\nNy Tomponao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM144', 'Mba venteso re ny hira\nAndro jobily anio;\nResy ny mpaniratsira\nKa ny tahotrao ario\nHe! ny fasana efa foana\nTsy nahazona  Azy tao\nTsy naharitra hateloana\nVelona (in-3)\nNy Tomponao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM144', 'Efa resy ‘zao  Satana\nAndro jobily anio;\nNy fatoranao vahana\nKa hobio sy ifalio!\n‘Lay Mpamonjy nolatsaina\nVelona ho avotrao,\nIo no mendrika\nhoderaina\nVelona (in-3)\nNy Tomponao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM145','FFPM 145');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM145', 'Efa velona tokoa\nHianao, ry Tomponay!\nKa ny herinao tsy toha\nNo manjaka hatrizay;\nFa ny fasana, ny ota\nNoresenao avokoa.\nTantaraina mba hiely :\n:,: ‘Zay no tokinay mpanota\nTanjakay sy hery koa :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM145', 'Efa velona tokoa\nHianao, ry Tomponay!\nLasa nanamboatra koa\nFitoerana ho anay :\nTany tsy mba misy ota\nTsy hidiran’ny manjo;\n:,: Tany soa sy madio\nMaharavoravo fo :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM145', 'Efa velona tokoa\nHianao, ry Tomponay!\nKa misolo vava koa\nSy mifona ho anay;\nNy Fanahinao omena,\nMba hitari-dalana\nHe! ny sentonay dia renao,\nJeso tena Havana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM145', 'Efa velona tokoa\nHianao, ry Tomponay!\nAry mbola ho avy koa,\nAvy mba handray anay\nMaminay, ry Tompo tsara;\nHiara-monina Aminao\nEny, tena manan-jara\n‘Zay mby eo akaikinao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM146','FFPM 146');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM146', '(Hira Paska)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM146', 'Anao ny dera,\nry Zanaky ny Ray ;\nAnao ny fandresena,\nRy Mpanjakanay\nNy fasana nivoha,\nNoho ny herinao\nNy Anaranao Tsitoha\nTsy voatana tao.\nAnao ny dera,\nry Zanaky ny Ray\nAnao ny fandresena,\nRy Mpanjakanay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM146', 'Hianao nandresy,\nlao re ny fasana;\nNy fanjakan’ny ota koa\nho lasana\nNy herin’i Satana,\nvato nikodia,\nNy Anaranao nandresy\nHaharitra doria,\nAnao ny dera,\nry Zanaky ny Ray\nAnao ny fandresena,\nRy Mpanjakanay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM146', 'He, ravo aho :\nIzy no santatra;\nIzaho koa hifoha,\nMba ho sambatra;\nNy fandresen’i Jeso,\nLovako tokoa;\nNy Anarany Tsitoha\nHanangana  ahy koa.\nAnao ny dera,\nry Zanaky ny Ray\nAnao ny fandresena,\nRy Mpanjakanay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM147','FFPM 147');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM147', 'Lasa ny Mpanavotsika\nAo an-danitra arý,\nMba hanoman-trano tsara,\nHitoerantsika ao.\n:,: Mifalia :,:\nHo tafiditra ao tokoa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM147', 'Lasa ny Mpisorontsika,\nAo an-danitra arý,\nHo Mpisolovava koa,\nHo an’olo-marobe.\n:,: Matokia :,:\nTsy ho very hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM147', 'Lasa ny Mpanjakantsika\nAo an-danitra arý,\nMba handray ny fanjakana\nMety ho anjarany.\n:,: Mihobia :,:\nAsandrato re ny feo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM148','FFPM 148');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Ry varavaran-danitra ô!\nAmpandrosoy ny Tomponao,\nFa fandresena lehibe\nNo efa vitany tatý', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Moa iza izao Mpanjaka\nizao ?\nMpandresy iza re izao ?\nNy lazany manerana\nNy tany sy ny lanitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Io no Kristy Mpamonjy soa\nNisolo olo-meloka,\nKa satro-boninahitra\nNo mendrika ny lohany.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Anjaranao, ry foko ô!\nHanompo sy hanaraka\n‘Lay Kapiteny lehibe\nNialoha ao an-danitra ao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Ry Kristy ô! Mpanavotray!\nIrinay mba ho hita koa\nIzany voninahitrao\nSy ny fiandriananao!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM148', 'Raha tapitra ny andronay,\nVohay ny varavaranao,\nNy trano namboarinao\nHonenanay mandrakizay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM149','FFPM 149');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM149', 'Efa lasa Jeso Tompo,\nHanamboatra izao\nFitoera-mahafaly\nIza re no tsy hankao ?\nFa ao ankoatr’i Jordana,\nAo an-danitra ao ambony,\nMisy fitsaharan-tsara\nHo an’ny madio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM149', 'Tany tsy idiran’ota,\nTany masina sy soa,\nKa izay rehetra hankany\nDia ho masina avokoa!\nFa ao ankoatr’i Jordana,\nAo an-danitra ao ambony,\nMisy fitsaharan-tsara\nHo an’ny madio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM149', 'Fa izay matoky tena,\nNy tsy mety mino koa,\nTsy havelany hankany,\nFa ho laviny tokoa!\nFa ao ankoatr’i Jordana,\nAo an-danitra ao ambony,\nMisy fitsaharan-tsara\nHo an’ny madio.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM149', 'Ny mandao ny fomba ratsy,\nNy mahazo fo vaovao,\nNy navotan’i Jesosy,\nDia  izy no hankao!\nFa ao ankoatr’i Jordana,\nAo an-danitra ao ambony,\nMisy fitsaharan-tsara\nHo an’ny madio.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM149', 'Ry mpanota saiky very!\nMibebaha re anio;\nManiria hovonjena,\nKa ny fahotana ario!\nFa ao ankoatr’i Jordana,\nAo an-danitra ao ambony,\nMisy fitsaharan-tsara\nHo an’ny madio.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM150','FFPM 150');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM150', 'He! tsara ny fonenanao,\nAndriamanitra ô!\nZiona tendrombohitrao,\nTanàna masina;\nKa iza no hiakatra ao ?\nIzay mahitsy fo,\nIzay madio tànana,\nIzay manao ny to,\nKa mino ny Mpanavotra,\nIreo hiakatra ao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM150', 'Mba misandrata faingana,\nRy varavarana!\nHidiran’ny Mpanjakanay\nBe voninahitra.\nMoa iza izao Mpanjaka izao ?\nAndriamanitra\nMahery sy mandresy koa,\nMpanjaka masina;\nHe, Izy ‘Lay Mpanjakanay\nBe voninahitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM150', 'Miantranoa, Tompo ô!\nMba hifalianay;\nVoavoatra ny tranonao,\nMidira aminay!\nJehovah no Mpanjakanay,\nMpanjaka tianay :\nNy hery, voninahitra,\nSy ny fisaorana,\nAnao tokoa, ry Tomponay,\nMandrakizay doria!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM151','FFPM 151');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM151', 'Miakara, miakara,\nRy Mpanjaka lehibe!\nVitanao ny famonjena\n‘Zay nalehanao tatý,\nMihobia, ry anjely!\nKa derao ny Tomponao,\nVoninahitra sy haja\nAtolory Azy izao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM151', 'Miakara, miakara,\nRy Mpandresy lehibe!\nEso, latsa, fahoriana\nNo anjaranao tatý;\n‘Zao ny lanitra miandry,\nMiandry hiverenanao;\nRenao ao ny feo manako,\nFeno fanajana Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM151', 'Miakara, ry Mpamonjy!\nRavo ny navotanao;\nIzahy atý an-tany,\nFaly te-hidera Anao;\nRaisonao ny fiderana\n‘Zay atolotray izao;\nHaleloia! Haleloia!\nHo Anao Mpanavotray!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM152','FFPM 152');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Niakatra ao :,: an-danitra :,:\nNy Zanak’Andriamanitra,\n:,: Haleloia! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Ka monina ao :,: an-danitra :,:\nJesosy Tompon-danitra,\n:,: Haleloia! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Izao zavatra :,: rehetra izao :,:\nRy Jeso ô, hazoninao,\n:,: Haleloia! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Isaoranay :,: ry Tompo ô :,:\nNy herinao sy indrafo!\n:,: Haleloia! :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Fa ny devoly resinao\n:,: he resinao! :,:\nNy ratsy nofongoranao,\n:,: Haleloia! :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM152', 'Ry tany sy :,: ry lanitra :,:\nDerao Andriamanitra!\n:,: Haleloia! :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM153','FFPM 153');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM153', 'Ao an-dapany, Jesosy\nDia derain’ny tapitrisa,\nFa ny lanitra sy tany\nDia samy mankamamy\n:,: Ilay Mpandresy mora fo! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM153', 'Jeso Tompo dia ho avy\nHo Mpitsara atý an-tany,\nNa ny ratsy na ny tsara\nSamy hanana anjara,\n:,: Valin’ny natao tatý! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM153', 'Ry Mpiantra be fitia,\nIantrao izahay mania;\nRaiso ho Anao, tahio,\nHafanao, ampifalio,\n:,: Ento any Aminao! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM154','FFPM 154');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM154', 'Izao Jesosy Tompontsika\nDia nasandratry ny Ray\nAo an-tsezam-panjakany;\nIzay rehetra nialany\n:,: Voarainy  indray :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM154', 'Tsy hadinony anefa\nIzay nilaozany tatý,\nFa omeny ny Fanahy\nMba hitondra sy hitahy\n:,: Ny mpianany :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM154', 'Ao anilan-dRainy Izy\nManam-boninahitra,\nKa miderà Azy any\nIzay rehetra anjakany\n:,: Eran-danitra :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM154', 'Tompom-pitsarana Izy,\nSamy mba hatsangany,\nNa ny ratsy na ny tsara,\nKa homeny izay anjara\n:,: Valin’asany :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM154', 'He! hohitantsika Izy,\nDia ny tena endriny,\nKa ny lova soa homena\nIzay nandray ny famonjena\n:,: Voatendriny :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM155','FFPM 155');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'An-tsezam-panjakany,\nAmbony kintana,\nNo lapan’i Jesosy\nIlay nasandratra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Atý an-tany iva,\nAnilam-pasana,\nNo ipetrahantsika\nZoim-pahoriana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Kanefa mety  ihany\nNy monina atý,\nHiomana ho any\nAn-danitra  arý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Isika tsy kamboty,\nNa dia nilaozany;\nNomeny ny Fanahy\nHo solon-tenany.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Ny fahoriantsika,\nDia efa maivana,\nNy fahafatesantsika\nDia afa-tsindrona.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Ny ain’i Jeso Tompo\nIainantsika atý;\nTsy ela dia hiseho\nIndray ny tenany.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM155', 'Ka hira no venteso\nRy havany izao,\nNy senton’alahelo\nMba atsaharonao!', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM156','FFPM 156');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM156', 'Jeso Mpanjaka tokana\nNa aiza misy olona :\nNy fanjakany hanerana\nNy tany sy ny lanitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM156', 'Vavaka sy fisaorana\nHakarin’ny navotana;\nHaharitra tsy tapitra\nHanolo-boninahitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM156', 'Ny firenen-drehetra anie\nHidera ny fitiavam-be;\nNy zaza aza hanatitra\nNy hajam-boninahitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM156', 'Ny tany izay alehany\nDia feno fitahiany;\nNy voagadra afaka,\nMiadana ny reraka.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM156', 'Izao rehetra izao anie,\nHanatitra fisaoram-be\nHo an’ny Tompo tokana,\nIzay Mpanjakan-danitra.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM157','FFPM 157');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM157', 'Hobio, ry tra-bonjy,\nFa indro ny Mpamonjy\nMiakatra indray;\nTsijonvy Izy any\nMandray ny fanjakany\nAo an-kavanan-dRay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM157', 'Ny hiran’ny anjely,\nManako sy miely\nArý an-danitra;\nInjay, ry Ray Tsitoha,\nMiarahaba koa,\nMandray ny Zanaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM157', 'O, miaingà, ry foko,\nFa aza mitoloko\nAtý an-tany izao;\nMiandrandrà, jereo\nIlay voahombo teo!\nTsitoha Izy ao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM157', 'Naharitra ny mafy,\nNiady sy nihafy\nNy Tomponao tatý!\nTahafonao izany,\nFa he! ny fanjakany\nMiandry anao arý!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM158','FFPM 158');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM158', 'Raha  afaka entana aho atý\nKa tody any an-danitra arý,\nNy hanakaiky Ilay Tompo tia\nNo hifaliako mandrakizay.\nSatriko re ny hanome\nSaotra tokoa eran’ny fo\nAn’Ilay maty fa velona\nindray,\nHatrehiko ao anilan’ny Ray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM158', '‘Ndrey ny haren’izao antrany\nizao!\nIzay handovako ilay tany\nvaovao!\nFa ny hahita ny tavany ao\nNo hiadanako mandrakizay.\nSatriko re ny hanome\nSaotra tokoa eran’ny fo\nAn’Ilay maty fa velona\nindray,\nHatrehiko ao anilan’ny Ray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM158', 'Hava-malala hihaonako ao,\nHobin-tra-bonjy hiaraha-\nmanao;\nMamy indrindra anefa izao;\nKristy hatrehiko\nmandrakizay.\nSatriko re ny hanome\nSaotra tokoa eran’ny fo\nAn’Ilay maty fa velona\nindray,\nHatrehiko ao anilan’ny Ray.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM159','FFPM 159');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM159', 'Satrohy voninahitra,\nAnjely masina ô!\nIlay voasatro-tsilo teo,\nDia Jeso, Jeso, Jeso,\nTompo tokana!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM159', 'Ry afa-pahoriana,\nIzay ao an-dapany!\nNombany tao an-dalana,\nKa saotra, laza, hery,\nAoka ho Azy re!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM159', 'Taranaky ny lavo ô,\nIzay natsangany,\nEkeo Izy eram-po,\nKa saotra, laza, hery,\nAoka ho Azy re!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM159', 'Ry firenena marobe\nAmbany lanitra!\nMiankohofa, maneke\nFa Jeso, Jeso, Jeso,\nNo Mpanjaka re!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM160','FFPM 160');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM160', 'Kristy Mpanjaka,\nMendrika  hoderaina\nIzy no mitàna\nAntsika ho velona  aina,\nDerao, derao\nIlay Mpanjakanao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM160', 'Kristy Mpanjaka,\nMendrika  ho hajaina;\nIzy no mifona\nHo antsika novonjena\nHajao, hajao\nIlay Mpanjakanao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM160', 'Kristy Mpanjaka,\nMendrika  ho hobiana;\nIzy no hitsena\nNy olo-notahiana,\nHobio, hobio\nIlay Mpanjakanao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM161','FFPM 161');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM161', 'Mivelatra eo imasoko\nNy fiandrianan-dehibe\nItoeran’ny Mpamonjiko,\nDia Jeso Ilay nandresy re.\nFa niakatra  Izy ka nandao\nIty tany fandalovana;\nManjaka ao an-dapany,\nKa feno voninahitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM161', 'Anjely no manotrona\nArahin’ny olo-masina\nIreo dia mandohalika\nAm-panajana fatratra,\nNy Tompo eo afovoany,\nMamiratra ny tavany,\nKa feno hasambarana\nIzay mahazo taratra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM161', 'Kanefa tsy mipetraka\nHo endriky ny lanitra\n‘Lay Zanak’Andriamanitra\nFa miasa tsy mijanona.\nRenao va ny fifonany,\nHo an’ny Fiangonany\n‘Zay novidiny tamin-dRà,\nKa tiany hampakarina ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM161', 'Ekeo, ry Fiangonana ô!\n‘Lay hany Mpanalàlana\n‘Zay mandohalika amin-dRay,\nKa mitomany hoa anao!\nRy Tompo aza sasatra,\nIfony lalandava e!\n‘Zahay izay navotanao.\nFa te-hankao an-danitra!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM162','FFPM 162');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM162', 'Amen, Jeso no Mpifehy\nAmen, ny Fanahiny,\nAmen, Amen re ny teny\nMbamin’ny fandraisany\nAmen, ny batisany,\nAmen, ny fiainany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM162', 'Amen, Jeso no Mpanjaka,\nAmen, ny Anarany;\nAmen, Jeso tonga maka\nAhy ho anjarany\nAmen, Amen ary to\nIzy, Izay inoako!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM162', 'Amen, ny fanantenana\nZavatra maharitra;\nAmen re, ny fifindrana,\nRaha  mankao an-danitra\nAmen, ny fiadanana,\nAmen, ny fiainana!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM162', 'Aoka  isika hihira Amen,\nAmen ho mandrakizay!\nJeso, mba valio Amen,\nDia  ho faly izahay;\nAmen, no ho hiranay\nRaha  mby Aminao izahay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM163','FFPM 163');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM163', 'He, Jesosy Tokintsika!\nTompon’ny fiainana\nTonga eto amintsika\nOlon-kovangiana.\nIzy no hitory teny\nSoa, mahavelona,\nFa ny ainy no nomeny\nMba ho solo-voina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM163', 'Andrandraonao ka andraso\nNy Mazava lehibe\nDia  Ilay tsy hita maso,\nMpanazava, Mpanome;\nFa ny ainao dia ho very,\nRaha tsy arahinao\nIlay Mpanjaka manan-kery\nIzay nanavotra anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM163', 'Eto afovoantsika\nIlay Mazava tokana;\nSambatra izay mahita\nAzy fa ho velona.\nRy Jesosy, iresaho\nIzahay mpianatrao\nHafanao sy hatanjaho\nNy finoanay Anao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM164','FFPM 164');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM164', 'Jesosy irery  ihany :\nFilazantsara soa!\nNentin’ireo mpanompo,\ntorina aminao\nMaizina avokoa izao rehetra\nizao,\nNefa he, ny mazava naposaka\naminao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM164', 'Jesosy irery  ihany :\nno ivavahana,\nNy Anarany irery no\nfanavotana,\nNy olona rehetra no \nhandohalika\nEtý an-tany ka hatrany \nan-danitra!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM164', 'Jesosy tsy miova\nomaly sy anio\nAry mandrakizay,\nfa tsy mamitaka,\nMifona ho antsika eo\nan-kavanan-dRay\nJESOSY IRERY IHANY re\nno isaorana!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM165','FFPM 165');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM165', 'Haleloia! Miderà!\n:,: Asandrato re ny feo :,:\nMiderà ny Ray Tsitoha,\n:,: ‘Zay Mpamorona anareo :,:\nFa Mpanjaka manan-jo,\nHaleloia! Haleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM165', 'Haleloia! Mihirà!\n:,: Lehibe sy masina :,:\n‘Lay Mpahary anareo.\n:,: Ao ny ranomasina :,:\nSy ny biby marobe\n‘Ndray mihoby! Haleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM165', 'Raiso re, ry Tompo ô!\n:,: Ny mpanota toa anay :,:\n‘Zay miantoraka Aminao\n:,: Mba henoy ny vavakay :,:\nHo fanatitra madio,\n‘Zay atolotray anio.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM166','FFPM 166');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM166', 'Derao ny Tompo lehibe,\nNahary izao rehetra izao;\nHaleloia! Haleloia!\nNy lanitra sy ny tany koa,\nSamia midera avokoa;\nAsandrato izao ny dera :\nHaleloia!\nHaleloia! Haleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM166', 'Ry fo voadion’ny rany soa;\nAnkalazao ny Tompo tia;\nHaleloia! Haleloia!\nRy voavela heloka ô!\nTsarovy re ny indrafo,\nAsandrato izao ny dera :\nHaleloia!\nHaleloia! Haleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM166', 'Miraisa fo ka miderà,\nFa Izy niahy hatrizay\nHaleloia! Haleloia!\nDerao ny Ray sy Zanaka\nSy ny Fanahy Masina\nAsandrato izao ny dera :\nHaleloia!\nHaleloia! Haleloia!\nAmena!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM167','FFPM 167');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM167', 'Midera ny Anaranao\n‘Zahay, ry Tompo ô!\nKa hira no Ventesinay\nHoe : haja, saotra, hery,\nMba raiso ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM167', 'He! voahombo Hianao\nNisolo heloka,\nKa mendrika hanaovanay\nHoe : haja, saotra, hery,\nMba raiso ho Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM167', 'Endrey! ny fitiavanao\nEndrey! ny herinao,\nTra-pamonjena izahay,\nKa haja, saotra, hery,\nMba raiso ho Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM167', 'Raha tonga ao an-danitra\n‘Zahay mpanomponao,\nHitohy re ny hiranay\nHoe : haja, saotra, hery,\nMba raiso ho Anao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM168','FFPM 168');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM168', 'Ry Jeso! ny Anaranao\nDia maminay tokoa;\nMihira sy miderà Anao\nIzahay navotanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM168', 'Tsy takatry ny hevitra\nNy fitiavanao :\nTsy tambonay tononina\nNy hasoavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM168', 'Ny tsara eran-danitra\nSy eran-tany koa,\nTsy azo anoharana\nNy fitahianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM168', 'Ho toy ny loharano e,\nNy fonay olonao;\nTsy hanam-pitsaharana e,\nNy hiderana Anao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM169','FFPM 169');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM169', 'Ry Tompo Andriamanitra,\nMpanao izao rehetra izao!\nMidera Anao ny lanitra\nNy tany koa mitsaoka Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM169', 'Hianao no Ray mandrakizay,\nMpanao izao tontolo izao,\nTongava re, ka mba tahio\nNy vavakay atao anio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM169', 'Ry Kristy ô, Mpanavotra,\nMpamonjy be fitia tokoa,\nHianao no Zanaky ny Ray,\nKa mendrika haja, saotra koa!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM169', 'Fanahy Masina ô, avia,\nSasao ho voadio izahay,\nHanoa sy hanara-dia\nIlay Mpamonjy Tomponay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM169', 'Anao ny voninahitra\nSy dera tsy mitsahatra,\nRy Telo Izay Iray, Tsitoha\nRay, Zanaka, Fanahy koa!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM170','FFPM 170');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM170', 'Ry Jeso ny fitiavanao\nNo ifalianay\nFa voavono Hianao\nHisolo voina anay,\nMba raisonao re\nNy saotra aterinay izao,\nHo fanajana\nAnao, Mpamonjy tia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM170', 'Mahery ny fitiavanao,\nKa itokianay;\nIzay mikamabana Aminao\nDia tsy hangaihay,\nMba raisonao re\nNy saotra aterinay izao,\nHo fanajana\nAnao, Mpamonjy tia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM170', 'Ambony ny fitiavanao,\nKa tsy mba takatray;\nKanefa noho ny herinao,\nHiezaka izahay,\nMba raisonao re\nNy saotra aterinay izao,\nHo fanajana\nAnao, Mpamonjy tia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM170', 'Hiezaka izahay, Jeso!\nKa mba ho tia Anao,\nKa tsy hatahotra eso koa,\nNoho ny Aminao!\nMba raisonao re\nNy saotra aterinay izao,\nHo fanajana\nAnao, Mpamonjy tia!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM171','FFPM 171');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM171', 'Jeso, Mpanjaka Malaza,\nNo Tompo Mpanjakanay;\nMahery sy tsara indrindra,\nKa Izy no Aronay.\nMendrika hankalazaina\nNoho ny heriny;\nEran-tany sy lanitra koa\nNy zo aman-dazany :\nRy Tompo, Mpanjaka\nMahery ô! Mihainoa!\nAvy manaiky tokoa  izahay\nFa Tompon’ny hery rehetra\nHianao,\nTsy misy mihitsy ny toa Anao\nTsy tratry ny saina ny herinao\nNy fiderana izay entinay,\nRaiso re! Raiso re!\nNy haja  atolotra  Anao etý.\nRaiso izao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM171', 'Tompo, Mpandahatra hendry,\nMpanao izao rehetra izao,\nNy zara sy tendry ataony\nDia tsara sy mahasoa;\nMendrika ny hoderaina\nNy fandaharany;\nAtolory ho Azy ny saotra,\nFa Izy tandrifin’io :\nRy Tompo, Mpanjaka\nMahery ô! Mihainoa!\nAvy manaiky tokoa  izahay\nFa Tompon’ny hery rehetra\nHianao,\nTsy misy mihitsy ny toa Anao\nTsy tratry ny saina ny herinao\nNy fiderana izay entinay,\nRaiso re! Raiso re!\nNy haja  atolotra  Anao etý.\nRaiso izao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM171', 'Tompo, Mpanjaka Tsitoha,\nKanefa be indrafo;\nDeraina eram-po eran-tsaina,\nDeraina mandrakizay;\nHe! ny mpanompo voavonjy,\nSamy mihoby hoe :\n“ Haleloia, ho amin’ny Avo,\nFa Jeso no Tomponay! ”\nRy Tompo, Mpanjaka\nMahery ô! Mihainoa!\nAvy manaiky tokoa  izahay\nFa Tompon’ny hery rehetra\nHianao,\nTsy misy mihitsy ny toa Anao\nTsy tratry ny saina ny herinao\nNy fiderana izay entinay,\nRaiso re! Raiso re!\nNy haja  atolotra  Anao etý.\nRaiso izao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM172','FFPM 172');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM172', 'Hoderaiko lalandava\nJeso Ilay Mpanavotro\nNoho ny fitiavana ahy,\nMaty mba ho soloko,\nHoderaiko, hoderaiko,\nFa ny rany masina\nNentiny hanavotra  ahy\nAfaka ny heloko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM172', 'Holazaiko lalandava\nNy tantara mamiko,\nIzay nitadiavana ahy,\nVery noho ny heloko :\nHoderaiko, hoderaiko,\nFa ny rany masina\nNentiny hanavotra  ahy\nAfaka ny heloko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM172', 'Hohiraiko lalandava\n‘Zao ny voninahiny\nFa ny fahafatesana aza,\nResy noho ny heriny;\nHoderaiko, hoderaiko,\nFa ny rany masina\nNentiny hanavotra  ahy\nAfaka ny heloko.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM173','FFPM 173');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM173', 'Hosana! Hosana!\nHosana!\nHosana no asandratray\nHo an’i Jesosy\nFa Izy no Mpanjakanay\nSy Tompo tia koa;\nHosana no atolotray\nAnao, ry Tomponay!\nIty no andro Jobily,\nJobily, Jobily, Jobily,\nIty no andro Jobily,\nKa hifalianay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM173', 'Hosana! (in-3) *\nHosana ho Anao anie,\nRy Kristy Tomponay!\nFa avy Hianao tokoa\nHanjaka aminay!\nHosana no atolotray\nAnao, ry Tomponay!\nIty no andro Jobily,\nJobily, Jobily, Jobily,\nIty no andro Jobily,\nKa hifalianay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM173', 'Hosana! (in-3) *\nHosana! fa ho sambatra\nIzay mpanomponao;\nTsy hisy fahoriana\nEtý an-taninao!\nHosana no atolotray\nAnao, ry Tomponay!\nIty no andro Jobily,\nJobily, Jobily, Jobily,\nIty no andro Jobily,\nKa hifalianay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM173', 'Hosana! (in-3) *\nHosana! fa miomana\n‘Zahay vahoakao\nHitsena Anao Mpanjakanay\nRaha  avy Hianao!\nHosana no atolotray\nAnao, ry Tomponay!\nIty no andro Jobily,\nJobily, Jobily, Jobily,\nIty no andro Jobily,\nKa hifalianay!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM173', 'Hosana! (in-3) *\nHosana! raisonao tokoa,\nRy Tompo tianay,\nNy dera, laza, saotra koa,\nIzay aterinay!\nHosana no atolotray\nAnao, ry Tomponay!\nIty no andro Jobily,\nJobily, Jobily, Jobily,\nIty no andro Jobily,\nKa hifalianay!\n\n*Ho an’ny feo (1) ihany\n\nNY FANAHY MASINA', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM174','FFPM 174');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM174', 'Fanahy Masina ô!\nNy hevitray izao\nOvay ho vao;\nVonoy ny otanay,\nDiovinao izahay,\nKa ny fanahinay\nOnenonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM174', 'Fanahy Masina ô!\nTsinjovinao izao\nNy olonao;\nMpananatra ô! ovay\nNy eritreritray;\nNy hadisoanay\nEsorinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM174', 'Fanahy hendry ô!\nJereo izahay izao,\nKa hazavao!\nAdala izahay,\nMania ny hevitray;\nDia atoroy anay\nNy lalanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM174', 'Fanahy Masina ô!\nMba asehoy izao\nNy antranao;\nBe tahotra izahay,\nHenoy ny hatakay,\nKa ny fanahinay\nOnoninao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM175','FFPM 175');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Avia, Fanahy ô,\nFanahy Masina ô!\nMidina eto aminay\nHitari-dàlana!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Fa diso làlana\nKa ory izahay;\nNy sainay dia maizina,\nNy fonay ratsy koa', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Midina Hianao,\nRy Mpanazva anay,\nHanaisotra ny maizina,\nAtý anatinay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Avia, Mpananatra ô!\nMombà anay tokoa;\nAmpahatsiarovinao\nNy teny mahasoa.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Ry Mpampianatra  ô!\nAmpionao izahay,\nKa aoka re ho marina\nIzay ianaranay!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM175', 'Mitomoera atý\nAnatin’ny fonay;\nIzany indrindra, ry Tompo,\nNo angatahinay!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM176','FFPM 176');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM176', 'Avia, Fanahy Masina ô!\nMidina eto aminay;\nFenoy ny hasoavanao\nNy fonay noforoninao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM176', 'Tongava, ry Mpananatra ô!\nNomen ‘Andriamanitra\nHo loharano velona\nHiboiboika ao am-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM176', 'Sokafy ny fanahinay\nHidiram-pitiavana;\nNy tenanay malemy koa,\nAmpaherezonao anie!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM176', 'Reseo ny fahavalonay;\nOnòny koa ny tahotray;\nTantano ao an-dalana\nHahatraranay ny lanitra!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM176', 'Tahio mba hitiavanay\nNy Ray sy Jeso Zanany\nSy hitokianay Anao\nIzay Fanahy Masina!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM177','FFPM 177');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM177', 'Ry Fanahy Mpanazava!\nMitariha anay izao\n!   ‘Zay nampanoratinao!\n:,: Dia hifaly :,:\nIzahay tarihinao! (in-2)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM177', 'Ry Fanahy Mpanazava!\nMaminay ny anatrao,\nFa matanjaka sy hendry\n‘Zay ampianarinao!\n:,: Hatanjaho :,:\nIzahay mpianatrao! (in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM177', 'Ry Fanahy Mpanazava!\nAoka tsy hangia anay\nNy angano sy tantara\n‘Zay hamily dia anay!\n:,: Mba sakano :,:\nTsy handavanay Anao! (in-2)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM177', 'Ry Fanahy Mpanazava!\nNy Baiboly taminao\nDia fanilo sady toky\nHanatonanay Anao!\n:,: Mba tsilovy :,:\n‘Zay miankina Aminao (in-2)', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM178','FFPM 178');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM178', 'Avia, Fanahy ô!\nMidina Hianao\nHanova ny fo vatonay,\nHo tonga fo vaovao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM178', 'Izay afafinay,\nTondrahan-drano koa,\nTsy mety misy vokatra\nRaha tsy ambininao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM178', 'Fenoy ny herinao\nNy fon’ny olona,\nHamelona finoana\nSy fitiavana!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM178', 'Fanahy Masina ô!\nTahio ny asa atao,\nAmpandrosoy am-po\nNy hasoavanao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM179','FFPM 179');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM179', 'Ny Fanahy Masina efa tonga\ntokoa,\nMba homba ny mpitory Teny\nmahasoa.\nKoa mitsangàna izao,\nandeha ry mahery fo,\nHatramin’ny faran’ny tany,\nTorio ny Teny soa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM179', 'Voasaron’aizim-pito ny\nNosinao;\nNy ody sy ny sampy no\nnotompoiny tao;\nNy fahazarana koa, nangeja\nmafy tokoa,\nKanefa tonga ny mazava :\nResy ny aizina ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM179', 'Ry fanahy voatafy hery,\nny Tompo anie\nKa efa miandry anao,\ninjay miteny hoe :\n« Angony, eny antsoy,\nhanatona avokoa\nNy firenena eran-tany,\nHo mpianatro tokoa! »', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM179', 'Tompo tia ô, ekeko ny\nantsonao;\nHafoiko ny hareko,\nny tenako izao,\nHo vavolombelona, hijoro,\nhanafaka,\nHitory sy hamafy koa;\nTafio ny herinao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM180','FFPM 180');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM180', 'Ny Tompo, raha vao nanao\nVeloma ny tatý,\nNamela ny Mpananatra\nHo arony.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM180', 'Dia tonga Izy hanome\nNy hery mahasoa,\nDia hery fanadiovana\nNy fo tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM180', 'Malemy ny fibitsiny,\nKanefa mora re,\nMahazo fiononana\nIzay mandre.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM180', 'Tsinjovy, ry Fanahy ô!\nKa iantrao izahay;\nAmboary ho tempolinao\nNy tenanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM181','FFPM 181');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM181', 'Fanahy Mpanazava,\nNy foko hazavao\nManiry lalandava\nNy Pentekositrao.\nNy aizina ao am-poko,\nFongary re ho lao;\nNy foko mitoloko,\nManiry indrindra Anao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM181', 'Fanahy Mpanadio,\nNy foko mba sasao.\nDiovy re anio\nHo tena lapanao;\nNy hevitray misoko\nIzay te-handroaka Anao,\nDia ota te-hijoko,\nEsory sy fafao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM181', 'Fanahy Mpampahery\nIzay rerakao sy voa,\nNy foko re dia tery\nHiantoraka Aminao.\nIzay mandrebireby,\nRoahy re izao,\nNy fo mitebiteby,\nHiondana Aminao!\nAmen.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM182','FFPM 182');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Ny Pentekosta tonga  izao;\nFanahy ô, ny jironao\nVelomy ao anatiko\nHahafantarako ny to.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Ampisehoy, Fanahy ô\nFa Jeso no fiainako,\nKa Izy dia làlana\nHo amin’ny fiainana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Dia mba tarihonao ny fo\nTohano ny fanahiko;\nAmpio ny finoako\nHahita ny Mpanavotro.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Fa Hianao, Fanahy ô!\nHanova ny fanahiko,\nKa raiso sy diovinao\nNy foko ho fonenanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Ny hazo-fijaliana,\nAnjara hivesarana,\nFa Hianao, ry Heriko,\nMba miaraha amiko.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'Mba asehoy ho fantatra\nNy soa tsy ho tapitra,\nNy satro-boninahitra\nHomen’Andriamanitra.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM182', 'O, ry Fanahy Masina ô!\nAmpaherezonao ny fo,\nKa hazavao ny lalako,\nRaha  avy ny hodiako.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM183','FFPM 183');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM183', 'Midina, ry Fanahy ô!\nMidira ao anaty fo,\nAmpio ny mihafy,\nFa Hianao no Mpanome\nNy to sy fahazavana be;\nNy vavanay sokafy\nIzao, hanao\nSaotra tsara, hanambara\nNy Mpamonjy,\nFa satria voavonjy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM183', 'Ka raha re ny teninao,\nDia mba avia, hazavao\nNy hevitry ny teny;\nMba ambarao aminay\nNy fomban’ny Mpanavotray,\nLazao ny famonjeny,\nIzahay, izay\nVory eto, andreheto\nJiron’aina,\nHialan’ny aizin-tsaina!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM183', 'Ny maizina onenanay,\nTsy mety afaka aminay,\nKa tena mahavery,\nRaha Hianao tsy tonga izao\nMitondra filazam-baovao\nSy toky mampahery;\nOvay izahay,\nHamasino ny te-hino\nAmpidiro\nEto aminay ny jiro.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM183', 'Mba hafanao re izahay,\nAmpio hitiavanay\nIndrindra ny Mpamonjy,\nNy rany mba ho avotray,\nNy didiny harahinay,\nHananay ny vonjy,\nJeso, Jeso\nNo torio sy bitsiho\nAo an-tsainay,\nMba hamelona ny ainay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM184','FFPM 184');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM184', 'Fanahy Mpanazava anay!\nMidina eto aminay,\nTarihonao ny sainay;\nNy alahelonay savao,\nNy toetray havaozinao,\nVelomy re ny ainay!\nSento renao\nMba valio, ka tahio\nNy mahantra,\nRy Fanahin’ny Mpiantra!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM185','FFPM 185');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM185', 'O! ry Fanahin’ny Ray ao\nambony\nAndriamanitra mandrakizay,\nAza avela hisaraka intsony\nNy olo-mino, fa aoka hiray;\nTaomy ho an’i Jesosy\nMpamonjy\nNy mbola maizina ka hazavao,\nHahafantarany tsar any vonjy,\nDia ho faly ny mino Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM185', 'O! ry Mpiantoka ny\nfamonjena,\nAzo ny antoka tsara izao;\nTonga ny iraka be fahendrena\nMba hanambara ny sitraponao,\nKa ny lelafo noraisin’ny mino\nSy ny fiteniny tonga vaovao\nDia nahagaga, ka tena\nnampino\nOlona maro hanaraka Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM185', 'Ry Mpampionona ô! mba\nsitrano\nFa voaratran’ny ota izahay;\nKa izay ory mba ampiadano,\nNy malahelo falio indray!\nO, mba ovaonao tokoa ny\nsainay,\nTaomy ka ampahareto ny fo;\nKa raha ory, arovy ny ainay,\nMba tsy hafoinay intsony\nny to!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM186','FFPM 186');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM186', 'Fanahy, Mpanavao anay,\nSimban’ny ota izahay,\nKa amboaronao indray,\nHavaozy ny fanahinay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM186', 'Avia, ry Afo masina,\nNy ratsy aoka ho levona;\nRy Loharano velona,\nTondrahonao ny efitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM186', 'Ny lohataonanao anie\nMba hampaniry soa be\nSy hampamony ho Anao\nIzao tany karankaina izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM186', 'Ny efitra sy tany lao\nHihoby sy hidera Anao,\nFa olom-potsy no ho ao;\nMpanompo teo fa afakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM186', 'Ry lohataona maminay!\nMidina faingana aminay,\nFanahy Mpanavao anay,\nNiandry ela izahay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM187','FFPM 187');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM187', 'Ny lanitra sokafinao,\nMidìna, ry Mahery!\nAmpisehoy ny sandrinao,\nRy Tompo manan-kery!\nHe! manakora izao\nNy fahavalonao,\nKa maro no mandà\nNy afo masina\nNarehitrao, ry Jeso.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM187', 'O, ry Mpitia olona,\nMpanjaka voahombo!\nNy teninao dia velona,\nMahery sy mitombo;\nAmpahafantaronao\nIzao tontolo izao,\nFa tsy mba foana\nNy ranao masina\nNalatsakao fahiny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM187', 'Mba ampiraiso hina re\nNy olom-boafidy,\nKa akambano mafy e,\nFa lova sarobidy,\nNy fitiavana\nMadio sy marina\nNo aoka hanavao\nNy fiangonanao,\nHandraisanao ny dera.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM187', 'Ny Nosinay, ny tranonay,\nNy vava aman-tsainay,\nDia samy mba havaozinao,\nRy fototry ny ainay!\nAmpiononinao\nNy manina Anao!\nAvia, ka mamonje,\nAvia, mampandrese\nNy olonao mahantra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM188','FFPM 188');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'Ry Fanahin’aina,\nMpanazava saina,\nMpampionom-po!\nO, mba akekezo\nIreto miambezo\nHamindranao fo!\nHazavao\nNy olonao,\nMba handraisanay tokoa\nFanomezan-tsoa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'Mba ampivavaho,\nHafanao re aho\nHanakalaza Anao!\nHataka sy sento\nAsandrato, ento,\nKa valionao!\nAnehoy\nSy ampinoy\nNy famindrampo mamonjy\nIzay te-ho tra-bonjy!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'O! mba amosahy\nFahazavam-panahy\nNy fisainanay,\nKa ny tarafo,\nAndreheto afo,\nNy fanahinay,\nKa ombay\nRe izahay,\nRaha  antsoinao hanambara\nNy Filazantsara!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'O! ry Andon’aina!\nTany karankaina\nMba vontosinao!\nDia ho vanom-boa,\nHahavoka-tsoa\nRe ny volinao!\nIndrafo\nSy teny to\nNo harena antenaina\nHanavao ny aina.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'O! mba areheto\nSy ampahareto\nNy finoanay!\nIzahay afaho,\nAmpahatanjaho\nNy fanahinay!\nTompo ô!\nMiraiki-po\nAminao ny olom-bery\nTonga manan-kery.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM188', 'Raha mitoloko,o\nTano re ny foko\nTsy handao Anao,\nKa tsilovy dia,\nTsy haniasia,\nHahatody ao\nAminao\nNy Zanakao\nAo ny lova andrandraina\nFahasambaran’aina.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM189','FFPM 189');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM189', 'O, ry Fanahy Masina ô!\nMba midira ao anaty fo!\nTaomy ny mania\nHody avokoa;\nEny, mitahia,\nManomeza soa,\nMiantrà, ry Tompo ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM189', 'O, ry Mazava lehibe,\nHazavao ny teny izay ho re!\nAsehoy Jesosy,\nAmbarao ny vonjy;\nIasao ny Nosy\nMba ho voavonjy.\nMiantrà, ry Tompo ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM189', 'Ry Afom-pitiavana ô!\nMba levoninao ny lolompo,\nAmpiraiso dia\nIreto ondry vitsy\nMba hifankatia\nHo iray mihitsy.\nMiantrà, ry Tompo ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM189', 'Ry Mpampifaly tsara ô!\nMba omeo toky re ny fo,\nMba hanantenanay\nFa ho voavonjy,\nAry handresenay\nNoho ny Mpamonjy.\nMiantrà, ry Tompo ô!\n\nNY TELO IZAY IRAY', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM190','FFPM 190');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM190', 'Ry Fanahy Mpanazava!\nMiandrandra Anao izahay!\nAza ela, fa tongava,\nTaomy ny fanahinay,\nMba ho fantatray mazava\nIzay lazain’ny teninao;\nAreheto lalandava\nAo am-po ny afonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM190', 'Ry Jesosy! mitenena\nAraka ny fombanao,\nAminay izay manantena\nMba handre ny teninao;\nFo marary sy manahy\nMba tsaboy sy iantrao;\nNy te-hino fa tsy sahy,\nAnehoy ny holatrao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM190', 'Rainay, Mpanome ny soa,\nMba henoy ny hatakay\nKa ny tananao tsy toha\nIarovinao anay;\nNy tanora mba tahio,\nNy vaventy hafanao,\nMba ho hitanay anio\nFa atý ny tenanao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM191','FFPM 191');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM191', 'Ny teny sy Fanahinao,\nRy Ray, mba avelao\nHandroso tsara, hanavao\nIzao tontolo izao.\nMitombo, mihabe\nNy ratsy izao, odrey!\nFa vitsy ny mpanomponao\nIzay ifalianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM191', 'Vonjeo, ry Jesosy ô!\nNy Fiangonanao,\nFa misy marobe izao\nIzay mody  olonao,\nAnefa tsy manao\nIzay tena sitrakao.\nO, ry Mpanjaka lehibe!\nMba mamonje anie.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM191', 'Fanahy ô! mba raisonao\nIzay vavakay izao;\nNy fonay mba havaozinao,\nNy maso hazavao,\nHahafantaranay \nIzay alehanay,\nMba hamoazanay izao\nIzay voa tianao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM192','FFPM 192');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM192', 'Andriananahary, Aba, Ray,\nIzay ianteheranay,\nMba raiso re ny vavakay;\nEsory sy vonoy ny helokay,\nVonjeo re, izahay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM192', 'Ry Jeso Zanak’Andriamanitra,\nMpitarika ho an-danitra\nMpanolo-tsaina marina,\nMpamonjy tia ka nolavina,\nVonjeo re, izahay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM192', 'Ry Mpampionona\nmandrakizay,\nAmpiomano izahay\nHandray ny famindramponao,\nNdrao very amin’otanay\nizahay,\nVonjeo re, izahay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM193','FFPM 193');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM193', 'Tahio re, ny teninao\nAnkalazao ny Zanakao,\nIzay nasandratrao ry Ray,\nHo kiady sy ho aronay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM193', 'Ry Jeso ô! Mpanjakanay,\nAmpandreseo izahay;\nHo menatra ny rafinao,\nRaha hitany ny herinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM193', 'Ry Mpampionona anay,\nAmpikambano ho iray\nNy sampam-piangonana,\nHiray am-pitiavana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM194','FFPM 194');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM194', 'Andriananahary ô, endrey ny\nvoninahitrao!\nNy tany sy ny lanitra \nmamelatra ny lazanao,\nNy asanao rehetra e,\nny famonjena lehibe,\nMitari-dàlana anay hidera ny\nAnaranao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM194', 'Ry Zanakondry masina,\nJesosy Izay Isaoranay!\nHe, Hianao niantra anay, ka\nnentinao ny otanay,\nNy menarana resinao,\nny fasana vinakinao,\nKa Hianao nanokatra ny\nlanitra hidiranay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM194', 'O, ry Fanahy Masina,\nIzay mitarika anay\nHanetry tena sy hanaiky fa\nmpanota izahay,\nMitaona sy mananatra anay\nhandray ny avotra,\nKa manamasina anay, mba\nraiso ny fisaoranay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM194', 'Ny voavonjy mbamin’ny\nanjely mankasitraka,\nNy tany sy ny lanitra \nmikambana hanandratra\nAnao, ry Ray sy Zanaka,\nAnao Fanahy Masina,\nIzay maneho famonjena\nfeno fitiavana.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM195','FFPM 195');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM195', 'Andriamanitra Ray\nloharanon’ny aina,\nMasina, masina re, Hianao ka\nderaina\nFa manome fahasoavana be,\nSoa tsy tratrin’ny saina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM195', 'O, ry Jesosy Mpamonjy,\nMpanjaka mahery,\nTonga tatý mba hampody ny\nzanaka very,\nRaiso izao ny fiderana Anao,\nSaotra aman-daza sy hery.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM195', 'Ry Mpampionona ô,\nMpanazava ny sainay,\nMba ampinoy izahay, ka\nhavaozy ny ainay,\nMba hazavao ny manantena\nAnao;\nRaiso ny hira hirainay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM196','FFPM 196');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM196', 'Ry Rainay ao an-danitra ô,\nIzay mendrika hoderaina,\nMahery sy be indrafo,\nTsy takatry ny saina,\nIzahay dia tonga zanakao,\nKa faly manana Anao :\nMihoby sy miravo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM196', 'Izahay miondrika Aminao,\nMidera Anao tokoa,\nFa be ny fitiavanao,\nRy Ray mpanisy soa;\nAnao izao rehetra izao,\nHo vitanao izay tianao,\nAndriananahary.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM196', 'Ry Jeso Kristy Tomponay\nMpanjaka manan-kery,\nIzay any ankavanan-dRay,\nMpanavotra ny very,\nHe, any no ifonanao\nHo an’izay navotanao,\nFa resinao ny ota.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM196', 'Ny ranao no nalatsakao,\nFanati-tsaro-bidy!\nNy ainao ho atohanao\nNy olonao mpiady.\nNa atý na ao an-danitra\nJesosy Kristy tokana\nHo avotra sy vonjy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM196', 'Ry Mpampianatra mahay\nFanahy Mpanazava,\nAmpianaro izahay\nHandroso lalandava,\nTariho ny fanahinay,\nHonenanay rahatrizay\nArý an-danitra Amen!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM197','FFPM 197');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM197', 'Haleloia, deraina\nAndriamanitray,\nMpanjaka fototr’aina,\nMpikarakara  anay,\nNy zava-boahary\nDia eo an-tananao,\nKa tena lavorary\nNy fandaharanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM197', 'Haleloia, deraina\nHianao, Mpamonjinay\nNijaly, noratraina,\nKa maty solonay,\nAnefa naharesy\nNy fahavalonay,\nNatsangana handresy\nMba ho fiainanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM197', 'Haleloia, deraina\nHianao, Fanahy ô!\nNy herinao ny aina\nHamelona tokoa;\nHianao mikarakara\nNy fiangonanao,\nManova, manatsara\nIzao tontolo izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM197', 'Haleloia, deraina\nNy Telo Izay Iray!\nHobina sy hiraina,\nFa Andriamanitray,\nHe, Tompo foto-tsoa\nIainanay atý,\nFa ho izany koa\nMandrakizay doria.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM198','FFPM 198');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM198', 'Isaoranay Jehovah,\nFa Tompo lehibe,\nIzay tsy mba manova,\nNy famindramponao.\nMiorina aminay izao\nNy fiangona-masinao;\nTorina aminay\nNy teny mampiray,\nKa ravoravo izao\nIzahay miderà Anao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM198', 'Derao Jesosy Tompo,\nIzay Mpamonjinao,\nHiraonao re, ry foko,\nNy fitiavany.\nHaleloia! haleloia!\nHaleloia! haleloia!\nJesosy avotray\nDia Zanaky ny Ray\nNy ainy no voaray,\nHisolo helokay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM198', 'Derainay, ry Fanahy,\nIzao ny asanao,\nTsy misy mampanahy,\nIzay tarihinao,\nKa anjakao re, ny fonay,\nArovy ny fiangonanay,\nVelomy izahay,\nAtaovinao mahay\nManoka-po izao\nHandray ny aim-baovao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM199','FFPM 199');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM199', 'Misaora! misaora an’i\nJehovah,\nRy olona atý an-tany ô!\nFa lehibe ny indrafony\nKa maharitra mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM199', 'Misaora! misaora an’i Jesosy,\nRy olona atý an-tany ô!\nFa vitany ny famonjena,\nKa misokatra ny lanitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM199', 'Misaora! misaora re ny\nFanahy,\nRy olona atý an-tany ô!\nFa fahazavana no omeny\nAry fanavaozana am-po.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM200','FFPM 200');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM200', 'Rainay ô Masina!\nTompon’ny lanitra,\nIzay tia anay;\nKiady sy mandanay\nHo fiarovana,\nIzay hitokianay\nMandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM200', 'Jeso ô, Tomponay!\nLalana marina\nAmin’ny Ray!\nFahamarinana\nAry fiainana\nAzonay aminao\nRy Tomponay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM200', 'Fanahy Masina ô!\nIrak’i Jesosy\nTonga etý;\nManazavà anay\nAmin’ny maizina;\nNy hevi-dratsinay\nEsorinao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM200', 'Andriamanitra ô!\nTelo fa tokana,\nTompo iray;\nAza mandao anay,\nOry sy reraka\nNoho ny heloka\nIzay momba anay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM200', 'Aza tsaroanao\nNy hadisoanay,\nRy Tompo ô!\nFa mamelà anay,\nNoho ny Zanakao\nKa manomeza anay\nNy fo madio.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM201','FFPM 201');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM201', 'Midina, Tomponay!\nAmpionao izahay\nHidera  Anao;\nRay soa tia  anay,\nHery sy Tanjakay,\nIzay hotompoinay\nMandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM201', 'Avia, Jeso ô!\nReseo ny rafinay\nHo lovanao;\nArovy izahay\nAmin’ny herinao;\nNy fitarainanay\nHenoinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM201', 'Fanahy Masina ô!\nTariho izahay\nHanaiky izao;\nMahery Hianao,\nNy fonay anjakao,\nAza ilaozanao\nMpananatra ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM201', 'Ry Telo izay Iray!\nDera mandrakizay\nOmena Anao;\nNy voninahitrao\nAoka ho hitanay,\nKa raisonao izahay,\nHo Aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM202','FFPM 202');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM202', 'Ry Ray malala ô!\nMba raisonao\nNy haja entiko\nHidera Anao.\nNy fitiavanao\nNo maiko izao\nIzaho dia Anao,\nRy Raiko ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM202', 'Ry Jeso tia  ô!\nMpanavotra,\nTa-hankalaza Anao\nNy vavako;\nNy avo-dehibe\nManafaka  ahy e!\nIzaho dia  Anao,\nRy Jeso ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM202', 'Fanahy Masina ô!\nMpananatra,\nMahiratra tokoa\nNy masoko,\nMazava re izao\nNy lalako hankao;\nHe! fifaliam-be\nNo ahy izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM203','FFPM 203');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM203', 'Ry Rainay be fitia,\nMpamelona anay!\nTariho tsy hania,\nHazoninao izahay;\nFa be ny fahavalo\nMitady ny ainay,\nMamely tsy mimalo\nIlay ratsy hatrizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM203', 'Ry Zokinay malala!\nRy Jeso havanay!\nToroy mba hahalala\nNy mety izahay;\nNy miaraka  Aminao re,\nRy Jeso Tompo ô!\nNo mahasoa ny saina,\nNy fo, fanahy koa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM203', 'Fanahy Mpanazava\nSy Mpanadio ny fo!\nTomoera lalandava,\nMonena ao am-po;\nKoa dia ampidino\nNy hasoavanao,\nOvay sy hamasino\nNy toetray izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM203', 'Ry Tompo be fiantra!\nRy Telo izay Iray!\nNy tananao miantra,\nAtsory aminay;\nRehefa tapitra andro\nKa hody izahay,\nMba raiso re, ry Tompo\nMba raiso izahay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM204','FFPM 204');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM204', 'Mamy ny fitianao,\nRy Jehovah Tompo ô!\nNahafoy ny Zanakao\nHanavotanao anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM204', 'Mamy ny antranao,\nRy Jeso Mpamonjy ô!\nTa-hamonjy Hianao\nSy hanafa-keloka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM204', 'Mamy ny fitaomanao,\nRy Fanahy Masina ô!\nNy Fanahinay ovay\nHankatò ny anatrao.\n\nNY SORATRA MASINA,\nTENIN’ADRIAMANITRA', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM205','FFPM 205');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM205', 'Ny teninao rehetra,\nRy Tompo tia  anay!\nNo tsy mba manam-petra,\nFa tò mandrakizay;\nHo levona avokoa\nIzao rehetra izao,\nHaharitra tokoa\nIzao teninao izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM205', 'Ny tenin’ny Baiboly\nNo sambatra entinay\nHandresy ny devoly,\nIlay fahavalonay;\nRaha misy mampahory,\nKa osa izahay,\nNy teninao mahery\nManjary tanjakay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM205', 'Fa teny mamy koa\nHo an’ny mpakatò\nKa loharano soa\nMiboika ao am-po,\nHo fanomezan-toky\nNy azon’ny manjo,\nSy hani-mahavoky\nMamelona ny fo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM205', 'Fa teny mampisava\nNy aizim-be atý,\nFanilo manazava\nNy dia ho arý;\nManolo-pahendrena,\nMananatra ny fo,\nMilaza famonjena\nSy lova tsy ho lo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM206','FFPM 206');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM206', 'Ny teny masinao,\nJehovah Tompo ô!\nNampanoratinao\nIreo mpanomponao,\nDia tiako ka tanako,\nHo lova sy fananako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM206', 'Ny teny masinao,\nIzay noteneninao\nMilaza amiko\nNy hasoavanao;\nIzay harena atolotrao\nHo entiko hidera Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM206', 'Ny teny masinao,\nAndriamanitra ô!\nManeho ny fitia\nNataon’ny Zanakao,\nIzay maty tany Kalvary,\nHamonjy ny mpanota etý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM206', 'Ny teny masinao,\nNo mampianatra\nNy saiko tsy mahay\nMba hahafantatra\nNy zavatra miafina\nIzay momba ny hasoavanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM206', 'Ny teny masinao,\nDia  tsy mba mety lo;\nIzay ambarany\nTsy misy tsy ho to.\nNa levona aza ka tsy ao\nIzao rehetra àry ‘zao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM207','FFPM 207');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM207', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM207', 'Mamy ny teninao,\nJehovah Masina!\nSy to ny teninao\nTsy azo ovana :\nNy lanitra ho levona,\nFa tsy simba ny teninao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM207', 'Madio ny teninao,\nKa tsara indrindra,\nDia fahendrena\nHo an’ny adala :\nMahafaka ny maizina\nKa mitondra ny mazava.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM207', 'Soa ny teninao,\nMahatsara ny fo,\nFa ao no hitanay\nMisy Mpanavotra;\nJeso, Loharanon’aina,\nMahasasa ny meloka.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM207', 'Irin’ny foko koa\nNy teny masina\nNoho ny harena\nNa fananana be :\nNy teninao no tanako\nHo lovako mandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM208','FFPM 208');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM208', 'Ny teny masinao\nTorina hatrizao;\nMaharitra tsy lo,\nMamabo izany fo,\nFa marina ka tianay\nHiainana mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM208', 'Ny teny masinao\nMitondra herivao,\nMandrava ny manjo\nIreo izay ory fo;\nKa mendrika ho tanana\nAnaty, ho fananana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM208', 'Ny teny masinao\nDia tsy mba mankaleo;\nFa hery velona\nMamelombelona;\nKa satrinay ho re indray\nRy Andriananaharinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM208', 'Ny teny masinao\nNo feo manorina;\nNy teny masinao,\nNo feo manarina\nKa tianay hanenika\nNy tany sy ny lanitra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM209','FFPM 209');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM209', 'Jesosy tena kiady\nSy reharehanay,\nNamoha vavahady,\nNy Tanindrazanay;\nNampiditra ny teny\nHampahalala  anay\nNy Ray, ny fahendreny,\nMba hianaranay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM209', 'Na betsaka mifofo\nNy Baibolinay,\nMihaza sy milofo\nMoa ketraka  izahay ?\nJesosy no Mpiaro\nKa moa ho kivy ve ?\nVao mainka mihamaro\nNy mpankasitraka e!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM209', 'Mbola Izy no Filoha\nMpitarika anay,\nHitory ka hamoha\nIreo namanay :\nVahoaka an-tapitrisa\nNo mbola hasondrotray,\nHahita Paradisa\nHo zanaky ny Ray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM209', 'Ry Jeso, hatanjaho\nNy fiangonana,\nHijoro, ho  tena taho\nMamoa mandrakizay.\nHianao anie no sandry\nIzay tena tanjakay,\nNo sady hany andry\nIzay hijoroanay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM209', 'Jesosy soa malala!\nTsy foinay Hianao,\nNy fonay dia handala\nIty lova taminao.\nFanahy ravoravo\nNoho ny teninao,\nRy Zanaky ny Avo,\nIzao misaotra Anao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM210','FFPM 210');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM210', 'Zava-tsoa tokoa ny fitsipikao\nTompo Andriamanitra ô!\nTeny mahasoa, aina, hery koa\nMba ho an’izay manoa.\nSoa tsy manam-paharoa ny\nfitsipikao\nIravoanay, fa harena be\nSarobidy, tsy afoy, izany\ndidinao,\nFamonjena ho an’izay\nmandre.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM210', 'Maizina izahay, kely fantatray\nNefa ao ny teninao :\nJiro sy fanilon’ny tongotray,\nHankanesana  Aminao.\nSoa tsy manam-paharoa ny\nfitsipikao\nIravoanay, fa harena be\nSarobidy, tsy afoy, izany\ndidinao,\nFamonjena ho an’izay\nmandre.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM210', 'Raha alaim-panahy itony \nzanakao\nIndro, ao ny teninao,\nSabatry ny fo, hanoheranay\nIlay ratsy hatrizay,\nSoa tsy manam-paharoa ny\nfitsipikao\nIravoanay, fa harena be\nSarobidy, tsy afoy, izany\ndidinao,\nFamonjena ho an’izay\nmandre.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM210', 'Fifalianay, odi-tahotray\nNy Baiboly taminao :\nAvy ny manjo, nefa kosa, Ray\nAo tokoa ny tavanao\nSoa tsy manam-paharoa ny\nfitsipikao\nIravoanay, fa harena be\nSarobidy, tsy afoy, izany\ndidinao,\nFamonjena ho an’izay\nmandre.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM210', 'Ry Jesosy ô Mpampianatray!\nMaminay ny teninao;\nTaomy izahay, mba \nhahaizanay\nHankatò ny didinao.\nSoa tsy manam-paharoa ny\nfitsipikao\nIravoanay, fa harena be\nSarobidy, tsy afoy, izany\ndidinao,\nFamonjena ho an’izay\nmandre.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM211','FFPM 211');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM211', 'Ilay Boky izay nodorana\nDia may, nefa tsy levona;\nIzay natao ho lavenona,\nLasa vato fanorenana;\nNoheverina ho foana,\nKanjo mainka koa velona;\nIlay nafenina, nalevina\nNo nisandratra, nivelatra!\nIza moa no hahasakana\nEny, iza no hanohitra\nIlay teny voasoratra,\nDia ny tenin’Andriamanitra ?\nIzao rehetra izao ho levona\nFa ny Teny dia haharitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM211', 'Rasalama nolefonina\nNisy hafa koa nodorana\nHantsana no namarinana,\nTora-bato: fahafatesana\nDia tao ireo nampinomina,\nNoterena mba hiozona :\nMoa izany nampivadika\nKristiana be finoana ?\nValin-teny voasoratra\nNentiny nandresy lahatra\nFeo tony, tava mirana,\nFeno hery, hasambarana :\n« Tsy mba misy atahorako\nAfa-tsy  Hianao, \nry Tompoko ».', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM211', 'Ilay teny masina sy to\nManambara ny Mpamonjiko,\nTena saro-bidy ao am-po,\nKa vakiko sy ianako.\nFifaliako, fiarovako,\nFahazavana ao an-dalako;\nKoa tanako ho lovako \nSy isaorako ny Tompoko,\nMaty aho, nefa velona\nFa Kristy no ahavelomako,\nMaty Izy, nohomboana,\nNoho  ny fahotana vitako\nNefa Izy dia natsangana,\nSantatry ny hitsanganako.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM212','FFPM 212');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM212', 'Velona sy mahery\nNy tenin’Andriamanitra,\nKa na dorana aza\nDia tsy ho levona;\nNy Sekoly Alahady\nDia mivelona aminy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM212', 'Sabatra rao lela\nMaranitra, manindrona,\nMampisaraka aina\nSy fanahy, tonona;\nFantany avokoa \nNy am-po miafina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM212', 'Hotsaraina isika,\nKa ilay teny velona\nNo hanavaka antsika\nAry koa hanavotra,\nKoa  minoa ny teny,\nTeny fahasoavana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM213','FFPM 213');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM213', 'Ry fanahy mangetaheta,\nMila fitsaharana;\nAza kivy, mahareta,\nSentonao hifarana!\nFa ny tenin''i Jehovah,\nSoa mangarangarana;\nLoharano tsy miova,\nAo no hasambarana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM213', 'Ry tontolo mila vonjy,\nTe ho afa-patotra,\nAo ny tenin''ny Mpamonjy\nDia  Kristy Mpanavotra!\nTeny velona sy mamy,\nFeno fananarana;\nHotorina eran-tany \nFa fampihavanana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM213', 'Ry Mpanjakan''ny mpanjaka,\nAo, tendreo ny lelako\nMba hitory sy hizaka,\nHampandre ny havako,\nDia  tahio ny Teny reny\nTsy ho very hasina,\nKa hamoy zato heny\nNy Baiboly masina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM214','FFPM 214');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM214', 'Finaritra ry Tompo ô!\nNy mankafý ny teninao\nSy mankatò ny didy.\nNy helony esorinao,\nNy sainy hohavaozinao,\nKa afaka hifidy\nNy lova sarobidy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM214', 'Ny teninao no rakitra\nSy tokin''ny mpandefitra,\nFa teny manan-kery;\nHe! ao dia voasoratra\nNy Aminao Mpanavotra,\nFa Hianao irery\nNy avotry ny very.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM214', 'Ny teninao no vatsinay\nManohana ny dianay,\nSakafo mahasoa \nSy ampy hivelomanay,\nKa ao am-parany indray\nHo azonay tokoa\nNy lovan''ny mpanoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM215','FFPM 215');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM215', 'Ny teny masina sy to\nNampilazainao, Tompo ô!\nNo manan-kery mahavoa\nNy fahavalonao tokoa,\nKa dia itokianay\nNa aiza no alehanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM215', 'Mitaona ny fanahinay\nNy teninao, Mpanavotray,\nMananatra sy manambara\nNy ratsy ary koa ny tsara;\nMpilaza mahafatra-po\nNy teninao ry Tompo ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM215', 'Ny teninao no sabatray\nSy mpampionona anay;\nNy teninao no mofon''aina\nSy mpanazava fo sy saina;\nMpiaro sady tanjakay\nNy teninao, ry Tomponay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM215', 'Ampinganay ny teninao\nAo amin''izao tontolo izao,\nKa raha levona ny tany,\nNy teny mbola ao ihany,\nDia izy iankinanay\nHo antoky ny avotray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM216','FFPM 216');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM216', 'Ny teninao ry Tompo ô,\nDia  ranon''aina soa, \nIzay mahalonaka ny fo\nMangetana tokoa,\nJereo ny tanimbolinao,\nFa tena mila io,\nHo feno voa ho Anao\nHatramin''ny anio', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM216', 'Ny teninao dia sabatra\nMaranitra tokoa,\nMitsara sy mamantatra\nNy fonay sy ny voa.\nHetseho izao tontolo izao\nHandray ny teninao,\nO, asehoy ny herinao,\nHamorona  aim-baovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM216', 'Ny teninao izay tokinay\nFanilon-dianay,\nNoraisinay ho lovanay\nSy fifalianay.\nAmpianaro izahay\nHanoa ny didinao,\nAtaovy izay hitiavanay\nNy teny masinao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM217','FFPM 217');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM217', 'Ry Jesosy Tomponay!\nIndreto izahy mivory,\nNefa tsy mahay mandray\nIzay ambaranao akory :\nKa iraho ny Fanahy\nMba hanampy sy hitahy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM217', 'Maizin-tasina izahay,\nFa taranaka mpanota;\nSimba ny fanahinay,\nTena voasoron’ota,\nTompo tsara ô, tongava,\nAposahy ny mazava.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM217', 'Ry Mazava lehibe,\nTaominao ny fo malaina;\nTairo mba hifoha re,\nKa handray ny tenin’aina;\nNy fivavakay valio,\nNy ataonay mba tahio.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM218','FFPM 218');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM218', 'Mba miangavy, Tompo ô!\nIraho ny Fanahinao,\nVangio ny mpanomponao,\nAmpianaro izy izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM218', 'Ampalasio ny sofinay\nHandraisanay ny teninao,\nTendreo koa ny lelanay,\nHahaizanay hidera Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM218', 'Hiely be ny lazanao\nAmbara-pahatonganao\nHitsara izao tontolo izao,\nHampody ny navotanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM218', 'Fanahy, Zanaka sy Ray,\nMba raiso ny fisaoranay;\nKa raha hiala atý izahay,\nHidera Anao rahatrizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM219','FFPM 219');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM219', 'Ry Mpampianatra mahay\nFanahy Mpanazava,\nAmpianaro izahay\nHandroso lalandava,\nNy indrafon’ny Tomponay,\nVelaro eo imasonay\nHo fantatray mazava.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM219', 'Mivory eto izahay\nHandre ny tenin’aina,\nKa hazavao ho fantatray\nNy hevitra lazaina;\nOvay ny sainay sy ny fo\nHamantatra sy hankatò\nNy tenin’ny Mpamonjy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM219', 'Raha  hodimandry izahay\nKa tonga ny anjara,\nBitsiho ao an-tsofinay\nNy tokon’aina tsara;\nAtaovy mora hitanay\nNy tavan’ny Mpanavotray,\nIzay hery mahavonjy.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM220','FFPM 220');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM220', 'Ry Jeso Tompo Avotray,\nMitomoera aminay,\nAidino ny Fanahinao,\nTahio izahay izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM220', 'Ny sitrakao mba ambarao\nHo fantatray ny hevitrao;\nNy fonay amboaronao\nHahay handray ny teninao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM220', 'Ny vavanay hasinonao\nHahaizanay hisaotra Anao,\nFa be ny soa azonay\nNomenao, ry Mpanavotray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM220', 'Rahatrizay ny olonao\nHihoby sy hidera Anao,\nFa masina, fa masina,\nFa masina i Jehovah.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM221','FFPM 221');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM221', 'Mivory eto izahay,\nJeso Tompo ô;\nAvia hanazava anay,\n:,: Hinoanay Anao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM221', 'Maniry mafy izahay,\nHihaona Aminao;\nOmeo hosotroinay,\n:,: Ny rano velona :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM221', 'Ny mofon’aina mba zarao\nHo anay, ry Tompo ô!\nTahio re ny irakao,\n:,: Ho voninahitrao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM221', 'Ny fonay dia atolotray\nAnao, Jesosy ô!\nOmeo hery izahay\n:,: Hanao ny sitrakao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM221', 'Raha tapitra ny andronay,\nIzay voafetranao,\nDia  ento mody izahay\n:,: Ho any Aminao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM222','FFPM 222');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM222', 'Ry Lela afo masina\nNilatsaka fahiny\nTan-dohan’ny mpianatra\nSy tao anaty fony,\nMiandry fatratra Anao\nIzahay mivory eto izao :\nAvia ry Fanahy!\nAvia, ry Jesosy ô!\nAtreho ny mpianatrao\nHo velona am-panahy.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM223','FFPM 223');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM223', 'Mba avia, malakia,\nRy mangetaheta ô!\nTeny tsara no ambara,\nKa Henoy eram-po,\nFa Jesosy ranon’aina\nNo torina sy lazaina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM223', 'Ry Mpamonjy  mahavonjy,\nMahatonga soa be,\nKa tsy maintsy ho tra-bonjy\nIzay manatona Azy re;\nKa henoinao ny teny\nManambara ny omeny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM223', 'Mba tariho  sy  tahio\nAho, ry Jesosy ô!\nMba ho ahy ny fanahy,\nHanazava ao am-po.\nHampahery fo sy saina,\nKa hamelona ny aina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM224','FFPM 224');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM224', 'Tafavory izahay ka manatona\nAnao\nZanahary nahary anay;\nKa mba raiso izao\nIzahay Zanakao;\nAza lavina re izahay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM224', 'Tafavory izahay ka miantso\nAnao\nRy Jeso Mpamonjy anay;\nMihainoa Tompo ô!\nMitenena izao,\nFa mitady Anao izahay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM224', 'Tafavory izahay ka miandry\nAnao\nRy Fanahy Mpananatra anay;\nAidino ilay afonao fahizay,\nAreheto atý aminay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM225','FFPM 225');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM225', 'Atý an-tranonao izao\nNo iangonanay\nHitady soa Aminao\nHahafaka ota anay;\nHiantso ny Anaranao,\nHandinika ny teninao,\nIzay mahavelona anay,\nKa mba ambinonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM225', 'Na vitsy aza eto izao,\nNa be no tonga atý,\nDia aza mba lalovanao,\nAtreho izahay!\nRaha  tonga eto Hianao\nDia ampy izany ho anay;\nNy fofonain’ny Tomponay\nNo mahavelom-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM225', 'Raha misy mangatsia-po,\nMba hafanao, ry Ray;\nIraho ny Fanahinao\nHamelona anay.\nHanetsika ny mafy fo\nHo tonga mpino mankatò\nIzay lazain’ny teninao\nHataon’ny zanakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM225', 'Izay rehetra tonga atý\nAmpirisihonao;\nKa aoka samy hankafý\nNy fanavotanao.\nNy fonay mba sokafinao\nHandray ny fananaranao;\nAo aminao ny hery be,\nEfao ny sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM225', 'Ambinonao ny irakao\nHitory teny izao;\nTolorinao ny hevitrao,\nNy fony hafanao;\nSokafy re ny vavany,\nTendreo koa ny lelany\nHilaza tsara aminay\nNy sitrakao, ry Ray.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM226','FFPM 226');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM226', 'Tompo ô! mba te-hihaona\nAminao ny olonao.\nKa ny oran-dohataona\nAmpombay ny teninao;\nNy Fanahinao iraho\nAminay izay mitalaho;\n:,: Mba vokiso zava-tsoa\nNy mangetaheta  Anao :,:', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM227','FFPM 227');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM227', 'Eto afovoanay Hianao,\nry Tompo soa,\nKa tahio ny vavakay\nMba ho maminao tokoa;\nRaisonao ny fideranay,\nKa savao ny fahantranay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM227', 'Mitoera aminay\nNa hariva na maraina;\nAza mahafoy anay\nMandra-pialanay aina;\nKa ny dera tsy ho lany\nDia ho Anao ihany.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM228','FFPM 228');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM228', 'Tafangona atý indray\nNy fiangonanao, ry Ray\nKa dia mba tahio!\nIraho ny Fanahinao\nHitarika ny zanakao\nHivavaka anio,\nAnao izao\nSaotra, laza, dera, haja,\nFa nomena\nHo anay ny famonjena.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM229','FFPM 229');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM229', 'Jesosy ô! mba hasoavinao\nNy asanay, izay atombokay\nAmin’ny Anaranao;\nKa mba ombay,\nSy tahio, Tompo ô!\nIzao atao izao\nDia tena sitrakao\nKa ho tanterahinay,\nMba ho fifalianay\nSy ho voninahitrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM229', 'Jesosy ô! derainay Hianao,\nFa feno famonjena olona\nNy Anara-masinao!\nNy herinao manome\naim-baovao.\nNy teny masinao\nDia iankinanay\nKa Hianao isaoranay\nSy ankasitrahanay\nEto sy rahatrizay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM229', 'Jesosy ô! ny fanorenana\nIainanay sy hahafatesanay\nDia ny Anaranao, fa Izy no\nManome toky be,\nKa hitsangananay\nHo velona indray;\nDia mba horaisinao\nIzahay navotanao\nAmin’ny Anaranao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM230','FFPM 230');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM230', 'Mba trotroy ny olona ory,\nRy Jesosy Tompo ô!\nTsy hirenireny saina,\nFa handray ny teninao.\n:,: Olona  osa, olona  osa,\nEnto mora, Tompo ô :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM230', 'Faly izahay, Jesosy,\nTratr’izao anio izao,\nTafavory ka hihaino\nNy Filazantsaranao.\n:,: Raisonao re, raisonao re\nIzao fisaoranay izao! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM230', 'Jesosy Tomponay Tsitoha!\nTaomy ny sakaizanay\nMba ho tonga mpino koa\nSy hiankina Aminao.\n:,: Mba tariho, mba tariho\nIzy ho mpanomponao! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM231','FFPM 231');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM231', 'Ry Tomponay Tsitoha!\nIlay Izy hatrizay,\nAvia, hampifoha\nNy fiangonanay\nAtreho ny mpivory,\nFa manantena Anao;\nFohazy ny matory\nHandray ny teninao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM231', 'Iraho ny Fanahy\nMba hanavao anay,\nKa homba sy hitahy\nNy teny inoanay\nNa lehibe na kely,\nAmpio sy hafanao\nHazoto hampiely\nAtý ny lazanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM231', 'Ny asam-pamonjena\nIzay natombokao,\nAmbino tsy hihena\nTahio sy tontosao!\nNy herin’i Satana\nFolahy hatrizao,\nHo afa-pahotana\nIzahay navotanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM231', 'Arovy ny finoana\nIzay naorinao;\nVonoy ny hevi-poana\nMandà ny teninao\nIzahay na be na vitsy,\nHazony tsy hania,\nMba ho Anao mihitsy\nMandrakizay doria.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM232','FFPM 232');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM232', 'Ny Alahady andronao,\nJeso Tompo masina ô!\nFotoana nitsangananao,\nKa maminay mpianatrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM232', 'Anio, mivory izahay,\nTahaka  ireo mpianatrao;\nKa enga anie ho hitanay\nNy hazavan’ny tavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM232', 'Omeo anay, omeo indray\nNy herin’ny Fanahinao;\nHavaozy ao anatinay\n‘Lay Pentekosta fahizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM233','FFPM 233');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM233', 'O! Ray Malala, asehoy\nNy hasoavanao;\nSasao ho afa-keloka\nIzahay ho zanakao;\nHo mafy ny fiezakay\nHandia ny lalanao\nTsy hisy hijanonanay\nRaha  tsy an-tranonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM233', 'O! Ray Malala, mba henoy\nNy feonay zanakao;\nTantano ao an-dalana\nHankany Aminao;\nHo mafy ny fiezakay\nHandia ny lalanao\nTsy hisy hijanonanay\nRaha  tsy an-tranonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM233', 'O! Ray Malala, hitanao\nNy hasambaranay;\nNy avotr’ain’ny Zanakao\nNo itokianay;\nHo mafy ny fiezakay\nHandia ny lalanao\nTsy hisy hijanonanay\nRaha  tsy an-tranonao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM234','FFPM 234');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Mahery Hianao,\nJehovah Tompo ô!\nMombà anay mpanomponao,\nKa miarova anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Mpanjaka Hianao,\nRy Zanahary ô!\nAvia, anjakao izao\nNy ao anatinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Miaro Hianao,\nAndriamanitra ô!\nHidera sy hisaotra Anao\nNo iangonanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Miantra Hianao,\nRy Tompo tia ô!\nTongava aminay izao\nMba hifalianay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Ny fanomezan-tsoa\nIzay maminay tokoa\nDia  Jeso ‘lay malalanao\nNafoy ho avotray.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM234', 'Mba raisonao, ry  Ray!\nNy saotra entinay,\nNy dera, laza, hery koa\nAnao Mpanjaka soa.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM235','FFPM 235');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM235', 'Tafavory izahay\nEto anatrehanao,\nRy Jehovah Tomponay!\nMba hivavaka aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM235', 'Te-hianatra izahay\nMba hanao sy sitrakao,\nMihainoa ny vavakay;\nManampia anay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM235', 'Fa mangataka aminao\nFanampiana izahay;\nRaha tsy ampianao; \nDia ho diso izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM235', 'Izay rehetra anananay\nEntinay miderà Anao,\nAoka hazoto izahay\nMba hanao ny sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM235', 'Aoka handroso izahay\nMba hanompo tsara Anao,\nDia  hifaly izahay\nAmin’ny fitianao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM236','FFPM 236');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM236', 'Avia, Tomponay!\nAtrehonao izahay;\nFiderana no atolotray\nHo Anao ry Tomponay;\nTongava atý an-tranonay,\nHandray ny dera atolotray,\nAvia, Tomponay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM236', 'Avia, Tomponay!\nAtrehonao izahay;\nEnga ka ho tonga olonao\nIzao izahay rehetra izao!\nNy vavanay hidera Anao,\nNy fonay mba diovinao;\nAvia, Tomponay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM236', 'Avia, Tomponay!\nAtrehonao izahay;\nAmpidino ny Fanahinao\nHo atý an-tranonay;\nAmpionao koa ny olonao,\nHilaza anio ny teninao :\nAvia, Tomponay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM236', 'Avia, Tomponay!\nAtrehonao izahay;\nFiderana no atolotray\nHo Anao , ry Avotray!\nMba raisonao ny deranay,\nEfao tokoa ny hatakay :\nAvia, Tomponay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM237','FFPM 237');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM237', 'Ry Jehovah Tomponay!\nTafavory izahay;\nAvy hankalaza Anao\nIzahay vahoakanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM237', 'Faly, ravo izahay\nNoho ny soa azonay;\nTonga mba hisaotra Anao\nIzahay voavotrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM237', 'Saotra tsara entinay,\nHira no asandratray,\nMba ho fiderana Anao,\nRain’izao rehetra izao,\nAmen.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM238','FFPM 238');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM238', 'Mivory eto izahay\nHiantso ny Anaranao,\nJehovah Masina ô!\nDia manomeza anay anio\nNy soa avy taminao,\nHo fitahiana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM238', 'Ny vavaka  tononinay\nMiakatra any Aminao,\nMpamonjy tia anay!\nMba raiso ao an-danitra\nHo zava-mani-pofona\nIzay ho tianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM238', 'Ny saotra izay aterinay\nMba raisonao, Jehovah ô,\nAndriamanitray!\nNy vokatry ny molotray\nDia aoka ho fanatitra\nAnkasitrahanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM238', 'Ankehitriny, Tompo ô!\nOmeo ny Fanahinao\nHitoetra aminay.\nHo fanalana aizina,\nSy fanoloran-kevitra\nHo an’ny olonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM239','FFPM 239');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ry Jeso!  vory izahay,\nFa andronao anio\nDia avy mba hivavaka\nAtý an-tranonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ka na aiza na aiza ny olonao\nNo vory toy izao\nNy herinao mba asehoy,\nEfao ny teninao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ny hira ikambananay\nAtý an-tranonao.\nEkeo ho fanandratana\nNy voninahitrao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ny vavaka  tononinay\nEo anatrehanao.\nMba raiso ho fanatitra\nAnkasitrahanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ny teny  fitarainana\nAtaon’ny ory koa\nSoloy fifaliana\nHisaoranay Anao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM239', 'Ny teninao halahatra\nHambininao anie\nHamelom-pitiavana\nAm-pon’izay mandre.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM240','FFPM 240');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM240', 'Alahady andro tsara,\nAndro fitsaharanay,\nNitsangananao ry Tompo,\nAndronao, Mpanavotray!\nEny maminay ny andro\nAndro fiangonanay\nHiderana Anao, Mpamonjy,\nSy ny voninahitrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM240', 'Tovy aminay ny teny\nIzay nataonao fahizay,\nTamin’ny Apositoly\nFony vory toy izao :\nRaha misy roa na telo\nAmin’ny ny Anarako\nVory mba hiantso Ahy,\nAo no hiangonako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM240', 'Mba soraty ao am-ponay,\nTompo ô! ny didinao.\nHiasanay saina tsara\nEto anatrehanao .\nMba avia, ry Jeso Tompo!\nTomoera aminay.\nHitandremanay ny andro\nIzay atokana ho Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM241','FFPM 241');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM241', 'Ry Jeso ô!  midina,\nJereo izahay izao;\nAtreho sao variana,\nKa tsy mahita Anao,\nHazoninao ny saina,\nHijery tsara Anao,\nMba tsy ho very maina\nIzao fivoriana izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM241', 'Ry Jeso!  hamasino\nNy toe-piainanay,\nKa dia ampidino\nNy hery ho anay;\nNy bitsika mangina\nAtaovinao izao,\nHamelom-paniriana\nHanao ny sitrakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM241', 'Ry Jeso ô!  monena,\nMidira Hianao,\nNy fonay mamantena\nHandray Anao izao;\nKa izay misalasala\nAmpaherezonao,\nDia  taomy hahalala\nNy fitiavanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM241', 'Ny hatakay mangina\nHenoy ka valio,\nKoa dia mitenana\nHianao ankehitrio,\nRy Jeso! Mpanazava\nNy dianay atý,\nOmàny lalandava\nNy fonay ho arý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM242','FFPM 242');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM242', 'Misaotra Anao izahay,\nry Ray!\nFa tsy nafenina anay\nIzay tena sitrakao tokoa\nMba hahazoanay ny soa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM242', 'Ka mitariha anay izao\nHandray ny toro-hevitrao\nIzay lazain’ny teninao\nHanaoavanay ny sitrakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM242', 'Ampahirato izahay\nHahaizanay mahita anio\nNy zava-mahagaga anay\nAo amin’ny lalànao soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM242', 'Ampianaro izahay\nHo tia  tokoa ny teninao,\nKa hankatò ny didinao,\nHanaiky hotapahinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM242', 'Ny asan’ny Fanahinao\nMba tanteraho aminay\nHampiorina ao anatinay\nIzay lazain’ny teninao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM243','FFPM 243');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM243', 'Mivory eto izahay,\nHandre ny teninao\nIzay hambara aminay,\nAndriamanitra ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM243', 'Tolory fahendrena,\nKa ampio ny irakao,\nIzay hitory aminay\nNy teninao izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM243', 'Ny fon’izay mihaino koa\nSokafy rahateo,\nHo tia  sy hirakitra\nNy teny mahasoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM244','FFPM 244');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM244', 'Ry Jeso! mba henoinao\nNy feonay mpanomponao\nIzay mivavaka  Aminao,\nMitady fitahiana', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM244', 'Vokiso ny Fanahinay,\nNy teninao no haninay,\nHahaizanay mamahana\nNy reraka ao an-dalana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM244', 'Ampaherezonao izao\nNy tànanay mpanomponao,\nHanohana ny olonao\nMiraviravy tanana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM244', 'Omeo fo mazoto re!\nTolory fahendrena be;\nTarihonao ny hevitray\nTendreo koa ny molotray.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM244', 'He! tsinontsinona izahay\nMalemy sady tsy mahay;\nKa dia ampaherezonao\nHanaovanay ny sitrakao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM245','FFPM 245');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM245', 'Ray ô! asehoinao\nAminay ny antranao,\nRaisonao ny zanakay\nAtsangana ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM245', 'Zanak’Andriamanitra ô!\nMba ekeo ny hatakay,\nTrotrinao ny zanakay\nTaomy ho mpanomponao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM245', 'Ry Fanahy Masina ô!\nMitoera aminay,\nIndro re ny zanakay\nAmpianaro, hazavao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM245', 'Ry Jehovah Izay Iray!\nNefa Telo, dia ny Ray,\nZanaka, Fanahy koa!\nMba tahio ny zanakay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM246','FFPM 246');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM246', 'Zazakely entinay\nMba hatao batisa izao;\nIzy no atokanay\nSy atolotray Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM246', 'Rano tsy mba mahasoa,\nRano tsy mba mahadio :\nKa tahionao izy izao,\nJeso ô, be indrafo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM246', 'Ary ny Fanahinao\nDia ataovy ao am-po\nMba hitarika azy, sao\nHisy loza izay hanjo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM246', 'Ry Jehovah be fitia!\nRy Jesosy Tomponay!\nRy Fanahy koa, avia\nMba handray ny zanakay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM247','FFPM 247');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM247', 'Ry Tompo ô! tsinjovinao\nNy mila famonjena\nSatria manantena,\nNy tany namboaranao\nHo an’izay mpianatrao\nHo lovany tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM247', 'Fa Hianao dia tsy mandà\nNy ory sy mpanota\nIzay nandatsahanao ny rà\nHanaisotra ny ota;\nKa tonga izahay izao\nMitady hodiovinao;\nMba raisonao ny fonay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM247', 'Mifona, Tompo, izahay\nIzay efa voaisa\nHo olonao, izay nandray\nNy soan’ny batisa;\nAmpaherezonao ny fo\nMba tsy hafoinay ny to\nAmbara-pahafaty!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM248','FFPM 248');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM248', 'Nitondra ny zaza\nny reny tao Salema,\nMba hotahin’i Jeso Kristy\nbe indrafo;\nNolavin’ny mpianatra izy,\nNefa hoy Jesosy hoe : \n“Avelao ny zaza \nhanatona  izao”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM248', 'Fa Ahy ny zaza\nka tiako indrindra,\nMpiandry zanakondry Aho\nka aza mandà;\nFa raha manantona Ahy izy,\nHotahiko tsara e :\n“Avelao ny zaza \nhanatona  izao”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM248', 'Endrey mahagaga\nNy fiantran’i Kristy,\nFa indro zazakely aza\nasiany soa;\nAvia, manatòna ilay \nMpiandry zanakondry, ka\n“Avelao ny zaza \nhanatona  izao”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM248', 'Ry Jesosy Tompo!\nampanatony Anao re\nNy zazakely tafavory\neto izao\nIzay mandrara mba rarao.\nHo tò anie ny teninao :\n“Avelao ny zaza \nhanatona  izao”', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM249','FFPM 249');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM249', 'Tompon’ny lanitra ô!\nmba tahio\nIzy izay ta-hanatona  Anao,\nKa ta-handray ny batisa anio\nSady maniry mba ho Zanakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM249', 'Ampifalio ny fony, izay ory,\nSady miaky ny ota natao\nAry ny ratsy maniry fongory,\nKa mba omeo ny aina vaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM249', 'Izay manaiky hitana ny soa\nSady mandà ny devoly izao;\nAoka hiseho ho mpino tokoa\nAmin’ny fomba sy asa \nvaovao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM249', 'Afon’ny lanitra ô! mba avia,\nKa ateraho ny fony izao\nAry tarihonao mba tsy hania\nFa te-ho sambatra ao Aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM249', 'Andriamanitra Ray be fitia,\nTaomy ny maro hanatona \nAnao\nNy Fiangonanao, ho be\nmpitia,\nHo marobe ny ankohonanao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM250','FFPM 250');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Atolotray hatao batisa\nNy zanakay Jesosy ô!\nIrinay izy mba ho isan’\nNy zaza arovanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Izahay izao efa nifidy\nAnao handray ny zanakay;\nKa raiso izy fa voavidy\nNoho ny ranao soa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Soraty izy mba handova\nNy lanitra fonenanao,\nKa ny Fanahinao hanova\nNy fony ho Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Tahio ny fahazazany\nHo fanorena-marina;\nAmpianaro azy izany,\nMivavaka Aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Tantano izy mandra-pita,\nHo tonga ao an-danitra,\nKa aoka izy mba hahita\nAnao an-dalany.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM250', 'Ka amin’ny fotoana feno,\nHandaozany ity tany ity,\nOmeo toky, iteneno :\n« ‘Ndeha hody, anaka ».', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM251','FFPM 251');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM251', 'Ry Jeso Zana-Janahary\nSy fototry ny aim-baovao!\nMba aniraho ny Fanahy\nIzao madinikao izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM251', 'Ny fahafatesanao nandresy\nNo aoka hitombonany,\nNy herinao tsy mety resy\nNo mba ho fiarovany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM251', 'Ka ny Anaranao hajaina\nDia mba omeo ny zanakay;\nKa io no hialany aina\nSy hitsanganany indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM251', 'Tantano izy tsy ho osa,\nRaha lavitra ny diany;\nFa raha fohy izany kosa,\nMba raiso ny fanahiny.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM251', 'Ka mba soraty ao am-pony\nRy Tompo, ny Anaranao,\nKa ny anaran’ny mpanompo\nSoraty ao an-tananao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM252','FFPM 252');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM252', '« Mba avelao ny zaza\nHanatona Ahy re,\nFa an’ny toa azy\nNy fanjakan’ny Ray! »\nIzany teny tsara\nNo ifalianay,\nKa dia tsy rarana\nNy zazakelinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM252', 'Ao amin’ny batisa\nTrotroiny izahay,\nKa tena voaisa\nHo zanany indray,\nAtsangany handova\nNy fahasambarana,\nFainan-tsy miova\nSy fiadanana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM252', 'Sakaizanay malaza\nRy Jeso, Hianao,\nFinaritra ny zaza\nMiankina Aminao.\nAmpio, ry Mpamonjy,\nNy ondrikelinao,\nHo tonga voavonjy\nAo anatrehanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM253','FFPM 253');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM253', 'Avia, ry Mpanavotra.\nTahio ny fandraisana\nSakafo namboarinao\nIzao hatoninay izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM253', 'Ireo zava-masina\nAroso mba hohanina\nHo famelana heloka,\nHo aina sy ho tanjaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM253', 'Tsaroanay ny dianao,\nNy ra sy fijalianao,\nNy nisoloanao anay,\nNy nitsangananao indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM253', 'Ny teninao natolotra,\nNy ranao dia nalatsaka,\nSakafo iombonanay,\nHo tena sy fanahy iray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM254','FFPM 254');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM254', 'Avia, ry mangetaheta ô\nKa aza dia mba mamoy fo,\nFa indro misy rano velona\nIzay omena mba hamelona\nAnao mahantra sy variana\nRy zanakondry very làlana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM254', 'Ny mofon’aina no atolony\nAnao manaiky mba ho olony\nNy tenany no ho fihinana,\nMba hahazoana fiainana;\nKanefa tsy mba hovidina anie,\nFa tena fanomezan-dehibe.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM254', 'Jesosy Tompo no nanolotra\nNy rany masina ho avotra\nIzany raiso mba ho tanjaka\nSy toky ho anao, ry reraka\nRy mpivahiny sasatra ao\nam-po,\nAvia re, ka manaràna fo!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM255','FFPM 255');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM255', 'Ny ran’ny Zanakondry latsaka\nNamelona  ahy tany Golgota,\nKa io no tena vatofantsika\nMaharitra ny tafio-drivotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM255', 'Raha voaratra noho ny otako,\nKa lany foana ny heriko,\nNy rany masina nalatsaka\nNo nahitako fahasitranana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM255', 'Izao hira vao izao no mamiko,\nKa tonga tsy misaraka amiko\nNy ran’ny Zanakondry no\nmahay\nManavotra ahy mba ho an’ny\nRay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM255', 'Raha ketraka sy kivy re ny fo,\nVelomiko indray ny hirako\nNy amin’ny Jesosy sy ny rà\nKa afaka erý ny tahotra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM256','FFPM 256');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM256', 'Mivoaka ao Golgota\nIlay renirano soa\nIantsoana ny mpanota\nHo any avokoa;\nNy ratran’ny Mpamonjy\nNo loharanon’io,\nKa ony mahavonjy\nSy tena mahadio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM256', 'Mamelona ny tany\nIty ony soa ity,\nIzay rehetra ombany\nMiadana erý,\nVahoaka an-tapitrisa\nIzay misotro ao,\nMahita Paradisa\nSy fiainana  vaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM256', 'Ny fo izay maratra\nKa entina mankeo\nNy ory sy mahantra\nIzay manatona eo,\nMahita fanafody,\nKa sitrana avokoa,\nNy ota sy ny rofy\nDia  afaka tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM256', 'Fanahy be ahina,\nAvia misotro ao,\nFa io no mampangina\nNy alahelonao;\nFanahy ô, hatony\nIty ony soa ity,\nFa io no mahatòny\nNy fanirianao atý.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM256', 'Hianao, ry Tompon’aina!\nIsaoranay tokoa,\nNanaiky horatraina\nHandefa ony soa,\nNy ranao tao Golgota\nNo iankinanay,\nFa mahadio ny ota,\nMamelona aina anay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM257','FFPM 257');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'Ry Jesosy ô! indreto\nIzahay nasainao eto\nAmin’ny latabatrao,\nMba tolory mofon’aina,\nO! omeo ranon’aina,\nDia ny ra aman-tenanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'O! ry Loharanon’aiko,\nTonga aho, fa ilaiko\nHianao Mpamonjiko,\nRaiso ka diovy aho,\nAtafio izay mitalaho\nNy fahamarinanao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'Ry Mpiandry tsara indrindra,\nTaomy aho mba hifindra\nAo am-balan’ondrinao;\nMamonje ka mitahia\nIreto ondrinao nania,\nEnto any Aminao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'O! ry Fahazavan’ny saiko\nSady tanjaky ny aiko,\nTonga aho ka vonjeo;\nNoana ka mitaraina,\nMba vokiso mofon’aina,\nRano velona omeo!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'Indro, miankohoka aho,\nTompo ô! ka mitalaho\nEto anatrehanao;\nAza mba manary ahy,\nIzay misento sy manahy,\nMamelà ny heloko!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM257', 'Ry Mpisolo ny mpanota,\nIzay nandoa ny tambin’ota,\nLatsa-dra ny tenanao,\nRaisiko am-panajana,\nFa nataonao fanasana\nIreto zava-masinao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM258','FFPM 258');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM258', 'Manaraka ny hafatrao,\nTafangona izahay,\nMba hahatsiarovanay\nAnao, ry Tomponay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM258', 'Tsy azo hadinoina\nNy fahorianao,\nNy dinitrao izay toy ny ra\nTsaroanay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM258', 'Ny hazofijalianao\nDia tazanay izao\nRy Zanakondry masina ô!\nTsaroanay Hianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM258', 'Nijaly mafy Hianao,\nNisolo voina anay;\nRaha mbola velona izahay\nTsaroanay Hianao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM258', 'Raha tapitra ny andronay,\nKa tonga Hianao\nMba haka ny fanahinay,\nTsarovinao izahay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM259','FFPM 259');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM259', 'Ny latabatrao, ry Jeso!\nDia atrehinay izao;\nNy fanahinay vokiso\nAmin’ny fitianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM259', 'Tsy nitady zo sy laza\nHianao, ry Tomponay!\nFoinao ny ainao aza\nNanavotanao anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM259', 'Jeso ô! ny ranao soa\nNo nataonao avotray,\nMba hanafaka avokoa\nIzay tsy mahadio anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM259', 'Manomeza mofon’aina\nTompo ô! ho tanjakay;\nMihainoa  ny mitaraina,\nMamalia ny hatakay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM259', 'Ny fanahinay ry Tompo!\nRaiso, fa atolotray;\nFaly izahay hanompo\nSy hanao ny sitrakao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM260','FFPM 260');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM260', 'Ry Kristy ô! malalako,\nSakafon’ny fanahiko,\nManaraka ny hafatrao,\nTsarovako ny teninao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM260', 'Mangorakoraka ny fo,\nFa voavono Hianao!\nKa saotra no atolotray\nAnao, ry Ilay nalatsa-dra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM260', 'Ny teninao izay raisiko\nFiainako vaovao tokoa;\nNy ranao izay sotroiko\nNo manadio ny foko koa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM260', 'Ry Kristy ô! ampitomboy\nNy fitiavako Anao.\nNy toe-piainako fenoy.\nNy tena hamasinanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM260', 'Atolotro anio indray\nMba hoa Anao mandrakizay\nNy tenako, ny ananako,\nNy heriko, ny asako.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM261','FFPM 261');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', 'Ankehitrio no isehoanao,\nRy Jeso Tompo, izay \nmalalanay!\nAnkehitrio no anandramanay\nNy hafaliamben’ny lanitrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', 'Ampiomany ao am-po izahay\nHampahadio ny eritreritray,\nHahatakaranay ny avotrao\nIzay namboaranao tao\nKalvary.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', 'Eto no anoloranao anay\nNy mofon’aina, rano velona;\nEto no ialanay sasatra\nAmin’ny adinay  sy  rafinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', 'Ry Jeso ô! miandry izahay\nNy fihavian’ny voninahitrao,\nHo toy ny andro vao miposaka\nHo toy ny rano mahavelona.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', '“Raiso ny Tenako” no teninao\n“Ary ny Rako ho fiainana”\nAm-pitiavana no andraisanay,\nNa dia tsy mendrika aza\nizahay.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM261', 'Mombà anay, ry Tompo tia ô!\nAza miala amin’ny fonay,\nAoka ny tavanao hazava re,\nAmin’ny làlana alehanay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM262','FFPM 262');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM262', 'Indreto izahay,\nRy Jeso ô!\nManaraka izao,\nNy hafatrao,\nNy fahorianao,\nTsaroanay izao,\nFa fatratra tokoa\nNy nentinao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM262', 'Ny mofo haninay,\nRy Jeso ô!\nMilaza aminay\nNy tenanao;\nNy fanavotanao\nMahafaka anay,\nFa saotra re izao\nAtolotray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM262', 'Misotro ny divay\nIzahay izao\nHahatsiarovanay\nNy antranao;\nNy ra nilatsaka\nNo manadio anay,\nManafaka tokoa\nNy olonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM262', 'Tarihonao ny fo,\nRy Jeso ô!\nHo tia sy hankatò\nNy didinao;\nKa tsy ny sitrakay,\nFa ny Anao, Jeso,\nNo aoka ho maminay,\nRy Tompo ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM263','FFPM 263');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', 'Mandrenesa ry sofina,\nMifalia, ry fo;\nNy feon’ny Filazantsara\nManatona anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', 'Ry olon’ota rehetra,\nRy ory sy noana,\nIzay mameno ny kibony\nAmin-java-poana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', 'Jehovah no mamboatra\nIzay mofon’aina,\nHo an’izay rehetra\nMety hihinana.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', 'Kraist’sy ny fitahiany\nIzany mofo izany,\nFa Izy no mamelona\nNy maty mosary.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM263', 'Avia, ry mosarena,\nKa manarana fo;\nNy mofon’aina tsy lany\nFa ampy ho anao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM264','FFPM 264');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'He mahagaga anay\nNy fitiavana\nNasehonao, ry Jeso ô!\nMba ho anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'Ny fijalianao\nIlay tao Golgota,\nIndrisy! lalina tokoa\nNy ngidiny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'Na mafy aza izay\nTsy nandosiranao,\nNataonao tsinontsinona\nNy teninao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'Ny fitiavanao,\nFa tsy ny fantsika,\nNo anton’ny nihantonanao\nTao Golgota.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'Ny ra nalatsakao\nNo vidin’ny ainay,\nNo fijaliana nentinaonao\nNo avotray.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM264', 'Tsaroanay izao,\nDerainay avokoa\nIlay fitiavanao anay,\nRy Tompo soa!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM265','FFPM 265');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Ny fitiavanao\nNo mahagaga anay,\nRy Zanak’Andriamanitra ô!\nRy Jeso Tomponay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Hanavotra aina anay\nNo nijalianao,\nKa famonjena lehibe\nNo azonay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Ny mofo sy divay,\nIzay haninay izao,\nDia mampiseho aminay\nNy fitiavanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Avia, Jeso ô!\nAvia ankehitrio,\nKa ny fanahinay sasao\nHo tsara sy madio.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Mampaneke anay\nHanao ny sitrakao,\nKa aoka tsy ho tianay\nIzay tsy tianao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM265', 'Monena aminay,\nRy Tompo be fitia!\nKa aza ilaozanao izahay\nMandrakizay doria.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM266','FFPM 266');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM266', 'Ry Jeso Tompo, Hianao\nIsaorako tokoa izao,\nNy ranao sy ny tenanao\nNo nihinanako izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM266', 'Ry foko faly, ambarao\nNy soa azonao izao;\nJesosy monina ao am-po\nEndrey ny hafaliako!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM267','FFPM 267');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM267', 'He, ny andon’ny maraina\nLatsaka ao an-tsaha re,\nKa mamelona ny maina,\nIzay maniry rano be!\nRavoravo e, ny tany,\nFa he, ny andro maina efa\nlany,\nKa mitsahatra ny fahantrany,\nManaroka ny hazo be.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM267', 'Ny fanahy karankaina\nMisy rano velona,\nFa Jesosy andon’aina\nManome fiainana :\nVelona ny jentilisa,\nNy tany hay dia tonga\nParadisa\nMarobe no efa voaisa\nHandray ny lova masina!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM267', 'Misy làlana mizotra,\nIzay mankao Ziona re;\nAny no mitanjozotra\nNy vahiny marobe;\nKa Ziona dia mivoha\nHidiran’ny navotan’ny \nTsitoha;\nAo no ivorian’ny mifoha,\nFa an’ny Tompo lehibe.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM267', 'He, mikambana ny mino\nAmim-pifaliam-be.\nKa ny hobiny maneno\nTahaka ny rano be!\nAo mitovy avokoa,\nTsy misy Tompo sy \nmpanompo koa,\nEny, razana iray tokoa\nNy mponina ao Ziona re!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM268','FFPM 268');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM268', 'Jesosy no Mpiandry\nNy Fiangonanay;\nNy feon’izy ireny\nNo feo fantatray,\nKa tsy mba vala maro\nNy Fiangonanay;\nIray tsy hay zaraina,\nTapahin-Tompo iray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM268', 'Iray no Vatolampy\nIzay iorenanay,\nIray no Fehizoro\nIzay ikambanany,\nIray no Mofon’aina\nFihinanay etý,\nIray no antenaina\nHo azonay arý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM268', 'Tabain’ny hevi-diso,\nKanefa mbola iaraý;\nNy saina tsy mitovy\nTsy mahazara anay;\nFisoko maromaro,\nKanefa vala iray\nNy Tompo no mpiaro\nNy Fiangonanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM268', 'Ny teny samy hafa,\nNy fomba tsy miray,\nTsy misy maharava\nNy fikambananay;\nNy fanenjehana aza\nVao mainka mampiray\nSy mahatsara laza\nNy Fiangonanay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM268', 'Ry Jeso! hatanjaho\nNy Fiangonanao,\nNy fony halalaho\nMba hitoeranao;\nIzay firaisan-tsaina\nMiseho hatretý,\nVelomy hanana aina\nHitohy hatrarý.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM269','FFPM 269');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM269', 'He! tianay ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao,\nHe! tianay ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM269', 'He! tianay, fa misy aina,\nRy Tomponay ny valanao!\nTsy tianay, fa tany maina\nNy lavitra ny tranonao,\nHe! tianay, ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM269', 'Fehezinao, Mpiandry tia,\nMilamina ny valanao;\nTsy misy tsy mifankatia\nNy ondry izay tarihinao,\nHe! tianay, ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM269', 'Ny fanimban’ny fahavalo\nDia lavitra ny valanao;\nMitazan-davitra mandalo\nNy rafinao tsy tia Anao,\nHe! tianay, ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM269', 'Ny fototra izay mahatsara\nNy valanao, ry Tomponay!\nDia Hianao Mpiandry tsara\nNo miara-monina aminay.\nHe! tianay, ny monina eto,\nFa maminay ny valanao,\nTsy tianay, fa mampisento,\nNy lavitra ny tranonao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM270','FFPM 270');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM270', 'Ry Tompo, Izay nanangona\nAnay ho vato velona!\nHazony tsy handao Anao\nNy vato voarafitrao;\nFa maro no mandronjina\nHandevona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM270', 'Jesosy Fehizoro ô,\nMpifehy mora sady to!\nTohano mafy izahay\nMba tsy hirodana indray,\nFa indro ny mpisompatra\nMandrirotra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM270', 'Ry Vato fampiraisana!\nTariho mba hikambana\nNy vato voapaika re,\nHo tonga trano lehibe,\nTsy zakan’ny mpandevona\nHarodana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM270', 'Ry Kristiana marobe\nMba ampiraiso tsara re,\nHiray am-pitiavana,\nHo velona finoana,\nKa mba hiaraka hanao\nNy asanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM271','FFPM 271');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM271', 'Mba mivavaha raha vao\nmaraina,\nTsarovinao Ilay Mpanao\nanao.\nIzay niaro ny fanahy sy aina\nMba ho salama toy  izao;\nTsarovy re ny Tomponao \nIzay Mpiaro  anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM271', 'Rehefa tonga koa ny\nantoandro,\nO! miambena tsara hianao,\nFa manangoly saina isan’andro\nIlay devoly rafinao;\nTsarovy re ny Tomponao \nIzay Mpiaro  anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM271', 'Raha alina mangina ka\nhatory\nTsarovy eo ny ota izay natao\nKa dia ifony sy itsory\nFandrao maningotra anao;\nTsarovy re ny Tomponao \nIzay Mpiaro  anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM271', 'Na aiza na aiza Hianao\nmitoetra\nSatana fahavalo ao tokoa,\nKa aza kivy na mba \nmanjoretra\nFa mivavaha tsy ho voa;\nTsarovy re ny Tomponao \nIzay Mpiaro  anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM272','FFPM 272');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM272', 'Faly izahay nandre\nHavan-tia nanao hoe :\n“ Miaraha aminay,\nTrano soa halehanay ”.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM272', 'Efa tonga izahay\nMba hivavaka Aminao :\nRy Jehovah Tomponay,\nMitahia ny olonao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM272', 'Miandrandra Anao izahay,\nKa mangataka  Aminao\nHanomezanao anay\nSoa avy Aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM272', 'Dia sambatra izahay,\nFa mitoky Aminao;\nKa ho tanterahinay\nIzay rehetra sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM272', 'Hoderainay Hianao\nAndro aman-alina,\nMbamin’ny Anaranao,\nFoto-piadanana.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM273','FFPM 273');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM273', 'He! vokatra ny tany,\nJehovah Tompo ô!\nFa be tsy mety lany\nNy hasoavanao :\nNy andro fararano\nNo ifalianay;\nVoataona ao an-trano\nNy vokatra azonay :\nSaotra tsara entinay\nHo Anao tokoa,\nNy olonao rehetra  izao\nMifaly avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM273', 'Ny tany tsy misaona,\nFa sambatra tokoa,\nTsy tapaka isan-taona\nNy fanomezan-tsoa;\nEndrey, nahazo maina\nIzao rehetra izao;\nNy zava-manana aina\nMifaly Aminao :\nSaotra tsara entinay\nHo Anao tokoa,\nNy olonao rehetra  izao\nMifaly avokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM273', 'Tontosa izay nirina,\nNahazo izahay,\nFa misy taona zina\nNataonao ho anay;\nTsy diso isan-taona\nNy fitahianao.\nNy olonao mihaona\nMba hankalaza Anao\nSaotra tsara entinay\nHo Anao tokoa,\nNy olonao rehetra  izao\nMifaly avokoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM274','FFPM 274');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM274', 'Tao an-tany karakaina\nNisy olo-maro be,\nTsy mba nampodina maina,\nTao Jesosy  nanome.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM274', 'Na dia mofo kely aza\nTonga nahavoky  ireo,\nFa nitombo mahagaga,\nSamy faly izy  ireo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM274', 'Fa ny herinao, ry Jeso,\nIzay namonjy fahizay\nNo miasa lalandava\nHahavoky soa  anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM274', 'Dia tahio ny fambolena\nHahavokatra tokoa;\nMiantrà ny firenena\nTsy ho diso zava-tsoa.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM274', 'Na dia voky fatratra aza,\nMora reraka  izahay;\nAo ambony ny mateza\nIankinan’ny ainay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM275','FFPM 275');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM275', 'Raisonao ry Tompo soa,\nNy fanatitray izao;\nHamasino avokoa\nIzay atolotray Anao,\n:,: Raiso re, ho Anao,\nHo fanati-tsitrakao! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM275', 'He, Anao, ry Tompo soa\nIzay rehetra anananay\nNy harena, vola koa,\nTaminao, Jehovah Ray,\n:,: Raiso re, ho Anao,\nHo fanati-tsitrakao! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM275', 'Na dia kely aza, Tompo,\nKa tsy mendrika Anao,\nRaiso ho entina hanompo\nSy hanao ny sitrakao.\n:,: Raiso re, ho Anao,\nHo fanati-tsitrakao! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM275', 'Indro, Tompo, raiso koa\nTena, fo, fanahinay,\nMba ho fiasana koa\nEo an-tananao izahay.\n:,: Raiso re, ho Anao,\nHo fanati-tsitrakao! :,:\nHo voninahitrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM276','FFPM 276');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM276', 'Ry Jehovah, Ray Mpahary\nSy Mpamelona anay,\nTsapanay fa tsy manary\nHianao Mpitondra anay;\nHe, mandrotsa-pitahiana\nSesehena Hianao,\nKa dia feno fifaliana\nIzahay mpanomponao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM276', 'Noteneninao ny tany,\nNotarihinao izahay,\nKa nitobaka  aoka  izany\nIzao ny vokatra azonay.\nFeno hika isan-taona\nNy fitiavanao anay,\nKa aoreno tsy ho foana,\nTompo ô! ny asanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM276', 'O! mba raiso re, ry Tompo,\nIzao fanatitray izao;\nEnga anie ka mba hitombo,\nHandrosoan’ny hanitrao.\nRaiso koa sy hamasino,\nNy fonay hiasanao;\nNy Fanahy ampidino\nHampahery, hanavao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM277','FFPM 277');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM277', 'Indro, Tompo, vory eto\nAnatrehanao izahay,\nMba hanatitra ireto\nVokatry ny asanay,\n:,: Raiso re, raiso re!\nHo fanati-tsitrakao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM277', 'Hianao no mampaniry\nSy mampisy vokatra;\nIzahay dia mpitahiry,\nFa Anao ny zavatra.\n:,: Raiso re, raiso re!\nHo fanati-tsitrakao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM277', 'Ary na tsy mendrika aza,\nAoka tsy holavinao,\nFa ho enti-mankalaza\nNy Anaran-tsoanao.\n:,: Raiso re, raiso re!\nHo fanati-tsitrakao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM277', 'Raiso koa re, ry Tompo,\nHo Anao ny tenanay,\nAmboary ho mpanompo\nMahafatra-po izahay.\n:,: Raiso re, raiso re!\nHo fanati-tsitrakao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM278','FFPM 278');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM278', 'Mba ampio, ry Tompo soa\nIzahay navotanao,\nFa mikasa mba hanoa\nSy hanaraka Anao;\nHitanao fa kely hery\nIzahay mpanomponao,\nTsy mahefa raha irery,\nKoa mba tarihonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM278', 'Izahay manolo-tena\nMba hiasa ho Anao,\nKa maniry, manantena\nFa hanampy Hianao;\nHitanao fa kely hery,\nIzahay mpanomponao,\nTsy mahefa raha irery,\nKoa mba tarihonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM278', 'Tianay hiara-dia\nAminao, ry Tomponay,\nKa tantano tsy hania\nAmin’ny alehanay.\nHitanao fa kely hery,\nIzahay mpanomponao,\nTsy mahefa raha irery,\nKoa mba tarihonao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM279','FFPM 279');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM279', 'Raisonao, ry Tompo soa\nIzato asan-tananay,\nFa nomenao avokoa\nIzay rehetra anananay\nSimba izahay rehetra,\nSady very hatrizay,\nNefa soa tsy misy fetra\nNo novalinao anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM279', 'Hianao nanetry tena,\nTsy nitandro henatra,\nBe fiantra ka onena\nNy tra-pahoriana,\nMba tsarovanay izany,\nKoa dia tahafinay,\nNefa fiasana  ihany\nAo an-tananao  izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM279', 'Arosoy sy ampitaro\nAminay ny teninao;\nHazavao ny olo-maro\nIzay tsy mahalala Anao!\nNy misaona mba vangio,\nNy kamboty iantrao,\nIzahay izay tonga anio\nMba ataovy irakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM279', 'Eny, ry Mpamonjy tsara,\nAmboary izahay\nMba ho tonga mpanambara\nNy fitianao anay;\nAry dia mba tahio\nIzato fikambananay,\nHafanao, ampirisiho,\nHamasino izahay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM280','FFPM 280');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM280', 'Ry Tompom-boninahitra,\nJereonao izao\nIreto izay milahatra\nHo tena irakao;\nNy fanasana fatratra\nOmaninao izao,\nIlà-mpitondra hafatra\nHamory izay hankao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM280', 'Hitety sampan-dàlana\nSy vohitra  izahay\nHanetra fisakanana\nSy ady mahamay;\nKa aoka hotafiana\nNy fiadianao,\nFa tena fanafihana\nIzay hatao izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM280', 'O, ry Fanahy Masina,\nMonena aminay!\nKa aoka ho fanasina\nTokoa izahay,\nFihino tsy hihemotra,\nAtaovy irakao\nManefa zava-tsarotra\nHo voninahitrao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM280', 'Ry Tompom-boninahitra,\nNy voninahitrao\nNo aoka mba hitaratra\nAn-tavanay izao,\nKa raha ao an-danitra\nFonena-masinao,\nDia  mainka vao hamiratra\nHo voninahitrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM281','FFPM 281');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM281', 'Vory eto izahay\nHihevitra ny asanao,\nTompo, manatreha  anay\nKa asehoy ny sitrakao.\nAoka Hianao no mba hitarika\nanay \nTompo, tahio izahay\nMba ho voninahitrao ny\nasa vitanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM281', 'Hahavita inona\nNy saina aman-kevitray ?\nTena tsinontsinona,\nRy Tompo ô! ny herinay,\nKa mba midina eto afovoanay\nHanana aina masina ny \nfivorianay!\nTompo, tahio izahay izahay\nMba ho voninahitrao ny\nasa vitanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM281', 'Hianao no nanome\nNy asa hoheverinay,\nTena adidy lehibe\nNo voatolotra anay,\nEnga anie ny sitrakao irery\nno hatao!\nAoka tsy ho vanona izay\ntsy sitrakao!\nTompo, tahio izahay izahay\nMba ho voninahitrao ny\nasa vitanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM281', 'Areheto aminay\nNy afom-pitiavanao,\nMba hahaizanay miray\nMitory ny Anaranao,\nHahavory marobe hanatona\nAnao,\nHampamirapiratra ny \nvoninahitrao!\nTompo, tahio izahay izahay\nMba ho voninahitrao ny\nasa vitanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM282','FFPM 282');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', '(Manaraka ny famakian-teny voalohany)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ry Jeso, Tompo velona,\nMpiandry sy Mpamelona\nNy Fiangona-masinao,\nAtreho izahay izao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Indreo (Inty*) mpanomponao\nvaovao\nAtokanay, ka raisonao\nHanao ny raharahanao,\nHamahana ny ondrinao.\n\n(Manaraka ny faharoa)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ny tany no nakana anay,\nMihelina ny andronay,\nKa vetivety izahay\nDia hody vovoka indray.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ry Jeso ô, Mpitia anay,\nIzay Mpanjaka hatrizay,\nEndrey ny voninahitrao,\nManerana ny lapanao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ny deranao hasandratra\nHitohy tsy hitsahatra;\nHazava toy ny kintana\nNy tsara fanompoana.\n\n(Manaraka ny fahatelo)', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Mba raison y mpanomponao,\nKa aoka hamboarinao\nHo mpanambara mankatò\nNy hafatrao, ry Tompo ô!', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Omeo Afo Masina\nSy vava mampionona;\nNy sainao sy ny feonao\nOmeo ny mpanomponao.\n\n(Manaraka ny fahefatra)', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Raha misy tafio-drivotra,\nTohano tsy hatahotra,\nHahery sy hisakana\nNy rafim-piangonana.', '9');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ka mba ampirisihonao\nHanaraka ny dianao :\nTantano raha mbola atý,\nHandresy ka ho tonga arý.\n\n(Manaraka ny ordinasiona)', '10');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ka mba ampirisihonao\nFa kely ny finoany;\nNy ranao masina anie\nHanafaka ny helony!', '11');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Ampio mba haharitra,\nRaha mbola atý an-efitra;\nRaha avy ny hodianay,\nMba hazavao ny làlanay!', '12');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM282', 'Raha tonga ny harivany,\nKa ao ny ady farany,\nDia raiso ny mpanomponao\nHiala sasatra Aminao!\n\n*) Inty, raha olona iray no\natokana', '13');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM283','FFPM 283');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM283', 'Manan-jara, ry Jesosy,\nNy mpanomponao,\nIzay natokanao hitondra\nNy Anaranao :\nNofidinao ho mpitory\nNy fitiavanao,\nNitokianao ho mpamory\nNy vahoakanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM283', 'Izao no zara fanompoako\nVoatendrinao,\nKa ny mafy tsy ahoako\nHahefako izao;\nTsy handosi-pahoriana\nNy mpiasanao,\nFa ny hazo fijaliana\nLova taminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM283', 'Na ho voky na ho noana\nNy mpanomponao,\nTsy handao ny fanompoana\nNametrahanao;\nSitrakao ny fihafiana,\nKa mba tiako koa;\nZakanao ny tsy fisiana,\nKa zakaiko  koa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM283', 'Tsy ahiko ny handany,\nHolanina koa,\nFa famoizan-tsoa no hany\nAhefany soa;\nNa ny saiko, na ny aiko,\nAndro, vola koa,\nTsy mba misy holalaiko,\nFoiko avokoa.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM283', 'Nefa raha  izaho irery\nTsy mahefa  izao,\nKa mangataka ny hery\nEo an-tananao,\nAoka ho feno ny Fanahy\nNy mpanomponao,\nMba ho tena lehilahy*\nVoahosotrao..\n\n*) na : « vehivavy »', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM284','FFPM 284');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM284', 'Mangataka aminao ny olonao\nry Tompo!\nMba hitahianao ny havan-\ntianay\nIzay atokanay hitondra sy\nhanompo\nNy Fiangonanao, henoy ny\nvavakay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM284', 'Tafio ny hery fa tsy mahefa\nirery,\nFenoy ny hevitrao ho toy ny\nzanakao.\nMpitady ny mania, mpikaroka\nny very.\nHitondra ireo ho tia ny\nvalan’ondrinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM284', 'Ny sainy hazavao hahazo\nfahendrena\nHahay hitondra izao vahoaka\nbe izao.\nAmpianaro koa mba tsy\nhatoky tena,\nTolory saina soa hiankina\naminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM284', 'Raha ory, aza afoy, tohàno sy\nonòny;\nMarary, mba tsaboy;\nmahantra, mba jereo;\nApetraka aminao ny ainy sy\nny fony;\nKa mba tsinjovinao, arovy sy\nvonjeo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM285','FFPM 285');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM285', 'Mivory maro eto\nIzahay navotanao,\nNy saotranay no ento\nHo voninahitrao;\nMifaly sy mihoby\nMandray ny irakao,\nKa eto no mitoby\nMangataka aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM285', 'Ry Kristy tena Andry\nSy Vatolampinay!\nRy Lohan’ny mpiandry\nSy Tompo tokinay!\nTohano mba hijoro\nIty mpanomponao,\nTinendry ho mpanoro,\nMpilaza hafatrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM285', 'Handray ny asa mafy,\nKoa aza ilaozanao;\nHitory, ho mpamafy,\nKa dia mba hazavao.\nVokiso lalandava\nNy saina tianao;\nOmeo ny andro lava\nHanao ny asanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM285', 'Tahio mba ho salama\nHahefa ny anao,\nHo iraka mafana\nAmpian’ny herinao;\nMandrava manda mafy\nMba hampanjaka  Anao,\nKoa  aoko mba hihafy,\nFa  izay no sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM285', 'Ny fitaizam-panahy\nAdidy lehibe,\nAmpio mba tsy hanahy\nNy asa maro be,\nKa dia tahio ny asa\nHataony ho Anao;\nNy fony no mikasa\nHanoa izay didinao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM286','FFPM 286');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM286', 'Ry Jeso Mpitarika hendry!\nTsinjovy ny olom-boatendry\nTolory ’zay hevitra hendry\nHandinika sy hahakendry.\nRy Tompo Mpanjaka mahery;\nVangio raha ory sy tery\nTohano raha mahatsiaro fery\nVimbino ‘ndrao saraka irery.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM286', 'Raha miasa dia miasa ny\nsaina\nKanefa ny tany no maina,\nKa mila ho kivy ny aina.\nTondrahy fandrao karankaina.\nNy mpiasa izay voafidy\nHamoha ny fo izay mihidy\nHitari-panahy saro-bidy,\nTantano hanaraka didy.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM287','FFPM 287');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'O! miaingà izao, ry\nmiaramila soa,\nAntsoin’ny Tomponao hiady\nhianao.\nNy fahavalo ao, kanefa\nmandrosoa,\n:,: Mahery re no momba\nanao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'Izao tontolo izao izay feno\nfahotana\nNo iantsoana anao mba\nhotafihinao\nIndreo mihoraka ao ny\nfehin’ny Satana\n:,: Jeso anefa momba anao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'Ny aizim-be izay mandrakotra\nny tany\nNo iantsoana anao ka andeha\nmba savao;\nN Tompo no tafio, alao ny\nhazavany,\n:,: Tsilovy izao tontolo izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'Ny fahoriam-be izay\nmanarona eto\nNo iantsoana anao, ka moa\nve handà ?\nAmpiononinao ny ory sy\nmisento\n:,: O! mazotoa ka miaingà :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'Na inona hanjo mbola ao ny\nfamonjena\nHahery hianao! izay no\nantenao;\nAmpoizinao tokoa izao ny\nfandresana,\n:,: Mahery Ilay arahinao :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM287', 'O! mahereza izao, ry\nmiaramila soa!\nNy hatrotrahanao iareto sy\nzakao.\nJesosy no jereo, ka matokia\ntokoa.\n:,: Fa Izy re no herinao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM288','FFPM 288');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM288', 'Sambatra izay voafidy\nHo mpiasanao\nKa hanohy ireo adidy\nIzay natombokao.\nHo mpitaiza ny fanahy\nToy ny vitanao\nHo mpiady tena sahy\nTarikao Jeso.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM288', 'Dia mpiasa tsy an-tery\nKa mafana fo\nTe-hanangona ondry very\nMarobe tokoa.\nTe-hitaona ny tanora\nSy ny zaza koa\nTsy hifidy asa mora,\nFa ho mpankatò.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM288', 'Hianao, ry Jeso Tompo,\nNo nampianatra\nNy olonao mba hanompo\nTsy mitsahatra.\nTsy handala ny talenta\nIzay natolotrao :\nFa ny aina re no fetra\nEntina manao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM288', 'Nefa tsy matoky tena\nFa malemy moa,\nKa dia mila fahendrena\nMila hery koa;\nHo mpiasa mahavita\nIzay anjara etý,\nMandra-pody ao am-pita\nAminao arý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM289','FFPM 289');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Hitsangana izao\nIzahay, ry Tompo ô!\nMba hanompoanay Anao,\nAmpionao izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Ny fahotana be\nIzay vitanay tatý,\nDia ibebahanay izao,\nKa mamelà anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Ny tsy finoanay\nNo nijanonanay\nTsy nanatonanay Anao\nIzay ela be izay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Sasao madio izahay,\nAsio fo vaovao\nHo ao anatinay izao,\nRy Jeso Avotray!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Inoanay tokoa\nFa maty Hianao,\nHisolo olo-meloka\nNo nijalianao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM289', 'Mba manampia anay\nHiankina aminao,\nFa tokinay ny avotrao\nNatao tao Kalvary.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM290','FFPM 290');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM290', 'Indreto fa mivory izao\nZatovo vonon-kanavao\nIlay fanekena tsara;\nMba raisonao, Rainay ô!\nNy fitarainanay izao.\nOmeo toky tsara,\nHenoy, fenoy\nAim-panahy, mba ho sahy\nLalandava\nHo mpanaiky ny mazava.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM290', 'Mandà ny ratsy izy izao,\nManaiky fa ho zanakao\nHandia ny lalan’aina;\nRy Ray ô! mba tsarovinao\nIreto voasoratrao\nAo amim-bokin’aina;\nTezao izao\nTsy ho resy, fa handresy,\nKa omeo\nAzy hery mahaleo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM290', 'Natsanganao ho zanakao\nSy ondry mba handrasanao,\nKa tena sarobidy;\nArovy re ny ondrinao,\nTantano ny malalanao.\nRy Tompo Izay nifidy \nAnay handray\nLova soa tsy miova,\nKa hazony\nTsy handao Anao intsony!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM291','FFPM 291');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Efa tonga zana-dRay Tsitoha\nhianao,\nRy tanora, tamin’ny batisa\nmasina;\nIzany no tenin’ny Tompo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Koa aza manadino ny\nbatisanao,\nZava-tsoa sarobidy efa\nazonao\nTamin’ny ranon’ny aina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Famelana heloka sy\nfahasoavana,\nFanavaozana ny fo sy\nfiadanana,\nSamy nomen’ny Mpamonjy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Dia arahonao Jesosy, fa\nMpamonjinao;\nAoka hahafaly Azy ny\nfiainanao,\nTovy izay sitrapony!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Mivavaha, miambena ao\nan-dalana!\nMisy fahavalo fetsy\nta-hamitaka\nNy ondrikelin’ny Tompo.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Mahatoky ny Mpamonjy,\naza kivy fo,\nIzy hampionona raha avy ny\nmanjo;\nAzy ny hery rehetra.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM291', 'Ary raha tapitra ny andronao\natý,\nEndrey ny fifalianao rehefa\n‘mby arý\nAmin’ny Tompo Jesosy!', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM292','FFPM 292');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM292', 'Izahay natao batisa,\nVoarain’ny Tomponay,\nAry efa voaisa\nMba ho Zanaky ny Ray;\nVoavelany tokoa\nNy fahadisoanay;\nNefa mbola mora voa,\nMora resy izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM292', 'Na ny asa, na ny teny,\nNa ny hevitra ao am-po,\nMbola tsy madio ireny,\nKa diovy Tompo ô!\nMora aminay ny ratsy,\nSarotra aminay ny to;\nMba ampio tsy ho resy\nIzahay, ry Tompo ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM292', 'Raha mbola atý an-tany\nIzahay izay zanakao,\nMba ampio tsy ho lany\nNy finoanay Anao.\nRy Jesosy Tompo soa,\nTano mafy izahay,\nMba ho azonay tokoa\nIzay anjara lovanay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM293','FFPM 293');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM293', 'Izaho nentina nanatrika\nNy Tompo sy ny fiangonana,\nNy ray sy reny no niantoka\nHitaiza sy hitari-dàlana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM293', 'Ka faly aho fa noraisina\nNatao batisa mbola zaza re,\nNanaovam-panekena masina\nHo zanaky ny Tompo lehibe.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM294','FFPM 294');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM294', 'Ampio aho, Zanahary ô!\nHanaraka ny « eny » masina,\nIzay nataoko taminao, ry To,\nKa tsy mba hisy fivadihana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM294', 'Ry Tompoko, Izay\nnanomboka\nNy asa tsara ao anatiko,\nArovy aho ho tanteraka,\nMba tsy ho faty ny finoako.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM295','FFPM 295');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM295', 'Miorena mafy tsara\nAmin’Ilay Vatosoa,\nMandrosoa, mifahara,\nMifikira mafy koa,\nHe! ny Tompo manambara\nFa ho sambatra tokoa,\nKa ho tsara miafara\nNy mpanompo mahasoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM295', 'Raha misy fahoriana\nIzay midona aminao,\nRaiso re ho fitahiana\nIzay omen’ny Tomponao;\nFa ny lalam-pijaliana\nIzay alehanao izao\nDia mamelom-paniriana\nHitomboan’ny herinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM295', 'Miadia ny ady tsara,\nHo mpandresy hianao;\nTontosay izay anjara\nEo am-pelatananao;\nJeso Tompo no mijery\nSy mahita ny atao,\nKoa dia tsy mba hisy very\nIzay rehetra vitanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM295', 'Ry Jesosy! hatanjaho\nIty mpanolo-tenanao,\nMiangavy, mitalaho,\nKa iteneno, Tompo ô!\nAoka re ho tena taho\nIzay mikambana aminao.\nKa ny foko halalaho,\nDiovy ho Tempolinao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM296','FFPM 296');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM296', 'Ankehitriny\nJereo ry Ray!\nNy mpivahiny\nMiampy   indray;\nKa manomeza hery\nNy fiangonanao,\nMba tsy hiasa irery\nNy olonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM296', 'Avia hitahy\nNy olonao;\nKa ny Fanahy\nOmeonao;\nHo hery izay handrava\nNy toetra ratsinay,\nHo jiro hanazava\nNy lalana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM296', 'Ry Tompo tia!\nTarihonao\nHifankatia\nNy olonao,\nMba tsy ho rava  intsony\nNy fikambananay,\nHamantana ao ambony\nNy dianay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM297','FFPM 297');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM297', 'Ry havanay malala!\nManolo-tena izao,\nFotoana mahafaly\nIraisantsika anio;\nFaly izahay mandray anao,\nHiara-manompo ny Ray,\nJeso anie handray anao!\nMba ho sakaizany tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM297', 'Hajao ny fanekena,\nAdidinao efao\nAtaovy tsy terena\nIzay andraikitrao.\nJereo Jeso, ka matokia,\nFa Izy no hiahy anao,\nKa mandrosoa sy mifalia\nHanefa izay anjaranao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM298','FFPM 298');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM298', 'Aina no fetra, ry Tompo\nMpanjaka!\nAina no fetra anarahana Anao\nKa ny faneva tsy maintsy ho\nzaka,\nNy fanompoana tsy maintsy\nhatao.\nIndreto izahay hilanja faneva :\nIlay hazo izay nanavotana\nanay.\nAn-tsitrapo no anoloranay\ntena,\nKa tano  mba ho Anao  izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM298', 'Aina no fetra ho enty-manoa\nIlay Zanakondry nisolo anay;\nFandavan-tena sy fanaovan-\ntsoa\nNo fianarana atolotra anay,\nIndreto izahay hilanja faneva :\nIlay hazo izay nanavotana\nanay.\nAn-tsitrapo no anoloranay\ntena,\nKa tano  mba ho Anao  izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM298', 'Aina no fetra, ry Tompo\nmalala!\nAino no fetran’ny fitiavanay;\nKa sanatria izay handao na\nhiala;\nMandrakizay, ho Anao izahay.\nIndreto izahay hilanja faneva :\nIlay hazo izay nanavotana\nanay.\nAn-tsitrapo no anoloranay\ntena,\nKa tano  mba ho Anao  izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM298', 'Aina no fetra, ny hofo anefa\nMora mirona ho lavo indray,\nKa manampia, ry Mpandresy\nmahefa!\nO! mba tantano, hazòny\nizahay.\nIndreto izahay hilanja faneva :\nIlay hazo izay nanavotana\nanay.\nAn-tsitrapo no anoloranay\ntena,\nKa tano  mba ho Anao  izahay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM298', 'Aina no fetra, ka ampio,\nry Fanahy!\nAina no fetra, vonjeo e,\nry Ray!\nAina no fetra, izahay re no\nsahy;\nAina no fetra, handresy\nizahay.\nIndreto izahay hilanja faneva :\nIlay hazo izay nanavotana\nanay.\nAn-tsitrapo no anoloranay\ntena,\nKa tano  mba ho Anao  izahay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM299','FFPM 299');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM299', 'Tompo mahery Tsitoha,\nFaly izahay mahatsiaro,\nFa Hianao Izay Loha\nEfa niantso olo-maro.\n:,: Mba hitohizan’ny asa,\nAsa natomboka teto :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM299', 'Raiso ny saotra aman-dera\nNoho ny zavatra vita,\nFa Hianao nampahery\nNy mpiasanao izay tafita.\n:,: Raiso fa Anao samy irery\nNy fahefana sy hery :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM299', 'Dia hamasino ny asa\nSy ny fiezahana mafy,\nEfa nataon’ilay mpiasa\nTamin’ny fo sy ny hafy.\n:,: Ho voninahitrao, ry Tompo\nIzay niantso  azy  hanompo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM299', 'Ary izahay izay mandova\nSy ta-hanohy ny asa,\nAoka ny toetra ho lova\nHoraisinay, enti-miasa.\n:,: Ho voninahitrao, ry Tompo\nIzay efa niantso  mpanompo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM300','FFPM 300');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ny tany izay vangianao,\nRy Jeso Masoandronay,\nTsy maintsy lasanao, Jeso,\nMba hanjakanao avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ny fo sy tany lasanao\nHo feno hasambarana,\nNy loza hosakananao,\nNy soa hampidinina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ny vavakay sy dera koa\nTsy manam-pitsaharana,\nHiakatra Aminao tokoa\nHitady fiadanana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ireo olona voaforona,\nDia àry ho Anao tokoa :\nHohasoavinao ireo\nHanjary masina avokoa.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ny maty hovelominao,\nNy ratsy hohavaozinao,\nNy very hotadiavinao,\nNy diso, re, horaisina.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM300', 'Ry vazantany efatra!\nRy Nosy tanindrazanay!\nMba raiso Ilay Mpanavotra\nHo Tomponao mandrakizay!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM301','FFPM 301');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM301', 'He, sahanao, Mpamonjy ô,\nIzao rehetra izao.\nKa be izao ny vokatrao,\nFa vitsy ny Mpanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM301', 'Indreto, tonga izahay\nHivavaka Aminao,\nHanolotra ny tenanay *\nHiasa ho Anao.\n\n* na Haniraka ny namanay', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM301', 'Ny firenena marobe\nSy nosy mba tahio,\nIndrindra fa ny Nosinay,\nRy Tompo ô tahio.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM301', 'Vimbinonao ny irakay,\nNy feony hamamio,\nIndrindra fa omeonao\nNy zotom-po madio.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM301', 'Tahio re ny olonao\nHihaino sy hanoa,\nMba hahitany Aminao\nNy antra mahasoa.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM302','FFPM 302');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM302', 'Miandry ao ny Tomponao,\nSamia manendry tena,\nFa be ny asa izay hatao;\nAtreho ny firenena!\nTopazy maso kely\nNy ondry izay mania\nIlay zandry lasa niala\nAtaovy hoe : modia.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM302', 'Miandry ao ny namanao,\nMoa ve tsy hovonjena ?\nHatòny re dia ilazao :\nKristy no famonjena.\nTopazy maso kely\nNy ondry izay mania\nIlay zandry lasa niala\nAtaovy hoe : modia.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM302', 'Hevero e! ny Nosinao\nIty Madagasikara!\nMba efa aiza izy izao\nAra-Pilazantsara ?\nTopazy maso kely\nNy ondry izay mania\nIlay zandry lasa niala\nAtaovy hoe : modia.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM303','FFPM 303');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM303', 'O! mandrosoa,\nry mpanaraton’i Jeso,\nIzay no baiko azontsika,\nka mandrosoa;\nJesosy Tompo no mibaiko,\nmandrosoa :\nRaiso ka  arotsahy\nny haratonao.\nMiaingà, namako ô!\nJeso no mibaiko\nMandrosoa, mandrosoa,\nmandrosoa tokoa;\nAza kivy koa,\nna dia  tsy mahazo :\nMandrosoa amin’ny lalina\nkokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM303', 'O! mandrosoa,\nry mpanaraton’i Jeso,\nSaina mora kivy\naoka ho lavinao;\nNy mora kivy\ndia hanenina tokoa;\nRaiso ka  arotsahy\nny haratonao.\nMiaingà, namako ô!\nJeso no mibaiko\nMandrosoa, mandrosoa,\nmandrosoa tokoa;\nAza kivy koa,\nna dia  tsy mahazo :\nMandrosoa amin’ny lalina\nkokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM303', 'O! mandrosoa,\nry mpanaraton’i Jeso,\nMbola ao ny hazandrano\nho azonao;\nTsy azonao anio,\nampitso mandrosoa,\nRaiso ka  arotsahy\nny haratonao.\nMiaingà, namako ô!\nJeso no mibaiko\nMandrosoa, mandrosoa,\nmandrosoa tokoa;\nAza kivy koa,\nna dia  tsy mahazo :\nMandrosoa amin’ny lalina\nkokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM303', 'Mba mitoera,\nJeso ao an-tsambonay\nMba ho renay lalandava\nny teninao;\nNy baikonao, ry Tompo,\nhankatoavinay\nKa harotsakay izao\nny haratonay.\nMiaingà, namako ô!\nJeso no mibaiko\nMandrosoa, mandrosoa,\nmandrosoa tokoa;\nAza kivy koa,\nna dia  tsy mahazo :\nMandrosoa amin’ny lalina\nkokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM304','FFPM 304');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM304', 'He! ali-maizim-pito e!\nSao very ao ny marobe,\nSatana no manjaka ao,\nMivadi-po ny olona ao :\nAvia, ry Masoandronay,\nMba hazavao ny taninay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM304', 'Fa ny mazava ho anay\nAo Aminao, Jehovah Ray!\nMamirapiratra tokoa\nIlay Fitarikandro soa.\nAvia, ry Masoandronay,\nMba hazavao ny taninay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM304', 'Ry Jeso Masoandronay!\nMiandry eto izahay;\nMba misehoa Hianao\nFanilon’ny fanahy ô!\nAvia, ry Masoandronay,\nMba hazavao ny taninay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM304', 'Dia hazavao ny taninay,\nAndrao very eto izahay;\nSavao ny aizim-be izao\nHizorany mankaminao\nAvia, ry Masoandronay,\nMba hazavao ny taninay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM305','FFPM 305');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM305', 'O! miasà, sakaiza,\nJeso no herinao;\nNa misy mafy aza,\nIzy tsy handao.\nDia matokia tokoa,\nFa Jeso momba  anao,\nKa hisy vokan-tsoa\nHifalianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM305', 'Maro ny andro lasa\nIzay tsy nanaovanao,\nKa mbola be ny asa\nIzay tsy vitanao,\nKoa dia mitsangàna,\nHanao tokoa izao,\nHahavitanao tsara\nNy anjaranao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM305', 'Indro fa mihariva,\nFohy ny andronao;\nMoa tsy mba fantatrao va\nKa tsy hitanao ?\nEny, fa manakaiky\nJeso Mpitsara re,\nAry efa ‘mby akaiky\nNy hodianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM305', 'Rehefa tonga Jeso,\nTompon’ny asanao,\nAry hamaly soa\nNy mpiasany.\nMandrakizay doria\nNo hifalianao,\nRaha mpanompo tsara\nMahatoky e!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM306','FFPM 306');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM306', 'Mamafaza voa,\nka  aza mba malaina\nFa tsy fantatrao re\nizay ho vanona\nNa  amin’ny hariva,\nna  amin’ny maraina\nMamafaza voa,\ntsy mijanona.\nMatokia re,\nmatokia re,\nHisy amboara,\nho anao anie!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM306', 'Mamafaza voa\namin’ny mahantra,\nKa  aza mba mifidy\nizay hasian-tsoa;\nFa ny fo mazoto\nsady feno antra\nDia  homen’ny Tompo\nvalisoa tokoa,\nMatokia re,\nmatokia re,\nHisy amboara,\nho anao anie!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM306', 'Mamafaza voa \namin’ny malemy,\nAry mba ampio izay\nreraka ao am-po;\nAsehoy Jesosy\nloharanon-kery,\nAo no anovozy\nizay ilain’ny fo.\nMatokia re,\nmatokia re,\nHisy amboara,\nho anao anie!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM306', 'Miasà sakaiza! \nmilofosa tsara\nDieny misy asa\nazonao atao;\nMatahora sao\ntsy vita ilay anjara\nIzay napetraky\nny Tompo aminao\nMatokia re,\nmatokia re,\nHisy amboara,\nho anao anie!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM307','FFPM 307');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM307', 'Iza no hanompo an’i Jeso\nsoa ?\nIza no hanaiky mba ha Azy\nmoa ?\nHe, ny hatsarany! he, ny\nantra be!\nFa Izy ta-hamonjy, ka meteza\nre!\nJeso Tomponay ô!\nIndreto izahay\nAvy mba hanaiky,\nKa mandraisa anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM307', 'Iza re no mety, iza re, lazao,\nHanome ny fony mba ho Azy\nizao ?\nHe, miantso mafy Jeso\nTompo tia,\nIzay rehetra mety, ô! avia,\navia!\nJeso Tomponay ô!\nIndreto izahay\nAvy mba hanaiky,\nKa mandraisa anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM307', 'Iza no mba sahy, sahy ao\nam-po\nHo miaramila fehin’i Jeso ?\nIza no hiady ady tsara re,\nFa ny fahavalo dia marobe ?\nJeso Tomponay ô!\nIndreto izahay\nAvy mba hanaiky,\nKa mandraisa anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM307', 'Iza re no homba Azy\nankehitrio\nMba hamonjy  ireny azon’ny\nmanjo ?\nIza no hihafy sady hanome\nAndro, hery, saina ?\nMamalia e!\nJeso Tomponay ô!\nIndreto izahay\nAvy mba hanaiky,\nKa mandraisa anay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM307', 'Iza no hazoto mba hiasa\nmoa ?\nIza no handroso mba ho\nhendry koa ?\nIza no hanaiky, iza re ?\nlazao!\nMba ho an’i Jeso, izao anio\nizao ?\nJeso Tomponay ô!\nIndreto izahay\nAvy mba hanaiky,\nKa mandraisa anay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM308','FFPM 308');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM308', 'O! miaingà, miasà izao,\nIrak’i Jesosy hianao;\nNy masoandro miposaka ao\nMba hanazava ny dianao,\n:,: Ka dia mazotoa ô :,:\nO! miaingà, miasà,\nmitoria,\nAza ho kivy, fa mba\nmihafia;\nDia mba lazao ny nataony\ntatý,\nMba hanazava ny maizina\natý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM308', 'O! miaingà, miasà izao,\nKa afafazo ny voanao\nHo ao an-tany mahantra ao;\nJeso Mpamonjy no aronao\n:,: Hitahy ny asanao :,:\nO! miaingà, miasà,\nmitoria,\nAza ho kivy, fa mba\nmihafia;\nDia mba lazao ny nataony\ntatý,\nMba hanazava ny maizina\natý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM308', 'O! miaingà, miasà izao,\nAoka hiezaka fatratra;\nJeso hanambina anao atý\nMandra-pahazo ny vokatra\n:,: Izay valin’ny asanao :,:\nO! miaingà, miasà,\nmitoria,\nAza ho kivy, fa mba\nmihafia;\nDia mba lazao ny nataony\ntatý,\nMba hanazava ny maizina\natý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM308', 'O! miaingà, miasà izao,\nFa mby akaiky ny Tomponao\nMba hanome valisoa anao,\nAraka izay voa  nafafinao,\n:,: Ka dia miasa izao :,:\nO! miaingà, miasà,\nmitoria,\nAza ho kivy, fa mba\nmihafia;\nDia mba lazao ny nataony\ntatý,\nMba hanazava ny maizina\natý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM309','FFPM 309');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM309', 'Iza no hitantara\nNy Tompo Jesosy,\nIlay nandao ny lapa\nKa nidina tatý ?\nNitafy nofo Izy,\nNanetry tena koa;\nKa maty ho Mpisolo\nIzao rehetra  izao\nIza no hitantara (in-3)\nNy Tompo Jesosy ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM309', 'Iza no hitantara\nNy fitiavany ?\nFa tia ny mpanota\nMahantra, very koa;\nKa izay manatona Azy\nDia tsy hariany,\nFa raisiny tokoa\nMba ho sakaizany;\nIza no hitantara (in-3)\nNy fitiavany ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM309', 'Iza no hitantara\nNy zava-marobe ?\nIzay raisin’ny voavonjy\nAmin’ny alalany ?\nTsy mbola hita maso,\nNa ren’ny sofina,\nNa takatry ny saina,\nNy hasoavany;\nIza no hitantara (in-3)\nNy hasoavany ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM309', 'Iza no hitantara\nNy soa be arý ?\nHe! lova tsara fara\nHasolo ny atý;\nAny an-danitra any\nBe haravoana,\nFa ao ny Tompo Jeso\nIzay hifaliany;\nIza no hitantara (in-3)\nNy soa arý ?', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM310','FFPM 310');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM310', 'Misy maro ao an-tsaha\nmitaraina\nKa ento ny jiro mba hankao,\nTsy mba misy antoandro\nna maraina,\nFa maizina re ny ao;\nIndro olo-maro be\nNo maniry mafy hoe :\nMba midína mankatý,\nItondray Baiboly re\nIzy ireo, fa ta-handre\nAn’i Kristy Tompo soa;\n« Mandehana, »\nhoy ny Tompo\n« Mandehana ho amin’izao\ntontolo izao ».\nMitsangàna ary,\neny mitsangàna,\nFa Izy no homba anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM310', 'Mandehana mba hitarika\nny jamba,\nMba ampifalio ny ory fo;\nNy mahantra ilazao fa misy\nlamba\nTsy miova, tsy mety lo;\nJeso Mofon’aina soa,\nSady Ranon’aina koa,\nAsehoy ho hitany,\nTena Andriamanitra,\nTompo tao an-danitra,\nAmbarao ho fantany :\n« Mandehana, »\nhoy ny Tompo\n« Mandehana ho amin’izao\ntontolo izao ».\nMitsangàna ary,\neny mitsangàna,\nFa Izy no homba anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM310', 'Mandehana hanatanjaka ny\nosa,\nOmeo toky re ny ketraka;\nNy anjaranao, ataovy ho\ntontosa,\nKa aza dia reraka,\nMandehana hianao, ka vitao\nny asanao,\nFa ny tambinao arý;\nMbola any ihany re\nNy handraisan-tamby be,\nDia rehefa tsy etý,\n« Mandehana, »\nhoy ny Tompo\n« Mandehana ho amin’izao\ntontolo izao ».\nMitsangàna ary,\neny mitsangàna,\nFa Izy no homba anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM311','FFPM 311');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM311', 'Miely lavitra any\nNy olo-marobe\nKoa iza no hankany,\nHamonjy azy re;\nHanorina sekoly,\nHitory teny koa,\nHamaky ny Baiboly\nMilaza zava-tsoa ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM311', 'Indreny olona ory\nTsinjovy rizareo!\nTsy misy ny mpitory,\nKa moa hafoinareo ?\nTsarovy Jeso Tompo\nNandao ny lapa soa,\nKa tonga mba hanompo,\nNanolotra aina koa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM311', 'Ry Lohan’ny mpiandry!\nTendreo ny irakao,\nFa reraka mandry\nNy ondrikelinao;\nIraho ny mpitory\nHandeha ankehitrio,\nKa tsy handà akory\nHanao veloma anio.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM311', 'Ny tia famonjena\nMiaramila soa;\nIzay manolo-tena\nNo iraka tokoa;\nNa lavitra ny tany,\nHanendry tena hoe :\n“ Izaho no hankany,\nIraho aho e! ”', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM312','FFPM 312');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM312', 'Mitoera, ry Jesosy!\nAo an-tanimbolinao,\nKa amboary izao ny voly\nMba hitombo sy hamoa,\nTomoera;\nIasao ny nosinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM312', 'Mba onenonao ny lasy\nItoeranaoy izao,\nKa ovay ny Malagasy\nMba ho tena zanakao,\nO! nomena;\nHazavao ny nosinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM312', 'Akekezo ireo mpania\nTafaverina Aminao,\nKa tantano mba ho tia\nNy miresaka Aminao,\nO! tariho\nHo Anao ny nosinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM312', 'Dia fohazy ny mpitory,\nMba hanao ny asanao,\nKa hamoha ireo matory\nMba handre ny sitrakao,\nHamasino\nHo Anao ny nosinay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM312', 'O! Jesosy feno antra!\nDera, laza, ho Anao,\nNy lohalika rehetra\nHandohalika Aminao,\nMitoera,\nFa Anao ny nosinay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM313','FFPM 313');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM313', 'Miantra ny firenena,\nRy Jesosy Tomponay!\nAmbarao ny famonjena\nIzay nataonao fahizay;\nAsehoinao ny hery\nNamonjena marobe;\n:,: Ry Mpamonjy olom-bery!\nMamonje indray anie :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM313', 'Mba heveronao ry Nosy\nItoeranay izao;\nIantraonao, ry Jesosy,\nNy tsy mahalala  Anao;\nIantrao ireo faritany\nAnjakan''ny aizim-be,\n:,: Mba ho tonga faingana any\nNy mazava lehibe :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM313', 'Be ny tany tsy voasa,\nVitsy ny mpanomponao;\nKoa izahay mpiasa\nAo an-tanimbolinao\nMba omeo fo minia\nHankato ny teninao,\n:,: Ka aoka mba hikely aina\nIzahay hiasa ao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM313', 'Mankanesa, ry Mpitory!\nAo an-tany lavitra ao,\nBe tsy mahalala  akory\nAn''i Jeso Tomponao,\nHe, ny fahantrany, indrisy!\nHe, ny hadalan''ny ao,\n:,: Fa ny olona tsy misy\nHampianatra azy ao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM313', 'Ny harena anomezo\nSy ny fahendrena koa,\nEny, Kristiana! aelezo\nIzay rehetra mahasoa;\nMankanesa re izay tia\nNy Mpamonjy lehibe;\n:,: Miantrà ka manampia\nNy mahantra marobe :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM314','FFPM 314');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM314', 'Injany, misy feo!\nKa iza no tsy mandre ?\nRy Kristiana, raiso\nAdidy lehibe,\nManerana ny tany\nNy antso avo izao,\nHo an''i Jeso Tompo\nIzao tontolo izao,\nMihobia\nSy mitoria\nNy teny mahafaly\nIzay voarainareo;\nIzao no tena fetra :\nHo an''i Jeso soa\nNy olona rehetra ho Azy\nAvokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM314', 'Tsy ho antsika irery\nNy fahasoavam-be,\nFa ho an''ny olom-bery\nTsy an-kanavaka  e!\nNy fiantran''ny Tompo\nTsy misy fetra, koa\nLazaonareo mpanompo\n''Lay fitiavan-tsoa.\nMiasà.\nKa milazà\nNy teny mampionona\nMahafa-po;\nVoarainareo ny baiko :\nHo an''i Jeso soa\nNy olona rehetra ho Azy\nAvokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM314', 'Ny Tompo no milaza :\n« Andeha mitoria, »\nKa na dia sarotra aza\nNy asa, matokia;\nFa tsy mandeha  irery\nIzay mitondra soa,\nFa omban''Ilay Mahery\nNy irany tokoa,\nKa sahia\nDia  mitoria\nNy famonjena lehibe\nVoarainareo;\nVoatsangana ny saina :\nHo an''i Jeso soa\nNy olona rehetra ho Azy\nAvokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM314', 'Ry Tompo sy Mpanjaka!\nAmpio ny olonao\nHanoa sy hanahaka\nKa hankalaza  Anao,\nDia aoka hokendreny\nIzay katsahinao.\nKa  hahita famonjena\nIzao rehetra izao,\nRy Tsitoha!\nMba manehoa\nNy hery mahagaga izay\nAnananao :\nTongava mba hanjaka :\nKa  angony avokoa\nNy olona navotanao\nRy Tompo soa!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM315','FFPM 315');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM315', 'Ry Ziona, mitsangàna,\nKa mihazavà izao;\nAndrandrao ny fahazavana,\nIzay miposaka  aminao', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM315', 'Maizina ny firenena\nAmin-tany fantatrao,\nFa tsy manam-pamonjena,\nNefa ankohonanao', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM315', 'Atopazy re ny maso!\nMarobe ny zanakao;\nToy ny tany feno hazo,\nEo anatrehanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM315', 'Asandrato ny fanilo\nHanazava lavitra,\nMba ho marobe no hino,\nAn''Andriamanitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM315', 'Ry Jesosy, notahianao\nAnie ny lovanao;\nOlo-maro izay irinao,\nTaomy mora ho Anao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM316','FFPM 316');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM316', 'Maizina ny firenena,\nKoa diso lalana,\nTsy mahita famonjena,\nTia zava-poana;\nEndrey, ny haverezan-tsainy\nLany foana ny ainy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM316', 'Lehibe ny aizin''ota,\nTakona ny lalana,\nHandosiran''ny mpanota,\nNy fahaverezana;\nIndrisy, very re ny aina!\nInjay ny feo mitaraina!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM316', 'Mitsangàna izao, ry mino,\nMandehàna faingana,\nEnto aminy ny jiro,\nAtoroy ny lalana;\nHianao va tsy onena\nNy tsy manam-pamonjena ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM316', 'Dia ento ny mazava\nIzay naseho taminao;\nMazotoa hampisava,\nIzany aizim-pito ao,\nKa ny namanao mahantra\nItorio ny Mpiantra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM316', 'Eny, tsara sy mahery\nNy Filazantsara re!\nAfaka ny olom-bery,\nSambatra ny mahare;\nKa mitandrina tokoa!\nIzany teny mahasoa.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM317','FFPM 317');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM317', 'O, ry Rain’ny fahazavana\ntsy milentika!\nAvy izahay mitondra ny\nfisaorana;\nAloky ny fasanay\nno nipetrahanay,\nNefa andro no nasolonao\nny alinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM317', 'Enga ka handroso tsara\nny mazava e,\nMba ho fantatray tokoa\nIlay manoa hoe :\n« Izaho no fahazavan’izao\ntontolo izao ».\nHanazava sy hanitsy\nizay alehanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM317', 'Ny Fitarikandron’aina\nefa hita re,\nManazava na ny kely\nna ny lehibe.\nMahasoa, mahahendry,\nmahasambatra,\nKa akory re ny andro\nizay hiposaka!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM317', 'Mitsangàna, ry Ziona,\nka mihazavà!\nVoninahitry ny Tompo\nno miposaka;\nAtopazy manodidina\nny masonao.\nNy haren’ny firenena\ntonga aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM318','FFPM 318');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM318', 'Mandrosoa, ry mpanarato,\nAza ketraka izao!\nMandrosoa tsy miato,\nJeso re no herinao;\nKa ny jentilisa maro,\nHavana sy tapaka,\nMba toroy, ampahafantaro\nAn’Ilay Mpanafaka!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM318', 'Mandrosoa, ry mpanarato,\nMiezaha fatratra,\nKa na iza hisahato,\nAza mba matahotra,\nNotolorana adidy\nHianao ka miasà!\nNa ho mamy na mangidy,\nAza fay na mba handà!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM318', 'Mandrosoa, ry mpanarato,\nAo an-drano lalina!\nMisy ve hitora-bato ?\nAnehoy fitiavana!\nRaha kivy ny mpanota\nNoho ny haratsiny,\nEnto any Gologota\nAmin’ny Mpamonjiny.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM318', 'Mandrosoa  re no baiko\nIzay mifehy ahy  izao,\nKa ny tena sy ny aiko\nRaiso, Tompo, ho Anao!\nHe, afoiko manontolo\nIzay ananako izao\nKoa raisonao daholo\nMba ho voninahitrao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM319','FFPM 319');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM319', 'Mba iraho ny Fanahy,\nRy Jesosy Tompo ô!\nMba hanampy sy hitahy\nNy mpiasa irakao.\nTany mafy no asaina,\nNefa kely izahay;\nMarobe no tsy misaina\nRaha itorianay!\nTanteraho re ny toky,\nIzay nomenao fahizay.\nKa mombà anay mpitory\nMandra-podi-mandrinay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM319', 'O, ry Masoandron’aina,\nHazavao ny namanay,\nMba fafazo andon’aina,\nFa  efa toy ny tany hay;\nTapa-kazo no hajainy,\nKa tsy fantany ny To;\nFeno aizina ny sainy,\nEfa momoka sy lo;\nNy sikidy mahavery\nNo ataony solonao,\nSampy vato, hazo kely\nNo hajainy toa Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM319', 'Averenonao ireny\nMba ho tonga olonao;\nTadiavo tsy ho very,\nRaiso re fa lovanao!\nEntonao ny famonjena\nKa ovay ny fony izao;\nAoka hisy sesehena\nNy hanaiky ho Anao!\nDia  hiova re ny tany\nKa hanjary lonaka,\nAry hisy voa mamy\nIzay ho tena vokatra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM319', 'Aoka re mba tsy ho rava\nNy mazava hitanay!\nMba handroso lalandava\nNy anjara asanay,\nMba ho dera aman-daza\nHo Anao, ry Tomponay!\nHatanjaho ny mpiasa,\nDia tsy mba hety fay;\nAoka re ny olo-mino\nMba hamory ho Anao,\nKa hitombo be ny mpino\nHiandany Aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM320','FFPM 320');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Manana fiorenana\nNy fiangonan''i Kristy;\nEla, fa he, tsy levona\nIzy na maro na vitsy;\nVavan''ny olo-masina\nMety ho voatampina,\nNefa tsy maty ny feo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Ny fiangona-masina\nTrano tsy mety mikoa,\nIzy no vato velona\nRafitry ny Ray Tsitoha;\nJeso no fehizorony,\nIsika mirafitra aminy,\nMonina ao ny Fanahiny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Nefa mba misy koa atý\nTrano nataon-tanantsika\nHo voninahitr''i Kristy,\nMendrika ho tiantsika;\nFa ao no andrenesana\nNy tenin''Andriamanitra,\nMamin''ny olona mino.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Ao ny Batisa masina,\nIzay tena ranon''ny aina;\nAo Ilay Mpihaino vavaka,\nTokin''izay mitaraina;\nAo koa ny Fandraisana,\nDia ny sakafo masina,\nTena aman-dràn''i Jesosy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Enga ka mba ho fantatra\nAmin''ny tany rehetra;\nIlay loharano velona,\nSady tsy mety ho ritra!\nRaha  ny lakolosy velona,\nFaly izay mpivavaka,\nFa manantena hihaona.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM320', 'Raiso, ry Kristy, ho Anao,\nNy fideranay anio!\nAmpandrosoy ny teninao,\nNy ondry very vorio\nMandra-pikambany hiray,\nAmin''ny valanao indray,\nFa Hianao no Mpiandry.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM321','FFPM 321');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM321', 'Ry Jesosy Tomponay\nRavoravo izahay;\nTonga izahay izao\nMba hihaona Aminao;\nIndro misy tranonao\nHitokananay izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM321', 'Ka mangataka  Aminao\nIzahay, ry Tompo ô!\nAoka mba horaisinao\nIzay nataonay ho Anao :\nTrano fiangonana\nTrano fivavahana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM321', 'Aoka mba ho fantatray\nEto ny alehanay,\nFa vahiny izahay,\nKa ny tanindrazanay\nDia any Aminao;\nKoa mba tarihonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM321', 'Aoka ny Anaranao\nMba hohamasininao;\nAoka ny Fanahinao,\nMba ho tonga hanavao\nNy mpanota marobe,\nDia hovoavonjy re!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM321', 'Ka ny fiadananao\nAmpombay ny olonao,\nHampikambana ny fo,\nKa ho toy ny iray tam-po,\nMba hifankatiavanay\nIzao sy rahatrizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM322','FFPM 322');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM322', 'Indro, Tompo, misy trano\nIzay namboarinay ho Anao,\nAngatahanay tsodrano,\nItokananay ho Anao\nTompo ô, mba hamasino\nHo fihaonana Aminao,\nHo tempoly tian''ny mino\nFivavahana Aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM322', 'Diovy, Tompo, mba ho trano\nIzay hajaina ho Anao,\nKa omeo sy itokano\nMba ho fideràna Anao.\nTompo masina ô, idiro\nMba ho mendrika Anao\nKa aoka  Hianao ho jiro\nIzay hamirapiratra ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM322', 'Mba tahio, ry Ray Mpitahy,\nHo tempoly masinao\nHo Betelan''ny fanahy,\nVavahady ho Aminao.\nItoero, mba ho kianja\nMahamanina ny fo,\nMba ho trano mendri-kaja,\nMampivavaka ny fo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM322', 'Mandrosoa ka midira\nHo mpanjaka tokana  ao\nKa ny vavaka sy hira\nMba tahio ho sitrakao,\nNefa tsy ny trano ihany\nNo atolotray, ry Ray,\nIndro koa mba itokany\nHo Anao ny tenanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM323','FFPM 323');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Vory ny mpanomponao\nEto anatrehanao,\nRy Jesosy Tomponay!\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nVory maro toy izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Mba atrehonao iizahay \nFa mitokana  eto izao\nNy trano ho Anao :\nHe! faly ny fonay,\nVory maro toy izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Eto hitorianay\nAn''i Jeso Tomponay,\nMpamonjy lehibe :\nHe! faly ny fonay,\nVory maro toy izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Eto hanomezanao\nTsara ny Fanahinao\nMba hanadio ny fo :\nHe! faly ny fonay,\nVory maro toy izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Eto no hanananao\nLaza saotra ho Anao;\nNy maro mba vonjeo :\nHe! faly ny fonay,\nVory maro toy izao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM323', 'Aoka re ny tranonay,\nTrano iangonanay,\nMba ho tempolinao :\nHe! faly ny fonay,\nVory maro toy izao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM324','FFPM 324');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM324', 'Ry Andriananaharinay!\nIsaoranay ny Anaranao;\nNambininao ny tranonay\nKa vita tsara ho Anao :\n(Feo 1-2)\nFenoy, fenoy, fenoy\nNy hamasinanao\nNy tranonay ho tranonao.\n(Feo 3-4)\nFenoy, fenoy\nny hamasinananao\nFenoy ny hamasinanao\nNy tranonay ho tranonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM324', 'Ry Jeso! avy izahay\nHitokana ny tranonao,\nNy trano izay naorinay\nHo voninahitrao anie :\n(Feo 1-2)\nFenoy, fenoy, fenoy\nNy hamasinanao\nNy tranonay ho tranonao.\n(Feo 3-4)\nFenoy, fenoy\nny hamasinananao\nFenoy ny hamasinanao\nNy tranonay ho tranonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM324', 'Avia, Fanahy Masina ô!\nHitoetra eto aminay,\nNy aizinay mba hazavao,\nHanananay fo be fitia :\n(Feo 1-2)\nFenoy, fenoy, fenoy\nNy hamasinanao\nNy tranonay ho tranonao.\n(Feo 3-4)\nFenoy, fenoy\nny hamasinananao\nFenoy ny hamasinanao\nNy tranonay ho tranonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM324', 'Mba raisonao ny deranay\nIzay enti-mankalaza Anao;\nNy trano itokananay\nEkeo tokoa ho tranonao :\n(Feo 1-2)\nFenoy, fenoy, fenoy\nNy hamasinanao\nNy tranonay ho tranonao.\n(Feo 3-4)\nFenoy, fenoy\nny hamasinananao\nFenoy ny hamasinanao\nNy tranonay ho tranonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM325','FFPM 325');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM325', 'Ry Jehovah Tompo soa!\nVory eto izahay,\nKa mifaly avokoa,\nRaisonao ny vavakay!\nAndro fitokanan-trano,\nFifaliam-be izao,\nAmpidino ny tsodrano\nAvy ao an-danitrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM325', 'Ry Jesosy! mandrosoa\nFa Anao ny tranonay,\nHiderana Anao tokoa,\nKa henoy ny hatakay!\nNefa tsy ny vatan-trano\nNo honenanao izao,\nFa ny fo no itokano,\nItoero, hafanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM325', 'Ry Fanahy Mpanazava!\nAnjakao tokoa izahay,\nDia hazava lalandava,\nNy fanahin-janakao;\nKa fenoy fanahy mino\nHo tempolinao tokoa,\nHatrizao dia hamasino\nKa hitombo sy hanoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM326','FFPM 326');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM326', 'Atreho ny mpanomponao\nIzay mivory eto izao\nKa efa nametrahanao\nAdidy masina hatao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM326', 'Hianao, izay Tompon’ezaka\nNifidy anay tsy mendrika\nKa efa nampirisika\nHandroso tsy hiherika.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM326', '‘Ndrisy mpanompo tsy manoa\nIzahay izay nofidinao.\nMpiasa tsy mba mahasoa,\nTompo ô! mifona Aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM326', 'Na dia kely aza izao\nNo azonay atolotra,\nAoka re mba ho sitrakao\nHaroso ho fanatitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM326', 'Dia saotra no omena Anao\nKa raiso re, ry Tomponay\nNy fonay koa onenonao\nSy anjakao mandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM327','FFPM 327');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM327', 'Isaoranay Anao,\nRy Tomponay Tsitoha,\nNy nanomezanao\nMpiasa mahasoa.\nKa nony vao nandre\nIlay antso taminao,\nDia roso ka nandeha\nNanao ny asanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM327', 'Natokanay ho Anao,\nNy taona maro be;\nIlay fitiavanao,\nNataony rehareha.\nNa nisy ny manjo,\nTsy kivy sanatria\nHianao ilay ao am-po\nNanao hoe: « Matokia ».', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM327', 'Izay nataony anie,\nHambininao tokoa,\nHitombo be dia be\nHitera-boka-tsoa,\nHianao Ilay Tompo tia\nNo angatahanay;\nTongava, manampia\nIzay vitany ho anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM327', 'Ka mba tsinjovinao,\nSikino hery indray,\nIty mpanomponao,\nAnio sy rahatrizay,\nIlay teny taminao\nHo aminy anie;\nMpanompo sitrakao\nSatria nahefa be.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM328','FFPM 328');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM328', 'Mba tahio, Jeso ô!\nHira, hatakay sy teny;\nMba tarihonao ny fo\nHanarahanay ireny;\nHianao no Tompon’aina,\nSady mendri-koderaina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM328', 'Izahay mpanomponao\nHody ao an-tokantrano,\nFaly manana Anao,\nKa vimbino sy tantano;\nAza avela ho irery,\nIzahay, fandrao ho very.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM328', 'Saotra no atolotray,\nRaha mbola atý an-tany;\nAo an-danitra indray\nDia dera tsy ho lany\nNo hatao sy hohiraina\nHo Anao ry Tompon’aina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM329','FFPM 329');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM329', 'Saotra, dera, no homena\nHo Anao Mpanavotray,\nHianao manetry tena\nMba hanandratra anay.\nMba tariho Tompo ô!\nNy fanahy sy ny fo;\nTianay ny hiara-dia\nAminao ka tsy hania.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM329', 'Raha ory sy mijaly\nEto aza izahay,\nTsy ho kivy, fa hifaly\nAmin’ny anjaranay.\nHianao ry Tomponay,\nNo mba iankinanay,\nKa inoanay homena\nHo anay ny famonjena.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM330','FFPM 330');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM330', 'Sambatra ny mankatò\nIzay lazain’ny Tompon’aina;\nSy manaiky eram-po\nFa hanolotra ny saina,\nKa mitandrina ny didy\nToy ny zava-tsarobidy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM330', 'Sambatra izay mandà\nRaha taomina hanota,\nKa na dia halatsa-drà,\nTsy mba mety resin’ota,\nTsy ekeny ny mpanimba,\nNa ireo mpanazimba.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM330', 'Sambatra ny olona\nIzay misaina ao am-pony\nAndro aman-alina\nNy lazainao, ry Mpamonjy;\nFa ataonao toy ny hazo\nMaitso tsara, tsy malazo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM331','FFPM 331');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM331', 'Mba soraty ao am-poko\nJeso, ny Anaranao;\nMba arovy tsy haloto\nNy kasen’ny tananao.\nHianao, Jesosy ô!\nNo ho voninahitro :\nHianao, ry voahombo,\nNo Mpanjakako sy Tompo.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM332','FFPM 332');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM332', 'Finaritra ny olonao\nJesosy Tompo ô!\nFa manana ny aim-baovao\nKa ravo eram-po.\nNy famonjena vitanao\nDia efa voaray  izao.\nNy fifaliany atý.\nHitohy hatrarý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM332', 'Izaho va Jesosy ô,\nMba isan’ny Anao ?\nNy solika fitaziako\nMoa misy va izao ?\nHevero ry fanahiko,\nKa aza mety afa-po\nAmbara-pahafantatrao\nFa Jeso no anao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM333','FFPM 333');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM333', 'Hody Tompo, izahay\nMiaraha aminay,\nKa tahio ny teninao\nMba hamorona aim-baovao,\nSao mivory foana\nIzahay mpiangona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM333', 'Marobe ny rafinay\nTa-hamandrika anay;\nTompo, miarova anay,\nSao dia very izahay;\nMitoera aminay\nAo an-tokantranonay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM333', 'Efa renay taminao\nFa anay ny lanitrao,\nEfa namboarinao\nMba ho an’ny olonao;\nKa tariho, Tompo ô,\nHody ao ny Zanakao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM334','FFPM 334');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM334', 'Sambatra ny sofiko\nFa nandre ny teny,\nTenin’i Jesosiko,\nTenim-pamonjeny.\nHe! izaho tiany\nMba hiara-dia\nSy hianatra aminy\nAry tsy hania.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM334', 'Sarotra ny làlako\nSady mampanahy,\nNefa ny Mpamonjiko\nMahatoky ahy;\nVetivety foana\nDia  ho avy Izy\nAmim-boninahitra,\nKa handray ny Azy.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM335','FFPM 335');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM335', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM335', 'Hody izahay, Zanahary!\nTahio tsara izahay;\nAmpifalionao ny fonay\nAmin’ny fitianao :\n:,: Ampifalio :,:\nIzahay etý an-tany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM335', 'Mankasitraka Anao izahay\nNoho ny teny soa\nIzay nampianaranao\nSaina hahasoa anay.\n:,: Tomoera :,:\nAminay isan-andro.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM335', 'Raha ho faty izahay\nKa handao ity tany,\nDia ampifalio izahay,\nEnto ho an-danitra;\n:,: Dia faly :,:\nIzahay mandrakizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM336','FFPM 336');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM336', 'Ampodio izahay, Jehovah,\nAmin’ny fitianao;\nNa  aiza na  aiza no haleha\nAoka hovimbininao :\n:,: O, ambino :,:\nIzahay mpanomponao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM336', 'Fa ny teny renay any\nAoka ho tadidy koa,\nKa mba hiasanay saina\nHahazoanay ny soa\n:,: Isan-andro :,:\nIzay hiainanay  atý.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM337','FFPM 337');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM337', 'Ry Jehovah, Tompo ô!\nTompo masina sy to,\nAzonay ny teninao\nMampandre ny antranao;\nAoka mba harahinay\nKa ho masina aminay,\n:,: Mba hanao ny sitrakao\nIzahay mpanomponao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM337', 'Hody izahay izao\nAmin’ny Anaranao;\nMitoera aminay\nAo an-tokantranonay,\nMba ho velona aminao\nIzahay navotanao;\n:,: Be ny fahavalonay\nKa arovy izahay :,:', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM338','FFPM 338');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM338', 'Arovy aho, Tompo,\nAtolotro izao\nNy tenako hanompo\nSy hankalaza  Anao.\nOmeo ahy hery\nSy faharetam-po,\nArovy tsy ho very\nIzay anjarako!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM339','FFPM 339');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM339', 'Ry Jesosy, mba ampio\nAho ho madio fo;\nRaha mivily ahitsio\nHanarahako ny to.\nMba ampaherezo aho\nHanompoako Anao;\nRaha ory hatanjaho\nMba hifikitra Aminao.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM340','FFPM 340');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM340', 'Tompo ô! mba hasoavy\nSy arovy izahay;\nTompo ô! mba aposahy\nAminay ny tavanao;\nTompo, mitodiha  anay,\nDia hiadana izahay;\nRay sy Zanaka, Fanahy,\nMitahia anay, Amen!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM341','FFPM 341');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM341', 'Tompo ô! ampitandremo\nIzay lazainao izahay;\nHazavao ka mba omeo\nHery ny fanahinay;\nKa ny fo ampionony\nTsy hitebiteby intsony;\n:,: Mba diovy, hamasino\nIzahay, ry Tompo ô! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM341', 'Ka rehefa hodimandry\nIzahay, ry Tomponay,\nTsy ho taitra, fa hiandry\nNy handraisanao anay,\nRy Jesosy Tompon’aina,\nHianao no antenaina,\n:,: Hianao no hanazava\nNy hodianay arý :,:', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM342','FFPM 342');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM342', 'Ny fahasoavan’ny Jesosy\nKristy\nSy ny fitiavan’Andriamanitra\nAry ny firaisana  amin’ny\nFanahy Masina\nHo amintsika rehetra anie,\nAmen!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM343','FFPM 343');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM343', 'Ry Jeso Tompo soa,\nRy Vatolampiko!\nEsory avokoa\nNy hevi-dratsiko.\nOmeo ahy hery,\nArovy tsy ho very\nNy ondry kelinao,\nMba hifalianao;\nJesosy ô! henoy re, henoy.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM344','FFPM 344');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM344', 'Fiadanana be,\nHasambarana re,\nNo miandry antsika  ao\nan-danitra e!\nKa handeha handao\nIzao tontolo izao,\nKa hitady tokoa ilay\ntany vaovao.\nMiaingà hody ao!\nMiaingà hatrizao!\nMba modia hianao (izao)\nAo amin’i Jesosy!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM345','FFPM 345');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM345', 'Mba tarihonao, ry Raiko,\nNy fanahy sy ny foko,\n:,: Mba ho any Aminao! :,:\nO, ry Loharanon’aiko,\nIzao ihany no ilaiko,\n:,: Dia ny hahita Anao! :,:', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM346','FFPM 346');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM346', 'Ny teninao, Jehovah ô!\nVoatory aminay\nTahio tsy ho levona,\nVelominao anie!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM346', 'Izay voatory tsy anay,\nFa avy Aminao,\nKa dia  ny fanambinanao\nNo mba ilainay koa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM346', 'Fa tsy mba ampy ho anay\nNy toriteninay,\nKa tsy ho tokinay ireo,\nRaha  tsy ambininao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM346', 'Dia  ampitoeronao izao\nHo eto aminay\nNy herin’ny Fanahinao,\nMba hahasoa anay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM347','FFPM 347');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM347', 'Derao Andriamanitra,\nFa Izy Loharanon-tsoa\nDerao ny Tompo tokana,\nRay, Zanaka, Fanahy koa.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM348','FFPM 348');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM348', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM348', 'Andriamanitra!\nTahio ny mihaino;\nNy tsy manoa vava-poana\nHahazo ny iriny,\nAndriamanitra\nHo masoandrony;\nKa ny Fanahy Masina\nMpitari-dàlana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM348', 'Ny Anaran’i Jeso\nNo voninahiny;\nNy hamarinan’i Kristy\nNo fihaingony,\nTiavo Jesosy,\nRy mino ny teny!\nKatsaho fihavanana,\nRy tsy mino rehetra!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM349','FFPM 349');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM349', 'Dera re, laza anie!\nHo an’Andriamanitra!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM349', 'Aoka ny tany re,\nMba hiadana anie!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM349', 'Ary ny olony\nAoka hankasitrahany!\n\nNY FIAINANA KRISTIANA\n1. NY ANTSON’NY FILAZANTSARA', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM350','FFPM 350');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM350', 'Hianao, ry Ray, no mibaiko\nHanaovanay ny asanao,\nKa ny handà e mba tsy haiko,\nNa sarotra aza ny atao.\nNy fitoriana lalaina,\nNatomboky ny mpianatrao\nDia tsy azo atao very maina,\nFa he, tohizanay izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM350', 'Fa mbola  adidin’ny mazava\nMitondra ny fanala izao,\nHiainga, handeha hampisava\nNy aizina  ao an-ala ao.\nIreo rahalahy sy rahavavy\nDia be tsy mahalala  Anao\nKoa indro, Tompo, aho avy\nHitory ny Anaranao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM350', 'Kanefa tsy ny eto ihany\nNo anirahanao anay,\nFa na ny any lavitra any\nDia samy mbola  adidinay.\nHiezaka, hikely aina,\nHamafy koa ny teninao\nIzay hany tena mofon’aina,\nHo an’izao tontolo izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM351','FFPM 351');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM351', 'Tsy hangina re ny hoby,\nnoho hianao ry Ziona;\nFa miposaka aminao\nny fahazavana soa;\nNy fanilom-pamonjena,\nindro fa torina\nHanazava ny olona tokoa.\nMivoaha, asandrato ny\nfaneva soanareo;\nTsenao re ny Mpanjaka,\nfa avy aminao\nNy famonjeny sy ny lova\nizay atolony anao\nSatria hianao dia tsy foiny.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM351', 'Voninahi-panjakana\nisaloranao\nSy anaram-baovao no\niantsoana anao\nFampakaram-bady, fety\nanaingàna anao\nMba ho an’i Kristy,\nIlay Tomponao.\nMivoaha, asandrato ny\nfaneva soanareo;\nTsenao re ny Mpanjaka,\nfa avy aminao\nNy famonjeny sy ny lova\nizay atolony anao\nSatria hianao dia tsy foiny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM351', 'O! Ry mpiambina tinendry\neo ambony manda,\nAza  avelanao hangina re\nny feonao\nKa hijoro izao ny mino,\nfa tsy hisy banga\nEo an-tobin’i Jeso Tomponao.\nMivoaha, asandrato ny\nfaneva soanareo;\nTsenao re ny Mpanjaka,\nfa avy aminao\nNy famonjeny sy ny lova\nizay atolony anao\nSatria hianao dia tsy foiny.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM352','FFPM 352');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM352', 'Fantatrao va ny Mpamonjy,\nIlay Tompon-danitra ?\nJeso, Kristy sy Mpanjaka,\nZanak’Andriamanitra.\nIlay nandao ny lapan-dRainy\nFeno voninahitra,\nTompo tonga mba hanompo,\nNoho ny fitiavana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM352', 'Eny, zava-mahagaga,\nFietrena lalina :\nSaro-bidy ka tsy foiny\nIsika olombelona.\nIlay Mpisorona Ambony\nIzao no asa sorona,\nKa manolotra ny ainy\nMba ho fanavotana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM352', 'Ao ny lanitra mivoha\nMiantso anao hiakatra;\nAoka tsy hiroa saina,\nManapaha hevitra.\nHe mitsotra moramora\nMba handray ny tanany;\nMitodiha : izao no ora,\nManeke ho zanany.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM353','FFPM 353');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM353', 'Mba sainonao ange,\nSao tsy mba fantatrao\nNy zava-dehibe\nNataoko ho anao :\n:,: Hevero, ka lazao, lazao\nIzay mba vitanao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM353', 'Ny lapako tarý,\nNy fahefako tao,\nNilaozako tatý\nHanavotra aina anao :\n:,: Hevero, ka lazao, lazao\nIzay mba foinao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM353', 'Heveroronao ange,\nNy nisoloanao anao;\nNangidy indrindra anie\nNy nahazoana anao :\n:,: Hevero, ka lazao, lazao\nIzay mba nentinao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM353', 'Endre! ny aiko koa\nNomeko ho anao;\nTsy misy zava-tsoa\nTsy foiko ho anao :\n:,: Hevero, ka lazao, lazao\nIzay mba taminao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM353', 'Ry Tompo be fitia!\nEndrey, ity vitanao;\nIzaho izay mpania\nTsy mahavaly izao :\n:,: Ny aiko no mba raisonao\nHanao ny sitrakao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM354','FFPM 354');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM354', 'Ny Mpamonjy no mitady\nFihavanana aminao;\nIzy no manambitamby\nHanatonanao izao;\nSao manjary fandatsana\nNy fifonana aminao,\nKa ny mety, mihavàna\nAmin’ny Mpamonjy izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM354', 'Dieny misy hafanana\nKa mangoraka ny fo,\nManatòna ny Mpamonjy\nSao dia mangatsiaka indray\nIzao no andro famonjena,\nKa vonjeo sao neninao;\nRy mpanota, miverena\nIzao ankehitriny izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM354', 'Sao ity no toriteny\nFara-fanasana  anao;\nSao anio no fotoana\nFara-fahavelomanao :\nKa aza mba misalasala,\nSao manjary neninao,\nRaha tsy mety mahalala\nIzao fotoana mety izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM354', 'Indrisy! be ny fahotako,\nBe ny ratsy vitako;\nSao tsy raisin’ny Mpamonjy\nNy mpanota tahaka  izao ?\nMiverena, fa ny rany\nAmpy hahadio anao;\nManatona hosasany\nIzao ankehitriny izao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM355','FFPM 355');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM355', 'Ry namako mahantra\nManaram-po izao!\nNy ota no mandratra,\nSao simba hianao;\nIzay anao rehetra\nHo lasa avokoa,\nFa tsy mba misy fetra,\nHo levona avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM355', 'Ny Tompo be fiantra\nMangora-po tokoa\nMahita anao mahantra\nFa tsy mahita soa;\nNatolony ny ainy\nHo vidin’ny ainao,\nNalatsany ny rany\nMba hanadio anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM355', 'Ny Tompo malahelo,\nTsy foiny hianao,\nNy feo mamelovelo\nMibitsika aminao;\nOnena anao ny fony\nKa mitaraina hoe :\nNy ota ajanòny,\nMba ajanòny re!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM356','FFPM 356');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM356', 'Ry mpanota! mihevera,\nFa miantso Kristy izao :\nIzy ta-handray mpanota\nManatòna hianao :\n:,: Mihainoa, mihainoa,\nKa ario ny ditranao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM356', 'Ry mpanota! miverena\nAo am-balan’i Jeso;\nAza dia mirenireny,\nSao iharan-doza izao\n:,: O! modia, O! modia,\nIalao ny ditranao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM356', 'Ry mpanota! manatòna\nDieny misy antso izao\nFa ho avy ny fotoana\nMbola hanenenanao :\n:,: O! avia, O! avia,\nIzao ankehitriny izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM356', 'Ry mpanota! matokia,\nTompo mora fo Jeso;\nIzy dia tena tia\nIzay mibebaka tokoa :\n:,: Matokia! matokia,\nMibebaha re izao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM356', 'Ry Sakaizan’ny mpanota,\nEnto aho ho Anao;\nHe! ny tenako rehetra\nNo atolotro izao :\n:,: Raisonao re, raisonao re,\nHo fanati-tsitrakao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM357','FFPM 357');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM357', 'Efa tonga atý izao\nTeny fiainana :\nRaiso mba ho fiainanao,\nTeny fiainana.\nHe! ny teny tsara,\nTeny manan-kery;\nTenin’ny Ray\nTsara tokoa\nTeny fiainana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM357', 'Io no Filazantsara soa,\nTeny fiainana :\nTeny mamy indrindra koa,\nTeny fiainana.\nRaisonao ny teny,\nTeny soa nomeny :\nTenin’ny Ray\nTsara tokoa\nTeny fiainana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM357', 'Ry mpanota! henoy izao,\nTeny fiainana :\nFa fiainana ho anao,\nTeny fiainana.\nKristy no nomena\nMba ho famonjena :\nTenin’ny Ray\nTsara tokoa\nTeny fiainana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM358','FFPM 358');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM358', 'He! ry namako mahantra,\nIndro Jeso Tompo tia,\nIlay Mpamonjy feno antra,\nNo mitady ny mania;\nOlom-bery tsy mba foiny,\nKa na diso aza re,\n:,: Mbola tiany sy antsoiny\nHanam-pifaliam-be :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM358', 'He! fa tsy mba misy fetra\nNy homena lova soa\nFa ny olona rehetra\nSamy tiany avokoa;\nNefa  izay be hataka  andro\nDia hanenina tokoa;\n:,: Misy fetra ny fotoana\nAzo amindrana fo :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM358', 'Manatòna ankehitriny, \nRy mpanota ory fo!\nMba hesoriny ny tsiny\nKa hadio indray ny fo;\nFa ny ota hosasany\nDia ho afaka avokoa,\n:,: Izany re no fikasasny\nKa tsy maintsy to tokoa :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM358', 'Fa izay mandà ny teny\nSy maditra, mafy fo,\nHampangain’ny teny reny,\nFa tsy nety nakatò;\nJeso Tompo no hitsara\nSy hamaly ny natao,\n:,: Nefa kosa ny anjara\nDia miankina aminao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM359','FFPM 359');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Tsy renao va ny feon’ny Ray,\nRy malahelo fo!\nMiantso hoe : « Avia, avia,\nModia hianao! »', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Ny Rainao be fitiavana\nHifaly aminao,\nKa hanome malalaka,\nRaha hody hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Na diso aza hianao,\nMitebiteby koa,\nNy Rainao ta-handray anao\nHo sambatra tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Modia an-tranonao arý,\nMahantra hianao;\nTsy misy zava-tsao atý\nHahafa-po anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Ny lamba efa rovitra\nHesorina aminao,\nKa hafa tsara lavitra\nNo hitafianao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM359', 'Mba maneke ny teniny\nAnkehitriny izao,\nFandrao dia hisy loza re\nHihatra aminao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM360','FFPM 360');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM360', 'Mba hevero, ry mpanota!\nNy nataon’ny Tomponao :\nIzy tsy mba manana ota\nNefa tonga solonao;\nHe! ny lanitra nafoiny\nMba hidinany tatý\nOlom-bery no antsoiny\nMba handova ny arý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM360', 'Mba hevero, ry mpanota!\nFa nijaly Jeso tia,\nMaty tany Gologota\nMba hamory ny mania,\nIndro, latsa-dra ny Tompo\nNefa tsy mba diso re!\nFa nisolo ny mpanompo\nIzay  nanohitra   elabe.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM360', 'Mba hevero, ry mpanota!\nAlatsaho ao am-po;\nMahavery re ny ota\nRaha tsy voadio ny fo,\nMangataha ankehitriny,\nDia hodiovin’i Jeso,\nFa izany no iriny\nMba handraisanao ny soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM360', 'Mba hevero, ry mpanota!\nNy fifonana aminao\nHahafoizanao ny ota\nTena fahavalonao.\nManatòna hovonjena\nSao hiharan-doza be!\nManatòna, fa homena\nFifalian-dehibe.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM360', 'Mba hevero, ry mpanota!\nInona ary no hatao ?\nAza mety resin’ota,\nTiavo Jeso Tomponao;\nNy lalàny no araho\nSitrapony tontosay;\nNefa Izy angataho\nHomba anao mandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM361','FFPM 361');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM361', 'Manatòna, ry malala!\nAn’i Jeso Tomponao;\nRaiso re ny famonjena,\n:,: Tsy ho faty hianao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM361', 'Indro Jeso, fa miandry\nMba handray anao izao;\nMiverena aza kivy,\n:,: Mazotoa, sy matokia :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM361', 'Aza mba mangataka andro,\nSao dia tratra hariva etý\nTahotra sy horohoro\n:,: Hampivadi-po anao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM361', 'Ao ny tany soa homeny\nMampifaly fo erý\nSady tsy mba misy ratsy,\n:,: Mandrosoa ho tonga arý :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM362','FFPM 362');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM362', 'Tsy fantatrao va Ilay namonjy\nanao ?\nRy havako ory izao ?\nMitady anao Ilay namonjy\nanay.\nManiry hamonjy anao;\nMihainoa ny hamonjy anao\nManao hoe : “ Manatòna\nanio,\nNa dia be aza ny ratsy\nnatao,\nDia mety ho afaka  izao. ”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM362', 'Fa tonga tatý Ilay namonjy\nanay\nKa nampijaliana tokoa;\nNy rany izay namonjeny\nanay\nHamono ny helokao koa;\nMihainoa ny hamonjy anao\nManao hoe : “ Manatòna\nanio,\nNa dia be aza ny ratsy\nnatao,\nDia mety ho afaka  izao. ”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM362', 'Misento anao Ilay namonjy\nanay,\nRy olo-mahantra atý!\nTomany anao Ilay namonjy\nanay\nFandrao dia ho very arý;\nMihainoa ny hamonjy anao\nManao hoe : “ Manatòna\nanio,\nNa dia be aza ny ratsy\nnatao,\nDia mety ho afaka  izao. ”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM362', 'Henoinao izao ny hamonjy\nanao,\nHiadam-pinaritra am-po;\nFaingàna handray ny homeny\nanao\nDia lova tsy mety ho lo;\nMihainoa ny hamonjy anao\nManao hoe : “ Manatòna\nanio,\nNa dia be aza ny ratsy\nnatao,\nDia mety ho afaka  izao. ”', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM363','FFPM 363');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM363', 'Ry olo-mahantra\nMihainoa izao!\nSaino tsara ny teny\nIzay lazaina aminao;\nRy olo-mahantra!\nModia, modia,', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM363', 'Fa ela dia ela\nHianao no nania,\nTsy nahita ny tsara,\nTsy nahazo ny soa;\nRy olo-mahantra!\nModia, modia,', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM363', 'Tsy misy mpiantra\nMba hitsinjo anao\nAfa-tsy ny Mpamonjy,\nIzay mitady anao;\nRy olo-mahantra!\nModia, modia,', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM363', 'Tsarovy ny Rainao\nMalahelo anao\nKa miandry tokoa\nHampandroso anao;\nRy olo-mahantra!\nModia, modia,', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM364','FFPM 364');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM364', 'Ry mpanota! ry mpanota!\nRaiso Jeso Tomponao,\nAza mba misalasala,\nManatòna Azy izao.\nKa ekeo ny feon’i Jeso\nIzay nifona ho anao\nTeo ambony hazo avo\nMaty Izy ho anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM364', 'Indro Jeso, ry mpanota!\nFaly hohatoninao,\nSady Tompo tsy mandatsa,\nFa mamindra fo tokoa,\nKa miteny moramora\nTa-hamela heloka :\nManatòna, ry mpanota!\nMba handray ny avotrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM364', 'Ry mpanota! ry mpanota!\nMisy vonjy ho anao,\nKa toneo ny alahelo\nMampahory fo anao;\nAza mety resin’ota,\nFa jereo ny Tomponao;\nIzy no handresy tsara\nIzay miady aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM364', 'Hianao tsy manan-toky\nHo mpamela heloka,\nAfa-tsy ny Tompo Jeso,\nIlay nanavotra aina anao;\nKa aza mba misalasala,\nRy mpanota very ô!\nFa azonao ny lova tsara,\nRaiso Jeso Tomponao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM365','FFPM 365');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM365', 'He! ry mpanota ana, sasatra,\nMitondra fahoriana lehibe;\nJeso mpanavotra olo-meloka\nNo mahavonjy ny fanahinao.\nMatokia ny mpamela helokao,\nAza kivy, tsy ho faty hianao;\nMatokia re, matokia re,\nMatokia,\nJeso tsy handao anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM365', 'Indro ny fitiavan-dehibe!\nNy ainy tsy nataony ho\nzavatra\nHamonjy ny mpanota meloka\nSy manana entana mavesatra.\nMatokia re, matokia re,\nMatokia,\nJeso tsy handao anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM365', 'Mba mahareta, Jeso aminao\nNy tanany mahery hiambina\nAza malaky resin-tahotra,\nFa Izy tsy hiala aminao :\nMatokia re, matokia re,\nMatokia,\nJeso tsy handao anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM366','FFPM 366');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM366', 'Andeha, ry hava-malala!\nAndeha hiaraka izao,\nHitady fonenana tsara\nHonenana mandrakizay\nAo amin’ny tanin’ny Tompo\nNy fahasambarana be,\nNy ota tsy miditra akory,\nTsy misy ny loza manjo,\nDia aoka hiaraka isika,\nRy hava-malala izao!\nHitady fonenana tsara\nHonenana mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM366', 'Ny trano dia maro tokoa,\nMifaly ny mponina ao,\nTanteraka soa ny aleha,\nFitia omena ny ao;\nMiara-midera ny Tompo,\nMpanavotra be indrafo;\nMiara-mandova ny soa,\nMitafy ny lamba madio.\nDia aoka hiaraka isika,\nRy hava-malala izao!\nHitady fonenana tsara\nHonenana mandrakizay.\n\n3-Na ety ny lalana aza,\nNa maro ny zava-manjo,\nDia aza matahotra akory,\nMandroso ny mety hatao;\nAnjely tsy tambo isaina\nHirahin-kanampy anao;\nMpanompo ny Avo indrindra\nHitoby hiaro anao.\nDia aoka hiaraka  isika,\nRy hava-malala izao!\nHitady fonenana tsara\nHonenana mandrakizay..', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM367','FFPM 367');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM367', 'Ry zanako mania!\nHenoinao izao :\nIzaho be fitia\nMangora-po anao;\nRy zanako! modia,\nSao maty hianao,\nFa be ny bibidia;\nModia re!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM367', 'Ny zavatry ny tany\nSao mahasimba  anao,\nHarena mety lany\nTsy mahavonjy anao;\nIzaho irery ihany\nNo hiadananao;\nKa mbola manontany :\nTsy hody va ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM367', 'Mamiratra jerena\nNy lalan-tsitrapo\nFa akoso-bolamena\nMamitaka ny fo;\nNy sitrapon’ny tena\nMamery ny ainao,\nArio ka miverena,\nModia re!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM367', 'Izaho Tompon’aina,\nNijaly ho anao,\nKa he, manolotra  aina\nMba hamonjena anao;\nNy rako mitaraina,\nModia hianao;\nKa aza mba malaina,\nModia re!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM368','FFPM 368');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM368', 'Manatòna ry mpanota\nOry, jamba, very koa!\nHianao simban’ny ota,\nIndro, ao ny Tompo soa\nRy tsy mendrika hovonjena,\nMisy izay miantra  anao;\nFifaliam-be homena,\nFamelana helokao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM368', 'Mba henoy ny teny tsara\nIzay lazaina  aminao,\nSao very ny anjara\nSoa tadiavinao;\nFeno antra, manan-kery,\nJeso no mitaona anao,\nKa ny mino tsy ho very,\nManatòna re izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM368', 'Ny miato tsy mba tsara,\nNy halainanao ario;\nSao helohin’ny Mpitsara,\nManatòna re anio;\nHe! miandry ny Mpamonjy,\nMba faingana hianao;\nRaha te ho voavonjy,\nAza ela hianao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM369','FFPM 369');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM369', 'Faingàna ry hava-malala,\nHatòny ny Tompo izao,\nNy fo sy ny feo asandrato,\nDerao Ilay nanavotra anao,\nNy avotra ny famonjena,\nIzay vitany tao Kalvary,\nNo fanantenan’ny mpanota\nHahazo fiainana arý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM369', 'He Izy mitondra irery\nNy mafy, nisolo anao,\nKa maty hamonjy ny very;\nNy rany nandriaka tao.\nNiaritra latsa sy eso,\nNy hombo sy lefona koa;\nNivesatra ota Izy teto\nHanananao fiainana koa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM369', 'Endre! ny fitiavan’i Jeso,\nRy olo-mahantra, jereo!\nNijaly hamonjy, hevero,\nNy ota mahazo ekeo;\nEkeo, fa ny fo mihamafy,\nDia loza manenjika anao;\nFaingàna hamonjy ny ainao,\nHararaoty ny andro izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM369', 'Ny masom-panahy atopazo,\nNy lanitra no andrandrao;\nNy Tompo maniry hamonjy,\nHenoy fa miantso anao.\nFaingàna, ry hava-malala!\nModia an-tranon’ny Ray;\nMiandry anao re ny lova,\nFiainana mandrakizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM370','FFPM 370');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM370', 'Mba henoy ny feon’i Jeso,\nRy mpanota very ô!\nAtsaharo re ny ota,\nIzay mamery aina anao;\nJeso Tompo no miantso,\nAoka tsy ho lavinao;\nDieny mbola re ny antso,\nManatòna hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM370', 'Izao no tenin’ny Mpamonjy\nIzay lazainy aminao :\n“ Manatòna Ahy, Vonjy\nSy Mpamela helokao;\nIzaho, Tompo feno antra,\nHanome anao ny soa,\nKa ny helokao rehetra\nDia ho afaka tokoa ”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM370', 'Izaho koa no Vavahady\nIzay hidiranao izao,\nSady Lalan-toratady\nIzay mankao an-danitra ao;\nIzaho dia Mofon’aina\nSady Raon’aina koa;\nTsy mba misy miala maina\nIzay rehetra tia tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM370', 'Indro, efa maty Aho\nHanavotako anao;\nMoa tsy hatolotra Ahy\nNy fanahinao izao ?\nRy mpanota! mihevera,\nAoka izay ny ditranao,\nManatòna, manatòna\nAhy, Jeso Avotrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM376','FFPM 376');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM376', 'Mpanota ory sy mahantra\nHenoy ny teny ho anao\nJesosy Tompo be fiantra,\nNisolo voina anao,\nKa Izy feno indrafo\nMitaona anao hiova fo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM376', 'Jesosy Tompo sy Mpamonjy\nMiantso ny anaranao\n« Mpanota very mila vonjy\nMinoa Ahy hianao;\nNy sainao aoka ho vaovao,\nNy fomba ratsy ialao! »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM376', 'Jesosy koa mampahery\nNy sasatra ao an-dalana;\nNy rany soa manan-kery\nHahafaka ny entana;\nJesosy tsy mandroaka\nNy ory izay manatona.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM376', 'Ka itokianao ny teny\nNaloaky ny vavany!\nNy mino Azy hovonjeny\nHanatrika ny tavany.\nSakaizako mahantra ô!\nArio ny famoizam-po.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM377','FFPM 377');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM377', 'Tsy mba hisy tonga arý\nan-danitra\nRaha tsy mandrombaka\ntokoa;\nNy mpiady tsara izay\nmaharitra\nNo handray anjara lova soa.\nEty sady tery ny vavahady ao,\nKely sy mideza ny lalana\nmankao;\nNefa aza kivy, ry havako izao,\nFa izay malaina dia ho very.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM377', 'Maro no mitady hisakana\nanao,\nKoa mba tohero, ry sakaiza;\nMba reseo mafy ny\nfahavalonao.\nFetsy izy  ireo ka mahaiza,\nIzay rehetra mamin’izao\ntontolo izao\nDia avelao, fa mamandrika\nanao;\nAoka mba Jesosy no\nhifalianao,\nEny hifalianao tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM377', 'Satroboninahitra tsy ho\nazonao\nRaha tsy katsahinao tokoa\nFa hevero kosa ny fifalianao\nRaha tonga ao an-dapa soa,\nFa hahita maso ny Tompo\nhianao,\nKa hifaly amin’\nAndriamanitrao.\nKoa miomàna re,\nry sakaiza ô!\nMba ho faly ao am-pitsarana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM377', 'Dia miangavy, mangataka\naminao,\nMba modia, ry mpirenireny!\nFa ny Tomponao ta-handray\nanao izao.\nHianao tsy sitrany ho very.\nIzy dia mananty ny tanany\nizao\nKa ny fonao simba mba\natolorinao\nHosoloan’i Jeso fo tsara sy\nvaovao;\nIzany mba hevero, ry sakaiza!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM378','FFPM 378');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM378', 'Ho aiza, ho aiza izao hianao\nRy havako izay mbola tia\nNy fomban’ny nofo manimba\nanao ?\nAvia ry olo-mania!\nHenoy fa miantso ny Tompo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM378', 'Ho aiza, ho aiza izao hianao,\nRy havako mbola tamana\nAo amin’izao fivelomana izao,\nKa fatra-pikiry hitana\nIzay zavatra halan’ny\nTompo ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM378', 'Hevero fa tsy mba mahafaka\nanao,\nKa tsy mba heken’ny Mpitsara\nNy fahamarinana ao aminao;\nNy an’i Jesosy no tsara,\nKa dia katsaho ny Azy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM378', 'Ekeo ny tenin’ny Tompo soa\nInoy ny toky nomeny,\nKa dia ho hita ny lalam-\nbaovao,\nIzay voatoron’ny teny :\nJesosy no lalana tsara.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM379','FFPM 379');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM379', 'Torotoro va ny fonao,\nRy mpanota re, izao ?\nKa ifonanao tokoa\nVa ny hadisoanao ?\nHianao va mitomany\nKa maniry mba ho any\nAmin-Jeso, Izay nandany\nRe ny ainy ho anao ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM379', 'Ny Fanahin’ny Mpamonjy\nMoa nangatahinao\nHampandray anao ny vonjy\nHahamasina anao ?\nMoa fantatrao tokoa\nFa ny rany mahasoa\nDia avotra naloa\nMba hahafa-trosa anao ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM379', 'Maro no manaiky  ihany\nAraka ny vavany,\nFa hanoa ny Mpamonjy,\nKa ho tena havany.\nNefa kosa mbola tia\nFomba ratsy, ka mania,\nDia tsy handray fitia\nRaha ao am-parany.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM379', 'Koa dia miangavy\nAho, ry sakaizako\nMahereza mba hitady\nFiadanana ao am-po\nMba hatòny ny Mpamonjy,\nAngatahonao ny vonjy\nDia tsy maintsy ho tra-bonjy,\nJeso no mamindra fo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM380','FFPM 380');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Mba mifohaza re, henoy izao\nNy hafatra ataon’ny\nTomponao,\nNy Tompo, izay Mpanjaka\nmanan-kery\nMikatsaka anao,\nry olom-bery!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Dondòniny ny fo, ka hianao\nMandrindrina ny\nvaravaranao!\nTandremo sao dia sasatra ny\nfony,\nSao lasa Izy ka tsy avy\nintsony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Fa indro Izy mbola atý izao\nMitady hampiverina anao\nKa aza lavina ny Tompo tsara,\nSao hianao ho ratsy fiafara.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Faingàna ary, ka ampandrosoy\nIlay Sakaiza Izay nahafoy\nNy ainy hoanao mpanota very,\nTsy misy Mpamonjy afa-tsy\nIzy irery', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Ifony aminy ny helokao,\nHariany ka tsy ho hitanao,\nKa hianao izay mendrika ho\nvoa\nHatsangany ho zana-dRay\nTsitoha', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Ka raha renao ao anaty fo\nNy fiadanana izay mahatò\nNy famelana ny helokao\nrehetra\nDia aoka mba handrasanao ny\nfetra.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Akaiky re ny fahafahana,\nKa mba zakao ny\nhatrotrahana,\nHo avy faingana Jesosy\nTompo\nKa dia ho afaka  ady ny\nMpanompo.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM380', 'Rehefa hitanao ny Tomponao\nDia  afaka ny hasasaranao,\nHijanona ny sento sy taraina\nFa hobin-danitra no\nhohiraina.', '8');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM381','FFPM 381');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM381', 'He, ny  fiantsoana\nFeno fitiavana,\nTeny masina sy to\nHo anao, ry ory fo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM381', 'Hoy Jesosy Tomponao :\n« Manatòna Ahy, re,\nRy miasa fatratra\nSy mavesatra entana! »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM381', '« Fa Izaho hanome\nFitsaharan-dehibe\nSy fiainana vaovao\nHahasambatra anao »', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM381', 'Ry Mpamonjy tsara ô!\nSaotra no atolotro;\nKa ampio aho izao\nFa manaiky ho Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM382','FFPM 382');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM382', 'Ry olo-matory ô! mba\nmifohaza,\nFa indro Kristy,\nIlay Fahazavana Izay tena\nmalaza,\nDia tonga atý,\nKa aza matory,\nFa mba atolory\nNy fonao izao\nMba hanazavany anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM382', 'Atý dia matevina sady mahàna\nNy zavona be;\nNy sento, taraina sy\nfitomaniana\nDia misy anie,\nRy olo-mahantra,\nJereo ny Mpiantra\nHenoinao izao\nJesosy nanavotra anao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM382', 'Atý dia mangentana sady be\nady,\nKa maro no voa;\nTsy tambo isaina ireo mitady\nFiadanana am-po\nDia  aza tomany,\nFa eto ihany\nIlay nanome\nNy fahasoavana be!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM382', 'O, miandrandrà ka jereo ao\nambony,\nFa  antoandro izao,\nFalia toa zaza, tahafo ny fony,\nNy Tompo derao,\nNa misy ny onja\nSy ota mandoza,\nDia mbola derao\nJehovah Mpiaro anao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM382', 'O, mendrika hankalazaina\nJehovah\nIzay manome\nNy lalana sy fahamarinana\nkoa\nSy fiainana be\nTsilovy, ry Kristy,\nNy lala-mahitsy\nIzorako izao,\nTantano re ny zanakao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM383','FFPM 383');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM383', 'O, ry mpanota, aza mandà,\nJeso miantso, ka miovà;\nMba manatòna Azy izao,\nIzy hamonjy anao.\nHe, mivoha izao ny lanitra,\nRy mpirenireny lavitra;\nIndro Jesosy, Izy no ao;\nAiza no hisy anao ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM383', 'Be ahiahy va hianao\nNo tsy mandroso faingana\nizao ?\nDia tapaho ny hevitrao,\nKa miovà hatrizao.\nHe, mivoha izao ny lanitra,\nRy mpirenireny lavitra;\nIndro Jesosy, Izy no ao;\nAiza no hisy anao ?', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM383', 'Mba miverena re hatrizao,\nKa hararaoty ny andronao,\nFa ny atý ho simba sy lao,\nKa mba modia izao.\nHe, mivoha izao ny lanitra,\nRy mpirenireny lavitra;\nIndro Jesosy, Izy no ao;\nAiza no hisy anao ?', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM384','FFPM 384');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM384', 'Ry olom-bery, tsy ho very\nFoana ny androanao,\nRaha ‘mby an-tsainao, fa ny\nainao\nTsy fanananao,\nNy hery misy, nefa indrisy,\nResim-pahalainana!\nAtý an-tany mora lany\nNy fiainana.\nMba mazotoa, ry havako,\nKa aoka hoheverinao\nNy andro lasa, sao ny asa\nTsy ho vitanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM384', 'Ka manenena, miambena,\nMivavaha hianao!\nEfao ny ady, ao ny kiady\nVoninahitrao.\nMba ahitsio ankehitrio\nNy dia sisa hatrizao,\nFa be ny simban’ny\nmpanimba\nKa migadra izao.\nSakaiza, ô fantaronao,\nFa nijalian’ny Tomponao\nNy fahotana tsy ialana,\nIlalaovanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM384', 'Dia mba ampio sy tahio\nIzahay, ry Tomponay,\nFa mba hiady ka hitady\nVonjy ho anay.\nHomenao soa ny manoa\nAmin’ny fotoanao.\nO, ry Mpanjaka avia haka\nNy malalanao,\nNy olonao dia te hankao\nAn- danitra fonenanao.\nRy Jeso tia, mba avia\nFaingana izao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM385','FFPM 385');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM385', 'Ry Mpamonjy be fitia\nNo miantso hoe: Avia!\nRy mahantra, raiso izao\nFamonjena ho anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM385', 'Hoy  ny Tompo :\nRy mpanota,\nManatòna, fa ny ota\nVoavela, anaka \nAfaka ny helokao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM385', 'Teny mamy, re izany,\nFaly ireo mitomany,\nKa araho hatrizao,\nDia ho sambatra hianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM385', 'Ry Jesosy, Izay Mpiantra,\nIzaho ory sy mahantra,\nKa ampio aho izao\nFa Mpamonjy Hianao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM385', 'Efa azoko ny teny\nKa hazoniko ireny;\nHianao, Jesosy ô,\nAmpy hiankianako.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM386','FFPM 386');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM386', 'Jesosy Tompo soa\nNo miantso mafy hoe :\n« Manatòna avokoa\nRy mpanota marobe!\nFa izay manatona  Ahy\nTsy mba ho horoahiko;\nAza manana ahiahy,\nRaisonao ny teniko »', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM386', 'Aza mba misalasala\nKa mihevitra hoe;\nSao ny Tompo tsy hamela\nAhy efa diso be.\nTsia, tsia, ry mpanota,\nMatokia marina,\nAnenenonao ny ota,\nJeso hanamarina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM386', 'He, ny rany sarobidy\nNo mahafa-keloka\nNy mpanota voavidy\nKa miaiky  heloka.\nEny, afaka ny revo\nNoho ny Mpanavotra,\nNy devoly manandevo\nEfa resy lahatra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM386', 'Ny Mpamonjy mampifidy,\nTsy manao an-keriny,\nKa antsika ny hifidy\nSy handray ny teniny.\nKoa raha misy very,\nDia tsy avy aminy;\nNy manao ny mahavery\nDia tsy mba maminy.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM387','FFPM 387');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'Ampihetsehin’inona\nIzao ireo vahoaka,\nAry iza no arahiny\nNo dia samy maika erý ?\n:,: Ry jamba ô, fantaronao,\nJeso mandalo anao izao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'Jesosy Iraky ny Ray\nDia samy mety no mahay\nManafaka ny rofinao\nSy mampahiratra anao;\n:,: Koa mitsangàna hianao,\nJeso mandalo anao izao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'O, ry mivesatra entana,\nHantòny ny Mpanafaka!\nRy zaza very hatrizay\nModia ao an-tranon-dRay\n:,:Ry jamba ô, heveronao\nJeso mandalo anao izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'Ny lalan-tsarotrao atý\nTsy misy tsy nalehany,\nNy rofy nositraniny,\nNy maty novelominy,\n:,: Ny jamba faly nahare;\nIndro Jeso mandalo re! :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'Ny indrafony mbola  injao,\nMitety izao tontolo izao:\nNy tranontsika alehany,\nNy fo mihidy doniny.\n:,: Ampandrosoy Izy hoe :\nJeso ô! aza mandalo re! :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM387', 'Fa raha tsy ahoanao\nIzao fandalovany izao,\nKa nony efa farany\nVao tia ny hovangiany.\n:,: Indrisy tsy ho hitanao\nJeso Izay efa nandalo tao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM388','FFPM 388');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM388', 'Tsy maintsy hateraka indray\nhianao\nIzay ta-handova\nNy lanitra sy ny fiainam-\nbaovao,\nIzay tsy miova;\nNy havan’ny Tompo ihany\nNo tena hahazo izany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM388', 'Ny fo vatolampy esory izao,\nFa tsy hovonjena;\nKatsaho ny fo feno aina\nvaovao\nFa io no ekena\nHoraisina any ambony,\nKa tsy hitomany intsony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM388', 'Ny Tompo mitondra ny hery\nvaovao;\nFanahy sy afo,\nIzay mampiova ny fonao izao\nHo tonga fo nofo;\nNy olona lasan-ko babo\nHo afaka sady hiravo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM388', 'Ry Masina ô, ateraho indray\nIzay mitaraina,\nVelomy ny maty hifoha,\nhandray\nIlay tena aina;\nMba raiso, ry Ray be fitia,\nNy zanaka adala mania!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM389','FFPM 389');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM389', 'Ny perla madio, ny perla\nvaovao\nNo tonga hampanan-karena\nny very,\nNy perla madio katsaho izao;\nArio ny ota, izay mahavery;\nTapaho ny gadra, izay\nmahamay,\nFa sao ho anjaranao\nmandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM389', 'Ny ota nataonao, ry havana e,\nMiteraka gadra, izay\nmahafaty;\nKanefa ny maro miezaka re,\nHahazo ny voan’ny ota, ka\nmaty;\nReseo ny ota, reseo izao,\nKatsaho indrindra ny perla\nvaovao', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM389', 'Avia, mpanota, faingàna izao,\nFaingàna ka dia hahazo hijery\nNy perla madio, ny perla\nvaovao,\nIzay tonga hampanan-karena\nny very.\nRy Jeso, Izay perla madio\nvaovao,\nAvia hampanan-karena izao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM390','FFPM 390');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM390', 'He, Jesosy Tomponao\nMalahelo, mitomany,\nFa izao tontolo izao\nMbola mihomehy ihany,\nKa ho ratsy fiafara,\nFa manda ny Tompo tsara!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM390', 'Indro, tevana no ao,\nFa tsy hitan’ny mpanota,\nIzay mandihy faly izao\nSy manaram-po manota.\nRy adala miverena,\nSao ho very famonjena.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM390', 'Mba heveronao izao\nFa ny tenanao ho faty;\nKoa ny fifonanao\nAza ataonao matimaty!\nHe, ny Tompo mitomany!\nSa tsy azonao izany ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM390', 'Latsa-dranomaso be\nSy onena ny Mpamonjy;\nKoa mifohaza re\nManatòna ho tra-bonjy,\nFa Jesosy be fitia\nMitomany ny mania.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM396','FFPM 396');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM396', 'Aizan’ny lanitra hianao,\nRy zanak’olona ô ?\nMoa mba efa niditra tao\nSa ao ivelany ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM396', 'Lapan’Andriamanitra ao\nKoa tsy mankao\nAfa-tsy izay mandray fo\nvaovao :\nOlona masina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM396', 'Any ny masina marobe\nVelona mandrakizay,\nKa fiderana tsara no re,\nEran’ny lanitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM396', 'Tapitra irina izay tonga ao,\nSambatra mandrakizay;\nAny ny Paradisa vaovao,\nIzay hiadanana.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM396', 'Aizan’ny lanitra hianao,\nRy zanak’olona ô ?\nO, mba hevero izay toetrao\nMbamin’ny asanao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM397','FFPM 397');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM397', 'Ry olona mbola tamana\namin-dratsy,\nHevero ny loza hihatra\naminao\nFa indro Satana izay lohan’ny\nratsy\nMandefa tsipika hamono\nanao.\nKanefa ny Tompo izay\nZanahary\nNo tonga hamonjy, fa tsy mba\nmanary;\nAvia, ry olo-mahantra, hihary\nNy tena harena tsy mety ho\nlo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM397', 'Jesosy mamoha anao,\nry matory,\nFa Izy maniry hitarika anao,\nIlaozy ny ota, fa he,\nmampahory,\nHenoy ny feo miantso anao!\nJereo Ilay kintana, Izay tsy ho\nrava,\nFa indro ny aizina dia hisava;\nAraho Jesosy, fa tena mazava,\nIzay hanazava tokoa anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM397', 'Ny Tompo mamelona ny efa\nmaty,\nKa aoka hitsangana re\nhianao!\nFadio tokoa izay mahafaty,\nKatsaho indrindra ny aina\nvaovao!\nJesosy Mpamonjy no mba\nitafio,\nKa dia tandremo fa lamba\nmadio!\nRy olo-mahantra mba raiso\nanio\nJesosy, Izay mahavonjy anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM397', 'Jesosy Mpamonjy mitondra\nny teny\nIzay hahavelona mandrakizay;\nKa dia henoy ny toky nomeny,\nRy olo-maniry ho amin’ny\nRay!\nFainganà tokoa, ry efa mifoha\nFa indro ny lanitra efa mivoha,\nKa faly indrindra ny Tompo\ntsitoha\nHitsena ny zanany velona\nindray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM398','FFPM 398');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM398', 'Iza no hiara-dia\nHo arý an-danitra,\nKa hanaiky sy ho tia\nAn’Andriamanitra ?\nRy mikatsaka ny To,\nAtolorinao ny fo;\nIzao tontolo izao ario,\nKa ny lanitra fidio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM398', 'Sao ho lany amin’ota\nNy anjara andronao,\nKa ny helo valin’ota\nNo hanjary lovanao;\nMiovà re hatrizao,\nMiverena hianao;\nTadiavinao tokoa\nNy Mpamonjy Tompo soa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM398', 'Mba avia, mianara\nIzay fitondrantena vao;\nMikeleza aina tsara,\nKa reseo ny nofonao,\nAza mba mamindra fo\nAmin-dratsy ao am-po,\nFa ongoty avokoa\nIzay misakana ny soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM398', 'Tsy mba misy lalan-kafa\nHiakaranao ho ao,\nKoa andeha manahafa\nNy nataon’ny Tomponao.\nTsy mba mahavonjy anie\nNy fahaizan-dehibe;\nRaha ny nofo no hajaina,\nDia ho very re ny aina.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM398', 'Dia ny lanitra katsaho\nHo anjara lovanao;\nNy Mpamonjy angataho\nHo mpitarika anao ?\nFa izay mpianany\nDia hotantanany\nIza no hiara-dia ?\nMitsangàna ka avia!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM399','FFPM 399');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM399', 'Ny sento ajanòny\nRy malahelo ô!\nKa aza misy intsony\nIzay hamoy fo!\nFa indro ny Mpamonjy\nDia eo anilanao,\nKa tonga mba hamonjy\nSy hitondra anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM399', 'Jesosy no nitory\nNy teny soa re,\nNy rera-po sy ory\nAntsoiny mba handre;\nMinoa fa ny ota\nDia voavelany,\nSakaizan’ny mpanota\nNo anarany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM399', 'Miposaka ny taona\nAnkasitrahana,\nKa be ny voataona\nAm-pitiavana.\nHevero, ry mahantra,\nIzay anjaranao!\nJesosy be fiantra\nNo Mpamonjinao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM400','FFPM 400');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM400', 'Tompo Tsitoha, izahay\nmifona,\nMba mihainoa, ô mba\nmanatòna!\nKa mamindrà fo aminay\nmpanota,\nHo afaka ota.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM400', 'Raha averina aminay mpanota\nIzay mendrika ho anay ho\nvalin’ota,\nDia ho anjaranay re ny hijaly,\nFa tsy hifaly.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM400', 'Indro izahay, fa vovoka sy\ntany,\nReraka, osa, sady mitomany,\nTraty ny mafy\nmampiferinaina,\nKa mitaraina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM400', 'Noho Jesosy Zanaka malala,\nIzay nijaly solonay adala,\nDia mba vonjeo izahay\nmahantra,\nRy be fiantra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM400', 'Ray be fitia, tokin’ny\nmahantra,\nMba manampia anay,\nry be fiantra,\nFa miandrandra izahay\nmijery\nAnao irery!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM401','FFPM 401');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Izaho nivily, ka simba ny fo,\nNafoiko ny làlana tery;\nIzaho nanary ny soa sy to,\nKa resin’ilay  mahavery.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Ka nony adala sy mafy ny fo,\nDia tonga ny Filazantsara\nNaneho ny teny mazava sy to,\nDia teny izay manambara.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Fa tonga ny Tompon’ny \nlanitra izao\nHamonjy izay olom-bery;\nModia anio, ry havako ô,\nAraho ny làlana tery.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Jesosy nijaly nisolo anao;\nNy fony, ny ainy nijaly;\nArio ny ratsy, fidio izao\nNy soa izay mahafaly.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Izaho fahiny nahery nandà\nTsy nety nifidy ny soa,\nFa nohon’ny herin’ny afo\nsy ra,\nNanaiky ny foko fa voa.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Izaho izao dia tretrika am-po\nFa afaka tsara sy sahy\nHiala amin-dratsy, hitady\nny to ,\nKa mino fa Jeso no ahy.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM401', 'Ry Jeso Mpamonjy, arovy\nny fo,\nAhiko ny fandrika maro!\nIzaho mikasa ao anatin’ny fo\nHanaraka Anao, ry Mpiaro.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM402','FFPM 402');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM402', 'Ory sady mitomany\nAho, ry Jesosy ô,\nFa tsaroako izany\nVesatry ny heloko;\nKoa mba todihonao,\nRaiso ho mpianatrao,\nNy fanahiko sitrano,\nAtsanganonao ka tano!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM403','FFPM 403');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM403', 'Ry Jeso Tompo tsara ô!\nHe, resy lahatra aho izao\nFa be ny ratsy vitako\nMandifotra ny tenako!\nMilela-paladia, re,\nFa efa diso lehibe;\nEsory tsy ho hitanao\nNy mariky ny otako,\nAmpiasao ny indrafo\nKa mamelà ny heloko!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM404','FFPM 404');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM404', 'Ny fasika amoron’ny rano\nTsy tambo isaina, fa maro;\nNy kintana an-danitra koa\nTsy azo isaina avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM404', 'Ny otako toraka izany,\nNy isany tsy hita lany;\nIzaho nanary ny soa,\nKa dia mahantra tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM404', 'Indrisy, izaho nania,\nKa very ny valim-pitia;\nNy foko tsy mety mangina,\nFa maro ny heloka ahina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM404', 'Izaho maniry hahazo\nNy lova izay tsy halazo;\nIriko ny ho tafafindra\nHo amin’ny Avo indrindra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM404', 'Ry Jeso Mpamonjy Mahery,\nVariana aho fa very,\nKa noho ny ranao madio,\nNy heloko re mba ario!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM405','FFPM 405');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM405', 'Jesosy Kristy Tompo ô!\nMba mamindra fo, e!\nFa raha tsy hatoninao,\nMahantra aho  re!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM405', 'Mifona sy mangataka\nIzaho Tompo ô,\nNoho ny ranao latsaka,\nVonoy ny heloko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM405', 'Ny famonjena vitanao,\nTsy hain’ny hafa  atao;\nNy teny sy ny herinao\nDia  ampy  hanavao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM405', 'Ho heriko ny indrafo\nSy ny fitiavanao,\nKa faly ny fanahiko,\nFa velon-ko Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM405', 'Ny hazofijaliana\nAnjarako atý,\nFa satro-pifaliana\nHo azoko arý.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM406','FFPM 406');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM406', 'Manenina aho, Ray Masina ô!\nFa simba ny tsirin’ny aina;\nIzay nambolenao tanatin’ny fo\nDia  lanin’ny  ota ka maina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM406', 'Indrisy ny fahadisoako, re,\nFa maro, tsy tambo isaina,\nKanefa, ry Tompoko, mba\nmamonje\nIty ory, izay mitaraina!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM406', 'Havaozy indray ny fanahiko\nizao\nAndrao lasa ho babon’ny\nhelo;\nKa ny fivalozako mba\nraisonao,\nVonjeo ny fo malahelo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM407','FFPM 407');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM407', 'O ry Raiko izay malala,\nTonga aho zanakao,\nIzay nania, fa adala, \nKa mifona Aminao;\nMamelà ny fahotako\nTeo anatrehanao;\nAry ny fahadalako\nAza mba heverinao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM407', 'He, izaho nanantena\nIzao fiainana izao,\nKa nandà ny famonjena,\nIzay lazain’ny teninao;\nKanjo hitako tokoa,\nFa izao tontolo izao\nTsy mba manan-java-tsoa\nHampiadana ny fo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM407', 'Enga aho, izay mahantra,\nMba ho isan’ny Anao;\nHianao ry Ray Mpiantra,\nMiantrà ny zanakao,\nAry nohon’ny Mpamonjy,\nIzay nanavotra ahy re,\nRaiso aho ho tra-bonjy,\nHa Anao, ry Ray! Amen!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM408','FFPM 408');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'Jehovah, Ray mahari-po,\nIzay tia sy mamindra fo\nO, mihainoa ny hatako :\nMba mamindrà fo amiko!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'Izaho izay mangataka\nTsy azo hamarinina;\nIndrisy! be ny tsiniko;\nMba mamindrà fo amiko!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'Tsy tamboko isaina re\nNy fahotako marobe,\nKa be tokoa ny tahotro;\nMba mamindrà fo amiko!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'He! misy hanatonako\nAnao, Mpandray mpibebaka :\nIzaho diso fatratra;\nMba mamindrà fo amiko!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'Fa Jeso no Anarana\nIzay entiko mangataka\nNy hamelanao heloka :\nMba mamindrà fo amiko!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'Tsinjovy re ny zanakao\nMiverina Aminao izao\nFa mitaraina Aminao :\nMba mamindrà fo amiko!', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM408', 'O! mba jereo ka iantrao\nIzaho miandrandra Anao;\nNy heloko vonoinao,\nFa mampisaraka Aminao.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM409','FFPM 409');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM409', '« Ry zaza mpiodina,\nmba miverena! »\nAntsoin’ny Ray;\nIsika hamaly am-po\ntsy terena :\n« Indreto izahay\nMiaiky fa ratsy\nMaratran’ny rafy;\nSitrano izahay,\nFa simba ny toetranay. »', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM409', '« Indrisy, nanota\nka mendrika ho faty\nSy very izahay!\nNy razanay dia nanompo ny\nmaty\nKa narahinay.\nRy Ray ô, jereo\nKa dia vonjeo,\nMba ho zanakao\nIzahay mitanondrika izao »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM409', '« Sitraniko ny \nfihemoranareo,\nRy zanako ô!\nTsy ampanjomboniko\naminareo\nNy tavako koa. »\nIzany irinay\nHo re ao am-ponay,\nFa Ray Hianao\nMampionona ny olonao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM410','FFPM 410');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM410', 'Ry Jeso ô! jereo,\n‘Ndrao maty, ka vonjeo;\nRy Kristy, Vonivatonay!\nMba raiso izahay,\nMahantra izahay,\nKa ory ny fonay;\nRy Tompo be fiantra ô!\nMba miantrà anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM410', 'Mpanavotra ô! jereo,\nAndrao very, ka vonjeo;\nRy Kristy, Orimbatonay!\nAvoty izahay,\nMpanota izahay,\nMaloto ny fonay;\nRy Zanak’Andriamanitra ô!\nVonoy ny otanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM410', 'Mpanjaka ô! jereo,\nAndrao lavo, ka vonjeo;\nRy Kristy, Harambatonay!\nArovy izahay,\nMalemy izahay,\nKa kivy ny fonay;\nRy Tomponay mahery ô!\nTantano izahay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM411','FFPM 411');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM411', 'Ry Zanahary Tomponay,\nMpanao izao rehetra izao!\nTsinjovy re ny olonao,\nKa miantrà ny lovanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM411', 'Ry Tokinay sy Tanjakay!\nMba mitalaho izahay;\nTsarovy re ny zanakao,\nKa mamelà ny helokay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM411', 'Ry Tomponay, Mpamonjy \nsoa!\nTariho izahay izao\nHanompo sy hanoa Anao,\nHo voninahitrao tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM411', 'Rehefa hody izahay,\nMba raiso ny fanahinay\nHandray ny hasambarana\nAtolotrao, Mpanavotray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM412','FFPM 412');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM412', 'Jehovah Tompo ô!\nIndreto izahay\nMifona Aminao;\nFa be ny helokay;\nHenoy izao, ry Ray!\nHenoy ankehitrio,\nHenoy ny vavakay,\nHenoy ka mba valio.\nRy Andriamanitray!\nmijere!\nJeso Kristy Tomponay!\nmamonje!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM412', 'Vonjeo, vonjeo, ry Ray!\nVonjeo ny olonao;\nMifona izahay,\nIsao ho zanakao;\nHenoy izao, ry Ray!\nHenoy ankehitrio,\nHenoy ny vavakay,\nHenoy ka mba valio.\nRy Andriamanitray!\nmijere!\nJeso Kristy Tomponay!\nmamonje!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM412', 'Mpanota izahay,\nMba mamelà anay;\nMaloto ny fonay,\nSasao ho voadio;\nHenoy izao, ry Ray!\nHenoy ankehitrio,\nHenoy ny vavakay,\nHenoy ka mba valio.\nRy Andriamanitray!\nmijere!\nJeso Kristy Tomponay!\nmamonje!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM412', 'Jereo ny Zanakao\nMisolo vava  anay;\nIlay Malalanao,\nMifona ho anay;\nHenoy izao, ry Ray!\nHenoy ankehitrio,\nHenoy ny vavakay,\nHenoy ka mba valio.\nRy Andriamanitray!\nmijere!\nJeso Kristy Tomponay!\nmamonje!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM413','FFPM 413');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM413', 'Ry Mpamonjy, Tompo soa!\nAvy izahay izao,\nMba hanaiky sy hanoa,\nKa hiverina Aminao,\nHianao no ranon’aina\nMahavelona ny fo;\nHianao no antenaina\nMba hanala ny manjo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM413', 'Indreto izahay mpanota\nEfa diso taminao,\nMamonje sy manavota\nNy fanahinay izao,\nHianao no mahavonjy\nIzay miankina Aminao;\nKoa raiso, ry Mpamonjy!\nNy fifonanay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM413', 'Ry Jesosy be fitia!\nMba tantano izahay,\nFa ho lavo sy hania\nRaha tsy hazoninao.\nTsy mba misy mety very\nEo am-pelatananao,\nFa Aminao no misy hery\nMahatanjaka ny fo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM413', 'Tompo ô! mba tanteraho\nIzay rehetra mahasoa,\nKa ny otanay afaho,\nFa manimba anay tokoa,\nMampianara anay haniry\nMba hanao ny sitrakao,\nHahazoanay ny hery\nEo am-pelatananao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM414','FFPM 414');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM414', 'Jeso, Vatolampinay!\nO! arovy izahay,\nKa ny fonay mba sasao\nManafaha  anay izao,\nMba tsy hisy  izay hanjo\nOlon-tsy mahitsy fo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM414', 'Tsy ny asa izay atao\nMahatò ny didinao;\nTsy ny hazotoam-po\nNo mahazo manadio;\nTsy ny ranomasonay\nNo mahafa-trosa anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM414', 'Tsinontsinona  izahay,\nSady be ny helokay;\nRy Mpiaro lehibe,\nJeso Tompo!  mamonje,\nFa miankina Aminao\nIzahay mpanomponao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM414', 'Tomoera aminay\nRaha  ho faty izahay,\nAry raha  hiakatra ao\nMba hiseho Aminao,\nJeso, Vatolampinay!\nO! arovy izahay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM415','FFPM 415');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM415', 'Mifona Aminao izahay,\nAndriamanitra ô!\nMba mamelà ny helokay,\n:,: Fa diso izahay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM415', 'Mivavaka  Aminao izahay,\nRy Jeso Tompo ô!\nAvoty ny ranao izahay,\n:,: Fa very izahay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM415', 'Mangataka  Aminao izahay,\nFanahy Masina ô!\nVelomy ny fanahinay,\n:,: Fa maty izahay :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM415', 'Jehovah ô! Izay iray,\nKanefa Telo koa,\nMba atokàny izahay,\n:,: Ho olonao tokoa :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM416','FFPM 416');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM416', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM416', 'Mamindrà fo amiko,\nRy Jehovah Tompoko!\nFa miantra Hianao,\nMamelà ny heloko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM416', 'Iza no mamindra fo\nToa an’Andriamanitra ?\nIza no Mpanavotra\nAfa-tsy ny Zanany ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM416', 'Jeso Kristy no mahay\nMamonjy ny mpanota\nIzay miankina Aminy\nKa tsy mandoka tena.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM416', 'Aza mahafoy ahy,\nRy Jehovah Tompoko!\nMamindrà fo amiko,\nMamelà ny heloko.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM417','FFPM 417');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM417', 'Nandao Anao ela aho,\nRaiko ô!\nIzao dia  te-hody aho; \nManiry hiankina an-tratranao\nIzao dia  te-hody aho,\n:,: Inty tamy aho, Raiko\nmalala ô\nRaiso ny tanako :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM417', 'Maniry hanana fiadanam-po\nIzao dia te-hody aho,\nSy mba hivesatra ny zioganao\nIzao dia te-hody aho,\n:,: Inty tamy aho, Raiko\nmalala ô\nRaiso ny tanako :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM417', 'Itambesaran’ny ota natao\nIzao dia te-hody aho,\nMatoky anefa fa horaisinao\nIzao dia  te-hody aho,\n:,: Inty tamy aho, Raiko\nmalala ô\nRaiso ny tanako :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM417', 'Raha tsy mendrika ny ho\nzanakao,\nIzao dia  te-hody aho,\nAtaovy ho isan’ny \nmpanomponao\nIzao dia  te-hody aho,\n:,: Inty tamy aho, Raiko\nmalala ô\nRaiso ny tanako :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM417', 'Indro fa tazako ny sandrinao\nIzao dia  te-hody aho,\nMitsotra mba hisakambina re,\nIzao dia  te-hody aho,\n:,: Inty tamy aho, Raiko\nmalala ô\nRaiso ny tanako :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM418','FFPM 418');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM418', 'Amorony fo madio\nAho, ry Jehovah ô!\nKa havaozinao anio\nNy fanahiko izao.\nBe ny ratsy vitako\nKa ny heloko sasao;\nMamindrà fo amiko,\nRy Jehovah Tompo ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM418', 'Amorony fo madio\nAho, ry Jehovah ô!\nKa diovy ankehitrio\nNy fiainako izao.\nSimba ny fanahiko,\nKa amboary ho vaovao;\nAza esorina amiko,\nNy Fanahy Masinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM418', 'Amorony fo madio\nAho, ry Jehovah ô!\nKa ny foko ahitsio,\nHamasino ho Anao.\nTaminao dia taminao\nNo mba nanotàko, Ray;\nKa ny heloko avelao\nNy fanahiko ovay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM418', 'Amorony fo madio\nAho, ry Jehovah ô!\nKa ny fo omeko anio,\nRaiso ho fanananao;\nFo mangorakoraka\nNoho ny ratsy izay natao;\nFo miaiky heloka,\nKa mba raiso, Tompo ô.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM419','FFPM 419');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM419', 'Ry Raiko ô! Ry Raiko ô!\nEfa nanota teo imasonao\nIty Zanaka mahantranao;\nNinia niala teo an-tranonao\nMangovitra ny feoko,\nTorovana ny foko,\nKanefa tazako Hianao\nKa mamelà, mamelà,\nRaiko ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM419', 'Ry Raiko ô! Ry Raiko ô!\nHo tanterahiko ny anjarako;\nMandao ny lalako taloha;\nIzay nanalavitra ahy taminao\nTratrariko ny eo aloha,\nIlaozako ny lasa,\nInoako ny famindramponao\nKa mamelà, mamelà,\nRaiko ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM419', 'Ry Raiko ô! Ry Raiko ô!\nAtsory amiko ny tananao\nHamelona ny heriko\nFa reraka aho, ka tantanonao\nNy fitiavanao, Ray ô!\nFanilo sady toky\nAndraisako fiadanam-po,\nKa mamelà, mamelà,\nRaiko ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM419', 'Ry Raiko ô! Ry Raiko ô!\nHo olom-baovao itý zanakao\nRaha tonga eo akaikinao\nFa ho sasan’i Jeso Tompo tia\nTsy tapitra ny antranao,\nFa manana amby ampy\nDia manantena aho izao\nKa mamelà, mamelà,\nRaiko ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM420','FFPM 420');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM420', 'Ry Raiko feno antra,\nInty aho fa ory;\nMijaly sy mahantra,\nKa tsy mahatraka  akory,\nJesosy no nilonjy\nNy ota vitanao;\nNy rany mahavonjy,\nNomeny ho anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM420', 'Nandao ny tavanao,\nNikaro-java-tsoa;\nKorana sy lalao,\nSambo-drivotra avokoa.\nJesosy no nilonjy\nNy ota vitanao;\nNy rany mahavonjy,\nNomeny ho anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM420', 'Izaho fahavalo\nFa tsy narianao,\nNy loza natakalo\nHasambaram-baovao.\nJesosy no nilonjy\nNy ota vitanao;\nNy rany mahavonjy,\nNomeny ho anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM420', 'Hanompo no iriko\nFa zanaka nania,\nRy hany itokiako\nMba ho Tompoko  doria.\nJesosy no nilonjy\nNy ota vitanao;\nNy rany mahavonjy,\nNomeny ho anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM421','FFPM 421');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM421', 'Andriamanitra ô, Ray\nMpamindra fo!\nAvy mankalaza Anao\ntokoa izahay;\nN''inon''inona midona,\nzavatra manjo\nEo ambany elatrao,\nmatoky izahay.\nMamindrà fo amiko,\nAndriamanitra ô!\nAvelao ny heloko,\nJeso Mpamonjy ô!\nHazavao ny lalako,\nFanahy Masina ô!\nFa izay no fahasambaran''\nny fanahiko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM421', 'Jeso Kristy Tompo sy\nZokinay,\nMiaraka Aminao\nafa-tahotra tokoa,\nHetraketrakin''ny tany\ntsy hanimba anay,\nIzay mialoka Aminao\nho ampoky ny soa,\nMamindrà fo amiko,\nAndriamanitra ô!\nAvelao ny heloko,\nJeso Mpamonjy ô!\nHazavao ny lalako,\nFanahy Masina ô!\nFa izay no fahasambaran''\nny fanahiko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM421', 'Ry Fanahy Masina\nMpanavao,\nHazavao re, ny ao am-poko\nmiafina ao\nKa ny lalana ombàko mba\ntarihonao,\nNy ota mahazatra mba levony\nkoa ho lao,\nMamindrà fo amiko,\nAndriamanitra ô!\nAvelao ny heloko,\nJeso Mpamonjy ô!\nHazavao ny lalako,\nFanahy Masina ô!\nFa izay no fahasambaran''\nny fanahiko.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM422','FFPM 422');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM422', 'Ry Andriananaharinay!\nNy hamasinanao\nDia tena lehibe tokoa,\nRaha te-hahita Anao\nizahay,\nTsy maintsy tsara fo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM422', 'Ny mason''ny anjelinao\nMahita Anao tokoa,\nKa tsy mba manjambena\nireo,\nNa dia mamirapiratra,\nNy hamasinanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM422', 'Fa tsy nanota taminao\nAkory izy ireo,\nTsy meloka, tsy menatra,\nKa misy hahazoany\nHijery tsara Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM422', 'Fa izahay, maloto fo,\nRaha te-hahita Anao,\nTsy mana-mahamendrika,\nFa zanak''olombelona;\nAhoana no hatao ?', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM422', 'Ry Andriananaharinay!\nNy ran''ny Zanakao,\nNy asan''ny Fanahy koa,\nNo zava-mahamendrika\nAnay hahita Anao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM423','FFPM 423');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM423', 'He maharavoravo,\nJeso, ny fitiavanao;\nIzaho dia mpanota lavo,\nNefa Jeso, nareninao.\nMamin''ny foko loatra,\nNy fanavotana vitanao;\nHe! ny foko tsy afa-\nmanoatra\nJeso, hihira ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM423', 'Izaho mpanota adala\nNo nanehoam-pitiavan-tsoa\nNy heloko, Jeso malala,\nNavelanao tokoa tokoa.\nMamin''ny foko loatra,\nNy fanavotana vitanao;\nHe! ny foko tsy afa-\nmanoatra\nJeso, hihira ho Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM423', 'Endrey ny hafaliako :\nNy heloko navelanao,\nHe! maivana ny fahoriako\nNoho ny fanavotanao.\nMamin''ny foko loatra,\nNy fanavotana vitanao;\nHe! ny foko tsy afa-\nmanoatra\nJeso, hihira ho Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM424','FFPM 424');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM424', 'Tsaroako dia tsaroako\nRaiko ô, Raiko be fitia!\nFa ny fahadisoako\nNodiovinao satria\nNoho Jeso Mpamonjy soa,\nInty izaho fa afaka,\nHe! azoko tokoa tokoa\nNy famelana heloka.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM424', 'Ny aizim-pahotàna\nRaiko ô, Raiko be fitia!\nMisolo hazavàna\nMamiratra erý.\nNy lalako mahitsy izao\nMitory olona afaka\nNoho ny hery vaovao \nNy famelanao heloka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM424', 'Endre, ny hafaliako\nRaiko ô, Raiko be fitia!\nFa maivana ny diako\nAvy any Kalvary.\nNy tahotaho-poko tao\nTsy reko intsony, afaka;\nAn-tanako tokoa izao \nNy famelana heloka.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM424', 'Deraiko lalandava\nRaiko ô, Raiko be fitia!\nNy vavako hilaza \nNy vitanao tetý.\nFa mbola misy marobe\nManiry te-ho afaka,\nHo azy  ireny koa anie\nNy famelana heloka.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM425','FFPM 425');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Ny ratsy efa tiako,\nTsy tahotro, tsy henatro\nFa zava-bao no hitako :\nTe-hijery izany aho.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Ao ny hazo fijaliana\nAo ny Tompo efa maty :\nIzy no nijery ahy\nTsy tezitra, fa niantra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Hoy ny fijeriny ahy\n« Hianao mamono Ahy »\nDia  hitako mahantra aho\nNy heloko namono Azy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Aiza no handosirako\n''Ndrao hidiran-doza aho ?\nIza no hamonjy ahy,\nFeno ota, feno loto ?', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Nijery ahy indray Izy :\n« Avelako ny helokao \nFa ny ràko no manadio\nHahazoanao fiainana ».', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM425', 'Maty Kristy, be ny ota,\nMaty i Jeso! be fitia.\nFaly malahelo aho,\nSambatra, manana ody aina.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM426','FFPM 426');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM426', 'Nanatona Anao, \nMpanavotra ô!\nNy olo-mahantra fahiny,\nNy rofiny be, ny senton''ny fo\nNaneho fa soa no niriny.\nTsy nety ho sasatra Hianao,\nTsy nisy nolavina akory,\nFa samy nandray ny\nindrafonao,\nKa ravo ny olona ory.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM426', 'Manatona Anao, ry be\nindrafo,\nNy olo-mahantra anio,\nFa be siasia, sy reraka am-po\nKa raisonao ankehitrio!\nNy maty omeonao aina\nvaovao,\nNy sasatra ampiadano,\nNy masonay jamba mba\nhazavao\nNy rofin''ny fonay sitrano.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM426', 'Ka rahatrizay hanatona Anao,\nNy tsy ho farofy intsony,\nFa hisy ny Alahady vaovao\nKa sitrana tsara ny fony.\nIzay tany soa misy Anao\nNo hisy ny olonao koa,\nHahita ny voninahitrao ao,\nRy Zoky malala Tsitoha.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM427','FFPM 427');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM427', 'Ho vavolombelonao\nN''aiza n''aiza no aleha\nIzay no faniriana vao\nSy ataoko rehareha,\nKa raha asa no atao\nInty tokoa fa vonona\n( ho vonona aho )\nTsy hiala na handao,\nTompo ô, iraho aho!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM427', 'Ho vavolombelonao\nEran-tany raha ilaina\nToy ny loharano vao\nIzay mamelombelona  aina\nHanasoa ny tany hay\nEfa mihamaina taho\n( mihamaina )\nTompo ô, inty indray\nAlefaso, vonona Aho.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM427', 'Ho vavolombelonao\nAo anaty fitsapana,\nKa hijoro ho Anao,\nNa fefena, na rarana,\nTsy hiahotra ny dia :\nFa Hianao naniraka Ahy\n( naniraka Ahy )\nTsy hiahotra aho satria\nAmiko Hianao Mpitahy.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM428','FFPM 428');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM428', 'Reko izao, ry Tompo,\nIzany antsonao\nMiantso izany mpanompo\nMba ho irakao!\nInty! inty!\ninty aho Jeso!\nInty! inty!\niraho aho Jeso!\nEkeko re,\nny ho miaramilanao\nHo vonona hanao\nny sitrakao,\nKa iraho!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM428', 'O! diovy Tompo\nizany molotro!\nKa ny fo madio hanompo\nno atolotro.\nInty! inty!\ninty aho Jeso!\nInty! inty!\niraho aho Jeso!\nEkeko re,\nny ho miaramilanao\nHo vonona hanao\nny sitrakao,\nKa iraho!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM428', 'Tsy handeha irery,\nFa hiaraka  Aminao,\nKa dia mba omeo ny hery\nsy Fanahinao.\nInty! inty!\ninty aho Jeso!\nInty! inty!\niraho aho Jeso!\nEkeko re,\nny ho miaramilanao\nHo vonona hanao\nny sitrakao,\nKa iraho!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM428', 'Reko izao ny toky hoe :\n" Momba ahy Hianao,\nRy Jesosy Tompo\nsy Zoky\nVonona aho " izao.\nInty! inty!\ninty aho Jeso!\nInty! inty!\niraho aho Jeso!\nEkeko re,\nny ho miaramilanao\nHo vonona hanao\nny sitrakao,\nKa iraho!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM429','FFPM 429');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM429', 'Inty ny olona, Jeso Tompo ô!\nFa nandre ny antsonao\nHe, maniry mba hotarihinao\nHo akaikinao kokoa.\nMba tariho aho, Jeso\nTompo ô!\nEo akaikinao kokoa,\nMba tariho aho, Jeso\nTompo ô!\nMba ho olonao tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM429', 'Tsy ny sitrako, fa ny sitrakao\nNo iriko mba hatao,\nFa navotanao ny\nmpanomponao\nKa Manaiky ho Anao.\nMba tariho aho, Jeso\nTompo ô!\nEo akaikinao kokoa,\nMba tariho aho, Jeso\nTompo ô!\nMba ho olonao tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM429', 'Raha mitokana mba hivavaka,\nKa miresaka Aminao,\nVelombelona ny fanahiko,\nTafakambana Aminao.\nMba tariho aho, Jeso\nTompo ô!\nEo akaikinao kokoa,\nMba tariho aho, Jeso\nTompo ô!\nMba ho olonao tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM429', 'Raha avy re izay hodiako,\nHody Aminao indray,\nAo ny saiko vao tena afa-po\nTonga ao an-tranon-dRay.\nMba tariho aho, Jeso\nTompo ô!\nEo akaikinao kokoa,\nMba tariho aho, Jeso\nTompo ô!\nMba ho olonao tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM430','FFPM 430');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM430', 'Endrika sariaka\nNo anompoako Anao,\nJehovah Ray\nFa tapaka ny hevitro :\nIzaho dia olonao\nmandrakizay.\nHe ny foko afa-jaly\nTena ravo, sady falifaly,\nKa : endrika sariaka\nNo anompoako Anao\nJehovah Ray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM430', 'Fa tsaroan’izany saiko,\nMandra-maty\nho tadidiko,\nNy nanavotanao\nny aiko,\nIlay fanahy sarobidiko.\nFa nomena fahendrena\nIzay ekena\nfa ny famonjena,\nKa : endrika sariaka\nNo anompoako Anao\nJehovah Ray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM430', 'Be ny zavatra mihatra\nMampahory\nsy mandrera-po;\nKanefa ireny\ntsy handratra\nNy arovanao,\nry Ilay Tsitoha.\nFa ny fony tena tony\nTsy mba kivy, \ntsy mba taitra intsony,\nKa : endrika sariaka\nNo anompoako Anao\nJehovah Ray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM430', 'Misy ve ny mampanahy\nSy ny zava-manahirana ?\nHe, tsy kivy ny fanahy\nFa hijoro, ka ho mirana,\nFa Jehovah,\nRay Mahery,\nMiandany\nsady koa mijery,\nKa : endrika sariaka\nNo anompoako Anao\nJehovah Ray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM431','FFPM 431');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', 'Na be no mahareraka,\nTsy mety kivy ny mino;\nNy Tsitoha no heriny\nNy lehibe no tohany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', 'Ny hani-mandrakariva\nMofo avy an-danitra\nNy sotroin’isan’andro\nDia rano mahavelona.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', 'Manda afo no arony\nFinoana no ampingany,\nVavaka no fofon’ainy,\nOdiaina no tànany.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', 'Ho lavorary ny diany,\nHo resy ny fahavalony,\nDia sitraka no hitany,\nVoninahitra no azony.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM431', 'Mahereza ilay malala,\nAza ketraka hanompo,\nLasa ny Mpitari-dàlana,\nHanamboatra ho anao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM432','FFPM 432');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM432', 'Mandra-pihavin’ny\nTompo, mivavaha;\nNy teny tsara nomeny\ntadidio,\nNy adidinao, tontosay\nsy efao,\nMijery ny ataonao\nny Ray.\nRaha mpanompo tsara\nhianao,\nHe, ny Tompo faly\naminao,\nKoa tanteraho ireo\nadidinao,\nMba ho mpanompo\nmahasoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM432', 'Mandra-pihavin’ny\nTompo, miasà;\nAmpitomboy ireo\ntalenta azonao :\nVola, fahaizana, aina,\nhery koa\nNo anompoy ny Tompo\nTsitoha.\nRaha mpanompo tsara\nhianao,\nHe, ny Tompo faly\naminao,\nKoa tanteraho ireo\nadidinao,\nMba ho mpanompo\nmahasoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM432', 'Moa tianao va\nIlay Mpamonjy \nTompo soa ?\nNy rany anie\nnanavotany anao!\nNy hafany tanteraho\nsy hajao\nValio ny fanavotany\nanao.\nRaha mpanompo tsara\nhianao,\nHe, ny Tompo faly\naminao,\nKoa tanteraho ireo\nadidinao,\nMba ho mpanompo\nmahasoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM433','FFPM 433');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM433', 'Mba taominao ny fo izao,\nRy Jeso be fitia,\nHanarahako Anao,\nKa mba tsy hania.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM433', 'Mba taominao ny fo izao,\nHamoizako ny tany,\nFa izao rehetra izao\nDia mora lany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM433', 'Mba taominao ny fo izao,\nHanaraka ny dia,\nIzay nomban’ny olonao\nTsy naniasia.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM433', 'Mba taominao ny fo izao,\nHahaizako hifaly,\nFa atý ny olonao\nOry sy mijaly.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM433', 'Mba taominao ny fo izao,\nHo any amin-dRainao,\nMba ho reko hatrizao\nNy hafin’ny ainao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM434','FFPM 434');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM434', 'Ny foko, ry Mpamonjy,\nAtolotro Anao;\nMaloto ka diovy,\nMba ho fonenanao.\nNy ranao izay nalatsaka,\nNo aoka mba hanafaka\nIzao fahotako be izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM434', 'Ny fahoriam-poko\nAtolotro Anao;\nFa he, mampitoloko,\nManindry mafy ao;\nO, ry nijaly an-tsitrapo,\nTohàny ny fanahiko\nMba tsy hamoy fo izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM434', 'Ny fifaliam-poko\nAtolotro Anao;\nArovy tsy haloto,\nDiovy ho Anao,\nAmpio ho tanteraka,\nHo tonga ao an-danitra\nHanatrika ny tavanao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM434', 'Ny tenako rehetra\nAtolotro Anao;\nAnao tsy misy fetra,\nAnao, re, hatrizao,\nKa raiso ho fanananao\nHanompo\nsy hanaja Anao,\nRy Tompo\nsy Mpanjaka ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM435','FFPM 435');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM435', 'Iza no hanoa\nny Tompo lehibe ?\nIza no hanaja\nAzy tsara re ?\nIza no hitady\nolon-kafa koa,\nMba hanaiky\nsy handray \nNy Tompo soa ?\nIndreto Jeso Tompo!\nizahay izao\nAvy mba hanompo,\navy ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM435', 'Tsy an-tery re\nno ilatsahana\nToy ny olom-bery\nnandevozina;\nTa-hanompo tsara\nizahay izao\nTa-hamely koa izay\ntoherinao :\nEny, Jeso Tompo!\nta-hanao tokoa\nIzahay mpanompo\nizay nasian-tsoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM435', 'Na dia ta-hanompo\naza izahay,\nBe ny fahavalo iadianay;\nIzahay malemy\nfeno tahotra,\nMba tsy horeseny,\nmanampia anay,\nKapiteny sahy!\nentonao izao\nMba hitomban-dahy\nny mpiadinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM435', 'Mafy re ny ady,\nmaro be no voa,\nMisy tsy mahandry,\nbe ny maty koa;\nIzahay mpanompo\nmiandrandra Anao;\nTompo izay tsy toha!\nmba herezonao :\nTompo manan-kery!\nhatanjahonao\nIzahay, sao very \nka afaka Aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM436','FFPM 436');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM436', 'Ny foko, ry Jehovah ô!\nMba ento ho Anao,\nDiovy ho fonenanao,\nHo tsara sy vaovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM436', 'Fanahin’Andriamanitra ô!\nMidína ato koa,\nOvay ny saiko mba hadio\nSy masina tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM436', 'Ny aiko no navotanao,\nRy Jeso be fitia!\nMba hanompoako Anao,\nRy Tompoko, avia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM436', 'Ry sofiko, mba mihainoa!\nRy maso, mijere!\nRy tongotra aman-tanako,\nHajao ny Tompo e!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM436', 'Ry tena sy fanahy koa!\nAvia hankatò\nNy tenin’ny Mpanavotra,\nIzay masina sy tò.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM437','FFPM 437');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM437', 'Ry Jeso Kristy Tompo,\nO! ampio ny olonao!\nAmpianaro mba hanompo\nSy hanao ny sitrakao;\nMalemy aho re,\nKa omeo ny herinao,\nTsy hivily, tsy hania,\nFa hanara-dia Anao.\nO! vonjeo, o! vonjeo,\nKa tantano sy jereo;\nAza afoy izahay,\nFa Hianao no Avotray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM437', 'Ny foko mba diovy,\nRy Mpamonjy lehibe!\nKa ambeno sy arovy,\nSao dia very aho re,\nIriko indrindra koa\nNy hitombo sy hamoa,\nKa ny voka-tsoa rehetra\nHo Anao, ry Jeso ô!\nO! vonjeo, o! vonjeo,\nKa tantano sy jereo;\nAza afoy izahay,\nFa Hianao no Avotray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM437', 'Mba raisonao, ry Tompo!\nHo Anao tokoa izao\nIzay ananay rehetra,\nKa anarano fo izao,\nFa maty Hianao\nNoho ny fitiavanao,\nKa tsy hainay hadinoina\nNy fitiavanao anay :\nO! vonjeo, o! vonjeo,\nKa tantano sy jereo;\nAza afoy izahay,\nFa Hianao no Avotray.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM438','FFPM 438');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM438', 'Avia, Jehovah Tomponay,\nHandray ny vavakay,\nFa mitaraina izahay,\nValio ny hatakay :\n:,: Avia :,: handray ny fonay,\n:,: Avia, :,:\nry Tomponay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM438', 'Savao ny alahelom-po,\nMba hifalianay;\nNa mafy aza ny manjo,\nMatoky izahay :\n:,: Avia :,: handray ny fonay,\n:,: Avia, :,:\nry Tomponay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM438', 'Avia, ka taomy izahay,\nHo tonga zanakao;\nMba averenonao indray,\nFa te-ho olonao :\n:,: Avia :,: handray ny fonay,\n:,: Avia, :,:\nry Tomponay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM438', 'Manolo-tena izahay\nMba ho mpanomponao;\nNy fonay no atolotray,\nKa raiso ho Anao :\n:,: Avia :,: handray ny fonay,\n:,: Avia, :,:\nry Tomponay!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM438', 'Raha avy ny hodianay\nHo any Aminao\nMba raiso ny fanahinay\nHo ao an-dapanao :\n:,: Avia :,: handray ny fonay,\n:,: Avia, :,:\nry Tomponay!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM439','FFPM 439');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM439', 'Mba taomy aho e,\nRy Tompo ô!\nHo tonga zanakao\nMadio am-po,\nMba taomy aho e,\nHo tia Anao tokoa!\nNy fo atolotro\nMba raisonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM439', 'Tariho aho e,\nRy Jeso ô!\nAza ilaozanao,\nFa be manjo.\nTrotroy an-tratranao\nNy ondrikelinao,\nKa ento mody izao\nIlay nania.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM439', 'Diovy aho e,\nFanahy ô!\nDiniho sy hazavao,\nNy toetro.\nDiovy aho e,\nNy fo ovay ho vao,\nKa ny fanahiko\nOnenonao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM440','FFPM 440');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM440', 'Ry Kristy ô, Mpanjakako!\nNy foko ho Anao;\nNy feoko hasandratro\nHihira ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM440', 'Mba raiso ny fanahiko\nHanao ny sitrakao;\nNy tenako, ny heriko,\nDia ento ho Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM440', 'Ny tongotro, ny tanako,\nHiasa ho Anao;\nNy androko, ny volako,\nOmeko ho Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM440', 'Izaho dia tsy mendrika\nAnao, ry Tompo ô!\nKanefa re, mba raisonao\nNy foko ho Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM441','FFPM 441');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Raiso aho, Tompo ô!\nFa te-ho mpanomponao;\nRaiso koa ny androko,\nKa  anarano fo izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Raiso re ny tanako\nMba hanao ny asanao;\nRaiso koa ny tongotro\nHo fanirakirakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Raiso ny fahaizako,\nEnto mba hanaja Anao;\nRaiso koa ny volako\nHo Anao tokoa izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Raiso re ny vavako\nHampiseho ny hafatrao;\nRaiso koa ny feoko\nHo mpanandratra Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Raiso ny fanahiko\nDiovy ho tempolinao;\nRaiso aho, Tompo ô!\nHo Anao mihitsy izao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM441', 'Ho Anao manokana,\nRy Mpamonjy,\nTompo soa!\nHo Anao dia  Anao\ntokoa,\nHo Anao mandrakizay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM442','FFPM 442');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM442', 'Endre! ity fahotana,\nMamely ao am-po,\nO! ady mampahana,\nKa mafy ny manjo;\n:,: Vonjeo, ry Mpiantra!\nIzaho zanakao,\nFa tery sy mahantra\nMiady lava izao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM442', 'Ry Antoky ny aiko!\nIzay mahafatra-po,\nRy Toky antenaiko!\nIzay tanjaky ny fo;\nNy tena sy fanahy\nApetraka  Aminao,\nKa  ataovy lehilahy\nMpandresy toa  Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM442', 'Izaho no Mpamonjy,\nKa matokia  tokoa,\nIzaho mahavonjy\nKoa  antenao ny soa;\nNy sandriko mahery\nNo iankinanao,\nHianao dia tsy ho very,\nMinoa hianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM442', 'Ry Tompo manan-kery!\nNy fitiavanao\nFitia feno hery,\nKa raisiko izao;\nNy dera aman-daza\nNo mendrika ho Anao\nNy foko hankalaza,\nNy voninahitrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM443','FFPM 443');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM443', 'Raiso ho Anao ny foko,\nRy Jehovah Raiko ô!\nMitoera atý am-poko\nMba ho tompon-\ntrano ao,\n:,: O, ry Raiko!\nMitoera ao izao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM443', 'Raiso ho Anao ny foko,\nRy Jesosy Tompo ô!\nTsy mba vola, fa ny foko\nNo atolotro Anao :\n:,: Raiso, Tompo!\nFa fanati-tsitrapo :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM443', 'Raiso ho Anao ny foko,\nRy Fanahy Masina ô!\nHazavao ny ao am-poko,\nDiovy ho tempolinao :\n:,: Indro, raiso!\nItokany ho Anao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM443', 'Tsy harindriko ny foko,\nFa vohako ho anao;\nKa midira atý am-poko,\nManjakà irery ao :\n:,: Eny, Tompo!\nRaiso aho ho Anao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM444','FFPM 444');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM444', 'Ry Raiko feno antra!\nInty ny zanakao,\nNy foko dia mahantra\nRaha  lavitra aminao;\nFa tany karankaina\nIzao tontolo izao,\nKa reraka ny aina\nMihataka aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM444', 'Nivezivezy aho\nNikaro-java-tsoa,\nIzay rehetra hita\nNandramana avokoa;\nNandany taona maro\nNanaran-tsitrapo,\nKanefa tsy nahazo\nIzay mahafa-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM444', 'Mamitaka mihitsy\nIzao tontolo izao,\nNy mamy dia  mangidy,\nIzay tena soa tsy ao;\nKoa  aza mba adalainy\nIntsony re, ry fo!\nAndeha mba ho hendry\nHatramin’ny anio.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM444', 'Ry Jeso, Mofon’aina\nSy Ranon’aina koa!\nHianao no mahatòny\nIzay filan’ny fo;\nHianao no mahavoky\nHianao no manome\nIzay irin’ny foko,\nDia  hasambaram-be.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM445','FFPM 445');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM445', 'Jeso mora fo indrindra,\nTsara sady mahasoa,\nTsy miova, tsy mifindra,\nTompo be fitia tokoa.\nMba iriko ho toa Azy\nTsy mba mety soso-po,\nKa hionona ny foko\nRaha avy ny manjo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM445', 'Jeso tia, nanetry tena\nSy nandefitra tokoa,\nNefa Tompo be harena\nSy Mpanjaka foto-tsoa.\nMba iriko ho toa Azy\nIzay ninia  ho ory koa;\nKa ny sainy no fidiko,\nFa fiainana tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM445', 'He! manolo-tena aho,\nHo Anao, ry Tompo soa!\nKa ny heloko rehetra\nMba sasaonao avokoa.\nEnga ka homenao ahy\nFo madio sy vaovao,\nMba hahaizako manefa\nIzay rehetra sitrakao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM446','FFPM 446');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM446', 'Atolotro Anao\nny tenako, ry Raiko!\nFa Hianao no tena\nloharanon-tsoa\nIzao tontolo izao\nmanintona ny saiko\nHiataka Aminao\nho babony tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM446', 'Atolotro Anao\nny tenako, ry Raiko!\nHo eo an-tananao\nhosakambininao,\nHohatanjahanao\nny tena sy ny saiko\nHisikina tokoa\nhiady ho Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM446', 'Atolotro Anao\nny tenako, ry Raiko!\nFa izany indrindra re\nno hetahetako;\nNy ran’ny Zanakao\nmitory ao an-tsaiko\nMba hanolorako Anao\nny tenako.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM447','FFPM 447');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM447', 'Hianao, ry Kristy\nTompo,\nNo hasiniko izao,\nAvy aho, fa mpanompo,\nHiankohoka Aminao,\nRaiso re ny dera saotra\nTena mendrika\nho Anao;\nHe! ny foko faly loatra,\nFaly mba hanaja Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM447', 'Izao no tena faniriako :\nNy ho velona  Aminao,\nKa hitoeranao ny foko,\nFa tsy holalovanao;\nEny, Tompo ô! monena,\nMba monena ao tokoa,\nIzay no tena famonjena\nIzay no mahafatra-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM447', 'Tsy ho orin-java-tsoa\nIzay rehetra itoeranao,\nTena sambatra tokoa,\nRaha ny fo no lapanao,\nMandrosoa, fa vohako\nHo Anao ny foko izao;\nEny, Tompo, fa vohako,\nKoa  midira Hianao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM448','FFPM 448');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM448', 'Ry Tompo ô! tariho\nNy ondrikelinao,\nTantano sy vimbino\nHanao ny sitrakao;\nRaha  misy hafaliana,\nDia  taomy mba ho tia;\nRaha sendra fahoriana,\nSakano tsy hania :\nRy Jeso ô! tazano\nNy lalanay izao,\nTariho sy tantano\nHo ao am-balanao;\nAnio dia mikasa\nHanolo-tena koa,\nFa nenina ny lasa\nHiezaka tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM448', 'Anio ho hafaliako,\nNy foko lasanao,\nNy maminao no tiako,\nHatao ny sitrakao,\nNy androko rehetra,\nAtolotro Anao;\nAnao tsy misy fetra,\nKa raiso, anjakao :\nRy Jeso ô! tazano\nNy lalanay izao,\nTariho sy tantano\nHo ao am-balanao;\nAnio dia mikasa\nHanolo-tena koa,\nFa nenina ny lasa\nHiezaka tokoa.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM449','FFPM 449');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Njay reko, Tompo ô\n‘Njay re ny feonao;\nMiantso ahy Hianao\nHankany Kalvary,\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Malemy aho e,\nKa mitaraina hoe :\nVonjeo ny aiko,\nTompo ô!\nVonjeo ny olonao :\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Ny fiadanam-po\nMandresy ny manjo;\nEsorinao ny tahotro,\nRy Tompo ô! vonjeo\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Mpanota tsy mandà,\nRy Tompo, mamelà!\nNy fahotako lehibe\nIfonako tokoa;\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Ny foko tsy madio\nMba diovinao anio\nMaloto aho, \nry Tompo ô!\nSasao ho voadio\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM449', 'Ny foko no sasao,\nKa diovinao izao;\nNy fahotako marobe\nLevòny avokoa\nTompo lehibe,\nRaiso aho e!\nMba sasao ny ranao soa\nIzay tao Kalvary.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM450','FFPM 450');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM450', 'Jeso Kristy be fiantra!\nMba Jereo izahay\nVery amin’ota.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM450', 'Hianao Mpiandry tsara,\nRaisonao izahay\nVery toy ny ondry.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM450', 'Fombanay ny tia ratsy,\nMba ovay ho vaovao\nNy fonay izay ratsy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM450', 'Zazabodo sy mahantra,\nIzahay raha  atý,\nTsy mba manan-kery.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM450', 'Hianao no Vatolampy,\nTanjakay, Avotray,\nHery sy Ampinga.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM451','FFPM 451');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM451', 'Tompo ô! tsy takatry ny saiko\nNy fitiavanao tsy nohajaiko;\nKanjo io no hany antenaiko\nMba hamonjy ahy  izao.\n(Hamonjy izao)\nTompo ô, voababonao\nIzany foko ho Anao\nMamy re!\nIzany fitiavanao, ry Jeso ô!\n\n( Feo II )\nTompo ô! dia resinao ny\nfoko ilay nandà,\nVoababonao tokoa tokoa;\nKa nasandratrao ho Zanak’\nAndriamanitra,\nHotarihinao an-danitra.\nMamy dia mamy re, tsaroan’\nny aiko izao\nIzany fitiavanao, ry Jeso ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM451', 'Ny fandavan-tenanao tsaroako\nFa fandavan-tena nahitako\nNy fitiavanao izay inoako\nFa mambomba ahy izao.\n(Mambomba izao)\nTompo ô, voababonao\nIzany foko ho Anao\nMamy re!\nIzany fitiavanao, ry Jeso ô!\n\n( Feo II )\nTompo ô! dia resinao ny\nfoko ilay nandà,\nVoababonao tokoa tokoa;\nKa nasandratrao ho Zanak’\nAndriamanitra,\nHotarihinao an-danitra.\nMamy dia mamy re, tsaroan’\nny aiko izao\nIzany fitiavanao, ry Jeso ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM451', 'Ry Jesosy, tsy mba misy haiko\nAfa-tsy manolotra ny aiko\nEo an-tananao izay\nandrandraiko\nHampijoro ahy  izao\n(Hijoro  izao)\nTompo ô, voababonao\nIzany foko ho Anao\nMamy re!\nIzany fitiavanao, ry Jeso ô!\n\n( Feo II )\nTompo ô! dia resinao ny\nfoko ilay nandà,\nVoababonao tokoa tokoa;\nKa nasandratrao ho Zanak’\nAndriamanitra,\nHotarihinao an-danitra.\nMamy dia mamy re, tsaroan’\nny aiko izao\nIzany fitiavanao, ry Jeso ô!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM452','FFPM 452');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM452', 'Tompo ô! ovay ny foko\nMba ho mora anarina\nToy ny any zazakely\nTsotra sady marina,\n:,: Tsy mialona, tsy maditra,\nFa manao ny sitrakao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM452', 'Zaza, ka tsy te-hifidy\nIzay homenao ahy anio;\nNy ho azoko ampitso\nDia  ankinina  aminao;\n:,: Koa tsy manahy aho,\nFa efa niantohanao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM452', 'Zaza tsy maharo tena,\nFa miankina amin-dray.\nTsy mahery, tsy mba hendry,\nAry tsy mahay mandeha;\n:,: Hianao no Raiko tia,\nRaiko be fahari-po :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM453','FFPM 453');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM453', 'Mihirà, ry mponina ao\nan-danitra\nTonga izao ny very fahizay,\nFa ny Rainy faly sy finaritra\nMba handray ny zanany indray\nMihobia, re, ry lanitra,\nKa derao Andriamanitra.\nEny, mihobia re , ry mino ô,\nKa hirao ny fihiram-baovao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM453', 'Mihirà, ry mponina ao\nan-danitra\nFa ilay very dia hita  izao,\nVoaray ho Zanak’\nAndriamanitra,\nEfa tonga olona vaovao.\nMihobia, re, ry lanitra,\nKa derao Andriamanitra.\nEny, mihobia re , ry mino ô,\nKa hirao ny fihiram-baovao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM453', 'Mihirà, ry mponina ao\nan-danitra\nLehibe ny fifalianay,\nKa derao izao Andriamanitra,\nFa ny maty velona indray!\nMihobia, re, ry lanitra,\nKa derao Andriamanitra.\nEny, mihobia re , ry mino ô,\nKa hirao ny fihiram-baovao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM454','FFPM 454');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM454', 'Veloma no apetrako,\nFa tapaka ny hevitro,\nHandao ny fahazarako,\nFa Kristy no harahiko.\nVeloma Hianao,\nRy izao tontolo izao!\nIzaho tsy tamana atý,\nVeloma Hianao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM454', 'Ny làlan’ota hitako\nNamono ny fanahiko,\nFa he, erý dia tazako\nIlay tany soa mamiko\nVeloma Hianao,\nRy izao tontolo izao!\nIzaho tsy tamana atý,\nVeloma Hianao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM454', 'Mpanota ô, nahoana\nNo tsy miaraka aminay,\nFa mbola misy toerana\nIzay ho anao  sy ho anay.\nVeloma Hianao,\nRy izao tontolo izao!\nIzaho tsy tamana atý,\nVeloma Hianao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM454', 'Veloma, fa  ao aloha ao\nNo tany izay honenako,\nKa maika aho mba hankao\nHandray ny fitsaharako.\nVeloma Hianao,\nRy izao tontolo izao!\nIzaho tsy tamana atý,\nVeloma Hianao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM454', 'Jerosalema tazako,\nKa velona ny hirako,\nFa any no honenako\nHidera ny Mpanjakako.\nHo any aho izao,\nHo any aho izao,\nIzaho tsy tamana atý,\nHo any aho izao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM455','FFPM 455');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM455', 'Ny androm-pahasoavana\nManeho zava-baovao;\nMahazo fahasambarana\nIzao tontolo izao.\nRavoravo ny efitra maina\nMbamin’ny tany karankaina;\nHe, torina ny teny soa,\nKa dia afaka avokoa\nNy olom-bery maniry ho\nvelona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM455', 'Ka miandrandra ny lanitra\nNy malahelo izao;\nMihoby izy fa sambatra\nNahazo aina vaovao.\nHe, vahàna ireo migadra,\nAfaka ny midradradradra,\nMitsambikina ny mandringa,\nFaingana izy sady kinga,\nAry mihoby ny lelan’ny\nmoana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM455', 'Ny very no tadiavina\nMba hody amin’ny Ray;\nNy maty dia velomina\nKa ravo mandrakizay,\nIzy dia mifady ny ota,\nNoho ny lova tsy ho tonta,\nSady manaraka Azy Tompo,\nIzay voaeso sy voahombo,\nAmabara-podiny any\nan-danitra.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM456','FFPM 456');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM456', 'He, sambatra ny navelanao\nNy helony, ry Jehovah!\nNy otany voasaronao,\nKa tsy mba isaina koa;\nHe, sambatra ny mahitsy fo,\nFa azy ny lovasoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM456', 'Ny fo nony nampaginiko,\nNy heriko nihalany;\nNy ota izay nafeniko\nNo dia nahatonga izany,\nKa ketraka ny fanahiko,\nNisento sy nitomany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM456', 'Ny otako dia nambarako,\nNiantso ny Tompo aho,\nNiaiky ny fahadisoako,\nNivalo sy nitalaho,\nKa dia nomeny indrafo,\nMba ho afa-keloka aho.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM456', 'Jehovah no fialofako\nSy manda miaro ahy;\nNy rano, na dia tondraka,\nDia tsy hahatratra ahy;\nNy hobin’ny afa-keloka\nNo ampihirainao ahy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM456', 'Ry olon’Andriamanitra,\nVonjeo ny andro soa,\nNy otanao izay miafina,\nItsorinao avokoa;\nRaha mita ilay ony maizina,\nDia  aronao ny Tsitoha.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM457','FFPM 457');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM457', 'Jeso hany  iriko\nLoharanon’aiko\nSy Sakaiza soa!\nMamiko indrindra\nNy ho tafafindra\nAny Aminao,\nNa dia toa takona,\nHianao ao an-tsaiko,\nSady tohan’aiko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM457', 'Loza tsy misava,\nSento lalandava\nNo mitranga izao;\nNotrotroiny aho,\nKa ny fahavalo\nTsy mahazo ao.\nNa be aza ny manjo,\nTsy ho kivy ny fanahy,\nJeso mbola  ahy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM457', 'Ny haren’ny tany,\nNa dia tsara ihany,\nTsy ahoako;\nHianao irery\nLova tsy ho very,\nReharehako!\nKa na fahoriam-be\nNo mihatra amin’ny aiko,\nHianao tsy foiko.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM457', 'Raha ao am-poko\nHianao, ry Tompo,\nKa manjaka ao,\nIreo ahiahy,\nNahavalaka  ahy,\nDia  afakao,\nNa mavesatra  entana\nHianao no antenaiko\nSady Tohan’aiko.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM458','FFPM 458');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM458', 'Tompo tia ô, midina,\nMitoera aminay,\nKa fenoy fifaliana\nAo anatin’ny fonay.\nHianao, ry be fiantra,\nTomponay Mpamindra fo,\nNo mpamangy ny mahantra,\nKa midira ao am-po.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM458', 'Aoka re ny fofon’ainao\nHahavelona anay,\nHanahafanay ny sainao\nHampiadana anay.\nNy fitiavanay ny ota\nMba vonoy, ry Tomponay,\nManafaha anay mpanota,\nRy Andriamanitray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM458', 'Ny mpanomponao ampio\nMba handraisany Anao,\nAza afoy fa mba tahio,\nAoka ho tempolinao,\nHianao no hotompoinay,\nRy Andriamanitra,\nHianao no hoderainay\nHatrarý an-danitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM458', 'Tanteraho ao am-ponay\nNy fiainana vaovao,\nNy fanahy sy ny sainay\nMba fenoy ny herinao,\nAmboary sy havaozy\nIsan-andro izahay\nMandra-pahatonga any\nAminao mandrakizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM459','FFPM 459');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM459', 'Jeso, Loharanon’aina,\nJeso, Masoandronay!\nIzao ny fonay mitaraina,\nMba velomy izahay!\nO, savao ny zavon-tany\nAo am-pandehananay,\nDia Hianao ihany\nNo ho Masoandronay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM459', 'Jeso, Mofon’aina soa,\nMba vokiso izahay,\nJeso, Làlana tokoa,\nMba tariho izahay!\nAlfa sy Omega tsara\nHianao, Mpamonjinay;\nTeny soa manambara :\nJeso no fiainanay.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM460','FFPM 460');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM460', 'Ario ny tahotrao,\nRy olona  osa fo!\nIzay lazain’ny Tomponao\nTsy hisy tsy ho tò;\nNy fisentoanao\nDia reny avokoa;\nNy feon’ny fitarainanao\nValiany tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM460', 'Mpanjaka lehibe\nNo itokianao;\nNy tanany mahery re\nNo hamonjena anao;\nTsy misy mahalà\nIzay tiany hatao :\nHandositra amin-tahotra\nNy fahavalonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM460', 'Ny fitondràny soa\nNo iankinonao;\nKoa  aoka hofidiny koa\nIzay halehanao;\nNa dia tsy takatrao\nNy sainy lalina\nIzay tendreny ho anao\nEkeo ho marina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM460', 'Ry Tompo tsara ô!\nMba mijere anay,\nNa reraka  aza re ny fo\nTohanonao izahay :\nOvay ny hevitray,\nNy fonay hazavao,\nIzay atoronao anay\nHizoranay izao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM461','FFPM 461');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Aoka ho an’Andriamanitra\nNy fanendrena ny lalanao,\nFa hovimbininy  hianao\nAmin’ny lalan-tsarotra;\nFa toky tsy mamitaka\nNy tenin’Andriamanitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Fa inona no azonao\nAmin’ny fitahiana ?\nTsy afaka  ory hianao\nNoho ny fisentoana;\nNa be herehina hianao,\nHo be ny alahelonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Lefero kely, maneke\nIzay sitrak’Andriamanitra,\nNy zavatra tinendriny\nTsy maintsy mahasoa anao;\nIsika nofinidiny,\nKa tsy ho foiny indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Fa fantatr’Andriamanitra\nIzay andro hifaliana\nIsika no hodioviny\nAmin’ny fahoriana;\nTsy maintsy hofantenana\nVao afa-pahoriana.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Dia aza atao fa hianao\nAfoin’Andriamanitra;\nFa Izy dia mananatra\nNy zaza izay tiany,\nKa dia mba manomana azy\nHandova ny an-danitra.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM461', 'Misaora ny Ananrany,\nFa aza ketraka hianao\nFa ho tanteraka aminao\nNy soa lazain’ny Teniny;\nFa toky tsy mamitaka\nNy Tenin’Andriamanitra.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM462','FFPM 462');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM462', 'Eo an-tananao, ry Raiko!\nNo apetrako izao\nNy fiainako rehetra,\nMba tahio ny zanakao;\nMarobe ny fahavalo\nTa-hamely ahy e;\nRy Jehovah, Ray Mpiaro!\nMba arovanao anie.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM462', 'Raha mbola eto aho,\nZaza be fisiasia,\nTia ratsy noho ny soa,\nKa mandà ny Tompo tia;\nAza mba manary ahy,      \nRy Mpamonjy tsy mandao!\nAza manalavitra ahy,\nAndrao dia takona Aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM462', 'Na ho lava, na ho fohy\nNo hiainako etý,\nTsy mba sitrako akory\nNy handà ‘zay tendrinao;\nRaha tonga anio ny andro\nIzay handaozako ity,\nEo an-tànanao no tiako,\nRaiso aho ho arý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM462', 'Eo an tànanao, ry Raiko!\nNo apetrako izao\nAina, tena sy fanahy,\nMba vonjeo ny Zanakao,\nAmpianaro hahazaka\nFitondrana tianao;\nIlazao mba hahalala\nFa izao no sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM462', 'Eny Raiko! mba valio\nIzao fivavako izao,\nE, jereo ka mba tahio\nIzaho miandrandra Anao;\nMba sasao ny ranao soa,\nDia hadio aho izao;\nRy Mpamonjy! mihainoa\nNy mpanomponao izao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM463','FFPM 463');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM463', 'Jehovah no Ampinga\nSy Masoandro koa,\nHiaro amin-doza\nSy hanazava koa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM463', 'Ka tsy handresy ahy\nIzay fahavaloko;\nNa ota na devoly\nHo resy avokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM463', 'Ka raha alaim-panahy\nNa misy izay manjo,\nHanatona Azy aho\nHakako hery koa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM463', 'Rehefa tapitra andro,\nKa tonga amiko\nIzay hialako aina\nDia tsy ho tahotro.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM463', 'Ny lanitra haleha\nSy hitoerako;\nHidera an’i Jeso\nMandrakizay doria.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM464','FFPM 464');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM464', 'Ry Tompo manan-kery,\nMiarova anay!\nRy mpitady ondry very,\nMamonje anay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM464', 'Jeso Tompo be fitia,\nMitsinjova anay!\nNy fanahinay mania,\nMiantrà anay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM464', 'Jeso Tompo be fiantra,\nMijere anay!\nNy fanahinay mahantra,\nMitahia anay!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM464', 'Jeso Tompo mahalala,\nMananara anay!\nNy fanahinay adala,\nMitariha anay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM465','FFPM 465');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM465', 'Ry Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;\nTsy manan-tahotra aho,\nHianao no aroko;\nNy lalako mazava,\nHianao faniloko.\nRy Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM465', 'Mitaona dia mitaona\nNy zava-poana;\nAnkoso-bolamena\nMamirampiratra;\nAnefa ry Mpamonjy!\nIzay ampianao\nDia haharesy tsara\nIzao tontolo izao,\nRy Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;  ', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM465', 'Ny nofoko malemy,\nKa be ny sitrapo;\nBe koa ny fitsapana\nMahazo ahy izao;\nAnefa Jeso tia!\nRaha re ny feonao,\nMahazo hery aho\nHanao ny sitrakao,\nRy Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;  ', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM465', 'Ry Jeso ô! ry Jeso!\nMba tovy amiko\nIlay teny maharavo\nHoe “Sakaizako”;\nIriko lalandava\nHiaraka Aminao,\nMba hahitako tsara\nNy fitiavanao,\nRy Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;  ', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM465', 'Ny dianao jereko\nEtý an-dàlana,\nAmbara-pahatratra\nIlay fitsaharana,\nOmeo hery aho\nHanompo tsara Anao;\nFa fantatrao, ry Jeso!\nNy foko lazanao.\nRy Jeso ô! ry Jeso!\nNy foko lasanao,\nKa Hianao irery\nNo Tompoko izao;  ', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM466','FFPM 466');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM466', 'Ry Jeso ô! ry Jeso ô! \nNy fonay tia Anao,\nKa manomàna anay izao,\nHo any aminao :\nFa sambatra avokoa\nIzay tonga ao aminao;\nIzahay maniry koa\nHo eo ankilanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM466', 'Ry Jeso ô! ry Jeso ô! \nAmpionao izahay\nHihevitra ny lanitrao\nIzay hodianay :\nFa sambatra avokoa\nIzay tonga ao aminao;\nIzahay maniry koa\nHo eo ankilanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM466', 'Ry Jeso ô! ry Jeso ô! \nMaloto izahay\nTsy mendrika ny lanitrao,\nDiovinao izahay :\nFa sambatra avokoa\nIzay tonga ao aminao;\nIzahay maniry koa\nHo eo ankilanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM466', 'Ry Jeso ô! ry Jeso ô! \nNy fahavalonay\nMamely ny fanahinay,\nReseo, fa rafinao :\nFa sambatra avokoa\nIzay tonga ao aminao;\nIzahay maniry koa\nHo eo ankilanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM466', 'Ry Jeso ô! ry Jeso ô! \nSao reraka izahay\nMiandry ny hodianay,\nTohanonao ‘zahay :\nFa sambatra avokoa\nIzay tonga ao aminao;\nIzahay maniry koa\nHo eo ankilanao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM467','FFPM 467');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM467', 'Mba manampia anay,\nRy Jeso Tompo soa!\nKa dia ny fiainanay\nHambinina avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM467', 'Ny tadiavinay\nDia fihavanana,\nTsy hisarahana aminao\nIzay Fiainana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM467', 'Ampionao izahay\nMba hahalala Anao,\nKa aoka mba harahinay\nNy nodiavinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM467', 'Dia mankalaza Anao\nIzahay ry Tompo ô!\nFa he, ny fitahianao\nDia tena mahasoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM468','FFPM 468');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM468', 'Irinay Jeso tia,\nMpanota izahay,\nKa misy alahelo\nAtý anatinay;\nIrinay ny Mpamonjy\nHiseho ho anay,\nHanafaka ny ota\nMba hifalianay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM468', 'Irinay Jeso tia,\nMba hanazava anay,\nFa maizina ny sainay,\nKa diso izahay;\nIrinay Jeso Kristy\nHanolo-trsaina anay,\nIrinay Jeso hendry\nMba hianaranay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM468', 'Irinay Jeso tia,\nHo tonga aminay,\nHiantra sy hiaro\nSy hanadio anay;\nNa dia malemy aza\nKa reraka izahay,\nRehefa voavonjy,\nMatanjaka izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM468', 'Ry Tomponay malala!\nRy Jeso tianay!\nRy Havanay mahery!\nRy Rahalahinay!\nVonjeo izahay mpanota\nMiankina aminao,\nTahio izahay mahantra\nMivavaka aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM469','FFPM 469');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM469', 'Jeso ô, Mpitia anay!\nMaminay ny teninao,\nOsa ny fanahinay,\nFa mahery Hianao;\nMamy, ry Jeso! (in-3)\nNy fitiavanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM469', 'Jeso ô, Mpitia anay!\nMahadio Hianao;\nKa ny halotoanay,\nAoka ho voasasanao :\nMamy, ry Jeso! (in-3)\nNy fitiavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM469', 'Jeso ô, Mpitia anay!\nTompon’aina Hianao;\nMaro ny aretinay,\nNefa samy afakao :\nMamy, ry Jeso! (in-3)\nNy fitiavanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM469', 'Jeso ô, Mpitia anay!\nAoka hotarihinao;\nAza mba mandao anay,\nMandra-pahafatinay :\nMamy, ry Jeso! (in-3)\nNy fitiavanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM470','FFPM 470');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM470', 'Ny foko, ry Mpamonjy,\nMangetaheta Anao,\nManiry lalandava\nHikambana Aminao.\nTsy afaka ao am-poko\nNy faniriana Anao;\nOneno re ny foko\nHo lapanao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM470', 'Ny androm-pahoriana,\nRaha lapanao ny fo,\nManjary fitahiana,\nIzay manadio ny fo :\nTsy afaka ao am-poko\nNy faniriana Anao;\nOneno re ny foko\nHo lapanao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM470', 'Ny ora fifaliana,\nRaha ao anilanao,\nMamelom-paniriana\nHanao ny sitrakao :\nTsy afaka ao am-poko\nNy faniriana Anao;\nOneno re ny foko\nHo lapanao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM470', 'Ho lao ny fahotako\nRaha akaikezinao,\nTsy misy hadalako\nIzay tsy afakao :\nTsy afaka ao am-poko\nNy faniriana Anao;\nOneno re ny foko\nHo lapanao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM470', 'Finaritra ny saiko\nRaha ipetrahanao,\nFa reraka ny aiko\nRaha halavirinao :\nTsy afaka ao am-poko\nNy faniriana Anao;\nOneno re ny foko\nHo lapanao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM471','FFPM 471');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM471', 'He, sambatra aho, Jeso,\nraha miaraka Aminao,\nFa ny làlanao dia lavi-\npahoriana;\nNy ali-mampahory,\nny raho-mitatao\nEo anilanao dia mody\nfitahiana.\nTano aho, Jeso, hiaraka\nAminao\nIzay làlana ombako, e! mba\nhazavao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM471', 'Izao no faniriako, manetsika\nny fo :\nHo sakaizanao mandrakizay\ndoria;\nNa inona mihatra, na inona\nmanjo,\nHianao no antenaiko hitàntana\nny dia.\nO! avia Jeso, tano aho e!\nTantanonao ny diako,\nTompo mamonje!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM471', 'Izay sakaizanao, Jeso, no\nampoky ny soa,\nFeno haravoana sy lavitra\nmanjo;\nIzay rehetra ilaina anananao\ntokoa,\nRaha miaraka Aminao,\nmionona ny fo\nSambatra aho, Jeso,\nTretrika tokoa,\nRavo ny fanahiko, toloranao\nny soa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM471', 'Inona no mamiko mihoatra\nnoho Hianao ?\nTompo manan-kery sy\nloharanon-tsoa ?\nIzay zavatra ilaiko azoko\nAminao\nKoa onenanao ny foko, ho\nlapanao tokoa.\nManjakà, Jeso, ato am-poko\nHianao\nIzay fahotako e! ry Tompo\navelao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM472','FFPM 472');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM472', 'Iriko e, ry Jeso!\nHitovy Aminao,\nIzay tsy manan-keloka,\nFa masina tokoa;\nIriko e, ry Jeso!\nHo tonga toa Anao,\nNamonjy sy nanafaka\nFanahy, aina koa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM472', 'Iriko, ry Mpamonjy!\nMba ho sakaizanao,\nHiaraka ory Aminao;\nKa tsy handao Anao;\nIriko, ry Mpamonjy!\nHanar-dia Anao;\nNy hazofijaliana\nHo entiko izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM472', 'Iriko, ry Mpandresy!\nHiaraka Aminao,\nHo eo an-toby lehibe,\nHo miaramilanao;\nIriko, ry Mpandresy!\nHanaraka Anao;\nMitondra ny fanevanao,\nHandray ny herinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM472', 'Iriko, ry Mpanjaka!\nHo ao an-dapanao\nHiara-paly Aminao,\nFa tonga Zanakao;\nIriko, ry Mpanjaka!\nHo eo anilanao\nHandray ny lova atolotrao,\nMpanjaka be fitia!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM473','FFPM 473');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Mombà anay, ry Jeso \nTompo ô! \nFa maizina ny alina atý;\nTsy misy vonjy raha tsy\nAminao;\nMpamonjy tia ô!\nmombà anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Mandalo koa ny andronay etý\nKa mihalo ny fifalianay;\nMiovaova izao rehetra izao\nRy tsy miova ô!\nmombà anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Aza mba mivahiny aminay,\nAza mihevitra ny helokay;\nAoka ho be ny famindranao\nfo;\nRy Jeso Tompo ô!\nmombà anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Tsy mahaleo tena izahay,\nFa mora resy, mora kivy koa;\nRy Jeso Tompo! aoka\nhonenanao\nEtý an-dasin’ny \nmpanomponao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Ny teninao no fifalianay;\nNy masonao mitari-dalana;\nAry ny herinao no tanjakay;\nSakaiza tsara ô! mombà anay.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Izay ombanao afa-tahotra,\nTsy mety kivy na mamoy fo;\nTsy misy fahoriana izay\nHaninona ny fo arovanao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM473', 'Rehefa tonga ny fotoana\nHitànay ilay ony maizina,\nAoka ny tavanao hazava ao,\nAmin’izany re mombà anay.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM474','FFPM 474');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM474', 'Jesosy ô, Hianao no faleha!\nMba hankanesana amin’ny Ray,\nKa mitariha anay mba handeha\nAmin’ny làlana marina indray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM474', 'Fa Hianao no Mpamonjy voatendry,\nZanaka mandrakizay Hianao;\nKa Hianao no Mpitarika hendry,\nLalana amin’ny Ray Hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM474', 'Diso ny tsara, ka dia nizotra\nTamin’ny lalana ratsy izahay;\nKoa mamerena anay mba hizotra\nAmin’ny lalana tsara indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM474', 'Fa Hianao no mitondra ho any\nAmin’ny lanitra fonenanao;\nAry tsy misy mahazo mankany\nAfa-tsy amin’ny alalanao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM474', 'Maro ny zavatra izay mampahory,\nFa Hianao no Mpiaro anay;\nAoka izahay tsy ho reraka Akory,\nRy Mpanalalana amin’ny Ray!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM475','FFPM 475');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM475', 'Jeso Mpamonjy, Mpiandry\ntokoa \nAmpivereno hanaraka Anao;\nOndry mania, manary ny soa,\nAza avela hiala aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM475', 'Taomin’ny ratsy, fitahin-tSatana,\nMila ho lasan-ko babo izahay,\nFa Hianao no mahery mitana\nTsy hahavery ny ondry iray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM475', 'Varivariana, salasalaina,\nBe ahiahy, jereo izahay;\nAmpianaro ny tsy hary saina,\nAmpitsaharo ny fanianay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM475', 'Aina nomenao hisolo ny very,\nAry ny ranao nanvotra anay,\nFa Hianao no nitondra irery\nFampijalian-kanitsy anay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM475', 'Fa ny fiainan-tsi-hita resenao\nVelona mandrakizay Hianao;\nDia fiainana an-danitra omenao\nIzay ondry mety manaraka Anao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM476','FFPM 476');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM476', 'Ny eo akaikinao, ry Ray,\nNo mamiko izao,\nHanjary tena tafaray\nNy foko sy ny Anao,\nSoa re, ry Raiko ô!\nRaha eo anilanao;\nNy hazo fijaliana\nHo tonga maivana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM476', 'Ny eo akaikinao, ry Ray,\nNo herin-janakao;\nHianao irery no mahay\nManampy ahy izao.\nSoa re, ry Raiko ô!\nRaha eo anilanao;\nNy ota tsy hanapaka\nNy olona afaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM476', 'Ny eo akaikinao, ry Ray,\nNo mandako tokoa;\nNy ratsy dia tsy hahay\nHandrombaka ahy koa,\nSoa re, ry Raiko ô!\nRaha eo anilanao;\nNy ora izay manjombona\nHo fiadanana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM476', 'Ny eo akaikinao, ry Ray,\nNo fifaliako izao,\nNy tanako dia hifandray\nAmin’ny tananao.\nSoa re, ry Raiko ô!\nRaha eo anilanao;\nFenoinao fanambinan-tsoa\nIlay kapoakako.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM477','FFPM 477');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM477', 'Oram-be mivatravatra,\nArotsahy, Tompo ô!\nFa mangetaheta loatra\nIzahay mpanompona.\nO! valio, O! valio,\nMitaraina ka valio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM477', 'He! malazo re ny voly\nIzay maniry tsy mamoa;\nNefa raha omenao aina,\nDia ho vokatra tokoa.\nO! vangio, O! vangio,\nSao dia maty, ka vonjeo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM477', 'Tovy eto, ry Mpamonjy!\nIzay nambara fahizay,\nKa iraho ny Fanahy\nAmin-kery lehibe.\nO! henoy, O! henoy,\nKa valio ny vavakay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM477', 'He! toa kivy ka manahy\nIzahay mpiasanao;\nAza ela, ry Fanahy!\nAsehoy ny herinao.\nO! avia, O! avia,\nMisehoa, Fanahy ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM478','FFPM 478');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM478', 'Ny hirako izao,\nRay be fitia,\nNy ho akaikinao\nBebe kokoa,\nIzay re no hirako,\nMandra-pahafatiko;\n:,: Akaikinao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM478', 'Raha mba sarotra\nNy diako\nKa zary maizina\nNy làlako,\nRy Ray! akaikinao\nNo tian’ny zanakao :\n:,: Akaikinao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM478', 'Ao no hiseho re\nNy tohatra\nMba hanatonako\nNy lanitra,\nAnjely miantso ahy\nAkaikinao, ry Ray!\n:,: Akaikinao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM478', 'Ny fahoriana\nSy loza koa,\nRaha eo anilanao\nDia mody soa,\nKa dia tano aho\nHo ao akaikinao;\n:,: Akaikinao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM478', 'Na dia hilentika\nNy androko,\nAry izao hita izao\nHilaozako,\nMbola ho hirako\nRy Andriamanitro!\n:,: Akaikinao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM479','FFPM 479');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM479', 'Jeso no anjara soa\nIzay mahafa-po tokoa,\nSoa tsy manam-paharoa,\nAhy Jeso : Ampy   izay.\nAhy Jeso hatretý,\nAhy Jeso hatrarý\nAhy Jeso Zoky tia\nMandrakizay doria, doria.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM479', 'Vola sy harena be\nMaro tia tokoa anie;\nNefa mamiko ny hoe :\nAhy Jeso : Ampy  izay.\nAhy Jeso hatretý,\nAhy Jeso hatrarý\nAhy Jeso Zoky tia\nMandrakizay doria, doria.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM479', 'Fahefana, laza soa\nMahafatifaty koa;\nNefa izao no tena soa :\nAhy Jeso : Ampy  izay.\nAhy Jeso hatretý,\nAhy Jeso hatrarý\nAhy Jeso Zoky tia\nMandrakizay doria, doria.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM479', 'Eny, izao rehetra izao\nTsy hamoizako Anao,\nFa Jeso izay tsy mandao!\nAhy Jeso : Ampy  izay.\nAhy Jeso hatretý,\nAhy Jeso hatrarý\nAhy Jeso Zoky tia\nMandrakizay doria, doria.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM479', 'Jeso, aina, hery, zo;\nJeso, lova tsy mba lo;\nJeso fiainam-po;\nAhy Jeso : Ampy  izay.\nAhy Jeso hatretý,\nAhy Jeso hatrarý\nAhy Jeso Zoky tia\nMandrakizay doria, doria.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM480','FFPM 480');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM480', 'Mamin’ny foko, ry Jeso ô!\nNy famonjena izay vitanao,\nNy hadisoako navelanao,\nTena afaka aho mandrakizay.\nJeso malala ô! Mpamonjy soa!\nIndro ny aiko raiso ho Anao;\nVelon-kanompo, velon-kanoa\nVonon-kanao izay sitrakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM480', 'Tano ny foko, ry Jeso tia!\nZaza tsy mahasaraka Anao!\nMbola malemy, mora mania,\nTano hifikitra ao Aminao.\nJeso malala ô! Mpamonjy soa!\nIndro ny aiko raiso ho Anao;\nVelon-kanompo, velon-kanoa\nVonon-kanao izay sitrakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM480', 'Aoka ny foko sy ny fonao\nHiara-mitepo tena iray;\nAoka ny saiko sy ny sainao\nHiray safidy mandrakizay.\nJeso malala ô! Mpamonjy soa!\nIndro ny aiko raiso ho Anao;\nVelon-kanompo, velon-kanoa\nVonon-kanao izay sitrakao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM481','FFPM 481');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM481', 'Ry Tompo be fitia!\nIzaho zanakao\nTantano tsy hania\nHiaraka aminao;\nFa mamiko tokoa\nNy eo ankaikinao;\nTsy orin-java-tsoa,\nIzay sakaizanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM481', 'Harena be an-tany\nMamilivily fo,\nFa tiana mora lany\nKa tsy mampionom-po;\nIzany aniriako\nHifikitra aminao;\nAtolotro ny foko\nHo eo an-tananao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM481', 'Fa raha Izaho irery\nVoasakan-tsitrapo,\nMandeha manirery,\nKa maro no manjo;\nIzany no ilàko\nHiaraka aminao,\nVimbino aho, Raiko!\nHo eo an-tananao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM481', 'Tsy hitako mihitsy\nIzay mahafa-po,\nTsy misy etý akory\nIzay tsy mety lo;\nFa ao am-paradisa\nNo feno zava-tsoa,\nTsy mahadisadisa,\nFa sambatra tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM482','FFPM 482');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM482', 'Jehovah ô! Hianao nandinika\nahy,\nKa fantatrao ny toe-piainako;\nNy fo sy saina mbamin’ny\nfanahy\nTsy miafina aminao, ry\nTompoko!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM482', 'Ka na mipetraka aho, na\nmandeha\nIzay rehetra ataoko hitanao,\nHe, fantatrao ny lalana haleha,\nNy androko dia eo an-tananao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM482', 'Na velona aho, eny, maty aza,\nNy tenako dia eo imasonao,\nKa toerana aiza, lalana\nmankaiza\nNo hialako tsy ho hitanao ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM482', 'Ry Tompo! tena mahagaga\nloatra\nNy asanao sy ny fisainanao;\nTsy misy saina mety\nmahatratra\nNy fahendrenao sy ny herinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM482', 'Izao no hany zavatra iriko;\nVelaro indrindra ny fitiavanao,\nHahaizako hametraka ny foko\nHionona eo am-pelatananao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM483','FFPM 483');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM483', 'Zanahariko Tsitoha\nTompo, Hery sy Fitia,\nRay hatramin’ny taloha,\nAhy anio, ka ho doria.\nManjakà mandrakizay\nAo am-poko, Tompo soa;\nDera, laza, Anao ry Ray!\nZanaka, Fanahy koa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM483', 'Ny finoakao Anao,\nHatanjaho mba hamoa\nHiasako ny asanao,\nHamafazako ny voa.\nAoka ny Fanahinao\nJiro mba hitarika ahy\nKa apetrako aminao\nNa ny tena na fanahy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM483', 'Antenaiko, Hianao, Jeso\nIzay Mpitsara lehibe\nHanamarina ahy ao,\nNa mpanota aza re.\nDia hiezaka aho etý\nMba hanao izay mendrika\nHamindrànao fo arý\nFa voavela heloka.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM483', 'Ray ô, ny fitiavanao\nAfindrao ho toetrako,\nMba hitiavako Anao,\nAry koa ny namako.\nHo mpanompo aho re!\nHo mpitory koa Anao!\nMba hanjaka an-tany e,\nTompo, ny fitiavanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM484','FFPM 484');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM484', 'Ireo didinao, Jehovah Ray;\nIzay tianao hankatoavinay\nDia rehareha sy voninahitra,\nSatria filamatry ny ao\nan-danitra.\nIlaina mba hiseho fa tsy hiery,\nHo fisintonana ireo izay very,\nFa antoky ny fiainanay,\nHatramin’izao, mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM484', 'Ny fitsipikao, Tomponay\nIzay nomenao mba\nharahinay,\nDia mampifantina izay anjara\nsoa\nKa manamboatra sy\nmanatsara,\nMampisy endrika itony tena\nSy manazava ny firenena,\nKa antoky ny fiainanay,\nHatramin’izao, mandrakizay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM484', 'Ireo teninao, Jesosinay\nNo hany zavatra ivelomanay,\nFa tanjaka tokoa, tena hery be\nHahafahanay ny lalana\nmideza re,\nSakafo mahavelona ny aina,\nSy mampiravo tokoa ny saina,\nTena antoky ny fiainanay,\nHatramin’izao, mandrakizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM485','FFPM 485');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM485', 'Moa Jesosy ve tsy ahy ?\nAndriamanitra mahery \nKoa nahoana no hanahy\nIzy miambina  mijery.\nFahavalo na dia maro\nTsy mba mahakasika ahy\nIzy no ampinga miaro\nKoa izaho tsy hanahy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM485', 'Moa Jesosy ve tsy ahy ?\nIlay Mpanolotsaina hendry\nKoa tsy kivy fa ho sahy\nAmin-java-tsoa kinendry.\nTsy manaonao foana\nFa tarihin-Kapiteny.\nTsy manahy satria nahoana ?\nAo ny saina izay nomeny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM485', 'Moa Jesosy ve tsy ahy ?\nIlay Jesosy mahagaga,\nMpanasitrana, Mpitahy\nKa ahoako izay hitranga ?\nRanomasina aza tao,\nNampagininy ka tony;\nHainy mihitsy ny manao\nHahatò ny sitrapony.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM485', 'Moa Jesosy ve tsy ahy ?\nRain’ny mandrakizay, eny!\nVelon-toky ny fanahy\nIzay nekeny , novonjeny,\nKoa na ory sy mijaly\nAza aho etý an-tany,\nVetivety dia hifaly :\nMampaninona izany ?', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM485', 'Moa Jesosy ve tsy ahy ?\nIlay Andriampiadanantsika,\nAndriamanitra Mpiahy,\nFitahiana feno hika.\nFamonjena efa vita\nHofikiriko hatrany,\nFahasoavana hampita,\nAny am-paradisa any.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM486','FFPM 486');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM486', 'Inona no hahasaraka ahy\nAmin’ny fitiavanao, Jeso ?\nFahoriana ve, sa ahiahy ?\nFahantrana, sa famoizam-po ?\nTsia, ry Jeso Tompo be fitia,\nIzaho tsy mivadika Aminao\nFa mandrakizay doria doria\nIzaho dia hanaraka Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM486', 'Inona no hahasaraka ahy\nAmin’ny fitiavanao, Jeso ?\nZo sy laza sy fakam-panahy ?\nSa harena, zava-mora lo ?\nTsia, ry Jeso Tompo be fitia,\nIzaho tsy mivadika Aminao\nFa mandrakizay doria doria\nIzaho dia hanaraka Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM486', 'Inona no hahasaraka ahy\nAmin’ny fitiavanao, Jeso ?\nSabatra, sa fanenjehana\nmafy ?\nSa mosary, ady be manjo ?\nTsia, ry Jeso Tompo be fitia,\nIzaho tsy mivadika Aminao\nFa mandrakizay doria doria\nIzaho dia hanaraka Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM486', 'Inona no hahasaraka ahy\nAmin’ny fitiavanao, Jeso ?\nFaty ve no hampivadika ahy,\nLoza, hery, fahefana koa ?\nTsia, ry Jeso Tompo be fitia,\nIzaho tsy mivadika Aminao\nFa mandrakizay doria doria\nIzaho dia hanaraka Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM486', 'Eny, izao rehetra izao,\nry Tompo\nTsy mba hahasaraka Aminao!\nNa inona hanjo ity mpanompo\nDia hijoro, tsy handao Anao!\nVelona aho, Tompo, eny maty\nDia tsy mivadika Aminao!\nHianao no velona ao anaty,\nKa doria, ny foko ho Anao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM487','FFPM 487');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM487', 'Fanavaozana izay mahagaga\ntokoa \nNomen’i Jeso ahy re!\nFahazavan’ny fanahy izay\nmahafa-po\nNomen’i Jeso ahy re!\n:,: Hatramin’izao dia\nendrey, endrey :,:\nNy fitempon’ny foko izay\nravo tokoa\nOnenan’ny Tompo Jeso.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM487', 'Ny fiainako be siasia taloha\nVoaova mihitsy izao\nEny, ny fahotako, izay\nnahavoa\nVoasasany koa izao,\n:,: Hatramin’izao, dia\nendrey, endrey :,:\nNy fitempon’ny foko izay\nravo tokoa\nOnenan’ny Tompo Jeso.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM487', 'Ny finoako, ny fanantenako\ndia be\nNy tokiko fatratra koa\nNy fisalasalana dia levona re,\nNy saiko mandroso ho soa.\n:,: Hatramin’izao, dia\nendrey, endrey :,:\nNy fitempon’ny foko izay\nravo tokoa\nOnenan’ny Tompo Jeso.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM487', 'Tonga mamirapiratra fatratra\nerý\nNy aloky ny faty re!\nKa dia tsinjoko ilay vavahady\narý\nMankao an-tanàn-dehibe\n:,: Hatramin’izao, dia\nendrey, endrey :,:\nNy fitempon’ny foko izay\nravo tokoa\nOnenan’ny Tompo Jeso.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM487', 'Tsy miato, mizotra mankany tokoa\nNy diako hatramin’izao\nHovantaniko any Ilay Tompo soa\nJesosy malala no ao.\n:,: Hatramin’izao, dia\nendrey, endrey :,:\nNy fitempon’ny foko izay\nravo tokoa\nOnenan’ny Tompo Jeso.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM488','FFPM 488');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM488', 'Na inona inona hitranga,\nJeso!\nNa ny lanitra ho manga,\nJeso!\nNa ho maloka mangina,\nJeso!\nDia ho feno fifaliana,\nJeso!\nNy fotoana dia handalo,\nJeso!\nFa tsy hisy hampimalo,\nJeso!\nRaha miorina ao am-poko,\nJeso!\nIlay fitiavanao inoako,\nJeso!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM488', 'Raha jereko ny andro lasa,\nJeso!\nTao ny tsiky, tao ny ratra,\nJeso!\nNefa Hianao, Ilay \nMpampahery,\nJeso!\nNo nambomba sy nijery,\nJeso!\nNy fotoana dia handalo,\nJeso!\nFa tsy hisy hampimalo,\nJeso!\nRaha miorina ao am-poko,\nJeso!\nIlay fitiavanao inoako,\nJeso!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM488', 'Ny ho avy antenaiko,\nJeso!\nMbola ho fifalian’ny saiko,\nJeso!\nNy hasasarako hisava\nJeso!\nNy harivako hazava,\nJeso!\nNy fotoana dia handalo,\nJeso!\nFa tsy hisy hampimalo,\nJeso!\nRaha miorina ao am-poko,\nJeso!\nIlay fitiavanao inoako,\nJeso!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM489','FFPM 489');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM489', 'Tena sambatra sy mahate-ho\ntia\nIzay masim-po, madio \nfisainana,\nFa miara-dàlana mifankatia\nAmin’Andriamanitra,\nFiainana.\nMasina tokoa re ry Tompo\nTianay mba ho masina,\nSaina, tena sy fanahy\nKa fiainan-danitra tokoa\nNo santarin’izay mino sy\nmanoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM489', 'Indro, mampahery, mahatoky\nkoa\nRaha mahitsy ny fijery, soa\nny fo;\nFa ny fo madio sy masina\ntokoa :\nParadisa an-tany, feno\nzava-tsoa\nMasina tokoa re ry Tompo\nTianay mba ho masina,\nSaina, tena sy fanahy\nKa fiainan-danitra tokoa\nNo santarin’izay mino sy\nmanoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM489', 'Koa halaviro ny fitaoman-\ndratsy,\nNy fisakaizana tsy mba\nmasina;\nFa ny tia ny Tompo, dia\nolon-tsoa mitafy\nFahadiovan’ny Fanahy \nMasina.\nMasina tokoa re ry Tompo\nTianay mba ho masina,\nSaina, tena sy fanahy\nKa fiainan-danitra tokoa\nNo santarin’izay mino sy\nmanoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM489', 'Miaraha làlana amin’i Jesosy.\nFa ny fahavalo ta-hamotraka,\nMijoroa, reseo ny toetra\nmampihosina\nAo anaty loto sy ny fotaka\nMasina tokoa re ry Tompo\nTianay mba ho masina,\nSaina, tena sy fanahy\nKa fiainan-danitra tokoa\nNo santarin’izay mino sy\nmanoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM490','FFPM 490');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM490', 'Ry kristiana, andrandrao\nNy Tompo sy Mpanjakanao,\nFa Izy no Mpiaro;\nKa aza taitra hianao,\nNa dia manakora izao\nNy fahavalo maro;\nOmban’ny Tompo hianao,\nKa aza atahoranao\nNy rahon’ny mpamely.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM490', 'Fa indro tsy rendrehana\nIlay Mpiambi-masina,\nIzay Tokin’Israely;\nFantaro marina izao,\nIzay ataon’ny rafinao\nAoka ho azy izany;\nFa andrandrao ny lanitra,\nAnao Andriamanitra,\nAnao ny fanjakany.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM491','FFPM 491');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM491', 'Inoantsika marina\nNy Mpamorona Tsitoha,\nIsika dia natsangana\nMba ho zanany tokoa,\nHanina sahaza omeny,\nAry be ny famonjeny,\nAmin’ireo loza maro\nDia Izy no Mpiaro;\nInoantsika ao am-po\nFa Izy marina sy to.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM491', 'Jesosy Kristy Zanany\nNo inoantsika koa;\nIsika dia fananany,\nFa navotany tokoa,\nIzy Zanak’i Maria,\nDia rahalahy tia;\nMaty ka natao ho very,\nFa nitsangana amin-kery,\nNiakatra ao an-dapany,\nHitsara ao am-parany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM491', 'Ka ny Fanahy Masina\nNo inoantsika koa,\nNy fiangona-masina\nNo naoriny tokoa;\nAo isika dia mahita\nFamonjena efa vita;\nAfaka ny helotsika,\nFo vaovao no raisintsika;\nIsika dia hatsangana\nHo velona ao an-danitra.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM492','FFPM 492');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM492', 'Izaho mino ny\nMPAMORONA,\nMpanao ny tany sy ny lanitra;\nIzaho manam-panorenana,\nFa manan-dRay arý\nan-danitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM492', 'Izaho mino ny\nMPANAVOTRA,\nNy rany masina no mamiko,\nNy momba Azy dia sambatra,\nNy diany no mba harahiko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM492', 'Inoako ny MPANAMASINA,\nMpananatro sy Masoandroko;\nIzaho omeny afo masina,\nMba ho madio ny fiainako.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM493','FFPM 493');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Ny loharanom-pamonjena,\nHe, hitako tokoa izao,\nDia Jeso Kristy, Ilay nomena\nHamonjy izao tontolo izao,\nNy rany dia fantaro\nFa ampy hiankinako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Ny otantsika no nanery\nNy Tompontsika hankatý\nIsika hitany ho very,\nIzany no nidinany\nNitondra fahoriana\nSy hazo-fijaliana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Ny nialan’ny Tompo aina\nHanaisotra ny heloka\nDia tsy mba takatry ny saina,\nFa hitan’ny finoana,\nNy rany no miantso hoe :\nHe, famindrampo lehibe!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Izay no nampionona ahy,\nKa afaka ny tahotro;\nNa dia ory ny fanahy,\nJesosy no Mpanavotro\nNa misy mampanahy fo,\nNy Raiko no be indrafo.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Na very aza ny harena,\nKa be ny fahoriana,\nIzaho mbola manantena\nHahita fifaliana;\nJesosy, Izay fananako,\nDia Tompo feno indrafo.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Izaho tsy matoky tena,\nNa ny fahamarinako;\nJesosy foto-pamonjena\nNo tena itokiako,\nNy Raiko no isaorako,\nFa izy be indrafo.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Izay sitraky ny Ray malala\nNo aoka mba ho sitrakao\nFa izy tena mahalala\nHametraka izay anjarako;\nIzay ataony tiako,\nFa hitako ny indrafo.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM493', 'Izany fototra izany\nNo toky izay hotanako\nAmbara-pitako ho any\nAn-koatry ny fasako,\nKa any no hisaorako\nIlay fototry ny indrafo.', '8');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM494','FFPM 494');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM494', 'O, ry Zanahary,\nIzay nahary ahy,\nBe ny herinao!\nManan-toky aho,\nFa tsy maty taho,\nManana Anao;\nAfa-po ny zanakao,\nHianao no Ray Mpiahy,\nKa  iza no hanahy!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM494', 'Hianao no Raiko\nTena fototr’aiko,\nSady heriko.\nHianao no aro,\nTsy ho reraka aho,\nTsy ho kivy fo;\nAo ambany elatrao\nNo ataoko fiereko;\nAo tsy misy sento.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM494', 'Latsaka isan-andro\nToy ny ranonando\nNy fitianao.\nRaha alaim-panahy,\nKa manafotra  ahy\nRe ny otako,\nDia ho tafatsangana\nHanavao ny herin’aiko\nHianao, ry Raiko.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM494', 'Ary raha lany\nToy ny zavon-tany\nNy fiainako;\nMisy onin’aina\nTsy mba mety maina\nAo an-danitrao;\nAo no hitoerako,\nAo an-tranonao, ry Raiko,\nAo no antenaiko.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM495','FFPM 495');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Jeso dia tokiko,\nFa Mpamonjiko mahery,\nSady tena zokiko\nTsy hamela ahy irery\nAo amorom-pasako,\nFa hiaraka amiko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Izy tenany mandre\nNy hangidin’ny fitàna\nIlay ony maintibe\nVokatry ny fahotana;\nKoa tsy hilaozany\nIrery ny olony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Izaho hody vovoka,\nFa ny androko ho lany,\nNefa dia hatsangana\nSy hakarina hankany\nAmim-boninahitra,\nIzay tsy mety tapitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Dia ho tafatambatra\nNy fanahy sy ny tena,\nAry samy sambatra,\nFa nahazo famonjena,\nIzay Jesosy, havako,\nVao ho tena hitako.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Izay manjo atý izao\nTsy mba misy ao akory,\nFa finaritra ny ao.\nTapitra ny mampahory,\nKa ny fahalovana\nHody fifaliana.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM495', 'Eto aho reraka,\nAny misy hazon’aina\nVita sy tanteraka\nIzay rehetra nantenaina\nAo no hahatrarako\nNy fahasambarako.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM496','FFPM 496');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'Jeso iankinako,\nIzy no mpanavotro;\nKristy itokiako\nAmin-tsaina sy ny fo;\nKristy ifaliako,\nIzy marina sy to.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'Nahafoy ny lanitra\nHianao, Mpanavotra;\nRaha ny vahoakao\nNobaboin’ny rafinao,\nHianao mangoraka,\nRy Kristy Mpanafaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'Fahoriambe ny erý\nNo nanjo Anao tatý\nFa ny fahavalonao\nDia nanenjika Anao;\nNefa novalianao\nIndrafo ny rafinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'He, nijaly Hianao\nNoho ny fitiavanao\nKa ny famindramponao\nNo nahafatesanao;\nHianao nasandratra,\nFa nijaly fatratra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'Sarobidy izahay,\nFa ny ranao avotray,\nIzay nomenao ho anay,\nMba hanafaka anay;\nTonga olom-potsinao\nIzahay navotanao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM496', 'Ravoravo izahay,\nRy Mpamonjy maminay,\nKa ny fanavotanao\nAn’izao tontolo izao\nSy ny fitivanao\nNo isaoranay Anao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM497','FFPM 497');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM497', 'Ny tany sy ny lanitra tsy\nmanam-petra\nHiaraka amin’ny mino\nrehetra\nManaiky fa Jeso no aina\nhamonjy\nNy olona ory izay mila vonjy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM497', 'Na dia manenjika ahy ny\nratsy,\nTsy lany ny hery, fa Jeso\nmanampy\nDia  Izy no tanako mafy\ntokoa,\nKa tsy ialako, fa Tompo\nTsitoha.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM497', 'Jesosy Sakaizako dia miahy\nNy Azy, ka afaka ny ahiahy,\nNy fo malahelo ovany ho\nfaly,\nKa tretrika indray   ireo olo-\nmijaly.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM497', 'Jesosy fidiko ho Tompo\ntokoa,\nEfaiko ny asa sy hevitra soa,\nIzay halan’ny Tompo tsy\ntiako intsony,\nKa tena iraisako tsara any\nfony.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM497', 'Izay tanako mafy sy mamy\nhambara\nRehefa ho faty, ka tonga ny\nanjara :\nJesosy, Jesosy irery ihany\nNo aina, harena tsy mety ho\nlany.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM498','FFPM 498');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM498', 'Ahy va Jesosy Tompon’aina ?\nMoa ahy va ny lanitra ?\nEny, matokia, ry fo sy saina,\nFa eken’Andriamanitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM498', 'Eny, zokiko Jesosy Tompo,\nFahagagana lehibe erý,\nTsy antsoiny hoe mpanompo,\nFa ataony tena havany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM498', 'Toa mila hampisalasala\nIo tena fahagagana io,\nAry lavin’ny tsy mahalala,\nNefa azon’ny finoako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM498', 'O, mba mifalia, ry fanahy,\nFa anao Ilay Mpanavotra!\nKa misaora, aza mba manahy,\nFa ho azonao ny lanitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM498', 'Iombonana ny lova any,\nFa Iray ny Ray an-danitra!\nKa harena be dia be izany,\nHasambarana maharitra.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM499','FFPM 499');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM499', 'Inona re no hatakaloko\nAn’i Jesosy Izay mpisoloko ?\nNy zavatra izay ho simba va\nsy mora levona ?\nRaha mbola hazoniko ny to,\nKa tsy maty ny jiro ao am-po,\nJesosy tsy soloako na inona\nna inona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM499', 'Indro, Jesosy no fiainako,\nIzy no manda fiarovako;\nIzaho efa maty, nefa\nnovelominy indray.\nKa na dia mahantra aza atý,\nKa tsy mbola nafindra ho arý,\nJesosy no anjarako, ka ampy\nahy re izay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM499', 'O, ry Jesosy Tompo tsara ô!\nAza mamela ny fanahiko\nHisaraka  aminao, fa tano aho\nho mpanomponao.\nMba velomy ny fitiavako,\nKa tohano ny fandehanako,\nMba hanarahako ny lalana\nizay nalehanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM500','FFPM 500');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM500', 'He! manda fiarovana,\nAndriamanitsika,\nAmpinga mahatohana\nIzay manjo antsika.\nMamely fatratra\nSatana sompatra,\nMpandoza hatrizay,\nMpamitaka mahay\nTsy manam-paharoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM500', 'Malemy, tsinontsinona,\nFa mora resy isika;\nFa misy voahasina\nMiady ho antsika;\nJesosy re izay,\nIlay iraky ny Ray,\nMpitarika mahay,\nMpamonjy hatrizay\nSy Tompo-pandresena.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM500', 'Na dia ta-handevona\nIreo devoly maro,\nTsy misy atahorana,\nJesosy no Mpiaro;\nIlay rain’ny maizina\nDia nohelohina,\nKa tsy ahoana,\nFa teny tokana\nDia mahalavo azy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM500', 'Kendreny hofongorana\nNy teny tanantsika,\nKanefa tsy ho foana,\nNy Tompo momba antsika.\nNa dia ho fongana\nNy laza ananana,\nHarena, havana\nTsy mampaninona,\nNy lanitra antsika.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM501','FFPM 501');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM501', 'Namely mafy loatra\nNy henatra aman-tahotra;\nTsy afaka ny aizim-po,\nFa mbola tao ny heloka,', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM501', 'Nandroso aho nivavaka :\nRy Jeso ô, Mpanavotra!\nIzao no angatahiko;\nMba mamelà ny heloko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM501', 'Izaho tsy hiahotra;\nNy tenako atolotro,\nIzay rehetra ananako\nAnao, Mpamela  heloka.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM501', 'Ny tahotra dia levona,\nAriako ny henatra, \nSatria mandre ny feonao\nHoe : voavelako ny helokao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM501', 'Endrey! ny hafaliako\nIzay velona ao anatiko,\nKa sahiko ny hanao hoe :\nVoavelanao ny heloko.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM502','FFPM 502');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM502', 'Finaritra ny vorona ao an-ala\nSy ao an-karam-bato avobe;\nNa dia betsaka ny \nmpankahala\nMivonon-kahafaty azy re;\nMatoky izy, tsy misalasala,\nFa manam-piarovan-dehibe.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM502', 'Jesosy Tompoko no\nharambato\nSy ala mafy ikirizako;\nNa mafy aza sady tsy miato\nIzay ataon’ny fahavaloko,\nMamely ahy ary misahato,\nJesosy re no fiarovako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM502', 'Izay rehetra ta-hamely ahy,\nMikendry, nefa sasa-poana;\nIzaho dia ravo am-panahy,\nTsy azony atao ahoana,\nFa misy manda manodidina\nahy,\nIzay miaro  sy  manohana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM503','FFPM 503');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM503', 'Ry Jeso Tompo tsara ô!\nTsy azoko valiana\nIzato fitiavanao\nManafa-pahoriana,\nHe, sambatra aho, Tompo ô!\nFa manana Anao izao,\nIzay tsy mba mety sosotra,\nNa faly hampitahotra\nKa Hianao no tokiko\nSy foto-pifaliako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM503', 'He, isam-pahoriana\nIzay niantsoako Anao,\nDia efa novaliana\nNy hataka izay natao,\nNy heloko navelanao,\nNy foko nohavaozinao,\nNy loza nosakananao,\nNy ngidiny nesorinao;\nNy aim-baovao iainako,\nKa velona ny heriko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM503', 'Ka amin’izao sisa izao,\nMikasa aho Tompo ô!\nHanao izay nohafaranao,\nHanaraka Anao am-po.\nSatana dia holaviko,\nHafoiko izao tontolo izao,\nRafesiko ny nofoko,\nFa Hianao, Mpamonjy ô!\nMpanavotra tsy foiko,\nNo sisa hotompoiko.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM504','FFPM 504');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM504', '“Ambarao, ry mpivahiny!\nNy alehanao izao!”\n“Fiakarana mideza,\nIhoaranay anio;\nJesosy Tompo no miantso\n:,: Mba ho ao an-tany soa;\n:,: Mba ho ao an-tany soa;\nJeso no alehanay :,:”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM504', '“Lozanao, ry mpivahiny,\nLàlana tsy fantatrao!”\n“Tsia, fa anjely maro\nNo miaraka aminay;\nJeso Tompo no mitondra.\nTsy hanjo anay ny loza,\n:,: Tsy hanjo anay ny loza;\nIzy no ampinganay :,:”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM504', '“Inona, ry mpivahiny,\nNo ho azonao ary ?”\n“Jeso Kristy be fitia\nVonon-kanome anay\nLamba fotsy, zava-tsoa,\nRanon’aina tsy ho lany,\n:,: Ranon’aina tsy ho lany!\nJeso no hatoninay :,:”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM504', '“Tianay, ry mpivahiny,\nMba hiaraka aminao!”\n“Mandrosoa ry sakaiza!\nMiaraha aminay;\nFa izay mitady tsara\nTsy mba lavin’i Jesosy,\n:,: Tsy mba lavin’i Jesosy,\nIzy no hidiranay :,:”', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM505','FFPM 505');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM505', '“Mpivahiny! mba lazao;\nZovy moa hianao ?”\n“Izaho namanao ity,\nFa miandry Ilay ary.”\n“Mpivahiny! mba lazao :\nIza no andraisanao ?”\n“Jeso, Havako arý,\nNo andrasako aty.”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM505', '“Mpivahiny! mba lazao :\nAiza no halehanao ?”\n“Lalana ety avokoa\nSady sarotra tokoa.”\n“Mpivahiny! mba lazao :\nIza no harahinao ?”\n“Jeso, Zoky be fitia,\nTsy mamela mba hania.”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM505', 'Mpivahiny! mba lazao :\nAiza no hodianao ?”\n“Ao an-danitra madio\nNo aleha ankehitrio.”\n“Mpivahiny! mba lazao :\nIza no handray anao ?”\n“Jeso, Ilay Mpanjaka soa,\nTompo, Havako tokoa.”', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM506','FFPM 506');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM506', 'Tsy misy miadana ka afa-po\nIzay monina eto an-tany;\nFa izay tia sy mino ny Tompo\nJeso\nNo hahazo ny soa tsy lany.\nMba irio, mba irio\nNy hananana an’i Jeso.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM506', 'Raha misy mahory mahazo etý,\nJeso no hanala izany;\nTsarovy ny avotra tao Kalvary\nFa nalatsany tany ny rany,\nMba irio, mba irio\nNy hananana an’i Jeso.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM506', 'Izaho maniry hanaraka Anao,\nRy Tompo Mpanafaka ota!\nFa fantatro tsara hatramin’izao\nNy fitiavanao ahy mpanota\nMba irio, mba irio\nNy hananana an’i Jeso.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM507','FFPM 507');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM507', 'Ranomasi-mampahory\nNo alehantsika izao;\nFa ny mino dia hitody,\nKoa maharitra izy izao;\n:,: O! andeha isika hody\nMba ho ao\nan-tranon-dRay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM507', 'Jeso Tompo eo am-pita\nKa miantso hoe: Avia!\nIzy koa no mampita\nKa manao hoe: Matokia!\n:,: O! andeha, isika hody\nMba ho ao\nan-tranon-dRay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM507', 'Maro efa tonga any\nKa mifaly avokoa;\nMbola be ny fiantrany\nMisy ho antsika koa.\n:,: O! andeha, isika hody\nMba ho ao\nan-tranon-dRay :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM507', 'Kristy koa no sambon’aina\nIzay mitondra ho arý.\nFamonjena azo maina,\nKa ilaozy re ity.\n:,: O! andeha, isika hody\nMba ho ao\nan-tranon-dRay :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM508','FFPM 508');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM508', 'Ny sambokelinay etý\nMitety ranobe,\nMisononoka ho ery\nAn-dafin’ony be  (in-3)\nMisononoka ho ery,\nAn-dafin’ony be  (in-3)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM508', 'Ny rivo-doza tsy hanjo,\nFa Jeso aminay;\nNy alondrano mankato\nIlay maherinay  (in-3)\nNy alondrano mankato,\nIlay maherinay  (in-3)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM508', 'Mamaky onja izahay\nFa tsy ho faty eo;\nNy fitodian-tsambonay,\nHe! tazanay izao  (in-3)\nNy fitodian-tsambonay,\nHe! tazanay izao  (in-3)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM508', 'Irinay ny ho tonga ao\nHilaozanay ity;\nMitsena anay tokoa izao\nNy zokinay ary  (in-3)\nMitsena anay tokoa izaonNy zokinay ary  (in-3)', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM509','FFPM 509');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM509', 'Jeso Tompo! Vatolampy,\nVato voafantina,\nMba ho fanorena-mafy\nIzay tsy mety levona;\n:,: Vato mafy :,:  (in-2)\nDia itokianay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM509', 'Jeso Tompo! Vatolampy\nVoazaha toetra;\nVato tsy mba misy tsiny,\nSady tsara endrika.\n:,: Vato soa :,:  (in-2)\nDia ifalianay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM509', 'Jeso Tompo! Vatolampy,\nVato fehizoronay;\nEfa nampiray fanahy\nNy fitianao anay\n:,: Fehizoro :,:  (in-2)\nVato fampiraisana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM509', 'Jeso Tompo! Vatolampy,\nTsy miova Hianao;\nManan-jara ny matoky\nNy tsy fivadihanao\n:,: Fa ho faly :,: (in-2)\nKa tsy hanan-kenatra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM510','FFPM 510');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM510', 'Jeso! ny hamarinanao\nNo lamba hitafianay,\nAmin’ny andro farany,\nIzany hifalianay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM510', 'Raha hitsangana izahay\nHandray ny lova aminao,\nDia tsy ho resy lahatra,\nFa Kristy no Mpanavotra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM510', 'Io lamba io no mbola vao,\nNa levona izao tany izao,\nHaharitra tsy rovitra,\nHavaozin’Andriamanitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM510', 'Ny hery sy ny antranao\nToroy izao tontolo izao;\nAmpandrosoy ny teninao,\nAmpanekeo ny rafinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM510', 'Ny maty hahare ny feo\nHiantso azy ho velona;\nJeso! ny hamarinanao\nNo lamba hitafianay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM511','FFPM 511');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso no sakaiza tena tia  anay,\nIzy ta-hamonjy olombelona;\nAoka  ho tiantsika ny\nMpanavotra,\nFa Izy no Sakaiza\nmahateho tia.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso no Sakaiza ifaliana,\nIzy nahafoy ny voninahitra,\nMba hananantsika fanavotana\nSy handraisantsika\nny fiainana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso no Sakaiza itokiana,\nIzy mahavaly sy mahanatra;\nAoka hinoantsika\nny Mpanavotra,\nHahazoantsika fiadanana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso no Sakaiza ivavahana,\nIzy mahavonjy ny \nMpangataka;\nAoka hinoantsika ny \nMpanavotra,\nMba handraisantsika\nfanampiana.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso no sakaiza fiarovana,\nIzy maharesy ny mpanohitra;\nIza no hanimba izay arovany ?\nAoka hisaorantsika ny\nMpanavotra.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM511', 'Jeso ô, Sakaiza! raisonao\nizao\nNy fisaoran-tsara izay\natolotray;\nIzahay mpanota te-hidera\nAnao,\nRaiso re ny dera izay\naterinay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM512','FFPM 512');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM512', 'He! matoky aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly,\nTeny avy Aminao.\nHe! matoky aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly\nNo omenao ahy  izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM512', 'Tahotra  amana ahiahy\nDia ariako izao;\nFa nomenao toky aho\nSady tô ny teninao,\nHe! matoky, aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly\nNo omenao ahy  izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM512', 'Izay rehetra fahotana\nEntiko hesorinao;\nHianao no mahadio\nKa diovy aho izao.\nHe! matoky, aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly\nNo omenao ahy  izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM512', 'Mahasasa, mahadio\nMahavonjy Hianao,\nKa mandray sy mahatondra\nTsara ho ao an-tranonao.\nHe! matoky, aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly\nNo omenao ahy  izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM512', 'Jeso Tompo! avy aho,\nAvy hankalaza Anao;\nRaisonao re izay omeko;\nVola, tena, aina koa.\nHe! matoky, aho, Tompo,\nAzoko ny teninao;\nTeny soa mahafaly\nNo omenao ahy  izao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM513','FFPM 513');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM513', 'Jeso Sakaizanay,\nJeso anay;\nSady tsy mahafoy,\nJeso anay;\nRaha ny olona\nMety mandao anay,\nJeso no tsy mandao,\nJeso anay', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM513', 'Jeso Sakaizanay,\nJeso anay;\nIzy no Avotray,\nJeso anay;\nMaty ny Tomponay\nNoho ny helokay;\nAfaka izahay,\nJeso anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM513', 'Jeso Sakaizanay,\nJeso anay;\nIzy no aronay,\nJeso anay;\nReraka izahay\nNoho ny adinay,\nJeso no herinay,\nJeso anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM513', 'Jeso Sakaizanay,\nJeso anay;\nIzy no lalanay,\nJeso anay;\nLalana marina \nHahatongavanay\nAny an-danitra,\nJeso anay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM513', 'Jeso Sakaizanay,\nJeso anay;\nManana izahay,\nJeso anay;\nJeso Sakaizanay\nNo hovantaninay\nAny an-danitra,\nJeso anay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM514','FFPM 514');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM514', 'Ry Jehovah Tomponay!\nOlom-bery izahay,\nNefa tsy mba foinao,\nFa vonjen’ny Zanakao;\nZanahary, Aba Ray,\nJeso Kristy, Havanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM514', 'Lehibe ny indrafo;\nIza re no nanampo\nFamonjena taminao ?\nKanjo azonay izao;\nZanahary, Aba Ray,\nJeso Kristy, Havanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM514', 'Gaga izahay izao!\nBe fitia Hianao;\nAvotr’aina azonay,\nHody aminao izahay,\nZanahary, Aba Ray,\nJeso Kristy, Havanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM514', 'Jeso ô! Mpamonjy soa\nSy mpamindra fo tokoa!\nAvy ny navotanao\nKa midera Anao izao;\nZanahary, Aba Ray,\nJeso Kristy, Havanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM515','FFPM 515');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM515', 'Tsara lova, ry Jeso ô!\nNy mpanota voavotrao,\nFa fonenana soa\nAmboarinao ao,\nHanefanao ny teninao;\nHo amin’io tany io tokoa\nNo izoran’ny dianay;\nJeso Tompo no ao, \nSady efa manao\nTrano soa hipetrahanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM515', 'Tsara lalana, Jeso ô!\nNy vahiny tarihinao;\nRaha misy manjo,\nTsy mba kivy ny fo\nFa tohanan’ny herinao;\nHo amin’io, tany io tokoa\nNo izoran’ny dianay;\nJeso Tompo no ao, \nSady efa manao\nTrano soa hipetrahanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM515', 'Tsara vatsy  ry Jeso ô!\nNy mpandeha fahananao,\nFa ny teninao soa\nMofon’aina tokoa \nIveloman’ny olonao.\nHo amin’io, tany io tokoa\nNo izoran’ny dianay;\nJeso Tompo no ao, \nSady efa manao\nTrano soa hipetrahanay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM516','FFPM 516');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM516', 'An-dafin’ny efitra lava sy\nmaina\nNo misy ilay tany izay\nmamin’ny fo\nIlay tany izay efa\nnampanantenaina\nHo lovan’ny mino izay\nmankatò\nIriko indrindra ny mba\nho tafita,\nTsy mety miadana\nmandra-pahita.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM516', 'Anefa ny lala-mankany \nno mafy,\nNy rafiko maro manotrika ao,\nNy nofo indrindra no tena\nmpandrafy,\nKa tery ny lalan-kaleha izao!\nAnefa tsaroako tsara ny teny\nMilaza fa misy fitsaharana \neny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM516', 'Ka aza mba ketraka,\nry mpivahiny,\nHevero fa Jeso no momba\nanao;\nIlay nampangina ny loza \nfahiny\nDia mbola mahay\nmampandresy anao!\nAndrasonao kely, ho lany\nny fetra,\nHo ringana ny fahavalo\nrehetra', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM516', 'Izaho hiezaka mafy tokoa\nHahazo ny loka ao\nalohako ao;\nNy tafio-divotra mba\nmahasoa,\nFa hahatongavako\nfaingana ao;\nIndray mipi-maso ny eto\nan-tany\nNy any an-danitra tsy\nhita lany.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM517','FFPM 517');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM517', 'Ny alina ho lasa,\nNa ela aza re,\nHipoaka ny andro\nMahafinaritra;\nNy zavona hisava\nAn-tendrombohitra ao,\nNy vavahady tsara \nHo tsinjoko izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM517', 'Mba sarotra tokoa\nNy fiakarana e!\nMamely mafy koa\nNy rivo-doza be;\nFa he ny mpivahiny\nIzay efa trotraka\nTantanan’ny Mpamonjy \nTsy ho solafaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM517', 'Ny famonjen’i Kristy,\nNy fanavotany,\nNo loharano soa\nMangarangarana;\nNandramako sahady\nNy rano velona,\nKa dia nahazo hery\nAm-pandehanana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM517', 'Ny rano be hitànay,\nNy fefy tsilo koa,\nNy lalana mahàna\nHo afaka avokoa;\nKa dera, Haleloia,\nNo mendrika hatao\nAmbara-pahatonga\nAm-pitsaharana.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM518','FFPM 518');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM518', 'Rehefa vita ny asako etý\nKa ny fanahiko raisina erý,\nMiara-mitoetra Aminao,\nTomponay,\nNo hasambarako\nmandrakizay\nMandrakizay, sambatra re,\nAzoko ilay fahasambarana\nbe!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM518', 'Rehefa ataoko veloma ny etý\nKa azoko ‘lay paradisa erý,\nSady mahita ny tavan’ny Ray\nNo fahasambarako \nmandrakizay;\nMandrakizay, sambatra re,\nAzoko ilay fahasambarana\nbe!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM518', 'Miombom-pahasambarana\narý\nAmin’ireo olon-tiako tatý\nKa tsy misaraka mandrakizay\nNo hasambarako\nmandrakizay;\nMandrakizay, sambatra re,\nAzoko ilay fahasambarana\nbe!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM519','FFPM 519');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM519', 'Mba maniry hody aho,\nRy Jesosy Tompo ô!\n:,: Ka ny foko hatanjaho\nMba hankany aminao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM519', 'Tsy tamana eto aho\nMampahory ny atý,\n:,: Koa dia mitalaho,\nMba hafindranao arý :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM519', 'Hody aho, ry Mpiantra,\nAoka mba horaisinao.\n:,: Hianao dia feno antra,\nKa matoky aho izao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM520','FFPM 520');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM520', 'Ny masoandronay\nMirefarefa izao,\nMadiva hody izahay\nHiverina Aminao;\nRy Jeso ô! sasao,\nSasao madio izahay,\nHo mendrika ny lanitra\nIzay honenanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM520', 'Tsy ela intsony koa\nIty ady lava ity,\nHo afa-tsasatra tokoa\nRehefa tonga arý :\nRy Jeso ô! sasao,\nSasao madio izahay,\nHo mendrika ny lanitra\nIzay honenanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM520', 'Madiva ho hitanay\nIlay Tomponay arý,\nMadiva hihaona aminay\nNy namanay tatý :\nRy Jeso ô! sasao,\nSasao madio izahay,\nHo mendrika ny lanitra\nIzay honenanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM520', 'He! kely sisa izao\nNo hisentoanay,\nDia ho fafan’ny tananao\nNy ranomasonay :\nRy Jeso ô! sasao,\nSasao madio izahay,\nHo mendrika ny lanitra\nIzay honenanay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM520', 'Ity hita maso ity,\nIzay tsy mahefa-po,\nHisolo paradisa arý,\nIzay hifalian’ny fo :\nRy Jeso ô! sasao,\nSasao madio izahay,\nHo mendrika ny lanitra\nIzay honenanay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM521','FFPM 521');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM521', 'Ravoravo re ny foko,\nFa Jesosy ao am-poko,\nIzy no tsaroako\nAmin’ny alehako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM521', 'Andro fohy, mora lany\nNo mba ahy atý an-tany,\nFa ny ao an-danitra\nDia tsara lavitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM521', 'Tsy mba misy ota any,\nKa tsy hisy hitomany,\nTsy mba hisy ny manjo,\nNa ny alahelom-po.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM521', 'Any aho no hahazo\nZava-tsoa tsy halazo,\nSatroboninahitra,\nHaingon’ny nanafika.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM521', 'Dia ao no hahitako\nSady tena hiderako\nAn’i Jeso avotro.\nMifalia re, ry fo!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM522','FFPM 522');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM522', 'He, tanim-pahazavana be,\nTsy misy maizina ao,\nKa any tsy mba hitete\nNy ranomasonao.\nIzay voavonjy hiangona ao,\nHiara-mihira ny hira vaovao,\nHo sambatra any an-danitra,\nAo amin’ny Mpanavotra.\nMoa ao an-danitra ?\nEny, ao an-danitra.\nKa tsy hisaraka ?\nEny, tsy hisaraka!\nHo sambatra any an-danitra\nAo amin’ny Mpanavotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM522', 'Ry Rainay feno indrafo,\nBe fitiavana,\nOmàny ny fanahiko\nHandray fiainana.\nIzahay, ry Jesosy, maniry\nAnao.\nFa maty nisolo anay Hianao,\nNanavotra anay mba ho afaka.\nKa tsy ho voaheloka.\nMoa dia ho afaka ?\nEny, ho afaka.\nKa tsy ho helohina ?\nEny, tsy ho helohina.\nJesosy Mpamonjy nanafaka,\nKa tsy ho voaheloka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM522', 'O, ry Jesosy Tompo ô!\nTsarovy izahay,\nKa mba ambino hatrizao\nNy fandehananay.\nVonjeo ny ondry manaraka\nAnao\nFa otany no namonoana\nAnao,\nHo faly   izahay ao an-danitra\nAo amim-boninahitra.\nMoa ao an-danitra ?\nEny, ao an-danitra.\nKa tsy hisaraka ?\nEny, tsy hisaraka.\nHiara-mifaly  ao an-danitra,\nHo feno voninahitra.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM523','FFPM 523');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM523', ':,: Te-hifindra :,:\nAho, ry Jesosy ô!\nBe manjo atý an-tany,\nFifaliam-be no any\nAminao, ry Tompo ô.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM523', ':,: Ny anjely :,:\nSy ny olo-masina\nTafahaona ka mihoby :\nSambatra ny tafatody,\nFaly fa  noraisina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM523', ':,: Faly koa :,:\nAho, ry  Mpamonjiko.\nManantena fa hahita\nNy fonenana ao am-pita,\nKa handray ny lovako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM523', ':,: Tsy tamana :,:\nAho, amin’ny manjo,\nFa vahiny atý an-taný\nKa maniry mba ho any\nAminao, ry Tompo ô.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM523', ':,: Ao tsy misy :,:\nOta na aretina!\nTsara raha hodimandry,\nNefa aho te-hiandry\nNy fetr’andro marina.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM524','FFPM 524');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM524', 'Hitsahatra aina, ry foko,\nizao ?\nKa iza ataonao hiaro anao ?\nNy tany va misy hitsaharan’\nny fo,\nNa lova tsy simba, tsy mety\nho lo ?\nTsia, tsia, tsy mba atý izany,\nFa any an-danitra erý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM524', 'Afoizo ny tany izay manindao\nKatsaho ny lanitra ho lovanao\nJerosalema any, tanàna \nvaovao\nSy tsara tokoa, miandry anao,\nEny, eny, ao dia ao \nNo misy tokoa\nfonenam-baovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM524', 'Ny mponina ao dia tretrika\nam-po.\nFa resy ny ota, mahery ny tò\nKa faly midera ny Tompo\nny ao;\nNy mino hihira ny hira\nvaovao!\nIndro, indro, be dia be tokoa\nNy soa ao an-danitra ao re!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM525','FFPM 525');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM525', 'Vahiny eto isika\nKa monina amin-day,\nMitady mba hahita\nNy any amin-dRay;\nFa ao ny fanjakany\nSy fiadanana,\nKa ao tsy hita lany\nNy fitiavana,\nAo no fodiana,\nMihaona ao ny mino,\nKa tsy hisaraka.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM525', 'Izay atý an-tany\nDia mora tapitra,\nFa ny tsy mety lany\nDia ao an-danitra!\nFa ao ny Tompontsika\nIzay nohomboana\nMba hahazoantsika\nNy fifaliana,\nAo no fodiana,\nMihaona ao ny mino,\nKa tsy hisaraka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM525', 'Manafotra ny tava\nNy ranomaso be,\nKanefa dia hisava,\nFa hofafana e!\nIsika manantena\nFa ny Mpampakatra\nHo tonga mba hitsena\nNy ampakarina.\nAo no fodiana,\nMihaona ao ny mino,\nKa tsy hisaraka.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM529','FFPM 529');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Jesosy no Mpiandry tsara maty tia,\nNy rany nampiray antsika olo‑\nFa Izy no mandidy hampifa­nkatia\nIzay te-ho olony.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Ka manahafa Azy Tomponaa, ry mino,\nTsarovinao ny didy izay nato­loriyy,\nFa tiany hifankatia isika mpino, Fa samy olony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Tsarovy fa iray tam-po izao isika;\nTsarovy re fa samy mpiantafika; Miraisa hina mba hiaraka tafita Ho ao an-danitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Ka aza mba mijery aaina an‑\ntava;\nMifanaralra tsara sy mifamelà,\nFa aza tia fotsiny amin'' ny\nvava;\nDia aza mifandà.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Mifankatiava ary mifanaova soa; Mifandefera tsy hiavona am-po;\nVonoy re ny lolompo sy t''osa koa, Ka aoka ho tao-po.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Mora. fo, mihavàna, maleme fa­nahy,\nKa aza mety hanaratsy narnana; Mifankatiava ré, toy ny mpira­halahy\nMiara-dàlana.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM529', 'Ka mivavaha re ho an'' ny raha­lahy,\nHiraisantsika tsara, fa iray manjo;\nNy fo izay tia tsy mba mampia­hiahy,\nHoraisin'' i Jeso.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM530','FFPM 530');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM530', 'Fitiavana rano velona,\nLoha.rano lalina;\nKa miafina ao anatiny\nNy fiainan-danitra.\n\nFitiavana no nirahina\nAvy tamin-Jehova;h;\nO, mba raisonao, dia ho fanta­trao\nNy fahasarnbarana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM530', 'Fitiavana didy tokana\nAry didy lehibe;\nMitoera ao, hitoeranao Arnim-piadanam-be.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM531','FFPM 531');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM531', 'Ry Jeso loharanon’aina,\nIzay foto-pitiavana!\nNy fonay toy ny tany maina\nFenoy fitiavana!\nAidino ao ny tena aina\nMba hampifankatia  anay,\nFandrao ho tonga very maina\nNy fitiavanao anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM531', 'Ny hasomparana levony,\nSoloy fitiavana;\nNy lolompo ampijanony\nOvay ho fihavanana;\nNy fo malaky mankahala\nAtaovy tia namana;\nAmpianaro hahalala\nNy didim-pitiavana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM531', 'Toroy sy ampahafantaro\nNy fitiavanao izahay;\nMpiandry tsara ô, velaro\nNy fonao mba ho hitanay;\nMba ho tarafiny tokoa\nNy fonay mbola maizina,\nKa samy hifanisy soa\nSy hifamela heloka.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM532','FFPM 532');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM532', 'Ry Jeso lohan’ny mpandefitra,\nNilaozanao ny voninahitrao,\nMba hahatonga anay \nmpiavona\nHanetry tena eo imasonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM532', 'Ry tsy miavonavona am-po!\nIzaho te-hianatra aminao,\nMba hitsaharan’ny fanahiko\nFa mampiandam-po ny\nentanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM532', 'Ny fietrenao, ry Voahombo\nô!\nNo iakaram-boninahitra;\nNy tany sy ny lanitra vaovao,\nHtaonao lovan’ny \nmpandefitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM532', 'Mifandefera sy mifanajà,\nRy samy voavela heloka!\nMiraisa hazo fijaliana\nHiraisantsika voninahitra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM533','FFPM 533');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM533', 'Iray ny Ray Tsitoha,\nMpitia olombelona;\nIray ny Tompo soa,\nIray ny rano velona,\nIray ny vavahady\nIzay idirana;\nNy rafy sy ny ady\nDia  iombonana,\nIray ny fahantrana\nIlaozantsika atý,\nIray ny fanjakana\nAlehantsika arý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM533', 'Ry zana-Janahary,\nRy voavela heloka,\nMiraisa hina ary,\nKa mifandraisa tanana;\nMifamelà isika,\nFa samy meloka;\nMifanajà isika,\nFa samy zanaka.\nRy Jeso be fitia,\nAmpio ny olonao\nMba ho mpifankatia\nManahaka Anao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM534','FFPM 534');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM534', 'Misy didy tena tsara\nIzay nomen’ny Tompo hoe :\nMba mifankatiava tsara,\nHianareo izay mino e!\n:,: Ka miraisa :,:\nIzao no didy lehibe. (in-2)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM534', 'Tonga Jeso mba hanompo\nSy mba hampihavana;\nTsy mpanaraka ny Tompo\nIzay tsy tia namana.\n:,: Ka tadiavo :,:\nIzay ho fampiraisana.(in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM534', 'Fa iray tokoa ny Loha,\nDia Jesosy Zanaka,\nEndriky ny Ray Tsitoha,\nIzay halaina tahaka.\n:,: Tsy ho resy :,:\nRaha miray ny tafika. (in-2)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM534', 'Jeso no Ilay foto-kazo,\nTena voaloboka;\nKa ny sampana halazo,\nRaha tafasaraka.\n:,: Ikambano :,:\nKa  aza mba mihataka. (in-2)', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM535','FFPM 535');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM535', 'Finaritra ny manome\nIreo mahantra maro be,\nKa mahafoy fananana\nHiantra ny tsy manana.\nIzao no asa mahasoa\nIzay manendrika tokoa;\nNy manome an-tsitrapo\nHitsinjo olona ory fo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM535', 'Ry olon’Andriamanitra!\nMba mihetseha fatratra\nHamonjy sy hanafaka,\nHanampy ireo madinika.\nIzay mamonkin-tanana\nMalain-kiantra namana,\nIzay mihirim-belona\nTsy hanam-piadanana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM535', 'Ny vola izay nafoinao\nDia tsy mba very foana izao,\nFa ny mahantra no mandray,\nKa lasan’i Jehovah Ray,\nIreo kamboty mba vangio,\nMpitondratena mba jereo;\nIzao no fivavahana\nIzay madio sy masina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM536','FFPM 536');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM536', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM536', 'Mifankatiava tsara,\nJeso no mampihavana,\nFa  Izy no alalantsika\nAmin’Andriamanitra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM536', 'Mifankatiava tsara,\nMba hahatsara antsika,\nFa  fototry ny didiny\nSady anton’ny lalàny.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM536', 'Hitsahatra finoana\nMbamin’ny fanantenana,\nNefa ny fitiavana\nHaharitra mandrakizay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM536', 'Mifankatiava tsara,\nTsy maharatsy namana,\nAry tsy mahatezitra\nAn’Andriamanitra koa.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM537','FFPM 537');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM537', 'Endrey, ny hamaroan’ny soa\nNomenao Ray ho ahy koa!\nNy aiko, he, navotanao,\nNy heloko vonoinao.\nEny, Raiko,\nEny fa ravo tokoa\nIty zanakao voavonjy re\nKa velombolo erý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM537', 'He, azoko tokoa Jeso,\nIlay perla sao, madio sy vao;\nNy zava-tsoan’ny tany re\nDia tsy ahoako tokoa.\nEny, Raiko,\nEny fa ravo tokoa\nIty zanakao voavonjy re\nKa velombolo erý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM537', 'Tsy haiko ny hilaza izao,\nHamisavisa re, ry Ray;\nNy fanomezan-dehibe\nDia tsy voatonoko tokoa\nEny, Raiko,\nEny fa ravo tokoa\nIty zanakao voavonjy re\nKa velombolo erý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM537', 'Ny foko no hidera izao,\nHisaotra sy hanaja Anao\nHanoa, ho vonona hanao\nNy sitrakao rehetra.\nEny, Raiko,\nEny fa ravo tokoa\nIty zanakao voavonjy re\nKa velombolo erý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM538','FFPM 538');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM538', 'Finaritra ny masoko\nMijery ny Mpanjakako;\nNy vavako hisokatra\nHidera ny Mpanavotro;\nAndro soa, andro soa,\nFa Jeso no Mpanavotra;\nHe! ravo ny fanahiko\nMihira ao anatiko,\nAndro soa, andro soa,\nFa Jeso no Mpanavotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM538', 'Ho tiako ny Tompoko\nAmbara-pahafatiko,\nFa Izy no Mpanafaka\nManaisotra ny heloko;\nAndro soa, andro soa,\nFa Jeso no Mpanavotra;\nHe! ravo ny fanahiko\nMihira ao anatiko,\nAndro soa, andro soa,\nFa Jeso no Mpanavotra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM538', 'Faingàna re, ry havako!\nHatòny e! ny Tomponao;\nAndeha mba hiaraka\nHihira sy hivavaka;\nAndro soa, andro soa,\nFa Jeso no Mpanavotra;\nHe! ravo ny fanahiko\nMihira ao anatiko,\nAndro soa, andro soa,\nFa Jeso no Mpanavotra.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM539','FFPM 539');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM539', 'Faly dia faly izahay \nmpanomponao\nIzay mihira eto anatrehanao;\nFa be fiantra Hianao, ry Jeso\nTompo tianay!\nKa feno haravoana tokoa\nizahay :\nFaly dia faly izahay \nmpanomponao\nIzay mihira eto anatrehanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM539', 'Ela dia ela no nandavanay\nAnao,\nBe ny zava-dratsy efa vitanay,\nNa diso aza izahay, anefa faly\naminao,\nFa afakao ny helokay, ry\nTompo tianay!\nFaly dia faly izahay \nmpanomponao\nIzay mihira eto anatrehanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM539', 'Sarotra tokoa ny alehanay\nizao;\nBe ny alahelo iaretanay;\nNa ory aza izahay, dia mbola\nfaly aminao,\nFa levonao ny tahotray, ry\nTompo tianay!\nFaly dia faly izahay \nmpanomponao\nIzay mihira eto anatrehanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM539', 'Manantena tsara izahay\nmpanomponao\nMba handray ny zaza\ntehirizinao;\nRehefa maty izahay ka entinao\nan-danitra,\nHo azonay ny lova soa\nhatolotrao anay;\nFaly dia faly izahay \nmpanomponao\nIzay mihira eto anatrehanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM540','FFPM 540');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM540', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM540', 'Hitako ny lalan-tsara,\nKa hizorako izao,\nAzoko ny famonjena,\nKa hotanako tokoa\n:,: Manampia :,:\nRy Fanahy Masina ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM540', 'Ravoravo aho, Jeso!\nHianao no Tompoko;\nFaly aho, ry Mpamonjy!\nAfakao ny heloko;\n:,: Gaga aho :,:\nNoho ny fanavotanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM540', 'Fitiavana ihany\nNo natolotrao anay :\nNefa kosa fahotana\nNo navalinay Anao :\n:,: Aza isaina :,:\nRe ny hadisoanay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM540', 'Ny mpanota hilazako,\nNy Mpamonjy tànako;\nHilazako fa ny rany\nNo nataony avotra :\n:,: Matokia :,:\nHe, ny fitiavany!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM541','FFPM 541');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM541', 'He, izany hira manako re!\nIlay zaza very tonga\namin-dRay\nHe! faly faly izay mandre :\nIlay efa maty  velona indray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM541', 'Indro ny Rainy lasa nankao,\nHe! fa miteny : « Peratra soa,\nSoloy ny lamba, kapa alao »\nIlay efa maty  velona indray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM541', 'He, izany hoby an-tranon-\ndRay!\nFa voavonjy ilay nania;\nHobio ry tany sy lanitra!\nIlay efa maty  velona indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM541', 'O, ry anjely an-dapa soa!\nMiraisa hina hanandra-peo;\nAza mangina, fa mba lazao,\nIlay efa maty  velona indray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM542','FFPM 542');
