INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM543','FFPM 543');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM543', 'Mihoby ny fanahiko,\nFa voavonjy izao;\nNy ratran’ny Mpamonjiko\nNo misy aim-baovao.\nNy ran’i Jesosy\nNo tena avotro;\nKa sambatra aho\nSy tretrika am-po.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM543', 'Ny ratran’ny Mpamonjinao,\nRy foko, mba jereo,\nFa hanasitrana anao,\nKa ho fiainanao,\nNy ran’i Jesosy,\nNo tena avotro;\nKa sambatra aho\nSy tretrika am-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM543', 'Mba mibitaha re, ry fo,\nNy gadra tapaka :\nNy hajambana izay nanjo,\nIzao dia  afaka,\nNy ran’i Jesosy,\nNo tena avotro;\nKa sambatra aho\nSy tretrika am-po.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM544','FFPM 544');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', 'Misaora an’i Jehovah,\nMiantsoa ny Anarany;\nMitoria ny asany,\nAmin’ny ny olombelona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', 'Ambarao ny fiantrany,\nLazao ny famindrampony,\nFa mahagaga antsika\nNy fitiavany antsika.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', 'Mpanota tsy naringana,\nVery mana-Mpanavotra,\nMaty ka nomeny aina,\nHo velona mandrakizay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', 'Ry Andriamanitray ô!\nRy Jesosy Mpamonjy ô!\nRy Fanahy Masina ô!\nVonjeo ny olona ory.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM544', 'Fa zohy no itoerana,\nLava-bato no ierena\nFa indrafo no ifalian’\nNy mpivahiny mandala.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM545','FFPM 545');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM545', 'Endrey, izany hafaliana\nFa velona  aina izahay\nTanteraka ny faniriana\nKa dera ho Anao, ry Ray!\nAtolotray tokoa ny tena\nMba ho fanati-tsitrakao,\nSatria manaiky sy ekena\nHo tonga olom-baovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM545', 'Ny Tanindrazanay malala,\nRy Jeso Tompo, anjakao\nHiorina eto, tsy hiala,\nNy fiadanana entinao!\nNy aizin’ota  anie hisava,\nNy fahantrana koa handao\nFa ho tarafin’ny Mazava\nHanjary tany vaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM545', 'Ny Fiangonanao angony,\nFanahy ô, ho tena iray,\nKa tsy hizarazara intsony\nFa Hianao no mampiray,\nDia ho fanasina, fanilo,\nHo an’izao tontolo izao;\nHijoro, tsy handraraka ilo,\nHitafy toetra vaovao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM546','FFPM 546');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM546', 'Haleloia, haleloia!\nJeso no Mpamonjiko, \nHaleloia, haleloia!\nAfaka ny heloko.\nSambatra  aho, tretrika aho,\nAhy re ny lanitra,\nHaleloia, haleloia! \nJeso no Mpanavotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM546', 'Haleloia, haleloia!\nRavoravo re ny fo,\nHaleloia, haleloia!\nJeso re no soloko.\nAfaka aho, afaka aho,\nLevona ny otako;\nHaleloia, haleloia! \nLanitra no lovako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM546', 'Haleloia, haleloia!\nMatokia hianao.\nHaleloia, haleloia!\nMaty mba ho solonao.\nJeso Tompo mahatoky,\nRy mpanota very ô!\nHaleloia, haleloia!\nRaiso ny famindrampo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM547','FFPM 547');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM547', 'Ry Jeso Masoandronay ô!\nNy aizin’ny fo lasa tokoa,\nFa tonga aty anatinay izao\nMazava lehibe.\nEny, Jeso ô, Zoky be fitia,\nSoa lehibe (no) nentinao tatý\nAvy izahay mba hisaotra\nAnao\nNoho  ny fitiavanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM547', 'Vangianao ny tokantrano\nKa menatr’erý, kaody sy lao\nNy fomba ahitana angano\nIzay tsy mba sitrakao.\nEny, Jeso ô, Zoky be fitia,\nSoa lehibe (no) nentinao tatý\nAvy izahay mba hisaotra\nAnao\nNoho  ny fitiavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM547', 'Mpanjaka Fiadananay ô!\nEkena tokoa ny herinao :\nNy sabatry ny firenena\nHatao fangady izao.\nEny, Jeso ô, Zoky be fitia,\nSoa lehibe (no) nentinao tatý\nAvy izahay mba hisaotra\nAnao\nNoho  ny fitiavanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM547', 'Ry Jeso Tompo tia anay ô!\nMisaotra Anao izahay izao\nFa henika ny hasoavanao\nIzao tontolo izao.\nEny, Jeso ô, Zoky be fitia,\nSoa lehibe (no) nentinao tatý\nAvy izahay mba hisaotra\nAnao\nNoho  ny fitiavanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM548','FFPM 548');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM548', 'He, Jehovah no Mpiandry ahy,\nTsy mba misy atahorako;\nRaha Izy no mitondra ahy,\nAhi-maitso no handriako.\nEny, fa ny tany karankaina,\nDia hody saha lonaka,\n:,: Ary ao amoron-dranon’aina\nHialan’ny foko sasatra :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM548', 'He, Jehovah no Mpitarika ahy,\nAo an-dàlam-pahamarinana,\nKoa tsy ho kivy ny fanahy\nAmin’ny alo-pahafatesana;\nHianao ry Tokiko irery,\nNo hiara-dia amiko,\n:,: Ka ny tsoran-kazonao\nmahery\nNo hanafaka ny tahotro :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM548', 'Amelaranao latabatra aho\nEo imasom-pahavaloko;\nNotoloranao kapoaka aho,\nKa mahery sady afa-po;\nEny, indrafo tsy hita lany\nNo hiaraka  amiko izao\n:,: Mandra-pahatongako ho\nany\nHanatrehako ny tavanao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM549','FFPM 549');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM549', 'Jesosy no asandratro,\nFa Izy no Mpanavotro,\nNy tanany nanafaka\nNy aiko tao an-davaka;\nNy rafiko ho ketraka,\nIzaho afa-kenatra,\nFa manana ny Tompoko, \nIzay mandako sy aroko :\nRy foko ô! ankalazao\nJesosy, Izay Mpamonjinao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM549', 'Ny tsiron’ny fiainana\nAndramako sahady re,\nFa efa mby an-tanana\nNy famonjena lehibe;\nNy ranon’aina azoko,\nNy mofon’aina haniko,\nSakafo mahatanjaka,\nMamelona ny reraka; :\nRy foko ô! ankalazao\nJesosy, Izay Mpamonjinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM549', 'Ny rany no anjarako,\nNy ainy no fananako;\nNy lanitra ho lovako,\nNy tany dia hilaozako\nNy ota tsy hanaraka\nNy ady dia hitsahatra\nNy aloka ho tapitra,\nFa ao no tena zavatra;\nRy foko ô! ankalazao\nJesosy, Izay Mpamonjinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM549', 'Ny hanitry ny lanitra\nMamerovero fatratra;\nNy hiran’ny voavotra\nManatsika ahy hiakatra\nNy tavan’ny Mpamonjiko\nNo tsijon’ny fanahiko,\nNy tavany manafaka\nNy aizina ao anatiko;\nRy foko ô! ankalazao\nJesosy, Izay Mpamonjinao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM549', 'Ny masoko mibanjina\nTahaka ny mpiambina,\nManiry ny Mpamonjiko\nHo tafahaona amiko,\nIzaho hovimbininy\nHipetraka  ao anilany,\nHanao ny hiran-danitra\nSy honina finaritra :\nRy foko ô! ankalazao\nJesosy, Izay Mpamonjinao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM550','FFPM 550');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM550', 'Ry Tompo ô, ny tany maina\nNo itoerako;\nMidina re, ry Andon’aina\nHo ao anatiko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM550', 'Tsy aloka malaky lasa\nNo angatahiko,\nFa hery monina hiasa\nSy hanavao ny fo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM550', 'Ny afonao ampandreseo\nNy afo’nofoko;\nNy sitrakao anie hekeko\nHo tena sitrako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM550', 'He, tena zavatra ilaiko\nNy hohavaozinao;\nNy ainao asoloy ny aiko\nHo velon-ko Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM551','FFPM 551');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM551', 'Tsy lany fahoriana\nIty tanintsika ity,\nFa be ny fihafiana\nIzay hitako atý,\nNy Tompo no jereko,\nRaha reraka ny fo,\nKa eo no fiereko,\nRaha  azon’ny  manjo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM551', 'Etý alaim-panahy,\nJeso, ny olonao,\nKanefa tsy manahy\nIzay nahita Anao,\nHianao no hojereny\nKa moa ho resy ve ?\nHianao no handreseny\nNy fahavalo be.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM551', 'Tsy azo ialana\nNy eo anilanao,\nMahita fanimbana\nIzay mahafoy Anao.\nAsain’ny fahoriana\nJerena Hianao,\nMahazo fifaliana\nNy maso aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM551', 'Rehefa hialana\nIzao tontolo izao,\nNy tany tsy hitana\nIzay mahita Anao.\nKa dia hojereko,\nRy Tompo, Hianao,\nFa Hianao homeko\nIzao aiko kely izao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM552','FFPM 552');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM552', 'Ry foko ô, mba atolory\nNy Rainao ny manjo anao;\nNa mafy aza ny mahory,\nDia hovonjeny hianao;\nNy lanitra no andrandrao\nHahafaka ny sentonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM552', 'Andriamanitra mahita\nIzay hahasambatra anao,\nKa Izy no mahay mamita\nIzay zava-tsarotra aminao;\nTsy hotsitsiny aminao\nIzay mety hahasoa  anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM552', 'Ka aza kivy, ry mahantra,\nNa ory aza hianao,\nFa matokia ny Mpiantra,\nIzay tsy mahafoy anao;\nNy amboariny izao\nDia  famonjena ho anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM552', 'Dia  aoka hianao hatoky,\nRaha  mafy ny manjo anao,\nNy Rainao dia mahatoky,\nKa ampy hiankinanao;\nTsy misy tsy ho afany\nRaha  avy ny fotoany.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM553','FFPM 553');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM553', 'Any an-danitra ambony\nMisy mijery anao;\n:,: He, feno antra ny fony,\nKoa mangina izao! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM553', 'Ry rera-po mitomany,\nJeso onena anao;\n:,: Ampy ho toky izany,\nKoa mangina izao! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM553', 'Na dia be ny mahory,\nIzy hiaro anao;\n:,: Tsy ho tra-doza akory,\nKoa mangina izao! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM553', 'Mba mahareta miandry,\nIzy hanafaka anao;\n:,: Haka anao hodimandry,\nKoa mangina izao! :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM554','FFPM 554');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM554', 'Ry Tompo mahavonjy ô!\nHenoy ny vavakay,\nKa mamelà ny helokay;\nFa tena tsy mba fantatray\nIzay tokony hatao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM554', 'Ry Tompo be fiantra ô!\nMalemy izahay,\nKanefa raha ampianao\nDia hanan-kery toa Anao\nIzahay mpanomponao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM554', 'Ry Tompo izay Mpandresy ô!\nOmeo ny herinao,\nFa tianay handresena koa\nNy ota mety hahavoa\nNy olon-tianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM554', 'Ry Tompo Ilay Mahery ô!\nAmpionao izahay,\nHijoro, hampiseho izao\nFa aminay tokoa Hianao\nRy Tompo tia ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM555','FFPM 555');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM555', 'Rahoviana no ho lany\nNy manjo atý an-tany ?\nJeso Vatolampiko\nAmpy hiankinako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM555', 'Mahereza, ry fanahy\nAza manana ahiahy,\nJeso itokiako,\nHampionona ny fo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM555', 'Ny mahory dia mandala,\nRingana ny fahavalo,\nNy atý hilaozako,\nMba handray ny lovako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM555', 'Mino aho, ry Mpamonjy,\nFa ho tena voavonjy :\nAfakao ny heloko,\nHianao isaorako.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM555', 'Dia ho lany ny mahory,\nKa ho samy tafavory\nEo anatrehanao,\nIzahay mpanomponao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM556','FFPM 556');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM556', 'Ny Paradisa  an-tany\nTsy misy re izany!\nNy hazon’aina very,\nFa tsilo be no ao!\nRy foko, aza kivy,\nFa ao ny tany soa,\nNy Paradisa hisy,\nRy foko, andrandrao!\nTsy misy ory any,\nFa tretrika  avokoa,\nAfaka ady ka mihoby,\nMisy hazon’aina ao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM556', 'Mandrahona ny ady,\nMirehitra sahady,\nFa be ny fahavalo\nMamely ahy izao,\nRy foko, aza kivy,\nFa ao ny tany soa,\nNy Paradisa hisy,\nRy foko, andrandrao!\nTsy misy ory any,\nFa tretrika  avokoa,\nAfaka ady ka mihoby,\nMisy hazon’aina ao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM556', 'Ny eso, latsa, ratra,\nMatetika mihatra\nTsaroako avaly\nNy asa vitako.\nRy foko, aza kivy,\nFa ao ny tany soa,\nNy Paradisa hisy,\nRy foko, andrandrao!\nTsy misy ory any,\nFa tretrika  avokoa,\nAfaka ady ka mihoby,\nMisy hazon’aina ao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM556', 'Miferinaina eto,\nTomany sy misento;\nIndrisy! ory aho,\nVonjeo, Tompo ô!\nRy foko, aza kivy,\nFa ao ny tany soa,\nNy Paradisa hisy,\nRy foko, andrandrao!\nTsy misy ory any,\nFa tretrika  avokoa,\nAfaka ady ka mihoby,\nMisy hazon’aina ao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM557','FFPM 557');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM557', 'Raha  manahy ny fanahy\nAzom-pahoriam-be,\nKa ny aina mitaraina,\nRanomaso mitete,\nAza ketraka etý.\nFa tazony ny arý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM557', 'Ao miharo feo maro,\nFatratra ny hira ao;\nAo mifaly ny nijaly,\nOry teo, ravo izao;\nAo Jesosy Zokinao\nFaly hovantaninao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM557', 'Hazon’aina tsy mba maina\nNo maniry tsara ao,\nVoninkazo tsy halazo\nNo ho fifalianao;\nFaly ny nandre izao,\nMainka fa ny tonga ao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM557', 'Ry Mpamonjy, ho tra-bonjy\nAnie ny olonao!\nFa maniry ny tahiry\nAo an-danitra  aminao;\nMba faingàna Hianao\nHaka ny malalanao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM558','FFPM 558');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM558', 'Ity fonenana ity\nTsy manam-pitsaharana;\nManiry aho ho arý\nAn-koatry ny fasana;\nNy lanitra no hitodiako,\nFa tena tanindrazako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM558', 'Kanefa mahatahotra\nNy ranobe alehako,\nFa ny tafio-drivotra\nManohitra ny samboko;\nNy tselatra, ny kotrokorana,\nMamely sy mandrahona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM558', 'Ny sambon’ny fiainako\nMamaky onja sarotra,\nKa amin’ny alehako\nMitopatopa fatratra\nNy alondranom-pahoriana,\nKanefa tsy maninona.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM558', 'Fa ny Mpamonjy tokana\nMitarika ny samboko;\nNy Tompon’ny fiainana\nMiara-mita amiko,\nMba ho tafita aho olony,\nKa honina  any aminy.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM559','FFPM 559');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM559', 'He, vetivety ny atý an-tany,\nFa trano lay no itoeranao;\nKa aza ketraka na mitomany,\nFa andrandrao ny\ntanindrazanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM559', 'He, vetivety ao an-dalan-tery\nNo mahasarotra ny dianao,\nKa aza kivy, fa Ilay Mahery\nMamboa-trano hitsaharanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM559', 'He, vetivety ao an-tany maina\nNo mahabe ny fijalianao,\nKa dia ho hitanao ny\nranon’aina\nHahafaka ny hetahetanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM559', 'Arahonao ny lalan-toratady,\nMba hahafaingana ny dianao;\nJesosy Tomponao no\nvavahady,\nNy lanitra no hovantaninao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM559', 'He, vetivety ary dia ho hita\nNy tany soa mandry fahizay;\nJesosy ô, faingàna hahavita\nNy fikasanao tsara aminay!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM560','FFPM 560');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM560', 'Mpivahiny aho eto\nTahaka ny razako,\nKa ny foko feno sento\nAmin’ny alehako.\nEny, tsy etý tokoa\nNo ho fitsaharako,\nFa mandalo avokoa\nIzay rehetra hitako,\nKa izaho tsy miato\nAndro aman-alina,\nNefa aho izay misento\nDia hasoavina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM560', 'Be ny mampahory ahy\nMila tsy ho zakako,\nToa velona  hiahy\nAo am-pandehanako;\nNefa kosa tsy mba tery\nSady tsy mamoy fo,\nFa izaho tsy irery\nEto amin’ny manjo,\nFa Jesosy momba ahy\nKa manafa-tahotra;\nRaha ory ny fanahy,\nIzy no mahavotra.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM561','FFPM 561');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Raha maizina ny lalana\nJehovah Tompo ô!\nHianao no iankinana,\nHianao no jiroko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Tsy hitako izay hanjo,\nFa takona amiko\nNy andro sisa iainako,\nIzay nalahatrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Na mbola ela velona,\nNa maty haingana,\nNy zarako voatendrinao,\nTsy te-hifidy aho.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Fa Kristy ivelomako\nRaha mitoetra;\nNy faty tombondahiko\nFodiana aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Ny fanompoako atý,\nTsy mahavesatra ahy;\nTsy maika te-hiala etý\nRaha tsy antsoinao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Raha tapitra ny androko,\nDia tsara lavitra\nNy mody any aminao\nHiala sasatra.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM561', 'Ny sitrakao no sitrako,\nJehovah Tompo ô!\nNy teninao andrasako,\nHianao no tokiko.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM562','FFPM 562');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM562', 'Miandry ao ambony\nNy fifaliana;\nAtý tsy mety tony\nNy fahoriana,\nKa tonga sesilany\nNy fitarainana;\nArý tsy hita lany\nNy hasambarana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM562', 'Variana mikoràna\nNy tsy misaina be,\nNy hendry dia mitana\nNy hevitra hoe :\nAleoko mitomany\nNoho ny otako;\nNy lanitra ihany\nNo fianinako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM562', 'Ny lalan’ny adala\nTsy mba harahiko,\nTsy mampisalasala\nIzay anjarako;\nNy sasany mikendry\nHo afa-po atý,\nIzaho dia miandry\nNy lovako arý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM562', 'Izaho manantena\nAnao, ry Tompo ô!\nKa hobim-pamonjena\nNo hoventesiko;\nHe, vetivety ihany\nNo hiaretako,\nTsy ela dia hankany\nAn-tanindrazako.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM563','FFPM 563');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM563', 'Ry mana-manjo!\nAkaiky anao\nNy Tompo, Ilay be fiantra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM563', 'Ka Izy anie\nHitahy anao,\nHanafaka ny mampahory.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM563', 'Ny ory atý\nHo faly arý,\nKa aza mba be alahelo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM563', 'Ny Tomponao re\nHanefa tokoa\nIzay hataky ny malahelo.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM563', 'Ny lapany ao\nVoavoatra ho anao\nHonenanao mandrakizay re.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM564','FFPM 564');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM564', 'Tsy hita  izay androko sisa\natý,\nAhiko fandrao tsy ho tonga\narý;\nRy fanahiko! ao ny\nMpamonjy anao,\nHe! Jeso Mpamonjy anao\n(in-3) \nRy fanahiko! ao ny\nMpamonjy anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM564', 'Izaho anefa tamàna atý;\nTsy hiomana ve, fa hifindra\narý ?\nFa  efa fantatrao izao fa\nhavela ity\nHe! lanitra soa arý (in-3)\nFa  efa fantatrao izao fa\nhavela ity\nHe! lanitra soa arý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM564', 'Ilaozy ity, hadinoy, ry fo!\nAfoizo izao, ry fanahiko ô!\nFa  efa reko ny Tompo\nmiantso anao,\nHe! feo mahafaly izao (in-3)\nFa  efa reko ny Tompo\nmiantso anao,\nHe! feo mahafaly izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM565','FFPM 565');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM565', 'Mandrahona ny andronay,\nKa raiki-tahotra izahay;\nAvia, manampia anay:\nRy Tompo ô! vonjeo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM565', 'Ny teninao no tokinay,\nNy herinao no tanjakay;\nAfaho loza izahay :\nRy Tompo ô! vonjeo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM565', 'Fa misy ifaharanay,\nKa toky be no azonay;\nHianao no iankinanay :\nRy Tompo ô! vonjeo!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM565', 'Noho ny nahaterahanao,\nNoho ny nahafatesanao,\nSy noho ny fifonanao :\nRy Tompo ô! vonjeo!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM566','FFPM 566');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Raha mafy ny manjo,\nRaha be ny hovitray,\nRaha malahelo fo,\nMihainoa, Jeso ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Endrikay notafinao,\nNentinao ny entanay,\nNitomany Hianao,\nMihainoa, Jeso ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Mafy ny nanjo Anao\nNefa tsy mba meloka;\nHelokay ny nentinao,\nMihainoa, Jeso ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Voahombo Hianao,\nVoatsindron-defona,\nNandry tao am-pasana,\nMihainoa, Jeso ô!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Raha ory izahay,\nKa ny fitarainanay\nTonga eo an-tsofinao,\nMihainoa, Jeso ô!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM566', 'Raha tapitra aminay\nNy fe-taom-boatendrinao,\nAza mba mandao anay,\nMihainoa, Jeso ô!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM567','FFPM 567');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM567', 'Aza malahelo,\nAza kivy fo;\nIzay tia an’i Kristy,\nLoza tsy hanjo.\nJeso, be fiantra!\nMba avia izao,\nAry ny mahantra\nMba tantanonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM567', 'Aza be ahina,\nMpino hianao,\nFa mba miankina\nAmin’ny Rainao.\nJeso, be fiantra!\nMba avia izao,\nAry ny mahantra\nMba tantanonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM567', 'Aza mba misento;\nKristiana anie!\nFa homen’ny Tompo\nFifaliam-be.\nJeso, be fiantra!\nMba avia izao,\nAry ny mahantra\nMba tantanonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM567', 'Tomponay mahery!\nMba tsinjovinao,\nTano sao ho very\nNy mpanomponao.\nJeso, be fiantra!\nMba avia izao,\nAry ny mahantra\nMba tantanonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM568','FFPM 568');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM568', 'Ry fanahy ory,\nAzon’ny manjo!\nBe ny mampahory,\nAza rera-po;\nFeo mamelovelo\nMba henoy izao,\nAza malahelo,\nJeso havanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM568', 'Aza mba misento\nNa mamoy fo,\nRaha mbola eto,\nMisy ny manjo;\nNefa Jeso tia\nTsy mandao anao,\nKa mba matokia,\nJeso havanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM568', 'Namanao mahantra\n‘Ndeha, ilazao,\nJeso be fiantra\nNo Mpamonjy izao;\nIzy Tompo tia\nKa mandray anao,\nDia mifalia,\nJeso havanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM569','FFPM 569');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM569', 'Indrisy! ry sakaiza ory fo!\nHolazainao aiza ny manjo ?\nJeso no Mpamonjy ho anao;\nIzy mahavonjy, ambarao\n:,: Azy, ry tra-bonjy!\nny manjo ao am-po :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM569', 'Indrisy! ry mahantra!\nlozanao;\nAiza ny Mpiantra ? Indro ao;\nJeso hanazava aizim-po,\nIzy hampisava ny manjo;\n:,: Soa lalandava\nNo hatao aminao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM569', 'Harena be an-tany tsy anao;\nZava-mora lany ka mandao,\nNefa indro Jeso Zaranao;\nHira no venteso, ka derao\n:,: Izay nataon’i Jeso\nHo anao hatrizao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM569', 'Ny lanitra mivoha rahateo;\nAndrandrao ny loha ka jereo!\nJeso Tompo soa no arý,\nHavanao tokoa hatretý;\n:,: Dia mazotoa\nHiditra ao Hianao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM570','FFPM 570');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM570', '« Mafy ny alon-drano izao,\nSady maria no manindao,\nNefa ny Tompo momba anao;\nMoa ho kivy va ? »\n« Tsia, Jeso ato aminay,\nIzy hampifaly ny fonay;\nTsy mba ho kivy re izahay;\nIzy no tokinay. »', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM570', '« Maro no efa tola sy lao\nNoho ny alahelo izao;\nIsan’ireny va hianao ?\nMoa ho kivy va ? »\n« Tsia, Jeso ato aminay,\nIzy hampifaly ny fonay;\nTsy mba ho kivy re izahay;\nIzy no tokinay. »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM570', '« Amin’izao fiainana izao\nTsy mba ilaozan-java-manjo,\nNefa  ao Jesosy, tokin’ny fo;\nMoa ho kivy va ? »\n« Tsia, Jeso ato aminay,\nIzy hampifaly ny fonay;\nTsy mba ho kivy re izahay;\nIzy no tokinay. »', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM570', '« Raha ny Tompo aza tetý\nNety ho faty tao Kalvary,\nIza no tsy handefitra atý ?\nMoa ho kivy va ? »\n« Tsia, Jeso ato aminay,\nIzy hampifaly ny fonay;\nTsy mba ho kivy re izahay;\nIzy no tokinay. »', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM571','FFPM 571');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM571', 'Raha misy mampahory,\nIndro, Jeso Tomponao;\nTsy afoiny tsy akory,\nAza kivy hianao.\nRaha rava ny harena,\nKa ho mafy ny manjo,\nMbola misy famonjena,\nAza mety kivy fo.\nRaha misy mampahory,\nIndro, Jeso Tomponao,\nTsy afoiny tsy akory,\nAza kivy hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM571', 'Raha misy ady mafy,\nIndro, Kristy herinao;\nRaha avy ny mpandrafy,\nRaiso koa ny sabatrao.\nRaha tamy hanangoly,\nIlay fahavalonao,\nKa mandrobo ny devoly,\nMba aingao ny vavakao.\nRaha misy mampahory,\nIndro, Jeso Tomponao,\nTsy afoiny tsy akory,\nAza kivy hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM571', 'Na marary mafy aza\nKa mangirifiry ao,\nAry na ho faty aza\nKa handao ny havanao,\nMbola misy antenaina,\nIndro, Jeso avotrao;\nFamonjena avotr’aina,\nIndro, raiso ho anao.\nRaha misy mampahory,\nIndro, Jeso Tomponao,\nTsy afoiny tsy akory,\nAza kivy hianao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM572','FFPM 572');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM572', 'Jereo ny fahorianay\nAndriamanitra ô!\nMarary izao ny namanay,\nKa dia mba iantrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM572', 'Raha sitrakao ry Tomponay!\nValio ny vavakay,\nFa mora reraka  izahay,\nTohano sy ampio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM572', 'Ny fitondrana tianao\nNo iankinanay;\nNy didy avy aminao,\nIzay no sitrakay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM572', 'Sitrano ny fanahinay\nHo tonga zanakao,\nTariho lalana  izahay\nHankany aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM573','FFPM 573');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM573', 'Mahereza, ry sakaiza\nVotom-pahoriana!\nMatokia, aza kivy,\nKristy mialoha anao;\n:,: Matokia :,:\nMahereza hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM573', 'Aza mba matoky tena,\nFoana ny herinao;\nTano mafy ny ampinga\n‘Zay atolony anao;\n:,: Raiso koa :,:\nNy Fanahy ho sabatrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM573', 'Maizina izao ny andro,\nSarotra ny lalanao;\nAo ambony ny mazava\nAmpy hanazava  anao;\n:,: Mba jereo :,:\nIlay mazava amboninao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM573', 'Vetivety, afa-doza,\nVita ny alehanao;\nAo an-danitra ambony\nMisy hifalianao;\n:,: Miravoa :,:\nTapitra ny adinao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM574','FFPM 574');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM574', 'Aza kivy hianao\nAzom-pahoriana,\nTany no fonenanao,\nMisy fihafiana.\nMatokia hianao\nRaha tratrin’ny manjo,\nJeso Tompo herinao,\nAza mety rera-po.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM574', 'Aza kivy hianao\nNoho ny manjo izao,\nRaha Jeso aminao,\nAfa-tahotra hianao;\nMatokia hianao\nFa ny Tompo tia tokoa,\nKa izao rehetra izao\nDia mety mahasoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM574', 'Aza kivy hianao\nNa dia  ory aza  etý,\nNy Mpanjaka Tomponao\nMba nihafy koa tetý;\nMatokia hianao\nNa inona mihatra izao,\nJeso Ilay Sakaizanao\nTsy mba mahafoy anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM575','FFPM 575');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM575', 'Ry Jeso ô! Sakaiza\nMpamonjy tia anay!\nRaha mbola mianjera\nNy rian-drano be;\nMifofofofo mafy\nNy rivo-doza be,\nVimbino izahay re,\nMba tsy ho faty ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM575', 'Arovy izahay re,\nRy Jeso Tomponay!\nAmbara-pahalasan’\nNy loza izay manjo;\nDia ento izahay re\nHo any aminao,\nKa raiso ny fanahy\nHo faly aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM575', 'Kanefa raha mbola\nHijanona izahay\nAtý ambony tany\nKa malahelo fo,\nNa misy fahavalo\nMiady aminay,\nAvia Jeso Tompo,\nAmpio ny olonao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM575', 'Tsy tambonay isaina\nNy olona aminao;\nHiadana tokoa\nIzay horaisinao;\nFa Jeso no Sakaiza\nAnjely maro be\nNo hiaraka  aminay ao\nAn-dapa rahatrizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM576','FFPM 576');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM576', 'Ry Sakaizan’ny mpanota!\nFantatrao ny zanakao,\nFa malemy, mora lavo,\nKa mangataka aminao;\n:,: Mba todiho, mba todiho,\nKa henoy ny vavakay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM576', 'Raha mitombo ny harena,\nNoho ny fanambinanao,\nNa matanjaka ny tena\nNoho ny fitahianao;\n:,: Mba tantano, mba tantano,\nSao tsy mahalala Anao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM576', 'Raha mamely ny devoly,\nFahavalon-janakao,\nKa mandroso manangoly\nHampisaraka aminao;\n:,: Mba tazòny, mba tazòny,\nFa tsy mahatana Anao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM576', 'Raha mangirifiry mafy,\nNoho ny tsorakazonao,\nKa ny havana rehetra\nTsy mahita izay hatao :\n:,: Mba tsidiho, mba tsidiho,\nFa maniry indrindra Anao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM576', 'Raha tonga ilay fotoana\nHiverenana aminao,\nKa manahinahy foana\nNoho ny ratsy izay natao :\n:,: Mba tohano, mba tohano,\nHahatsiaro tsara Anao :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM577','FFPM 577');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM577', 'Jeso Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay :\nJeso, Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM577', 'Jeso Sakaizanay,\nSakaiza be fitia!\nTariho izahay hanao\nNy zava-tianao :\nJeso, Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM577', 'Jeso Sakaizanay,\nSakaiza tsy mandao!\nNa dia mpanota aza re\nIzahay mpanomponao :\nJeso, Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM577', 'Jeso Sakaizanay,\nSakaiza tsy mamoy,\nNa ory na finaritra\nIzahay ankehitrio :\nJeso, Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM577', 'Jeso Sakaizanay,\nOmaly sy anio,\nKa mbola ho Sakaizanay\nMandrakizay doria :\nJeso, Sakaizanay,\nSakaiza rahateo!\nIndreto izahay, vonjeo,\nFa be ny adinay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM578','FFPM 578');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM578', 'Lohasahan-dranomaso\nIzao fiainantsika izao,\nKa misento lalandava\nIzay rehetra velona ao;\nKoa aiza re no misy\nHampionona ny fo ?\nIza no mahay mamonjy\nHampisava ny manjo ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM578', 'Manatòna ilay Mpamonjy,\nRy sakaiza ory ô!\nKa aza mba misalasala,\nMandrosoa hianao;\nFamonjena mahatoky\nTsy miova no anao,\nRaha manana an’i Kristy\nHo fanala-tahotrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM578', 'Vola sy harena an-tany\nMety tsy hanananao;\nHavana, sakaiza koa\nDia hisaraka aminao;\nNefa Jeso no anjara\nTsy alaina aminao;\nIzy no sakaiza tsara\nIzay nanavotra aina anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM579','FFPM 579');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM579', 'Aza mba mandalo ahy,\nRy Mpamonjy ô!\nAza mba manary ahy,\nJeso Tompo ô!\nRy Mpanjaka, mihainoa re!\nMamonje fa mitaraina\nNy vahoakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM579', 'Fantatrao fa malahelo\nNy mpanomponao;\nRaha mbola eto aho,\nMba tsinjovinao.\nRy Mpanjaka, mihainoa re!\nMamonje fa mitaraina\nNy vahoakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM579', 'Indro! fa miandry eto\nNy navotanao;\nAoka tsy mba halahelo,\nMba falio izao.\nRy Mpanjaka, mihainoa re!\nMamonje fa mitaraina\nNy vahoakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM579', 'Eny, manomeza hery\nMba ho ahy re,\nKa hahery sy handresy\nNy mpanomponao.\nRy Mpanjaka, mihainoa re!\nMamonje fa mitaraina\nNy vahoakao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM580','FFPM 580');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM580', 'Ry be fiantra sy be indrafo!\nAo aminao misy soa;\nOry izahay noho ny zava-\nmanjo\nAo aminao misy soa;\nBe siasia an-dalana atý,\nSao tsy ho tratra ny tsara arý;\nTompo miantra, vonjeo\nizahay,\nAo aminao misy soa;', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM580', 'Rahona mainty manarona\nanay,\nAo aminao misy soa;\nMba hazavaonao izay dianay\nAo aminao misy soa;\nAmpaherezo hanaraka Anao,\nAmpaherezo hatoky Anao;\nTompo mahery, hazòny\nizahay,\nAo aminao misy soa;', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM580', 'Any an-danitra izay lapanao,\nAo aminao misy soa;\nKa dia matoky izahay \nzanakao,\nAo aminao misy soa;\nAza ilaozana akory izahay,\nSao dia very an-dalana indray\nTompo malala, tariho izahay,\nAo aminao misy soa;', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM581','FFPM 581');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM581', 'Aiza re no hahitako\nIzay hampionona ny fo ?\nIza re no handrandraiko\nAndrao dia tolan’ny manjo ?\nO! ry ory sy mahantra\nManatòna Ahy izao.\nHe, ny foko feno antra,\nHampiadana anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM581', 'Aiza re no hahitako\nIzay hanala tahotra ?\nFa ny lalana ombako\nMahatoran-kovitra!\nAza kivy, ry mahantra;\nManatòna Ahy izao.\nHe, ny foko feno antra,\nAmpy hiafenanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM581', 'Aiza re no hahitako\nIzay hamela heloka ?\nIndrisy re ity fahotako\nTena mahaketraka!\nRy sakaizako mahantra!\nMba minoa Ahy izao;\nHe, ny foko feno antra,\nHanavotako anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM581', 'Ry Jesosy ô, malala!\nFialofako Hianao;\nIzaho tsy hisalasala\nHiantoraka Aminao.\nEny, manatòna Ahy\nFeno fitiavana;\nAza manana ahiahy;\nIzaho no mpiantoka.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM582','FFPM 582');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM582', 'Ry Jeso ô! tahio izahay\nAtý am-pandehananay;\nNy hadalanay avelao,\nNy fonay koa ovay ho vao,\nArovy re ny olonao,\nNy lalanay mba hazavao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM582', 'Ny aizim-be alehanay,\nMamely koa ny rafinay;\nTsy fantatray izay hanjo\nKa be ny tahotra ao am-po.\nArovy re ny olonao,\nNy lalanay mba hazavao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM582', 'Mikasa mafy izahay\nHo tsara, nefa fantatray\nFa raha tsy ambininao,\nTsy misy azonay atao.\nArovy re ny olonao,\nNy lalanay mba hazavao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM582', 'Mba tano mafy izahay\nAmbara-pahafatinay,\nDia ento ao an-danitrao\nIzahay ho faly aminao.\nArovy re ny olonao,\nNy lalanay mba hazavao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM583','FFPM 583');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM583', 'Mba tarihonao,\nTompo ô! izahay,\nFantatray fa mpivahiny;\nIzahy ankehitriny;\nAny aminao\nNo honenanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM583', 'Mafy ny manjo,\nReraka ao am-po;\nNa dia be ny ady aza,\nTsy ho ketraka ny fonay;\nAny aminao\nNo halehanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM583', 'Alahelo be,\nRanomaso koa,\nAzon’ny fakam-panahy,\nSaiky resin’ny devoly;\nFa ny Sandrinao\nIankinanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM583', 'Any aminao\nNo honenanay;\nRy Mpitari-dalan-tsara;\nMba tarihonao izahay re,\nHahatongavanay\nAny aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM584','FFPM 584');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM584', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM584', 'Arovy ny fanahinay,\nAndriamanitra!\nTariho ny fanahinay, (in-2)\nHanaraka Anao. (in-3)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM584', 'Hianao no hiankinanay,\nFa tsara Hianao;\nKa mamelà ny helokay (in-2)\nFa diso izahay. (in-3)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM584', 'Izahay hiantso Anao,\nAndriamanitra!\nKa henoy ny fivavaka (in-2)\nAtaonay aminao. (in-3)', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM584', 'Mitsinjova ny mpanota\nMahantra indrindra,\nFa Jeso, Ilay \nMpanavotra (in-2)\nNo maty nisolo (in-3)', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM585','FFPM 585');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM585', 'Mahantra aho, Tompo ô!\nKa mba tsarovinao\nManiry ho madio fo\nSy mendrika Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM585', 'Manolo-tena aho izao,\nRy Jeso Tompo ô!\nKa aza dia lavinao\nIzay atolotro.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM585', 'Izaho voasoratrao\nAo amim-bokinao\nHo isan’ny mpianatrao\nHianatra aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM585', 'Ataovy izay hahaizako\nHanaraka Anao\nAmin’ny fahadiovam-po\nHo voninahitrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM586','FFPM 586');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM586', 'Jesosy Kristy Tompo ô!\nHianao no antenaiko;\nTsy misy Mpamonjy toa\nAnao,\nRy Heriko sy Aiko,\nFa tsy mba misy olona\nMahafaka ny heloko;\nTsy zakakao ny entako,\nRy Jeso ô!\nHianao anefa tokiko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM586', 'Ny otako dia lehibe,\nNy foko dia ory!\nMpamonjy ô, vonjeo re!\nNy heloko esory,\nNy Rainao tsara ilazao,\nFa izaho no navotanao,\nKa mba havela heloka,\nDia azoko\nNy fiadanana ao am-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM586', 'Finoa-marina ao am-po\nNo aoka mba homenao,\nMba hanandramako tokoa\nNy tsirom-pamonjenao,\nMba hitiavako Anao\nSy ireo rahalahinao;\nRaha  avy ny fotoako,\nO, mba vonjeo!\nKa mba reseo ny rafiko.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM586', 'Ny saotra, dera, ho Anao,\nRy Raiko be fiantra,\nSy ho Anao, ry Kristy ô,\nMpamonjy ny mahantra,\nAnao, Fanahy Masina!\nIzay tena Mpampionona!\nIzaho mba omeonao\nNy aim-baovao,\nHaharitra ho olonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM587','FFPM 587');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM587', 'Jehovah Tompo no itokiako,\nFa mampitombo ny fifaliako,\nNy fo sy saiko miankina\naminy;\nIzay ilaiko omen’ny taniny,\nKa tena aiko ny toro-heviny.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM587', 'Ampio aho, Jehovah Tompo\nô!\nFa mitalaho izao ny zanakao,\nOmeo hery hitanako ny to,\nMba tsy ho very ny rakitra\nao am-po;\nHianao irery no iankinako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM587', 'Ry Kristy Tompo, mba \nmamonje anay\nMba ho mpanompo mazoto\nizahay,\nMpiasa tsara ankasitrahanao,\nIzay manambara ny fitiavanao\nKa hiafara eo anatrehanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM588','FFPM 588');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM588', 'Tompo Mpamindra fo!\nMahery sy Tsitoha\nIzay nidina tatý\nHamonjy ny mania!\nMivavaka Aminao\nMifona e! izahay,\nNy gadranay tapaho\nHahafaka anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM588', 'Tompo ô! Mpanjaka,\nAmin''ny olonao;\nFaingàna, iantrao\nIreo izay narovanao\nMiondreha, mijere,\nIzahay niandrandra Anao;\nNy herinao anie\nHatafinao ireo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM588', 'Tompo Mpanova fo,\nMpampionona tokoa,\nMidina ka ampio\nIzahay hahery izao.\nToky mamy loatra\nNo omena anay;\nHatrany an-koatra,\nArovinao izahay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM589','FFPM 589');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM589', 'Ry Jesosy Tompoko,\nIzay nanetry tena ô!\nNaka ny tarehinay\nHanavotanao anay\nMba omeo anay izao\nNy Fanahy Masinao,\nHanarahanay Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM589', 'Zanak''i Davida ô!\nMba midira ao am-po,\nRaiso ka diovinao\nIzy ho tempolinao;\nIzahay manasa Anao\nHonina ao am-po izao\nKoa mba ekeonao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM590','FFPM 590');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM590', 'Kristy Tsitoha, Tomponay\nmahery,\nMba mitodiha re ny olom-\nbery,\nKa mamonje anay izay\nmania;\nO, mba avia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM590', 'He, Hianao kiadin’ny mivalo,\nKa mba reseonao ny fahavalo,\nNy ta-hanimba ny Anao\nsakano,\nIzahay tantano!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM590', 'Ny fiangonanao ampiadano,\nNy tanindrazanay re mba\ntohano\nNy tena sy fanahinay tahio,\nAmpifalio!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM590', 'Ny asanao, ry Zana-Janahary,\nDia manakalaza Anao\nmiharihary,\nKa izahay midera Anao\nMpamonjy,\nFa voavonjy!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM591','FFPM 591');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Ry Jesosy, Izay Mpiahy,\nMba henoy izao;\nRaha misy mamely ahy,\nMba reseonao!\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Raha avy ny devoloy\nKa mandrahona,\nRaha ny nofo manangoly\nSy manintona.\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Be ny fahavalo fetsy\nMampahory izao,\nIzay dia mora resy,\nKa vonjeonao!\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Raha misalasala aho,\nMba toroy ny to!\nAry raha mitalaho,\nAmindraonao fo!\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Miangavy mafy aho,\nRy Mpamonjy ô!\nMba vonoy ny fahotako\nAmin’ny ranao.\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM591', 'Raha tapitra ny andro\nIvelomako,\nHazavao, ry Masoandro,\nAo am-pasako,\nRy Jesosy, mba henoy izao :\nRaha misy mahory ahy,\nMba tsarovinao', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM592','FFPM 592');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM592', 'Be ny mampahory\nAtý, Jesosy ô!\nKely, osa, ory,\nNy mpanomponao.\nRy Mpiandry lehibe,\nAnao ny tenako;\nHianao irery re,\nNo iankinako,\nTompo ô, ny foko\nManantena  Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM592', 'Miarova ahy,\nJesosy Tompo ô!\nTena sy fanahy\nHasoavinao.\nRy Mpamonjy lehibe,\nAnao ny tenako;\nHianao irery re,\nNo Vatolampiko,\nTompo ô, ny foko\nManantena  Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM592', 'Miarova ahy,\nJesosy Tompo ô!\nTena sy fanahy\nHasoavinao.\nRy Mpamonjy lehibe,\nAnao ny tenako;\nHianao irery re,\nNo Vatolampiko,\nTompo ô, ny foko\nManantena  Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM593','FFPM 593');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM593', 'Ry Jeso ô, Mpanjakanay,\nHadinonao va izahay\nNo tsy omenao faingana\nNy rano mahavelona ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM593', 'He, maina sy mangentana\nSy ivesarana entana,\nKa mampiferinaina anay\nNy efitra onenanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM593', 'Tsy hitanao ve, ry Tompo ô,\nFa valaka sy rera-po,\nMalain-kanaraka Anao\nNy olom-boafidinao ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM593', 'Aidino ny Fanahinao\nSy fifaliam-po vaovao;\nNy ranon’aina anie\nHatondrakao ny tany re!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM593', 'Reseo ny fahavalonay,\nOmeo rariny  izahay\nTapahonao ny gadranay,\nAmpiadano izahay!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM594','FFPM 594');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM594', 'Ry Tompoko malala,\nMpiandry tsara ô!\nHianao no mahalala\nNy hasasarako.\nNy ota an-tapitrisa\nIzao mandreraka!\nKa manomeza ahy\nFiadanana!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM594', 'Ry Tompoko malala,\nHe, zatra Hianao\nMampody ny adala\nNiala taminao;\nAmpiadano aho,\nTariho lalana,\nKa mahareta Tompo,\nAza sasatra!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM594', 'Ry Tompoko malala,\nTe-hody aho izao,\nFa manina ny vala\nNy ondrikelinao;\nKa mitalaho aho :\nVohay, ry Jeso ô,\nIzay mba efitrano\nHitoerako!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM595','FFPM 595');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM595', 'Ry Raiko ô! mba raiso ny\ntanako\nTantano mba handroso ny \ndiako\nHazòny tsy hania ny zanakao,\nRy Raiko ô! avia, tarihonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM595', 'Ny foko ta-hanoa ny didinao,\nKanefa mora voan’ny ratsy\nizao\nKa dia mba fenoy ny herinao,\nRy Raiko ô! henoy ny \nzanakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM595', 'Rehefa tsy mahita ny lalana\nKa toa tsy ho tafita ny lalina,\nFa ketraka ny aiko, dia \nraisonao\nTrotroy aho, Raiko,\nan-tratranao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM596','FFPM 596');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM596', 'Indreto izahay mitomany,\nFa be alahelo ny fo;\nNy ota no fototr’izany,\nNy heloko sy ny manjo;\nFa reraka re, ny fanahy,\nMahantra sy be ahiahy,\nKa tena variana erý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM596', 'Ry Tompo, Izay mofon’ny\naina,\nRy rano mamelona  anay,\nTsinjovy izay mitaraina,\nMahantra izao izahay!\nOnòny ny fonay fa voa,\nOmeo izay mahasoa,\nMonena aminay Hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM596', 'Ny fonay dia be hetaheta,\nManiry indrindra Anao;\nRy Tompo, mba mampahareta\nAnay ho mpanaraka Anao;\nNy reraka ataovy mahery\nVonjeo izahay olom-bery;\nMatoky Anao izahay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM597','FFPM 597');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM597', 'O, ry Jesosy Mpamonjy\nmahery!\nIzaho maniry indrindra Anao,\nFa reraka aho ka mila ho very,\nNy foko saronan’ny ratsy izao.\nRy Tompo, tsilovy\nNy lalan’ny saiko,\nKa mba arovy\nNy fo sy ny saiko!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM597', 'Efa hanafotra ahy ny rano,\nFaingàna, Jesosy, vonjeonao\nre!\nHo difotra aho, ry Tompo,\nka tano,\nDiovy, afaho ny foko anie!\nRy Tompo, tsilovy\nNy lalan’ny saiko,\nKa mba arovy\nNy fo sy ny saiko!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM597', 'Efa akaikin’ny lalina aho,\nKa mila ho voa, hilentika ao;\nRy Tompo malala, ny foko\ntanjaho\nKa mba hazavao hahalala\nAnao :\nRy Tompo, tsilovy\nNy lalan’ny saiko,\nKa mba arovy\nNy fo sy ny saiko!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM597', 'Aiza izao Hianao, ry \nMpamonjy,\nRy Tokin’ny ory sy reraka ô.\nNo tsy mampiseho ny herin’ny\nvonjy\nHanafaka ahy, izay ory\nam-po ?\nRy Tompo, tsilovy\nNy lalan’ny saiko,\nKa mba arovy\nNy fo sy ny saiko!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM597', 'O, ry Jesosy, Izay maharara\nNy onja namely ny sambo tarý\nAnivon’i Genesareta ho tsara\nToneo ny onjan’ny foko atý!\nRy Tompo, tsilovy\nNy lalan’ny saiko,\nKa mba arovy\nNy fo sy ny saiko!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM598','FFPM 598');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM598', 'Omeo mba handramako\nNy fitiavanao,\nHahaizako, ry Jeso ô,\n:,: Hihavana  Aminao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM598', 'Iriko re ny tavanao,\nRy Ilay malalako,\nFa tiako ny hahita Anao,\n:,: Izay Sakaizako :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM598', 'Hanjavona ny masoko,\nHamoy ny namako,\nFa Hianao Jesosy ô,\n:,: Ho eo anilako :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM598', 'Raha  ao ny ali-maizim-be\nIzay handehanako,\nHo eo an-tananao anie\n:,: No hahafatesako :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM598', 'Ka tsy mba hatahorako\nNy aizim-pasana,\nHatsanganao ny tenako\n:,: Ho tena sitrana :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM599','FFPM 599');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM599', 'O, ry Jesosy, mifaly ny foko\nRaha tsy lavitra  Anao,\nKa mba mangataka  indrindra,\nre aho\nAry mifona Aminao;\nTano ny zanakao mba tsy ho\nvery,\nTano akaiky Anao!\nZaza adala ka mety miery,\nRaha dia lavitra Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM599', 'Aza manary izay mitalaho,\nFa mba vonjeo anie;\nTena mahantra sy ory re aho,\nDiso sy meloka be;\nNefa maniry hiova ho tsara,\nKa ta-hanoa Anao,\nAry ny zavatra izay voarara,\nTsy mba hataoko izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM599', 'Raiso, ry Tompoko, ny\nfikasako,\nRaiso ny foko anio!\nRaha ny marina no ialako,\nDia ahitsio sy ampio;\nFa Hianao, ry Mpamonjy\nmahery,\nNo tsy mba mety mandao,\nAry Izaho dia tsy mba irery,\nFa tsy ho lavitra Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM600','FFPM 600');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM600', ':,: Ry Raiko ô! :,:\nIzaho atý mpivahiny\nManina ny tranonao,\nKa mba tariho\nNy zanakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM600', ':,: Ry Raiko ô! :,:\nIndro, Satana milofo\nMba hanangoly anay,\nKa mba vonjeo\nNy zanakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM600', ':,: Ry Raiko ô! :,:\nMaizina sady malama,\nSarotra ny lalanay,\nKa mba tantano\nNy zanakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM600', ':,: Ry Raiko ô! :,:\nMaro ny zava-mihatra,\nIzay mampanahy anay,\nKa mba tohano\nNy zanakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM600', ':,: Ry Raiko ô! :,:\nAoka  anie ny Fanahy\nNo mba hitarika anay\nHo tonga any\nAn-tranonao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM601','FFPM 601');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM601', 'Misaotra Anao, Jesosy ô,\nNy olom-boavonjy,\nFa be dia  be ny indrafo\nNataonao, ry Mpamonjy;\nFa tonga ory Hianao,\nNy ainao no natolotrao\nNisolo ny mpanota', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM601', 'Ampibebaho izahay\nHo olonao manoa;\nNy ota ivesaranay\nEsory avokoa,\nNy fifaliana vaovao\nNo aoka mba hasolonao\nNy alahelom-ponay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM601', 'Ampio izahay izao\nHinoanay ny teny\nIzay nolazain''ny vavanao,\nFa tanjakay ireny :\nIzao no angatahinay,\nMba hatanjaho izahay\nHanaraka izany.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM602','FFPM 602');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM602', 'Ry Andriamanitry ny\nfamonjena,\nSy Kintana antenain''ny\nfirenena,\nHenoy ny fangataham-\npandresena,\nRy Ray Tsitoha!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM602', 'Ilay fitopaton''alondrano\nSy reharehan-drafinao foano!\nNy olonao mahantra \nmba tantano,\nRy Ray Mpiaro!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM602', 'Raha  osa, Hianao mahay \nmitana,\nRaha  reraka\nasiam-pahotana,\nNy herinao\ntsy resin''i Satana,\nRy Ray Mahery!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM602', 'Ampionao izahay\nhandresy rafy,\nAmpionao mba haharitra\nny mafy,\nAmpionao tsy ho ketraka\nmihafy,\nRy Ray Mpanampy!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM603','FFPM 603');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM603', 'He sambatra, Jesosy ô,\nNy ondry vitsinao!\nFa Hianao Mpiandry soa\nMaharo ny Anao;\nNy ainao no natolotrao\nHo an''ireo ondrinao,\nNy very tadiavinao\nHiaraka  Aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM603', 'Izaho voamarika,\nHo isan''ny Anao,\nAnefa mba matahotra\nSao dia lavinao\nKa aoka mba hotairinao\nNy foko, raha hitanao\nFa mila ho sondriana\nSy diso lalana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM603', 'Ny hafanana mahamay\nNo mahatrotraka,\nAnefa mbola tazanay\nNy fitsaharana.\nHo avy faingana anie\nNy andro soa lehibe,\nIzay hamelaranao ny lay\nHandrakotra anay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM604','FFPM 604');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM604', 'Ento aho, ry Jehovah,\nMpivahiny raha etý;\nTano aho fa malemy\nRaha  tsy hazoninao\n:,: Mofon''aina :,:\nHo fihinako anie!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM604', 'Mba savao ny loharano\nHahazoako ny soa;\nAoka  hitari-dalana  ahy\nIzay andri-rahonao,  \n:,: Ry Tsitoha :,:\nFiarovana  Hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM604', 'Raha hita  an''i Jordana,\nAmpandrio ny tahotro;\nRy Mpandresy fanimbana,\nEnto any Kanana aho! \n:,: Fiderana :,:\nNo hatolotro Anao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM605','FFPM 605');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM605', 'Jeso, Hery mahavonjy\nTena fialofana,\nFa miantra sy mamonjy\nZanak''olombelona\n:,: Hery soa, hery soa,\nItokianay tokoa :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM605', 'Raha misy ny tafiotra\nIzay mamely mafy anay\nNy fitiany tsy ho ritra\nTokinay mandrakizay\n:,: Tsy mandao, tsy mandao,\nIankinana hatrizay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM605', 'Raha  mambomba sy miaro,\nMampitony tahotra,\nJeso Tompo tia, Mpiaro;\nResy re ny hovitra,\n:,: Fa matoky, fa matoky,\nIlay ampinga lehibe :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM605', 'Tianay tokoa  tokoa\nHo an-tratranao doria,\nMba hatoky ka ho soa\nRy Mpamonjy be fitia,\n:,: Tompo soa, Tompo soa,\nO! hazoninay tokoa :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM606','FFPM 606');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM606', 'O, ry Raiko\nIzay Mpandahatra!\nVatofantsika mafonja!\nAminao no mifahatra\nItony foko safotra  onja,\nRy Tsitoha, ô! mijere!\n:,: Ry Mpamonjy ô!\nMamonje! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM606', 'He manonja mafy loatra\nItony fiainako voafofo\nToa dia diso tafahoatra\nIreo akaso izay milofo,\nRy Tsitoha, ô! mijere!\n:,: Ry Mpamonjy ô!\nMamonje! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM606', 'Nefa kosa tsy mamoy!\nIzany foko manantena!\nFa ny masonao manjohy,\nIandrandrako famonjena\nRy Tsitoha, ô! mijere!\n:,: Ry Mpamonjy ô!\nMamonje! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM607','FFPM 607');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM607', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM607', 'Jeso no Mpiambina antsika\nSy Mpiandry tsara,\nKa natolony ny ainy\nHisolo ny ondry.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM607', 'Matokia hianareo,\nRy ondry vitsy\nFa ny Raiko no mikasa\nHitandrina anareo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM607', 'Izaho no Mpitarika\nSy Mpitondra tsara\nIzay manaraka Ahy\nHandresy ny ratsy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM607', 'Ary amin''ny farany,\nHalaiko ny Ahy\nTsy hisaraka amiko\nEla mandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM608','FFPM 608');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM608', 'He miandrandra  Anao,\nJehovah Tompo ô!\nNy olonao;\nHenoy ny vavakay,\nVonoy ny helokay,\nHahafantaranay\nFa Zanakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM608', 'Raha  hodiavinay\nNy tany maizina,\nTarihonao;\nFafao ry Jesosy\nNy ranomasonay!\nKa mba esorinao\nNy tahotray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM608', 'Mba manomeza anay\nNy hasoavanao,\nRy Tompo ô!\nMba hahazoanay\nNy hasambarana\nTsy mety levona,\nAn-danitra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM608', 'Tohanonao Izahay,\nRehefa tapitra\nNy andronay,\nRay ô! mba hamoray\nNy hanalana anay\nHo any Aminao,\nmandrakizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM609','FFPM 609');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM609', 'Hianao, Jehovah Tompo!\nNo hatoninay izao;\nAvy izahay hanompo\nSy hanao ny sitrakao;\n:,: Indro, raiso,\nRaiso ho Anao izahay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM609', 'Mba tantano sy arovy,\nFa malemy izahay;\nHe! marary sy farofy\nHianao no herinay;\n:,: Ody aina\nHitsaboanao anay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM609', 'Mpivahiny ka mahantra,\nEntonao, Fanahy ô!\nAna sy mangetaheta,\nAsehoy ny antranao;\n:,: Ranon’aina\nHosotrinay izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM609', 'Tranonao madio no any,\nVorodamba no anay,\nFa hilaozanay ny tany,\nKa soloy ny lambanay;\n:,: Lamba fotsy\nHitafianay anie :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM610','FFPM 610');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM610', 'Ny foko, ry Jehovah ô!\nFidio ho lapanao;\nEkeo ho fonenanao,\nKa ao no anjakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM610', 'Ny foko, ry Jesosy ô!\nSasao ho voadio;\nIzay eritreri-dratsy ao\nLevoninao anio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM610', 'Ny foko, ry Fanahy ô!\nMba hamasinonao;\nAvia, Fanahy Masina ô!\nOvay ho fo vaovao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM610', 'Ray, Zanaka, Fanahy ô!\nMpamonjy mahasoa,\nMpanafaka ahy Hianao,\nIsaorako tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM611','FFPM 611');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM611', 'Jehovah Ray Malala ô!\nIzay ao an-danitra ao,\nHenoy ny fivavahako\nAtaoko Aminao,\nFa Jeso Kristy Zanakao\nNo tena sorona\nIzay entiko ho Aminao,\nMpamela heloka.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM611', 'Jehovah Ray Malala ô!\nIzay ao an-danitra ao,\nHenoy ny fivavahako\nAtaoko Aminao,\nFa Jeso Kristy Zanakao\nNo tena sorona\nIzay entiko ho Aminao,\nMpamela heloka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM611', 'Ny fikapohana, izay\nAtaonao amiko,\nDia  misy fananarana\nMba hibebahako;\nNy fahafatesana, izay\nHo tonga koa  izao,\nDia  làlana halehako\nHo any Aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM611', 'Mba raisonao ny tanako,\nTantano aho izao,\nFa zazabodo, Raiko ô!\nAmpio ny zanakao\nNa tondraka ny rano re\nKa safononoka  ao,\nNy faty tsy ho tahotro\nHodiako Aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM612','FFPM 612');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'Ry Ray, Mpiaro lehibe!\nMba mihainoa ahy e,\nKa ampio aho hanao hoe :\nHatao anie ny sitrakao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'Izay rehetra sitrakao\nNo aoka mba hatao izao\nFa mahasoa ny tianao :\nHatao anie ny sitrakao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'Na sarotra  aza ny hatao,\nMba manampia ny zanakao\nHanaraka ny teninao :\nHatao anie ny sitrakao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'Na tonga aza ny manjo\nKa ory sy mivadi-po,\nHo toy izao ny teniko :\nHatao anie ny sitrakao!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'Mba tanterahonao tokoa\nIzay kasainao hahasoa;\nNy tena sy fanahy koa;\nHatao anie ny sitrakao!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM612', 'He! Hianao dia tsy mandao\nIzay voaray ho olonao\nKa mankatò ny didinao :\nHatao anie ny sitrakao!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM613','FFPM 613');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM613', 'Mpiandry lehibe!\nVorio ny ondrinao\nHiray fisoko avokoa,\nHiadana  Aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM613', 'Sakaiza herinay!\nJereo ny ondrinao\nMitebiteby, ory fo,\nKa miandrandra Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM613', 'Manahy izahay,\nHe! ala be izao;\nSao dia ho very foana  atý,\nVonjeo ny ondrinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM613', 'Henoy, ry Tokinay!\nVohay ny tranonao;\nRaha avy ny hodianay\nHitoetra  aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM614','FFPM 614');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM614', 'O, Ray, jereo ny zanakao\nMivavaka  Aminao!\nHenoy ny fitarainanay\nIzay atao izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM614', 'O, Ray, vonjeo ny zanakao\nFa osa izahay;\nNy tananao no herinay,\nHandresy izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM614', 'O, Ray, tahio ny Zanakao!\nNy soa Aminao;\nKa arotsahy aminay\nNy fitahianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM614', 'O, Ray, misaotra  Anao\nizahay!\nKa dera no atao;\nNy soa azonay atý\nIsaoranay Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM614', 'O, Ray, vahiny izahay!\nTsy taninay ity!\nKa raha hody raisonao\nHo Aminao arý.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM615','FFPM 615');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM615', 'Ry Jehovah, Ray Mahery!\nIndreto ny mpanomponao;\nFa mpanota saiky very,\nNefa tsy mba foinao;\nFa ny masonao mijery\nNy fanahinay mania;\nNy fitaomanao mahery\nNo miantso hoe : Avia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM615', 'Ry Jehovah, Ray Mpitahy\nIzay rehetra ory fo!\nNy tsy manana mpiahy\nMora resin’ny manjo;\nZovy ary no hanahy\nRaha  miankina Aminao ?\nEny, faly ny fanahy\nIzay matoky Aminao.\n\n.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM616','FFPM 616');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM616', 'Rainay be fitia!\nAvy izahay\nHila zava-tsoa\nAto Aminao;\nMihainoa anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM616', 'Rainay tsy miova!\nMijere anay,\nZanaka nikomy,\nFa naverinao :\nManeke anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM616', 'Rainay be fiantra!\nMenatra  izahay,\nDia mba mifona\nEo imasonao\nMiantrà anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM616', 'Rainay be harena!\nMpanome ny soa!\nIzahay mahantra,\nMitaraina hoe :\nManomeza  anay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM616', 'Rainay be fitia!\nIndreto izahay\nAvy mba hitondra\nSaotra ho Anao :\nAza lavinao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM617','FFPM 617');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM617', 'Aza manadino ahy,\nRy mpihaino vavaka!\nAza mba manary ahy\nHanalavitra Anao;\nMitodiha, ry Mpanjaka!\nKa jereo ny olonao;\nAza manadino ahy,\nRy mpihaino vavaka!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM617', 'Hianao no fiereko,\nVatolampy, heriko;\nNa kamboty aza aho,\nFaly manana Anao;\nAfa-tahotra ny foko\nRaha miandrandra Anao;\nAza manadino ahy,\nRy mpihaino vavaka!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM617', 'Eny, Hianao no Raiko,\nKa hatoniko izao;\nNefa ny fahadalako\nAza mba heverinao;\nO ! ampifalio aho,\nKa ombay ny elatrao\nAza manadino ahy,\nRy mpihaino vavaka!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM617', 'Tabataba lalandava\nNo mba hotako izao,\nKa izaho te-ho tonga\nAo am-pitsaharanao;\nMitenena, ry Jehovah!\nMamalia ahy izao;\nAza manadino ahy,\nRy mpihaino vavaka!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM618','FFPM 618');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM618', 'Eny Raiko! mba tariho\nNy fanahin-janakao,\nKa ny saiko atodiho\nHankatò ny teninao;\nZaza be fisiasia,\nTano re ny zanakao,\nDia taomy mba ho tia\nSy hanao ny sitrakao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM618', 'Eny Raiko! mba tsilovy\nNy alehan-janakao,\nKa tantano sy arovy\nMba hankatý Aminao;\nMora reraka ny aina\nRaha tsy fahananao,\nKa tohano tsy halaina\nMba hanao ny sitrakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM618', 'Eny Raiko! raha mafy\nIzany tsorakazonao,\nKa ny aiko tsy mahahafy\nMba vonjeo ny zanakao;\nKa ny foko izay adala\nMba ovay sy hazavao,\nDia taomy hahalala\nMba hanao ny sitrakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM618', 'Eny Raiko! mba tohano\nRaha  mihatra ny manjo,\nKa vimbino sy tantano\nTsy ho kivy re ny fo;\nRaha tapitra ny aiko,\nRaiso hody Aminao;\nEny, ento aho, Raiko!\nFa izay no sitrakao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM619','FFPM 619');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM619', 'Ry Raiko ô! tariho ny zanakao,\nTariho re!\nFa maizina izao lalako izao,\nTariho re!\nTsilovy, ka omeo finoana,\nTantano am-pandehanana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM619', 'Izay ela izay ny lalan-tsitrapo\nNo tiako;\nIzay ela izay izao tontolo izao\nNo mamiko;\nKanefa  izao, tariho ny zanakao,\nRy Raiko ô! handia ny lalanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM619', 'Tsy mba ahoako ny loza atý\nan-dalana;\nTsy te-hitsinjo koa ny arý\nan-koatra;\nFa isan-andro alaharonao,\nRy Raiko ô! \nny dian’ny zanakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM619', 'Na mbola lavitra aza re izay\nalehako,\nTarihonao ambara-pahafaka\nny alina,\nDia vao hitsahatra ny zanakao,\nRy Raiko ô! arý an-danitrao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM620','FFPM 620');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM620', 'Zanahary, Ray Mahery!\nIzahay tsy mana-kery,\nNefa he ny fahavalo,\nFa masiaka sady maro;\nO! ampio re izahay,\nFa ny zavatra mihatra\nTsy mba misy maharatra\nNy arovanao, ry Ray,\nZanahary, Ray Mahery,\nMba arovy izahay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM620', 'Zanahary, Ray Miantra!\nOlon-diso sy mahantra\nIzahay izay mitaraina,\nHianao no antenaina;\nIantrao re izahay!\nBe tokoa ny fahotana\nMahatonga fanimbana\nEfa vitanay tatý :\nZanahary, Ray Miantra,\nMamelà ny helokay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM620', 'Zanahary, Ray Malala!\nEnga  anie ka hahalala\nMba ho tia sy hanaiky,\nAry koa  mba hanakaiky,\nNy Mpamonjy izahay;\nTsy ny tahotray ny loza\nNo manaitra anay hiova,\nFa ny ran’ny Zanakao :\nZanahary, Ray Malala,\nMba hazòny izahay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM621','FFPM 621');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM621', 'Ry Jeso be fitia!\nTariho izahay\nMba tsy haniasia,\nFa hiaraka Aminao,\nIndrisy! ela loatra\nNo nijanonanay\nNanaram-po nihoatra\nNy sitrapon’ny Ray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM621', 'Ry Tompo ô! miarova\nNy fiainanay etý,\nIzay fohy, mora miova,\nFa tsy toy ny arý,\n‘Zay ianteherana eto\nMandalo avokoa;\nNy fo re no mba ento\nHikambana Aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM621', 'Tariho hahalala\nNy tianao hatao,\nKa tsy hisalasala\nHandà izay halanao;\nMandatsaka ao an-tsaina\nNy soa vitanao,\nKa dia hikely aina\nHanao ny sitrakao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM622','FFPM 622');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM622', 'Mba tantano, Raiko ô!\nNy fanahin-janakao,\nAoka re ny sandrinao\nNo hiaro ahy izao;\nIndro! raiso,\nTano aho, Tompo ô!\nMba hanao ny sitrakao;\nSy hitoetra ao Aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM622', 'Ray malala Hianao,\nSady tia ny zanakao;\nAoka  re ny tavanao\nHanazava ahy izao!\nIndro! raiso,\nTano aho, Tompo ô!\nMba hanao ny sitrakao;\nSy hitoetra ao Aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM622', 'Na dia maizina aza atý,\nDia matoky ano izao\nFa Hianao dia mandao\nIzay miaraka Aminao :\nIndro! raiso,\nTano aho, Tompo ô!\nMba hanao ny sitrakao;\nSy hitoetra ao Aminao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM623','FFPM 623');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM623', 'Mba omeo ahy\nFo madio kokoa\nAfaka ahiahy\nHo Anao tokoa\nIzaho dia malaina\nO! Mba hafanao re,\nMba hikely aina\nHahefako be.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM623', 'Mbola manangoly\nNy fakampanahy;\nAo koa ny devoly\nTa-hamotraka ahy;\nTompo ô! ampio\nNy mpanomponao izao,\nAry mba tafio\nHerim-po vaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM623', 'Atolory ahy\nZotom-po sy hery,\nFahendrem-panahy,\nFo mahay mietry.\nAmpianaro aho\nMba hanolo-tena,\nKa mba hatanjaho\nNy finoako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM623', 'Dia hamasino\nNy saiko, ry Tompo!\nKa omeo fo mino,\nFo mahay manompo,\nFo mahay mihafy,\nFo miravoravo,\nNa dia voa mafy,\nFo toy ny Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM624','FFPM 624');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nSambatra ny ondrinao,\nHianao no mialoha\nHanarahanay Anao;\n:,: Mitariha, mitariha\nNy fanahinay izao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nFohy ny fisainanay;\nHianao mahay manoro\nLalana halehanay :\n:,: Mitariha, mitariha\nNy fanahinay izao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nTsinjonao ny dianay;\nOndry very ka ho faty\nRaha tsy hatoninao;\n:,: Mitariha, mitariha\nNy fanahinay izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nIzao alehanay izao\nAla be sy làla-mafy,\nMaty re ny ondrinao;\n:,: Miarova, miarova\nNy fanahinay izao :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nMafy re ny tahotray;\nBibidia mamiravira\nMampivadi-po anay :\n:,: Miarova, miarova\nNy fanahinay izao :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM624', 'Jeso ô, Mpiandry tsara!\nEnto mody izahay;\nAminao ny valan''ondry\nTsy mba misy tahotra,\n:,: Mitariha, mitariha\nNy fanahinay izao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM625','FFPM 625');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM625', 'Mpamonjy soa malala ô!\nMba miandrandra Anao\nNy foko sy fanahiko\nAnkehitriny izao;\nFa Hianao irery\nNo tena Mpanome\nNy fahafinaretana\nSy fitsaharam-be.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM625', 'Mpiandry ondry mora ô!\nRy Jeso be fitia!\nHazony aho ondrinao\nMba tsy haniasia;\nAndraso isan-andro,\nArovinao anie,\nEndrey fa mahatahotra\nNy biby marobe.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM625', 'Ry Kristy be fitia!\nRy Tompo tsy mandao!\nNy sandrinao iondanako\nFa mamy Hianao;\nHianao nanolo-tena\nHo faty fahizay,\nHanangana olo-meloka\nHo zanakao indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM625', 'Ry Tompo Zanahary\nBe faharetam-po!\nIzaho te-ho olonao\nMahitsy sy madio;\nOvay ny toe-tsaiko,\nNy foko mba sasao,\nMba ho tempoly mendrika\nNy hitoeranao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM625', 'Ry Jeso tsy miova!\nRy Vonivatoko!\nRy Zanak''Andriamanitra ô!\nRy Aro lehibe!\nIzaho dia matoky\nNy fitiavanao;\nFa sambatra ny olonao \nMiankina Aminao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM626','FFPM 626');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM626', 'Jeso Tompo, mamindrà fo\nAmin''ny mpanomponao,\nFa tsy misy famonjena\nAfa-tsy ao Aminao;\n:,: O! vonjeo :,:\nNy mifona Aminao. (in-2)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM626', 'Fa kamboty sy mahantra,\nOry, osa, reraka\nIzahay atý an-tany,\nRaha tsy vimbininao;\n:,: O! ampio :,:\nNy miankina Aminao. (in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM626', 'Tokinay sy Vatolampy,\nAro sy ampinganay!\nAfa-tahotra, afa-doza,\nTsy ho ketraka izahay;\n:,: O! arovy :,:\nNy mialoka Aminao. (in-2)', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM627','FFPM 627');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM627', 'Vimbino tsara izahay\nRy Jeso Kristy Tomponay!\nMba tsy ho diso lalana\nAtý ambony rano be,\n:,: Ka na manonja aza re\nNy ria-dranomasina,\nTazòny mafy izahay\nMba tsy ho rendrika atý :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM627', 'Dia mitsangàna, ka avia,\nRy Jesosy, Mpamonjy tia!\nJereo ny fahorianay;\nAnaronao ny rivotra\n:,: Izay mampanonja toy  izao\nNy alon-dranomasina,\nIzay manafotra anay\nAtý am-pandehananay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM627', 'Fa Hianao no aronay,\nKa dia sahy izahay \nHamaky sy hanohitra\nNy onjan-drano betsaka;\n:,; Ka aoka tsy ho fefika\nAtý an-dranomasina,\nFa mba ho tonga aminao\nNy sambonay,\nry Tompo ô! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM628','FFPM 628');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM628', 'Ry Mpamonjy olom-bery!\nRy Jesosy tia anay!\nIzahay tsy manan-kery\nTsy mba hendry, tsy\nmahay,\n:,: Koa Hianao irery\nNo mba iankinanay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM628', 'Ry Mpamonjy be fitia!\nAza ilaozanao izahay;\nRy Jesosy ô! avia,\nHianao no tanjakay!\n:,: Miarova, manampia,\nBe ny fahavalonay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM628', 'Ry Mpamonjy! mitantàna\nizao mpanomponao izao;\nBe tokoa ny fikasana\nTa-hanao ny sitrakao\n:,: Nefa be ny fahosana\nMomba ny mpanomponao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM628', 'Ry Mpamonjy, Jeso tia!\nMivimbina, mamonje;\nRy Mahery, manampia!\nMiambena, mijere;\nMiarova, mitariha,\nRy Sakaiza lehibe!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM629','FFPM 629');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM629', 'Ry Jeso Mpamonjy,\nMpanavotra anay!\nTafangona eto  anio izahay\nHidera sy mba\nhankalaza Anao,\nFa Tompo namonjy\nanay Hianao :\nHaleloia! Haleloia! Hosana\nan''ny Avo!\nHaleloia! Haleloia! Hosana\nho Anao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM629', 'Ry Jeso, Sakaiza\ntsy mety mandao!\nSakaiza tsy mba mahafoy\nHianao\nMijery anay raha misy manjo,\nHo aron''ny tena\nsy tokin''ny fo :\nHaleloia! Haleloia! Hosana\nan''ny Avo!\nHaleloia! Haleloia! Hosana\nho Anao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM629', 'Ry Jeso Mpanjaka\nMpiaro anay!\nHandroso hiady tokoa izahay,\nKa dia vonjeo handresy izao,\nFa tsy mba ho resy\nizay manana Anao :\nHaleloia! Haleloia! Hosana\nan''ny Avo!\nHaleloia! Haleloia! Hosana\nho Anao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM629', 'Ry Jeso, Mpitarika\nanay ho arý\nTariho izahay tsy hivily atý.\nKa dia hamantana\nao Aminao,\nFa faly miandry anay Hianao\nHaleloia! Haleloia! Hosana\nan''ny Avo!\nHaleloia! Haleloia! Hosana\nho Anao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM630','FFPM 630');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM630', 'Ry Jesosy mba tantàno,\nHo tafita soa arý\nKa ambeno sy sakano\nIzay rehetra loza atý.\nRano be mangeniheny\nIzao alehako izao,\nKa aoka Hianao hiteny\nMba ho tokiko hatrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM630', 'Aza miandry ao am-pita\nSao dia  fefika aho atý;\nFa avia  hiara-mita,\nDia  ho tody soa arý.\nRaha sendra ka manonja\nIzany alon-drano be,\nAoka Hianao ho tonga\nHampitony azy re.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM630', 'Ao ny rivotra mahery\nMety hampivadi-po,\nFa ny feonao irery\nMampisava ny manjo\nAny koa ny vatolampy,\nSy ny biby maro be.\nFa ny herinao dia ampy,\nKa vonjeo ny zanakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM630', 'Ry Jesosy! Mihainoa,\nIzao fivavako izao,\nMijoroa, misehoa,\nKa jereo ny diako izao;\nMbola lavitra ao am-pita\nKa tsy hita izay hanjo,\nToy ilay tao Genesareta,\nMisehoa Hianao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM631','FFPM 631');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM631', 'Ry Jesosy Tompo tsara,\nRy Mpamonjy ô!\nSambatra aho, manan-jara,\nManana Anao;\nFa na maro ny mpandrafy\nTa-hamely ahy mafy\nHianao mahay manafy\nHery ny Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM631', 'Be ny manodidina ahy\nEfa lasana;\nManakaiky, mampanahy,\nRe ny fasana;\nNefa, ry Mpamonjy soa,\nTena sitrakao tokoa \nNy hitantana ahy koa\nAo an-dalana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM631', 'Eny, izaho manantena,\nRy Mpamonjy ô!\nFa hahazo famonjena \nAny Aminao,\nRaha ilaozako ny tany,\nIzaho tsy mba hitomany,\nFa hiakatra hankany\nAnatrehanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM632','FFPM 632');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM632', 'Ampianaro aho, Tompo,\nmba hiambina!\nMandalo tahaka ny rivotra \nny androko.\nKa mihalany isan-andro\nisan-alina,\nAmbara-pahatapitry\nny fe-potoako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM632', 'Endrey ny voninkazo,\nraha vao maraina e!\nFa tsara ka mamirampiratra\nny endriny;\nKanefa maty izy amin''ny\nhainandro be\nKa raha hariva dia simba\nny tarehiny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM632', 'Ny tenako no voninkazo\nka hihintsana,\nNy aiko tahaka ny\nzavona sy aloka\nIzay mandalo ka\ntsy manam-pijanonana;\nNy taonako mandroso\ntahaka ny riaka.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM632', 'Tsy manam-panorenana\natý ny heriko,\nMihelina ka tsy mba hita\nny alehany;\nMalaky tahaka ny tselatra\nny androko,\nKa tsy miatoato\nao am-pandehanany.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM632', 'Ry Tompo ô, ampio aho\nmba hiomana,\nKa mba hadio fo\nna aiza no alehako,\nAmpaherezo mafy aho\nmba ho malina,\nMba tsy ho tonga tampoka\namiko ny fetrako!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM633','FFPM 633');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Izaho tsy mba mahalala\nIzay hiainako atý;\nAnio angaha dia hiala\nKa hodimandry ho arý!\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Ry Ray ô, mampianara ahy\nHanisa e, ny androko,\nHiantombenan''ny fanahy\nAo amin''ny Mpamonjiko.\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Ny asa sy ny ahiahy,\nIzay maningotra  ahy izao,\nVahao mba tsy hisakana ahy\nHiainga raha antsoinao.\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Ny fahotako an-tapitrisa\nSaronanao ny avotra,\nIzay nandraisako batisa\nSy ny sakafo masina.\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Tsy misy mahasaraka ahy\nAmin’ny fitiavany;\nNy teniny no mahasahy\nNy olom-boafidiny.\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM633', 'Ka dia tsy mba mampanahy\nNy andro hahafatesako,\nJesosy no miantoka ahy,\nNy ainy no anjarako,\nNy ran''i Kristy, Raiko ô,\nNo amelao ny heloko.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM634','FFPM 634');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM634', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM634', 'Ny lalana izay nataon''\nAndriamanitra\nTamin''ny olombelona\n:,: Marina indrindra :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM634', 'Raha manaraka izany,\nDia tsy manan-tsiny\nFa nanota ny olona\n:,: Ka nanan-keloka :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM634', 'Raha tsy mino an''i Kristy\nNy olombelona,\nFa matoky ny tenanay,\n:,: Tsy azo hitsina :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM634', 'Fa Jeso no manafaka\nNy ota rehetra,\nNy manaiky ny teniny\n:,: No azo hitsina :,:', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM635','FFPM 635');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM635', 'Aina no fetra, ry Jesosy\nTompo\nIzany no tenin''ity zanakao\nVonon-kanaraka Anao sy\nhanompo\nAmin''ny mora sy sarotra\nhatao :\nMandrakizay no tokim-\npanompoana\nMamin''ny olona izay\nafakao,\nMandrakizay hekenay\nho faneva\nNy holatrao nanavotana\nanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM635', 'Na ny mangidy heverina ho\nmamy\nRaha miray Aminao izahay,\nIza no tsy hahafoy ny ainy\nMba ho Anao izay nisolo\nanay!\nMandrakizay no tokim-\npanompoana\nMamin''ny olona izay\nafakao,\nMandrakizay hekenay\nho faneva\nNy holatrao nanavotana\nanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM635', 'Hianao, ry Jeso! no Ilay\nKapiteny\nIzay hampandresy tokoa\nanay;\nFa raha Hianao, Tompo, no\nmba miteny,\nLasa izay mahakivy anay;\nMandrakizay no tokim-\npanompoana\nMamin''ny olona izay\nafakao,\nMandrakizay hekenay\nho faneva\nNy holatrao nanavotana\nanay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM635', 'Vonon-kandeha na aiza\nna aiza,\nIreto mpanompo matoky\nAnao;\nNa dia ny fahafatesana aza,\nTsy hahaleo anay\nmpianatrao;\nMandrakizay no tokim-\npanompoana\nMamin''ny olona izay\nafakao,\nMandrakizay hekenay\nho faneva\nNy holatrao nanavotana\nanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM636','FFPM 636');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Hianao, ry Jeso ô!\nNo mba hatoninay\n:,: Tompon''ny aina :,:\nMba mihainoa ka  avia.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Mba ampangino re\nNy ao anatinay,\n:,: Tsy hisy renay :,:\nRaha tsy feonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Aoka izahay handray\nNy fanavaozanao\n:,: Ka mba hitovy :,:\nToe-tsaina Aminao', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Mafy ny adinay,\nKa be ny tahotray;\n:,: Nefa tsy resy :,:\nIzay miankina Aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Dia tafionao\nAmin’ny herinao\n:,: Mba ho mpandresy :,:\nIzahay mpianatrao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Ny fonay hafanao\nMba hirehetanay\n:,: Amin’ny asa :,:\nIzay omenao hatao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM636', 'Mba ho tanterakay\nIzay tena anjaranay,\n:,: Dia  manomeza :,:\nFo miray aminao.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM637','FFPM 637');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM637', 'Mahareta, mahareta,\nRy mpihazakazaka ô!\nBe ny zava-mahalavo,\nAza kivy Hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM637', 'Mahareta, mahareta,\nRy mpihazakazaka ô!\nMahavesatra ny ota,\nAoka re harianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM637', 'Mahareta, mahareta,\nRy mpihazakazaka ô!\nLavi-dalana haleha,\nAndrao tsy tonga Hianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM637', 'Mahareta, mahareta,\nRy mpihazakazaka ô!\nIndreo ny maso izay mijery,\nTazany ny dianao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM637', 'Mahareta, mahareta,\nRy mpihazakazaka ô!\nAo ny Tomponao miandry,\nIzy no jereonao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM638','FFPM 638');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM638', 'Ry Jeso Mpamonjy malala!\nIndreto ny mpanomponao;\nRaha misy izay mankahala,\nMatoky, fa manana  Anao.\nJereo, Jereo!\nFa vonon-kanaraka Anao.\n(in-2)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM638', 'Ny tafika ataon’i Satana\nMilofo hamotraka  anay;\nAvia, ry Jeso mitantàna,\nFa mioman-kandresy izahay.\nJereo, Jereo!\nFa vonon-kanaraka Anao.\n(in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM638', 'Na zovy mioman-kandrafy,\nIrinay hanaraka Anao ;\nNa iza hisakana mafy,\nHijoro, fa manana Anao.\nJereo, Jereo!\nFa vonon-kanaraka Anao.\n(in-2)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM638', 'Ireo nentinao voatantara\nNo feo mampahery anay;\nNy tokin’ireo Maritiora\nFaneva mitarika anay;\nJereo, Jereo!\nFa vonon-kanaraka Anao.\n(in-2)', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM639','FFPM 639');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM639', 'Ry miaramila! mandrosoa izao,\nKristy Kapiteny mialoha anao;\nAo aloha tafika, loza, ratra be,\nFitsaharana tsy misy,\nmisikina re :\nRy miaramila! mandrosoa\nizao,\nKristy Kapiteny mialoha anao;', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM639', 'Any lehy ratsy no manotrika,\nAny ny tsipìka no milatsaka;\nTano ny finoana ho\nampinganao,\nEntonao ho fandresena izao\nrehetra  izao :\nRy miaramila! mandrosoa\nizao,\nKristy Kapiteny mialoha anao;', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM639', 'Aza miambohona miherika,\nAo an-tratranao ny fiarovana;\nAza mba matahotra, fa\nsahia, fandrao\nRaha tsy mandresy, dia ho\nresy hianao;\nRy miaramila! mandrosoa\nizao,\nKristy Kapiteny mialoha anao;', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM639', 'Dia mandrosoa hianao izao,\nKa miraisa dia aminay ho ao;\nMilofosa fatratra, aza ketraka\n« Miadia ny ady tsaran’ny\nFinoana » :\nRy miaramila! mandrosoa\nizao,\nKristy Kapiteny mialoha anao;', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM639', 'Kristy Kapiteny tapitra ohatra,\nIzy no mpiaro ny mpanafika;\nMiankìna Aminy mafy hianao\nKa aza mba ny tenanao no\nitokianao\nRy miaramila! mandrosoa\nizao,\nKristy Kapiteny mialoha anao;', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM640','FFPM 640');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM640', 'Misy fahavalo maro\nTe-hiady aminay,\nFaly sy miravoravo\nRaha mamotraka anay;\nIzahay tsy manan-kery\nHandresenay azy ireo;\nRy Mpamonjy olom-bery!\nJeso Tompo ô! vonjeo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM640', 'He! mibaiko ny devoly,\nIlay mpihaza aina soa,\nKa mikendry hanangoly\nSy handatsaka aina koa;\nTsy mba misy izay hanampy\nHampandositra azy izao;\nHianao no tsy manary\nJeso Tompo ô! vonjeo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM640', 'Indreo ny fandrika harato\nIzay mivelatra avokoa,\nTsara sy milantolanto,\nToa fiainana tokoa;\nKanjo indrisy ny mahazo\nIzay fatoran’izy ireo;\nTsy mba hainy ny miala;\nJeso Tompo ô! vonjeo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM640', 'Miomana ry sakaiza!\nBe ny fahavalonao;\nMitandrema sy mahaiza,\nSarotra ny lalanao;\nAza mba matoky tena,\nFa ny Tompo no jereo;\nIndrisy re ny halemena;\nJeso Tompo ô! vonjeo.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM641','FFPM 641');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM641', 'Ry Kapiteny, be ny ady manjo\nMila ho reraka sy kivy ny fo,\nKa hatanjaho mba\nhatoky Anao,\nTompo ô! avia mamonjy\nahy izao :\n“ Eny, Izaho mamonjy anao,\nKa mampahery sy miaro\nanao;\nAza matahotra mihitsy\nhianao,\nFa Izaho momba sy manampy\nanao.”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM641', 'Ny fahavaloko atý mba reseo,\nKa taomy aho mba handray\nrahateo\nNy fiadiana avy ao Aminao;\nTompo ô! vimbino aho,\naza mandao;\n“ Eny, Izaho mamonjy anao,\nKa mampahery sy miaro\nanao;\nAza matahotra mihitsy\nhianao,\nFa Izaho momba sy manampy\nanao.”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM641', 'Loza tokoa re ny tahotra teo,\nKa na mamely ahy aza ireo,\nTsy mba manahy  intsony\naho izao\nFa mamonjy sady\ntsy mandao Hianao.\n“ Eny, Izaho mamonjy anao,\nKa mampahery sy miaro\nanao;\nAza matahotra mihitsy\nhianao,\nFa Izaho momba sy manampy\nanao.”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM641', 'Fa ny mpiady maharesy atý\nNo hosatroham-boninahitra\narý;\nMaro no efa tonga ao\nAminao,\nTompo ô! avia hitarika ahy\nhankao\n“ Eny, Izaho mamonjy anao,\nKa mampahery sy miaro\nanao;\nAza matahotra mihitsy\nhianao,\nFa Izaho momba sy manampy\nanao.”', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM642','FFPM 642');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM642', 'Hitako izao, sakaiza!\nJeso no Mpanavotra :\nTsy mba lany ny fitia,\nJeso no Mpanavotra;\nNa dia  saiky lasa aza,\nKa ny olona mandao,\nIzao no mampiadana  ahy,\nJeso no Mpanavotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM642', 'Raha miasy mafy aho,\nJeso no Mpanavotra :\nToky sy Ampinga Izy,\nJeso no Mpanavotra;\nManome ny soa Izy,\nFa ny rany mahadio\nNo mahafa-keloka ahy,\nJeso no Mpanavotra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM642', 'He! ilaozako ny eto,\nJeso no Mpanavotra :\nIndro lanitra no azo,\nJeso no Mpanavotra;\nIzy no Mpamonjy ahy,\nAina sy fanilo koa,\nFahendrena mahasoa,\nJeso no Mpanavotra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM642', 'Ray ô! Hianao deraiko,\nJeso no Mpanavotra :\nHianao naniraka Azy,\nJeso no Mpanavotra;\nHianao Mpiaro ahy,\nMpitahiry, Tokiko,\nNo deraiko lalandava,\nJeso no Mpanavotra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM643','FFPM 643');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM643', 'O! mandrosoa mba ho tena\nmpandresy,\nDia mazotoa, miasà,\nmitomboa\n:,: Raiso ny tsara, ka roahy\nny ratsy\nKa matokia an’i Jeso tokoa :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM643', 'O! mandrese, ny finoana tano,\nNa dia mafana ny ady hatao,\n:,: Ny fandresena homena ny\nmino\nAzy ny herin’ny Tompo izao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM643', 'Mba matokia ny hery tsy hita\nIzay voatahirin’ny Ray\nho anao,\n:,: Ka voatolotra tao Gologota\nMba ho antsika rehetra izao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM644','FFPM 644');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM644', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM644', 'Matahora, mangovita,\nFa, indro! ny devoly\nNo mihendry hisambotra\nNy saintsika rehetra;\n:,: Miambena :,:\nKa mivavaha tsara. (in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM644', 'Mifalia, mivavaha,\nJeso no arontsika,\nManaraha ny teniny,\nFa hovonjeny isika;\n:,: Tano Izy :,:\nHahazoana aina. (in-2)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM644', 'Manandrata feo hihira\nHidera an’i Kristy,\nHanome voninahitra\nAn’Andriamanitra\n:,: Tompontsika :,:\nFa marina izany. (in-2)', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM645','FFPM 645');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM645', 'Jesosy Kapiteninay\nIzao miantso izao,\nHiady no ilana anay\nKa zovy no hanao ?\nIzay mahafy hatratý,\nMahery fo tokoa\nKa tsy miraika hatrarý;\nIreny no hanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM645', 'Ny tany hotafihinay,\nIzao tontolo izao;\nNy tafika hikatrohanay,\nTsy ady mora atao;\nNy ota hotoherinay\nHo rava sy hikoa.\nNy tany hitorianay\nNy herinao tsy toha.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM645', 'Indreo, ny maritiora soa\nNo loha-lalanay,\nNalatsaka  aina avokoa,\nKa marika aminay;\nFandavan-tena lehibe\nNo vitan’izy  ireo\nHodian-tsy hita foana ve\nIreo maritiora ireo ?', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM645', 'Ry Jeso Kapiteninay!\nIzao anio izao,\nNo anavaozanay indray\nNy fanompoana Anao;\nAtolotray Anao tokoa\nIzao tenanay izao,\nKa hamasino avokoa\nHanao ny sitrakao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM646','FFPM 646');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nDia  misy izay ahina,\nFa be ny fahavaloko\nMahery sy kirina.\nMikendry fatratra\nIreo mpamitaka,\nKa dia hazoniko ny to,\nNa aiza no alehako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nDia  misy ady mafy;\nNy ota hotoheriko,\nHataoko tena rafy;\nNy fahoriana,\nIzay fikapohana,\nTsy maintsy hiaretako,\nNa aiza no alehako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nNy fasana mangina\nMiandry eo alohako,\nFa aloka ny aina\nSy toy ny zavona\nMalaky levona;\nIzany no tsaroakao\nNa aiza no alehako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nMomba ahy ny anjely,\nKa tsy mba hatahorako\nSatana izay mpamely,\nRy izao tontolo izao,\nHo resy hianao,\nAnjely re ho namako\nNa aiza no alehako.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nJesosy no kiady;\nNy ratrany no aroko\nSy herin’ny mpiady.\nNy dian-tongony\nArahiko atý,\nKa fandresena azoko\nNa aiza no alehako.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM646', 'Na aiza no alehako,\nNy lanitra andrandraiko,\nKa ravo ny fanahiko,\nFa ao ny Tompon’aiko,\nRy izao tontolo izao,\nNy voninahitrao\nDia  vovoka hitsahiko;\nNy lanitra  ao alohako.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM647','FFPM 647');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'He! sarotra ny lalam-\npamonjena\nHitanana ny vonjy izay\nnomena\nHamelona hatrao am-parany\nNy fitiavana voalohany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'Ny maro dia mazàna \nmankamamy\nIzao tontolo izao, ka mora lany\nNy zotom-po sy finoana\nDia tonga tia zava-poana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'Malaina izy ka tsy te-hiady\nNy ady masina izay maro fady,\nNy lalan-tery dia halany,\nFa ny malalaka no tiany.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'Mazàna mety menatra ireny\nRehefa voatsindron-toriteny,\nFa hitany ny ratsy ao am-po,\nKanefa tsy mba te-hiova fo.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'Ry Jeso, Hianao no tokin’aina,\nIzay novonoina sy \nnankahalaina,\nOmeo ahy faharetam-po,\nHiaritra izay anjarako.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM647', 'Raha reraka aho ka misalasala,\nDia  asehoinao, ry Ray malala,\nNy lovako arý an-danitra\nHihazona  ahy mba haharitra.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM648','FFPM 648');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM648', 'Miambena  izao,\nRy fanahiko!\nMisy rafinao misaina\nHanangoly ny malaina;\nBe ny fandrika\nVoavelatra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM648', 'Miambena  izao,\nRy fanahiko!\nMba tsy ho andevon’ota,\nNa hotaomin’ny mpanota;\nMivavaha  izao,\nRy fanahiko!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM648', 'Miambena  izao,\nRy fanahiko!\nKa tohero ny devoly,\nRaha avy manangoly;\nKristy raisonao\nMba ho aronao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM648', 'Miambena  izao,\nRy fanahiko!\nTsy ho ela tsy akory\nDia ho lasa ny mahory,\nKa ho afaka\nNy mpiambina.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM648', 'Miambena  izao,\nRy fanahiko!\nFa ho avy  indray ny Tompo\nMba hampody ny mpanompo\nHo finaritra\nAo an-danitra.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM649','FFPM 649');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM649', 'Ry mino, miambena re,\nFa manam-pahavalo be;\nJesosy no arahonao\nHitarika anao.\nEzahonao ny dianao,\nNy satroboninahitrao\nMiandry ao aloha ao,\nKa mba tratraronao!\nMba mivavaha, ry havako,\nA miomana ao am-po;\nAndeha  izao ilaozinao\nNy zavatra ho lo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM649', 'Izao no fiadiana\nOmen’Andriamanitra,\nNy fahamarinana alao\nMba hisikinanao;\nHazony ny finoana\nAmpinga hanohanana;\nNy tenin’Andriamanitra\nNo tena sambatra;\nNy famonjena raisonao\nHo fiarovan-dohanao;\nIreo no hanoheranao\nNy ratsy ao am-po.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM649', 'Ry Havana malala ô,\nAndeha  isika hiray am-po\nHikatsaka ny lanitra,\nFa ao tsy misy manjo.\nHo faly ao an-danitra\nNy vita fanompoana,\nKa izao isika handao\nNy zava-poana!\nHo lasa faingana indray\nNy androntsika an-trano lay;\nVonjeonao ilay tany vao\nIzay mandry fahizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM650','FFPM 650');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM650', 'Miambena, mivavaha, fa tsy\nfantatrao\nNa ny andro, na ny ora\nfe-potoananao\nNy Mpanjaka masina ho\ntonga tampoka\nHampaneno ny trompetra\nao an-drahona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM650', 'Amboaro ny fanilon’ny finoana\nSy ny solika fitaiza voaomana,\nKa Velomy re ny afom-\npitiavana\nMba hidiranao an-dapam-\npifaliana.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM651','FFPM 651');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM651', 'Jeso ampio izahay mba\nhandresy!\nNy fahavalo mamely anay!\nIndro, ny aizina tsy mbola\nresy;\nAry Satana mamandrika anay,\nKa mba omeo anay ny\nmazava,\nHampahasahy anay lalandava.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM651', 'Jeso ampio izahay mba\nhandresy!\nKely finoana re izahay;\nKivy matetika, mila ho resy;\nAoka ny herinao homba anay;\nDia hatoky  izahay,\nry Mpandresy\nFa ny devoly dia  ho voasesy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM651', 'O, ry Mpandresy, arovy\nny ainay!\nAdy mafy hiseho izao;\nKa mba tohany hatoky\nny fonay!\nDia hiainga hanaraka Anao;\nNa dia loza ny herin-tSatana,\nSahy izahay, Hianao no\nmitana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM651', 'Ampandreseo izahay,\nry Mpamonjy!\nKa raha vita ny ady atý,\nDia ho isan’izay voavonjy,\nAry ho faly sy tretrika erý;\nTsy mba hitsahatra intsony\nny hoby\nHankalazana Anao,\nry Mpamonjy.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM652','FFPM 652');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM652', 'O, ry Jesosy, omeo ny hery,\nMba handreseko ny ota izao!\nOsa sy ketraka aho irery,\nRaha tsy avy izao Hianao.\nRaiso ny fo.\nTano tokoa,\nMba handreseko,\nry Tompoko ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM652', 'O, ry Jesosy, omeo ny hery,\nKa amboary ny fonay izao;\nO, mba esory izay mahavery,\nMitomoera aminay Hianao;\nKa hazavao\nNy fo izao\nAmpandosiro ny aizina ao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM652', 'O, ry Jesosy, omeo ny hery,\nKely finoana re izahay,\nAry ny lalanay ety sy tery,\nRy Jeso ô, mitantàna anay!\nTohanonao\nNy olonao,\nAmpandreseo izay manaraka\nAnao!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM653','FFPM 653');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM653', 'Sakaiza, raha tia\nNy Tompo Hianao,\nFaingàna ka avia\nHanaraka Azy izao!\nO, mba tsarovinao\nFa Izy tsy nifaly,\nNaleony nijaly\nMba hamonjena  anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM653', 'Fanahy, mahereza,\nEfao ny adinao,\nFa làlana mideza\nNo hiakaranao;\nNy zava-tsoa atý\nDia  zavatra mandala;\nTsy azom-pahavalo\nNy lovanao arý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM653', 'Ry Tompo manomeza\nAnay ny herinao;\nFinoana mateza\nMba atolorinao;\nMba hanarahanay\nNy lalam-pamonjena.\nHahita  Anao mitsena\nAnay rahatrizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM654','FFPM 654');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM654', 'Mba faingàna re, ry mino,\nAza mba tamana atý;\nAry aza manadino\nNy anjaranao arý.\nNy Mpamonjy anao\nNo manangana faneva,\nAry mampihevaheva\nAzy eo alohanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM654', 'Marobe no mba mitady\nNy fiainana vaovao,\nNefa kosa tsy miady\nAmin’izao tontolo izao.\nNy Mpamonjy anao\nNo manangana faneva,\nAry mampihevaheva\nAzy eo alohanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM654', 'Koa raiso ny ampinga,\nTano re ny sabatrao,\nFa izany mahakinga\nNy mpandeha toa anao.\nNy Mpamonjy anao\nNo manangana faneva,\nAry mampihevaheva\nAzy eo alohanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM654', 'He, akaiky anao Kanana,\nTany hovantaninao;\nAry any hy tanàna\nMisy ny anjaranao.\nNy Mpamonjy anao\nNo manangana faneva,\nAry mampihevaheva\nAzy eo alohanao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM655','FFPM 655');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM655', 'Kristy miantso antsika hiady,\nIzy nandresy ilay ratsy sahady,\nKa mba Henoy, ry sakaiza\nizao :\nKristy miandry indrindra anao!\nMila antsika\nKristy Mpanjaka.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM655', 'Kristy Mpitarika amin’ny ady,\nKa mampandresy izay\nte-hifady\nNy fahotana, izay maimbo\nsy lo;\nIzy no manda mafin’ny fo.\nMiaro antsika\nKristy Mpanjaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM655', 'Kristy mampiananatra antsika\nhahery,\nIzy miaro antsika sao very,\nKa mba avia hifahatra ao,\nIndro ny ady mandroso izao\nMiantso antsika\nKristy Mpanjaka.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM655', 'Kristy mamnjy antsika\nizay voa,\nAry tsaboiny ho entiny koa\nHo ao an-dapany mandrakizay\nHonina ao an-tranon’ny Ray.\nHaka antsika\nKristy Mpamonjy.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM655', 'O, ry Jesosy Mpanjaka,\nMpamonjy!\nTompon’ny dera aman-daza\nsy vonjy,\nIreo rafinao mba reseo izao,\nKa tanteraho izay sitrakao.\nO, mba avia,\nKristy Mpanjaka.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM656','FFPM 656');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM656', 'Maty malala, ka ory ny fo;\nLasa ny tiana, ka mafy manjo;\nNefa isika tsy mba mamoy,\nFa manantena hihaona indray :\nAo aminao Tompo! izy izao,\nTsy mba marary na misy\nmanjo;\nNentina any ambony madio,\nDia ho sambatra mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM656', 'Mba notandremana fatratra\nkoa,\nNefa tsy tana, fa lasa izao;\nEny, ry Tompo! ekena tokoa\nIzay sitrakao, fa izany no soa :\nAo aminao Tompo! izy izao,\nTsy mba marary na misy\nmanjo;\nNentina any ambony madio,\nDia ho sambatra mandrakizay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM656', 'Fantatra koa fa isika izao\nSamy vahiny ka hody indray;\nIndro! ny namana lasa izao,\nLasa miandry antsika arý :\nAo aminao Tompo! izy izao,\nTsy mba marary na misy\nmanjo;\nNentina any ambony madio,\nDia ho sambatra mandrakizay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM656', 'Ary isika, raha hiala atý,\nDia hotsenain’ireo havan-\ntsy foy\nEny, hihaona mifaly indray\nKa tsy hisaraka mandrakizay\nAo aminao Tompo! izy izao,\nTsy mba marary na misy\nmanjo;\nNentina any ambony madio,\nDia ho sambatra mandrakizay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM657','FFPM 657');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM657', 'Lasa re ilay nazoto,\nNody ao an-tany soa,\nIzay nanompo tamin-joto\nKa nahefa be tokoa,\n:,: Indro, faly :,:\nFa mijinja voka-tsoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM657', 'Lasa nody fa voantso :\n“Miakara”, hoy ny Ray,\nKa fafao ny ranomaso,\nJeso Tompo no mandray.\n:,: Faly, ravo :,:\nFa tafakatra ao tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM657', 'Lasa re ilay nihafy\nOry tena, be nanjo,\nFa nanohitra  ady mafy,\nNefa mba nahery fo.\n:,: Ka nandresy :,:\nFahavalo maro be.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM657', 'Afaka  ady ka mifaly,\nFa tsenaina hatratý;\nAfaka  ota, afa-jaly,\nKa mihoby hatrarý.\n:,: Hoy ny Tompo :,:\n“Mandrosoa, ka mifalia”.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM658','FFPM 658');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM658', 'Tonga ny fahafatesana,\nAry jinjany ny velona;\nIzy manapaka ny lehibe\nSady mamira ny kely re!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM658', 'Nefa ny fasana maizina\nEfa nidiran’ny Masina;\nIzy nampody ny fiainana,\nResy ny fahafatesana.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM658', 'Amin’ny manam-pinoana,\nDia mazava ny fasana;\nIzy hitsangana finaritra\nNoho Jesosy Mpanavotra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM658', 'Resin’ny Tompo ny fasana,\nKoa, ry fahafatesana,\nAiza izao ny fanindronanao ?\nAiza, ry helo, ny herinao ?', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM659','FFPM 659');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Ry hava-malala misaona\nMangina fa mbola hihaona\nIsika sy izy nalaina,\nRaha  tonga indray ilay \nmaraina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Ny naman’ny tany ihany\nNo mody ho amin’ny tany,\nKa dia ny fanahy mifindra\nHo amin’ny Avo indrindra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Tsy mainsty afafy aloha\nNy vary vao mety hamoa;\nNy faty halevina koa\nTsy very fa mbola hifoha.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Dia miandrandrà,\nry mpisaona!\nHo avy ilay lohataona,\nKa dia haniry ny voa,\nIzay misy ny ain’ny Tsitoha.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Ho avy ny Tompon’ny aina\nHiantso ny vovoka maina\nHitafy ny fahazavany\nSy hiditra ao am-panjakany.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM659', 'Faingàna, ry Kristy Mahery,\nRy Fanantenanay irery,\nNy fasanay iva tsarovy,\nNy toky nomenao mba tovy!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM660','FFPM 660');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM660', 'Sambatra ny nodimandry,\nNiala teto ka tafandry\nAo ampofoan’i Kristy;\nRavoravo izao ny fony\nKa tsy misasatra intsony,\nMby ao am-pitsaharany.\nNy asany tatý\nManaraka  azy arý,\nHaleloia!\nTafiditra  ao an-dapanao,\nRy Jeso, ny malalanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM660', 'Saotra, dera, laza, hery,\nMba raiso ho Anao irery,\nRy Zanakondry tokinay!\nHianao dia nialoha\nHanolotra anjara soa\nHo an’ilay malalanay.\nNy fahafatesanao\nNo misy aim-baovao,\nHaleloia!\nHahita Anao ny olonao\nHohazavain’ny tavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM660', 'Tsy mba misy alina any,\nJesosy no fahazavany\nSy tena masoandrony.\nAzony izay niriny,\nKa sambatra ny mpivahiny,\nFa ao no tanindrazany,\nFa efa tapitra\nNy ali-maizina,\nHaleloia!\nFa foana ny fasana,\nMaraina no miposaka.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM661','FFPM 661');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM661', 'He, lasa ny zaza malalan’ny\nfo!\nAtolotra ny tany ny tena ho lo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM661', 'Tsy maty anefa ny zaza, fa he\nJesosy no milaza :\n« Matory izy e! »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM661', 'Jesosy hamoha ny zaza indray,\nHiara-paly amin’anjelin’ny \nRay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM661', 'Ka mba mionòna, ry havana\natý!\nHo hitanao ny zaza ao\nan-danitra arý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM662','FFPM 662');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM662', 'O, ry Mpamonjy, avia Hianao,\nIndro misento ny fonay izao;\nNy alahelo mamely anay,\nKoa mitady Anao izahay!\nIza no aron’izay ory fo;\nSady mpanampy ny mana-\nmanjo\nFa tsy ny Tompo mahery\nsy to ?\nDia Hianao, Izay be indrafo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM662', 'Jeso Mpamonjy ô, mba\niantrao,\nIzay malahelo miantso Anao!\nNy mitomany tsy hitanao va ?\nFantatray fa Hianao tsy handà\nDia  manatòna ka mba mijere\nNy ranomaso izay mitete!\nFa Hianao no mahay manome\nFampiononana be dia be.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM663','FFPM 663');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM663', 'He, lasa izao ny malala!\nNifindra  ao an-dapan’ny\nRay;\nIsika rehefa miala,\nHo faly hahita azy indray,\nIsika izao mitomany,\nIharan’ny mafy manjo;\n:,: Jesosy mahita izany,\nKa Izy hanony ny fo :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM663', 'Matetika re ny mangidy\nAvela hihatra aminao,\nKa aoka mba tsy hanadidy,\nFa feon’ny Tompo izao,\nNy zanaka tian’ny rainy\nTsy maintsy anariny re!\n:,: Izay mahasoa ataony,\nOmbam-pitiavana be :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM663', 'Ny fo mora kivy ario,\nFa tsy mba hanary ny Ray;\nNy mamy tsy hita anio\nHaposany rahatrizay,\nHofaohiny ny ranomaso,\nSoloam-pifaliana be;\n:,: Ny toky omeny andraso,\nFa ho tanterahiny re! :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM664','FFPM 664');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM664', 'Nalain’ny Mpahary ity\nzaza ity\nHo sambatra mandrakizay,\nMiandry antsika nilaozany atý\nFa mbola hihaona indray,\nOnony ny fonao,\nRy mana-manjo!\nAo an-danitra izy izao,\nRavo izy izao,\nFa ny lapan’ny Ray\nFonenana mandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM664', 'Nafahina amin’ny loza etý\nKa tretrika izy izao,\nNy nofo ho lo no alevina atý\nFa any ny tena vaovao.\nOnony ny fonao,\nRy mana-manjo!\nAo an-danitra izy izao,\nRavo izy izao,\nFa ny lapan’ny Ray\nFonenana mandrakizay.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM665','FFPM 665');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM665', 'Ry mpisaona malahelo,\nMijere ny Tomponao,\nIzay namindra ny malala\nMba ho ao an-danitra;\nMba fafao ny ranomaso,\nAndrandrao ny lanitra\nMitsahara, ry mpisento,\nKa derao ny Tomponao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM665', 'Nofo no anterintsika\nAo am-pasana anio;\nNy fanahinay anefa\nTsy mba ao anatin’io.\nJeso no namindra azy,\nLasany ny havanao,\nFa navotany ho Azy,\nKa derao ny Tomponao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM665', 'Mangataha fahendrena,\nKa isao ny andronao;\nMikatsaha famonjena\nSy fiainana vaovao,\nMba horaisiny tokoa\nHonina  any Aminy,\nKa hekeny ho sakaiza,\nMba ho ao an-tranony.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM666','FFPM 666');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM666', 'Eo an-kavanan-dRay Hianao,\nRy Zanakondry ô!\nKanefa loza mahamay\nNo niaretanao.\nNy henatra aman-kelokay\nNihatra taminao;\nNivesatra ny otanay\nNo nahafatesanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM666', 'Ry Zanakondry masina\nNijaly an-tsitrapo,\nTeren’ny fitiavana\nHanala otako!\nNy tongotra aman-tananao\nDia  voafantsika;\nNy gadranay dia  tapakao,\nIzay dia  afaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM666', 'Vahoaka alinalina\nMitafy fotsy erý,\nKa samy miramirana\nMahita an’i Kristy.\nNy hira fihobiana\nManakoako ao,\nManeho fa navotana\nIzao tontolo izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM666', 'Indreo ny vahoakanao\nAn-tapitrisany\nMitondra ny Anaranao\nEo an-kandriny.\nHe! toy ny rian-drano be\nNy fiderana Anao,\nVoasokatrao ny lanitra\nHo an’ny olonao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM666', 'Misaotra Anao izahay, ry Ray\nIzay navotanao,\nNatolotrao ho solonay\nNy Lahitokanao.\nRy Zanakondry, Avotray,\nDerainay Hianao,\nDerainay ho mandrakizay\nNy fitiavanao!', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM667','FFPM 667');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM667', 'Zavatra iray ihany\nNo hotadiavina,\nFa izay atý an-tany\nDia tsy mampianina\nNy nofo dia zava-mandalo\nihany,\nSatria ho lo ao anatin’ny tany;\nRaha azoko kosa ny zavatra\niray,\nNy foko ho sambatra\nmandrakizay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM667', 'Tadiavinao tokoa va\nny zavatra iray ?\nMba hevero fa ny soa\nMomba ny mandrakizay;\nKa aza fatoran’ny eto intsony,\nKatsaho tokoa ny any \nambony,\nFa any no misy ny zavatra iray\nIzay hifalianao mandrakizay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM667', 'Ry Fanahy ô, ampio\nNy finoako izao!\nRy Mpamonjy ô, tahio\nNy mpangataka Aminao!\nTariho ny foko hitady tokoa\nNy any ambony izay \nmahasoa;\nJesosy ihany no zavatra iray,\nIzay ho anjarako mandrakizay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM668','FFPM 668');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Jesosy Tompoko no làlana,\nFahamarinana, fiainana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Tsy afaka manatona ny Ray\nRaha tsy amin’ny alalany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Jesosy Tompon’ny fiainana ô!\nAoka Hianao no ho fiainako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Etý an-tany : fiainam-bavaka,\nRahatrizay : fiainan-danitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Iriko mafy ny hiakatra,\nHiaina izany fiainan-\ntsambatra!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM668', 'Jesosy tokana no hanome\nAhy ny fiainana mandrakizay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM669','FFPM 669');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM669', 'He, tazako ny lalan-tery,\nIzay misy fahoriam-be,\nKanefa feno hira, re;\nFa na miady, tsy ho very.\nNy mino izay mizotra eo,\nNa misy mafy aza eo,\nHahazo lakrona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM669', 'He, tazako Sakaiza mora,\nMpanala fahoriam-be,\nMpiaro soa, Mpanome\nNy toky tsara isan-ora;\nSakaiza feno herim-po,\nMamonjy amin’ny manjo;\nSakaiza tsy manova.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM669', 'He, tazako ny lamba soa\nOmena ny voavotra\nHo fanesoran-keloka\nSy fanavaozana  azy koa;\nFa Jeso efa nanome,\nNy rany sarobidy re,\nHo fanadiovana  azy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM669', 'He, tazako ny andro avy,\nIzay hialako sasatra,\nKa ny ririnin’efitra\nHanjary lohataona mamy;\nKa any vao hivelatra\nNy vonindraozin-danitra\nAo amin’ny Edena.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM669', 'He, tazako ny voavonjy\nAo amin’ny Mpampakatra,\nDia  ao an-tampon-danitra,\nIzay niakaran’ny Mpamonjy;\nMiravoravo izy ao,\nMihira fideram-baovao\nHo an’ny Zanakondry.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM670','FFPM 670');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM670', 'Ny ony tsy miato, fa mitady\nNy ranomasina ihaviany;\nKa toy izany koa ny fanahy\nMitady ny Andriamaniny,\nAndriananahary\nNo Tompoko nahary\nNy faniriako,\nIzay mitady Azy, ka manary\nIzay misakana ny diako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM670', 'Izay midongy sy mirehareha\nTsy hahatratra ny Edenany;\nLomorina ny rano tsy\nmandeha,\nKa samba ao am-pijanonany;\nKa toy izany koa :\nHo samba avokoa\nIzay mijanona,\nKa tsy manatona ny Tompo\nsoa\nIzay mitahy sy mamelona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM670', 'Tsy misy zavatra atý an-tany\nMahafa-po ny faniriako;\nVahiny aho eto ka mankany\nAn-danitra izay fodiako.\nNy Tompoko malala\nHo avy hampiala\nNy olony atý;\nIzaho dia tsy misalasala\nHanaraka ny Tompo ho arý.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM671','FFPM 671');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM671', 'Ao an-danitra\nDia ho sambatra\nIzay tia ny Tompo atý!\nMalahelo izao,\nRavoravo re, ao\nAmin-dRaintsika an-danitra\narý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM671', 'Fahoriana\nAo an-dalana,\nFa iharan’ny zava-manjo;\nAo an-danitra re,\nFiadanana be;\nMba hevero, ry havana ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM671', 'Aza kivy ô,\nRy fanahiko,\nNa dia  maizina aza atý;\nVetivety izao\nDia hody hianao\nAo am-pahazavana arý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM671', 'Ry Mpanavotray,\nIndreto izahay\nMpivahiny an-dalana izao;\nTsy tamana atý,\nTe-hifindra arý\nAo an-danitra ao Aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM672','FFPM 672');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM672', 'O, mamiratra fatratra erý\nIrony kintana tazana etý,\nKa manainga ny foko hankao\nAmin-tranon’ny Raiko izao,\nRaiko ô, mba vohay\nAho hiditra ao Aminao!\nRaiko ô, mba vohay\nFa iriko ny honina ao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM672', 'Feno ota ny tany atý;\nTsy mba misy izany arý,\nTena masina ireo mponina ao,\nKa mifaly mijery anao.\nRaiko ô, mba vohay\nAho hiditra ao Aminao!\nRaiko ô, mba vohay\nFa iriko ny honina ao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM672', 'O, fonenana mamiko re;\nFa Jesosy nirina elabe,\nSady aina iainako izao,\nNo miandry hndray ahy ao,\nRaiko ô, mba vohay\nAho hiditra ao Aminao!\nRaiko ô, mba vohay\nFa iriko ny honina ao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM672', 'Mba tsilovy ny lalako izao,\nRy Fanahy Mpitarika ô,\nHahitako ny tranon’ny Ray\nHovantaniko rahatrizay,\nRaiko ô, mba vohay\nAho hiditra ao Aminao!\nRaiko ô, mba vohay\nFa iriko ny honina ao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM673','FFPM 673');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Hevero ny fihaonambe\nArý an-danitra;\nVahoaka izany re!\n:,: He, samy sambatra :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Ho vory ao ny iraky\nNy Tompom-bokatra,\nMitondra amboarany\n:,: Am-pihobiana :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Ny isam-pirenena atý\nDia samy misy ao,\nNy teny izay ninoany\n:,: Tanteraka izao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Ny feon’ny fisaorany\nHo toy ny riana,\nNy hira iray iraisany,\n:,: Ka samy mirana :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Ny lanitry ny lanitra\nDia feno hobiny,\nNy Zanakondry masina\n:,: No ao anivony :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM673', 'Ry Ray be fitiavana,\nIzahay mba taominao,\nMba samy ho tafangona\n:,: Ao anatrehanao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM674','FFPM 674');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM674', 'Ry mpivahiny reraka sy ana,\nHerezonao  ny dia, fa irý\nNy lapa soan’ny fanantenana,\nKa aza mba mamoy fo etý,\nFa vetivety Hianao no eto,\nDia  tapitra ny alahelonao,\nKa dia mba ononinao ny sento,\n:,: Fa mihafohy ny alehanao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM674', 'Jesosy no mpitsinjo mpivahiny\nKa Izy dia ta-handray anao;\nNy fony dia toy ny fahiny\nKa vonona hitantana anao,\nKa miezaha hanatratra eny,\nAntsoiny hianao izao hoe :\nMinoa Ahy araka ny teny,\n:,: Ny tranon-dRaiko dia\nlehibe :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM674', 'Mangoraka anao izao ny fony\nNy tena aman-drany vatsinao,\nKa aza mba mihemotra\nintsony,\nFa ampy ho anao Jesosinao,\nKa raiso ny finoana ho\nampinga,\nNy teny masina ho sambatra,\nNy fahamarinana mba\nhahakinga,\n:,: Ny fitiavana hanandratra :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM675','FFPM 675');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM675', 'Indreo ao an-danitra ny\nolo-marobe,\nMitsangana manatrika ny \nZanakondry, re! \nAkanjo fotsy lava no\nanaovany,\nKa sampa-palma fandresena\nno an-tànany.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM675', 'Ka iza moa ireo, ary avy\ntaiza re ?\nIreny dia avy tamim-\npahoriam-be,\nNanasa sy namotsy ny\nankanjony\nTao amin-dran’ny Zanakondry,\nIzay Mpanavony.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM675', 'Ny tia ny maloto tsy ho ao\nan-danitra,\nFa masina ny tonga any, sady\nsambatra\nMihira fiderana sy fisaorana\nNo zavatra ataony amim-\npifaliana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM675', 'Endrey, maniry mafy aho mba\nho isany,\nHiaraka hihoby sy hifaly\nAminy;\nAnefa an’ny Tompo ny \nfotoana,\nKa dia Izy no manendry\nny hodiana.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM676','FFPM 676');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM676', 'Ny voarain’Andriamanitra arý\nKa afaka tatý\nAn-tany be mahory,\nDia lasa nody, fa tsy maty tsy\nakory.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM676', 'Ny tafafindra monina ao\nan-danitra ao,\nNankao an-tany vao\nFonenan’ny mazava,\nDia  tsy mba maty, fa nandao\nny mety rava.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM676', 'Ny voasatro-boninahitra\ntsy lo,\nKa ao manaram-po\nMisotro ranon’aina,\nDia tsy mba maty, fa nandray\nny nantenaina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM676', 'Ny ondrinao izay manaraka\nAnao\nHo ao am-balanao,\nRy Ilay Mpiandry Tsara,\nDia tsy mba maty re, fa tsara\nfiafara.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM676', 'Ny fo mivantana aminao\nIzay nanome\nNy hasambaram-be\nNandramany sahady,\nDia  tsy mba maty, fa \nmpandresy afaka ady.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM677','FFPM 677');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM677', 'He! tazana ao an-danitra\nVahoaka finaritra\nMitafy fotsy, ravo fo,\nKa mirana  avokoa.\nNy vazantany efitra\nNo nielezan-kafatra,\nDia  tonga izao\nNy ory tao,\nKa afaka  entana.\nNy ran’ilay Mpamonjiny\nNahafotsy ny ankanjony;\nKoa dia  ireo\nManandra-peo\nAm-pifaliana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM677', 'Ho an’Andriamanitra\nAn-tsezam-boninahitra\nNy famonjena anie!\nHobin’ny marobe,\nIlay Zanakondry avotra\nNo nanafahan-tahotra\nIzay voaray\nHo zana-dRay\nHobio mandrakizay!\nKa saotra voninahitra\nHo an’Andriamanitra,\nO, mba derao,\nAnkalazao,\nHaleloia! Amena!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM678','FFPM 678');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM678', 'Hajao ny olo-masina\nMpanaraka ny Tomponao,\nMiely sy Manerana\nIzao tontolo izao;\nIreo dia tonga ohatra,\nKa tokony harahinao,\nNa efa olon-dehibe,\nNa zaza hianao;\nTanteraka ny sasany,\nKa efa nody amin-dRay;\nNy sasany dia mbola atý\nMilasy amin-day.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM678', 'Ka betsaka ny isany,\nNa atý, na ao an-danitra;\nNy Rainy kosa dia iray,\nAndriamanitra;\nIreo maro namanao\nMiantso koa maka anao\nHiaraka hiezaka\nHankao an-danitra;\nKa dia miezaha re,\nKa aza kivy hianao;\nJereo ao aloha ao\nNy loka ho anao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM679','FFPM 679');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM679', '« Moa te-hiara-dia ?\nMoa te-hiara-dia,\nO, ry havana malala,\nHo ao Kanana izao ? »\n« Eny, te-hiara-dia,\nEny, te-hiara-dia,\nFa antsoin’Ilay Mpamonjy\nHo ao Kanana  izao! »\n:,: Dera, dera, haleloia! :,:\nAn’Andriamanitsika\nIzay ao ambony ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM679', 'Kristy re no lalantsika,\nVatolampy, arontsika,\nIzy no mitondra antsika\nHo ao Kanana  izao.\nTano izahay ry Tompo,\nHatanjaho ny mpanompo,\nKa tsilovy ny haleha\nHo ao Kanana  izao!\n:,: Dera, dera, haleloia! :,:\nAn’Andriamanitsika\nIzay ao ambony ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM679', 'Tazana erý sahady\nPerla re ny vavahady,\nVolamena ny tanàna\nErý Kanana  erý.\nE! hahita ny Mpamonjy,\nKa hifaly fa tra-bonjy,\nSy hidera re ny vonjy\nErý Kanana  erý.\n:,: Dera, dera, haleloia! :,:\nAn’Andriamanitsika\nIzay ao ambony ao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM680','FFPM 680');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM680', 'Aingao ny masontsika\nHitsinjo tany soa ;\nFa ao ny Tompontsika\nManomana tokoa\nTanàna, trano tsara,\nFianan-tsambatra e!\nIzany no anjara\nHo an’ny mino re!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM680', 'Ny andro fifaliana\nHo avy ka  antenao ;\nNy andro nihafiana\nHo foana sy handao;\nNy taona fihobiana\nHomen’ny Tomponao;\nHo feno fifaliana\nIzao rehetra  izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM680', 'Ny andro maharavo\nTsy ho ela  intsony izao;\nHiarina ny lavo\nHandray ny tena vao,\nIrio ny Tompo Avo\nHo avy hanavao;\nHo faly izay mahazo\nIzao fiainan-tsoa izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM681','FFPM 681');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM681', 'Iza moa ireo mitsangana\nArý an-koatra arý ?\nNy seza fiandrianana\nNo eo anilany,\nHaleloia, mihobia!\nFa Mpandresy izy e!\nKa mitana ny rofia,\nVoninahi-dehibe.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM681', 'Fahorina mafy loatra\nNo nentin’izy ireo,\nKanefa tsy nitsoaka\nNijaly fa tsy leo,\nFamonjena firenena\nAdy masina tokoa,\nNanolorany ny tena\nHo mpitory “Teny Soa”.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM681', 'O! ry mponina ao an-danitra\nAnjely marobe,\nOmeo voninahitra\nNy maritiora e!\nIlay Kanana soa tokoa\nNo fonenany izao\nHetaheta, sanatria\nTsy haninona azy ao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM681', 'Mba avia, ry olom-belona\nAvia, ankalazao\nIlay maty nefa velona,\nJesosy Tomponao.\nDera, laza atolotray\nHaleloia, haleloia! \nHo Anao, Mpanjakanay,\nHo Anao, doria doria.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM682','FFPM 682');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM682', 'Hianao, Jehovah Tompo\nNo itokiako\nKa tsy matahotra aho\nFa manana Anao.\nRy Harambato mafy,\nIzay ao mandrakizay\nNy foko tsy hanahy,\nFa miankina Aminao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM682', 'Mitsoka mafy loatra\nNy rivo-doza re,\nKanefa tsy hihoatra\nNy fefy lehibe.\nRy Aron’ny tanora,\nRy Tokin-dehibe\nHo heriko isan’ora\nNy herinao anie.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM682', 'Raha tonga re ny fetra,\nNy andro tapitra,\nHaneno ny trompetra,\nHihovitrovitra.\nKanefa matokia,\nRy foko fa Jeso\nHitantana ny dia\nHo eo anilanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM683','FFPM 683');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM683', 'Ao am-pitan’ilay lohasaha\nizay\nAlo-pahafatesana koa,\nMoa mba tsinjonao ve ‘rý\ntanàna iray\n‘Zay mamiratra toa vatosoa ?\nNy masoandrony tsy mba\nmilentika koa\n‘Zay rehetra mby ao voadio\navokoa\nKa mamiratra toa vatosoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM683', 'Ny Mpanjakany dia ‘Lay Ray\nbe fitia\nSady aina ho an’izay ao;\nRy mpanota mibebaka ô,\nmatokia\nHosasany hadio hianao,\nNy masoandrony tsy mba\nmilentika koa\n‘Zay rehetra mby ao voadio\navokoa\nKa mamiratra toa vatosoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM683', 'Nefa tsinjoko fa ny fidirana\nao\nDia am-pototr’ilay lakoroà!\nHe mideza sy ety ny lala-\nmankao\nO, ry foko, moa ho kivy va ?\nNy masoandrony tsy mba\nmilentika koa\n‘Zay rehetra mby ao voadio\navokoa\nKa mamiratra toa vatosoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM683', 'Olo-masina maro no tsinjoko\n‘ndreo\nAo mihira sy mitafy vao;\nIriko indrindra ho isan’ireo\nKa tantano, Jeso aho, ho ao.\nNy masoandrony tsy mba\nmilentika koa\n‘Zay rehetra mby ao voadio\navokoa\nKa mamiratra toa vatosoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM684','FFPM 684');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Ao ny lanitra tsara tokoa\nIzay fonenana mandrakizay,\nTany be hasambarana koa;\nAo isika hihaona indray;\nMifalia, mihobia,\nFa ao isika hihaona indray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Ao ny lova izay mamin’ny fo\nSy fiainana mandrakizay,\nVoninahitra tsy mba ho lo;\nAo isika hihaona indray;\nMifalia, mihobia,\nFa  ao isika  hihaona indray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Ao ny Ray, Loharanon’ny soa,\nHovantanina rahatrizay,\nIzay hampiditra hoe : \nmandrosoa\nAo isika hihaona indray;\nMifalia, mihobia,\nFa  ao isika  hihaona indray.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Ao ny Zanaka be indrafo\nIzay nijaly tatý fahizay;\nNefa tsy mba nahita ny lo,\nFa  efa velona mandrakizay;\nMifalia, mihobia,\nFa ao isika hihaona indray.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Ny fanahin’ny Ray ao tokoa\nIzay mitarika antsika izao\nSy mananatra antsika ho soa,\nNo mitondra antsika hankao\nMifalia, mihobia,\nFa ao isika hihaona indray.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM684', 'Matokia, miravoa, mifalia,\nFa azontsika ny lapan’ny Ray\nMidérà, mihirà, mihobia,\nFiadanana mandrakizay\nMifalia, mihobia,\nFa ao isika hihaona indray.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM685','FFPM 685');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM685', 'Matokia, mpivahiny!\nAny an-tanàna arý\nMisy trano soa madio\nMandrosoa hianao :\nMisy fitsaharana any,\nMatokia hianao;\nMisy fitsaharana any,\nIzay ho azonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM685', 'Ao ny Tomponao miandry\nHanome anao ny soa;\nMisy fiadanana any\nVoavoatra ho anao :\nMisy fitsaharana any,\nMatokia hianao;\nMisy fitsaharana any,\nIzay ho azonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM685', 'Any tsy mba misy rofy\nAmam-panaintainana;\nIzay rehetra tonga any\nAfa-pahoriana\nMisy fitsaharana any,\nMatokia hianao;\nMisy fitsaharana any,\nIzay ho azonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM685', 'Tsy mba mamy va ny mody\nMba ho afa-tsatsatra\nSy horaisin’i Jesosy\nAmim-piadanana ?\nMisy fitsaharana any,\nMatokia hianao;\nMisy fitsaharana any,\nIzay ho azonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM686','FFPM 686');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM686', 'Maniry izahay\nHo any aminao,\nJerosalema tanànanay,\nTanàna masina;\nNy trano lay atý,\nTsy maintsy rovitra,\nKanefa tazanay erý\nIlay tsara lavitra;\nTazanay, tazanay\nNy tany masina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM686', 'Mba tanterahonao,\nRy Tompo tia anay!\nNy fikasan’ny Zanakao\nNataony taminay;\n« Ho any amiko\nIzay nomenao Ahy,\nFa tiako ho hitany\nNy voninahitrao »\nTazanay, tazanay\nNy tany masina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM686', 'Mankany aminao\nIzao ny dianay,\nNa sarotra ny làlana,\nMihira izahay;\nNy hasasaranay.\nTsy misy intsony izao,\nFa tazanay sahady re,\nNy tany masina :\nTazanay, tazanay\nNy tany masina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM687','FFPM 687');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM687', 'Ny tranon’ny Raiko, trano\nmadio,\nTsy misy mahory na zava-\nmanjo;\nAvia, ry malahelo, hankao,\nMizora, fa Izy hampiditra\nanao!\n:,: Sambatra re izay tonga\nao :,:\n:,: Faly tokoa :,:\nIzay tafiditra ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM687', 'Mandalo izao fiainana izao,\nKa aza sondriana atý hianao;\nNy ratsy izay mitaona reseo,\nNy any an-danitra no mba\nirio!\n:,: Sambatra re izay tonga\nao :,:\n:,: Faly tokoa :,:\nIzay tafiditra ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM687', 'He, ao no ho hitantsika tokoa\nNy tavan’Ilay Zanakondry\nmadio;\nNy mpino tetý no efa ao koa,\nManiry hihaona amintsika\ntokoa,\n:,: Sambatra re izay tonga\nao :,:\n:,: Faly tokoa :,:\nIzay tafiditra ao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM687', 'Tsy misy manjo izay afa-\nmankao,\nNa andro mahory hitseran’ny\nfo;\nFa any tsy misy alina koa,\nTanàna mazava, fonenana\nsoa,\n:,: Sambatra re izay tonga\nao :,:\n:,: Faly tokoa :,:\nIzay tafiditra ao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM687', 'Ny mino rehetra ory tetý\nTafakatra any ka faly tokoa,\nMihira ny famonjen’i Jeso,\nMidera ny fiandrianan’ny Ray.\n:,: Sambatra re izay tonga\nao :,:\n:,: Faly tokoa :,:\nIzay tafiditra ao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM688','FFPM 688');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM688', 'Misy tany mahafaly,\nTany izay alehanay,\nTany misy an’i Jeso,\nJeso Tomponay!\nTany soa maharavo,\nTany tadiavinay!\nAfa-tahotra, afa-doza\nIzay tafiditra ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM688', 'Tany tia mpivahiny,\nTany namboarinao,\nRy Jesosy be fitia,\nJeso Tomponay!\nHo anay atý an-tany\nIzay mba malahelo fo\nNoho ny fomban-tany ratsy\nMahazatra anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM688', 'Maro be ny fahavalo\nIzay miady aminay;\nMafy ny fakam-panahy\nHitanay atý;\nSakan-dalana, ady mafy\nNo alehanay izao :\nBe tokoa ny mampahory,\nNefa fantatrao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM688', 'Eny, fantatrao, ry Jeso\nFa  izahay mpanomponao\nDia  handresy ny devoly\nNoho ny herinao;\nKoa  ampionao izahay re\nMba hiankina aminao\nHahatraranay ny tany\nNamboarinao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM689','FFPM 689');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM689', 'Fandalovana atý,\nLanitra honenako;\nEfitra izao tany izao,\nLanitra honenako;\nVoahodidin-doza atý,\nReraka ao an-dalana,\nValaka sy sasatra;\nLanitra honenako.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM689', 'Na mandrivotra aza atý,\nLanitra honenako;\nTany no hilaozako,\nLanitra honenako;\nAlon-dranomasina\nSy ny rian-drano be\nTsy hisakan-dalana;\nLanitra honenako.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM689', 'Ao an-tratran’i Jeso,\nLanitra honenako;\nAfa-pahoriana\nLanitra honenako;\nAo ny olo-masina\nIzay mba tiako tatý,\nFaly raha hitako;\nLanitra honenako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM689', 'Dia tsy halahelo aho,\nLanitra honenako;\nMafy ny manjo atý,\nLanitra honenako;\nAo no hitoerako\nFaly anatrehan-dRay,\nAo homeny toerana;\nLanitra honenako.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM690','FFPM 690');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM690', 'He! misy re fonenana;\n:,: Tsara e! :,:\nKanefa tsy mba lavitra;\n:,: Tsara e! :,:\nNy trano ao voavoatra;\nHo an’izay mangataka;\nFa Jesosy no Tompony,\n:,: Tsara e! :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM690', 'Tsy misy fahoriana ao;\n:,: Tsara e! :,:\nTsy misy alahelo ao;\n:,: Tsara e! :,:\nNy ota tsy tafiditra ao,\nNy devoly tsy monina ao,\nFa ny anjely masina;\n:,: Tsara e! :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM690', 'Ny Tompo dia miantso anao;\n:,: Tsara e! :,:\nNy teniny henoinao;\n:,: Tsara e! :,:\n“ Avia atý ry zanako!\nKa mibebaha re anio,\nTsy misy ‘zay holaviko ”\n:,: Tsara e! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM690', 'Efa azonay ny santatra;\n:,: Tsara e! :,:\nVoavelany ny heloka;\n:,: Tsara e! :,:\nHo any faingana izahay,\nFa Kristy manome anay\nFiainana mandrakizay;\n:,: Tsara e! :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM691','FFPM 691');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Ny lapan’Andriamanitra\nNo ivorian’olona\nTsy omby alinalina,\nIzay madio sy masina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Izao firenen-drehetra  izao\nDia samy afaka hankao;\nTsy fomban’Andriamanitra\nHizaha tavan’olona.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Ireny no naharitra\nNy hazo fijaliana,\nNa dia nanao ny henatra\nHo zava-tsinontsinona.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Endrey, ny hafaliany!\nMazava ny tarehiny;\nFafàn’Andriamanitra\nNy ranomaso latsaka.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Ataony ao ny hira vao\nHoe : “ Voavono Hianao;\nNy ranao, Zanakondrinay!\nNo nanavotanao anay ”', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM691', 'Ry Jeso ô Mpanavotra!\nIzaho dia milatsaka\nHo isan’ny mpanomponao\nManaraka ny dianao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM692','FFPM 692');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM692', 'He! misy tany soa\nIzay tsy atý;\nMaro ny olona\nFaly arý;\nTsara fonenana\nSambatra sy tretrika\nSady finaritra\nIzay mponina  ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM692', 'Aza sondriana\nFoana atý;\nO! miomàna re\nMba ho arý;\nBe fiadanana,\nTsara fitoerana,\nBe haravoana\nIzay mponina  ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM692', 'Mafy izay manjo\nHita atý,\nKa misikìna re\nMba ho arý;\nJeso mitandrina,\nSy mitahy fatratra\nAry mahenina\nIzay mponina  ao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM692', 'Aza variana\nFoana atý;\nO! miaingà izao\nMba ho arý;\nJeso Sakaizanao\nNo Mpitari-dalana,\nKa dia hitondra  anao\nHo tonga ao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM693','FFPM 693');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM693', 'Ao ambony ny lapan’ny Ray,\nAo an-danitra feno ny soa,\nHasambarana mandrakizay,\nKristy soa no iriko tokoa,\n:,: Kristy soa, Kristy soa\nNo iriko ho ahy tokoa :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM693', 'Misy tsara ihany atý,\nMba ho santatra eto izao;\nFa tsy mety ho toy ny arý,\nKa iriko tokoa mba ho ao,\n:,: Kristy soa, Kristy soa\nNo iriko ho ahy tokoa :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM693', 'Ny voavotra ravo izao,\nAfaka ota ka faly tokoa,\nAfa-paty izay tonga ao,\nAfa-doza, mahazo ny soa,\n:,: Kristy soa, Kristy soa\nNo iriko ho ahy tokoa :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM693', 'Tsy ny lanitra be zava-tsoa,\nFa ny Tompo malalaka ao;\nTsy mba tahotro helo tokoa,\nFa ny Tompo tsy foiko izao.\n:,: Kristy soa, Kristy soa\nNo iriko ho ahy tokoa :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM694','FFPM 694');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM694', 'Enga ka hanana elatra soa\n:,: Aho etý :,:\nMba hanidinako avo tokoa\n:,: Hody erý! :,:\nFo malahelo ny ratsy natao\nNo ela-tsoa hitondra hankao;\nHanana elatra aho anie,\nMba hanidinako ao!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM694', 'Trano mamiratra tsara irý,\n:,: Raiko no ao :,:\nNa nahabe ahy aza ity,\n:,: Mamiko ao :,:\nHavako maro no sambatra ao,\nFaly ny foko hankeny izao;\nEnga ka hanana elatra aho,\nMba hanidinako ao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM694', 'Na dia an-danitra aza erý,\n:,: Lavitra va ? :,:\nRaha tarihin’i Jeso etý,\n:,: Ketraka va ? :,:\nTsia, fa hiainga tokoa aho\nizao!\nIndro akaiky ny lala-mankao;\nEnga ka hanana elatra soa,\nMba hanidinako ao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM694', 'Andriamanitra Ray no erý,\n:,: Tsara tokoa :,:\nJesosy koa ‘Lay Mpamonjy\ntetý,\n:,: Zanaka soa :,:\nAo ny Fanahy Masina re!\nTapitra ao avokoa ny soa;\nHanana elatra aho anie,\nMba hanidinako ao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM695','FFPM 695');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM695', 'Arý an-koatra arý\nIlay Paradisa soa\nToa takona atý,\nKanefa ao tokoa,\nMamirapiratra   ao,\nNy endriky ny Ray;\nJesosy Tompo ao\nMiandry mba handray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM695', 'Tsy misy ny hanjo\nIzay tafiditra ao;\nNy ranomaso koa\nTsy afaka hankao\nNy hazavana soa\nManelatrelatra ao;\nNy zava-mahasoa\nTsy misy izay tsy ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM695', 'Anjely marobe\nMihira any koa;\nIreo olo-masina  e\nMifaly avokoa.\nAndeha re izao,\nSakaiza marobe,\nArio ny tahotrao,\nKa dia mizora re!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM695', 'Raha misy loza etý,\nJereo ny Tomponao;\nFa izy raha tetý\nNitondra toy izao.\nIreo fahoriana atý\nOdio tsy hita re,\nHandraisantsika  arý\nNy fiadanam-be.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM696','FFPM 696');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM696', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM696', 'Raha ho faty aho\nKa handao ny havako\nAry dia hisaonany,\nFa handeha  hifaly aho;\nRaha afaka ny aiko,\nDia ho finaritra aho.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM696', 'He! antsoiny aho,\nHo any an-danitra,\nDia faly ny foko,\nSy ravo ny kiboko,\nFa  azoko ny iriko\nSy nantenaiko ela.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM696', 'Havelako ny tany,\nFa efa azoko tokoa\nNy fifaliam-be;\nLovako ny lanitra,\nDia tsy matahotra\nNy hafatesana aho.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM697','FFPM 697');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM697', 'Any ambony fonenana tsara\nDia tsy mba misy itseran’ny\nfo;\nEny iriko ho tsara miafara\nHiara-manjaka  aminao ry\nJeso!\nIsaoranay ny Tomponay,\nRaha ‘mby any dia faly\ntokoa;\nIsaoranay ny Anaranao soa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM697', 'Rehefa tonga ilay andro\nmalaza\nIzay hanatrehana Anao, ry\nJeso!\nIzay no heveriko ho tena\nlaza :\nDia ny hidera Anao,\nTompo ô!\nIsaoranay ny Tomponay,\nRaha ‘mby any tsy mba ory\nkoa;\nIsaoranay ny Anaranao soa!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM697', 'Ao izany havana tena malala\n‘Zay mahafaly fa hita indray,\nNefa izay hampifaly tokoa\nDia ny mihaona aminao ry \nJeso!\nIsaoranay ny Tomponay,\nRaha ‘mby any tsy misy\nmanjo;\nIsaoranay ny Anaranao soa!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM698','FFPM 698');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM698', 'Iza re ireto avy,\nVoatafy lamba soa,\nSamy voasatroka avy\nSatro-bolamena koa ?\nAvy taiza izy ireo,\nKa ho aiza izy ireo ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM698', 'Izy   ireo dia voavonjy,\nVoavela heloka;\nSamy nino an’i Kristy\nFony mbola velona;\nBe ny ratsy nentiny,\nFa izao dia sambatra.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM698', 'Maro be ny fahavalo\nNiadiany tatý,\nFa tsy mba misy izany\nintsony;\nAfaka ny sarotra,\nAfa-pahoriana,\nHe, ny hafaliany!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM698', 'Miramirana tarehy,\nIndreo, avy izy   ireo\nMba hihoby an’i Kristy,\nTompo sy Mpanjaka koa,\nFa nahazo zava-tsoa,\nKa dia tretrika tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM699','FFPM 699');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Midera Anao ny olo-masina\nNoho ny fandresena \nnomenao;\nRy Jeso ô! Mpitari-dalana!\nHaleloia! Haleloia!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Ory sy lao, fadiranovana,\nNatao ho zava-tsinontsinona\nNefa ireo no tsy nivadi-po;\nHaleloia! Haleloia!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Mafy ny ady aman-tafika,\nIzay nihatra tao an-dalana,\nFa Hianao no nitokiany;\nHaleloia! Haleloia!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Indro! mpandresy no idirany\nAo afovoan’ny ao an-danitra,\nHandray ny satro-boninahitra;\nHaleloia! Haleloia!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', '« Mpanompo tsara sady\nmahasoa,\nMidira am-pifalian’ny\nTomponao »\nHe, sambatra izy, fa efa\nvoaray;\nHaleloia! Haleloia!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Aoka ireo no hotahafinay\nAmin’ny ady iadiana,\nHiraisam-boninahitra aminy :\nHaleloia! Haleloia!', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM699', 'Ankehitrio, Anao ny fiderana,\nRy Ray sy Zanaka, Fanahy koa\nEran’ny tany aman-danitra :\nHaleloia! Haleloia!', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM700','FFPM 700');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM700', 'Ao ny andro lehibe\nMisy fifaliam-be,\nDia ny andro hahatongavana\nAmin’ny fonenana\nFeno fiadanana.\nTsy mba misy ota na heloka,\nEny, tena andro malaza tokoa\nizay.\nJeso Ilay nandresy ny fasana,\nIzy no hitantana\nAo am-pahafatesana,\nKa ho mora ny handehanana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM700', 'Ao ny andro lehibe\nMisy fifaliam-be,\nIzay hihaonana any an-danitra,\nAfa-pahoriana,\nAfa-pijaliana,\nSambatra tokoa sy tretrika.\nEnga ka ho ao avokoa isika\nizao\nKa tsy hisy very na dia iray!\nTava miramirana,\nEndrika mamiratra\nNo hananantsika mandrakizay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM700', 'Ao ny andro lehibe\nMisy fifaliam-be,\nHahitana an’Andriamanitra\nSy Jesosy Zanany\nMbamin’ny Fanahiny.\nHoby no hameno ny lanitra.\nSerafima sy arkanjely no\nnamana\nMankalaza ilay feno indrafo.\nNy fitomaniana\nSy ny fisentoana\nTapitra, fa afaka ny manjo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM701','FFPM 701');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM701', 'Ny hiran’ny lanitra\nTsara tokoa\nSy mahafinaritra, re!\nHenoy izany feon’ny\nolona maro\nizay faly tokoa mihira hoe :\n(Feo 1)\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen! \n(Feo 2)\nNy dera aman-daza,\nsy hery anie\nHo Anao, ry Zanak’ondry!\nNy dera aman-daza,\nsy hery anie\nHo Anao, Anao, Amen!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM701', 'Toy ny feon’ny rano\nmahery ny hira ataon’ny\ntra-bonjy arý;\nManerana ny lanitra\nny fiderany,\nFa vita ny adiny mafy tatý,\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen! \n(Feo 2)\nNy dera aman-daza,\nsy hery anie\nHo Anao, ry Zanak’ondry!\nNy dera aman-daza,\nsy hery anie\nHo Anao, Anao, Amen!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM701', 'Tsy mety mangina\nny hiran’ny lanitra\nVelona mandrakizay!\nEndrey ny fihaonana\nany an-danitra\nsy ny fiainana mandrakizay!\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen!\nHaleloia, Amen! \n(Feo 2)\nNy dera aman-daza,\nsy hery anie\nHo Anao, ry Zanak’ondry!\nNy dera aman-daza,\nsy hery anie\nHo Anao, Anao, Amen!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM702','FFPM 702');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'An-danitra, an-danitra\nTempolin’i Jehovah,\nNo hahitàna Azy, re\nAm-boninahitra!\n:,: Ka masina i Jehovah :,:\nNo hohiraina ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'An-danitra, an-danitra\nNo mba hamiratra\nNy voninahi-dehibe\nHananantsika e!\n:,: Raha tonga\nny fihaonana :,:\nAo amin’ny Jehovah.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'An-danitra, an-danitra\nNo ho finaritra\nNy tena izay nijaly be\nAm-pahoriana\n:,: Fa any no hifaly e :,:\nFahasambarana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'Ny fo sy ny fanahy e,\nNo faly anie,\nFa afaka ny entana,\nIzay nivesarany;\n:,: Ka fitsaharan-dehibe :,:\nOmen’i Jehovah..', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'Tsy hain’ny lela anie\nHanonona izao\nNy soa antenaina e,\nRaha Anatrehany,\n:,: Manenika ny lanitra :,:\nNy fitiavany.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'Ry Jeso Kristy Tomponay\nTariho izahay,\nKa mamelà ny helokay,\nMba hitokianay,\n:,: Fa tsy ho menatra\nizahay :,:\nFa ao i Jehovah.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM702', 'Raha avy ny hodianay\nHo anatrehany\nTariho izahay,\nMba ento, Jeso, izahay\nHankany Aminy!\n:,: Mba ho anay \nmandrakizay  :,:\nNy fitsaharana!', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM703','FFPM 703');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM703', 'Ry Jehovah, Ray Tsitoha\nVory eto izahay,\nRay hatramin’ny taloha,\nMihainoa ny vavakay,\n:,: Mitsangàna :,:\nEto afovoanay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM703', 'Andro fampakaram-bady,\nFifaliam-be izao;\nHianao no mampivady\nRaha voatendrinao;\n:,: Vady hendry :,:\nLova avy aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM703', 'Ry Jehovah Ray malala!\nMba tezao ireo ho soa,\nSamy tsy hisalasala,\nFa hifankatia tokoa;\n:,: Hamasino :,:\nMba ho olonao ireo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM703', 'Ho fanahy mifandanja\nSady tsy ho toy ny roa,\nHo mpivady mifanaja\nSady mifamaly soa;\n:,: Akambano :,:\nMba ho fo iray tokoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM704','FFPM 704');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM704', 'Ry olon-kanao fanekena\nmasina,\nMisaora ny Tompo, fa ny\nsitrapony\nNo nampikambana\nAmim-pitiavana;\nKa dia tsy olona roa intsony,\nNy tany Edena tsahivina\nindray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM704', 'Ny fahamarinan’\nAndriamanitra\nNo haingo manendrika ny\ntokantrano\nHo toy ny lanitra\nMamirapiratra.\nRy mpivady marina, Kristy no\ntano\nHandamina ny tokantrano\nvaovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM704', 'Ny fahasoavan’Andriamanitra\nNo andry manohana ny\ntokantrano\nKa mampisandratra\nNy te ho sambatra,\nIzay ankohonanareo\natsangano\nHidera ny famindrampo\nlehibe.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM704', 'Ny fanaky ny tokantrano\nmasina,\nManoatra be noho ny\nvolamena;\nNy fivavahana\nSy ny finoana,\nFisaorana sy fiderana homena\nMarain-tsy hariva ny\nMpamonjy e!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM704', 'Jehovah Mpitana ny\nfanekena ô!\nTahio ny toky nomeny ho\nmafy,\nHo masina sy to,\nHo marina am-po;\nKa izy handresy izay\nta-handrafy;\nHo azy ny lova ho\nmandrakizay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM705','FFPM 705');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM705', 'Tompo Zanaharinay!\nJereo ny fivorianay,\nIzao fampakaram-bady izao\nTahio sy hamasinonao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM705', 'Ireo zatovo roa ireo\nManketo anatrehanao,\nFa mifanaiky izy izao\nHivady sy hifanasoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM705', 'Mangataka aminao izahay\nHitahy ireo havanay,\nRaha ory mba ononinao\nRaha faly, aza ilaozanao', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM705', 'Arovinao ny tenany,\nTsinjovy ny taranany;\nHo-tsara fara anie ireo,\nHo ravoravo toy izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM705', 'Ny fifalianay anio\nHitohy hatrarý anie!\nIty andro lehibe ity\nHo santatry ny soa arý.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM706','FFPM 706');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM706', 'Izao manatrika Anao,\nRy Jesosy, izahay,\nIndro tokantrano vao\nNo hoarina indray.\nIzahay mangataka;\nNy tsodranonao omeo,\nKa avia hanapaka\nNy fiainan’izy ireo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM706', 'Ho Kristiana velona\nAnie ny zanany,\nHo vavolombelona\nFa Anao ny tenany.\nAoka mba hamiratra\nNy filazantsaranao,\nVelona hanaraka\nNy fonay ka hazavao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM706', 'Ka ny fiangonana\nHanompoanay Anao,\nHanana olom-banona\nFaly ny hiasa ao.\nAntenainay marina,\nFa Hianao hanohana\nIzay firaisa-masina,\nHisy fahasoavana.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM707','FFPM 707');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM707', 'Ry Jesosy be fitia!\nManatreha, manampia,\nNy mpanomponao izao\nIzay mivavaka aminao,\nFifaliana madio\nNo omena anay anio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM707', 'Indreo ny havanay jereo,\nMba ho soa anie ireo!\nTanan-droa mifandray,\nNofo roa, tonga iray\nMifaniry soa tokoa,\nMifanampy, mifanoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM707', 'Ilay tso-drano hatrizay\nNo omeo ireo havanay;\nMba ho marofara anie,\nHanam-panambinana,\nFeno fiadanana\nNoho ny fitahianao', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM707', 'Raha ory mba vangio,\nMitaraina mba valio;\nMitoera aminy\nAo an-tokantranony\nHamasino, hafanao\nNy fitiavany Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM708','FFPM 708');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM708', 'Ry Jehovah Ray kiady\nSy mpikarakara anay,\nKa nitahy ny mpivady\nTao Edena fahizay,\nIndro misy tonga koa\nEto anatrehanao,\nManam-pikasana soa\nHo mpivady hatr’izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM708', 'Mba tahio, ry Ray mpiahy,\nNy firaisany izao,\nHifanaraka am-panahy\nSy hiankina aminao.\nNy tsodranonao fahiny\nAngatahinay indray,\nMba hatao ankehitriny\nHahatò ny hatakay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM708', 'Raha omenao zaza izy,\nDia mba ampio re,\nHitaizany ny ankizy\nAmim-pahendrena be;\nAza avela ho irery\nRaha tratry ny manjo,\nFa tafionao ny hery\nMahatanjaka ny fo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM708', 'Raha ao ny andro tony\nMila haharenoka,\nDia taironao ny fony,\nRy Mpamela heloka.\nRaha tapitra ny taona\nEfa voafetranao,\nEnga ka ho tafahaona\nAo an-danitra aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM709','FFPM 709');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Jehovah ô, mba mihainoa!\nIndreo misy olon-droa izao\nIzay manam-pikasana soa\nHanorin-tokantrano vao :\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Dia angatahinay, ry Ray\nNy fitahianao ho azy ireo\nHo nofo sy fanahy iray\nKa hifanaja hatrizao.\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Fenoy ny fiadananao\nNy tokantranon’izy ireo\nKa mba hamirapiratra  ao\nNy fivavahana  Aminao.\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Tahio ireo, ry Tompo soa,\nMba ho mpivady marina,\nHitana sy hanaja koa\nNy fanekena masina.\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Tahio, hifampitantana\nMandritra ny fiainany,\nKa dia ny fahafatesana\nNo fetra isarahany.\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM709', 'Ho maro fara anie ireo\nKa mba hitaiza ho Anao\nIreo solofo ho tia  Anao,\nHanompo sy hanaja  Anao.\nO! tahio, O! tahio,\nMba ho tokantrano soa\nmadio\nO! tahio, O! tahio,\nMba ho tokantrano soa!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM710','FFPM 710');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM710', 'Nakambanao, ry Tompo ô!\nAdama sy Eva nankatò\nNy fampakaram-bady,\nTahio sy vimbinonao\nIreto anatrehanao\nManaiky ho mpivady,\nHahay handray\nNy anjara izay hihatra\nIzy roa\nAry hifanisy soa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM710', 'Dia nifanaiky izy izao;\nRy Tompo ô! vimbinonao\nMba ho iray tokoa;\nNy fony mba tarihonao\nHanaraka ny didinao\nNomenao azy roa;\nIzao handao\nRay sy reny, ka ny teny\nNolazainy\nEnga anie ka tsy hovany.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM711','FFPM 711');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM711', 'Tompo ô, endrey ny fitahiana\nIzay natondrakao ny zanakao\nVory eto, feno fifaliana\nAmpoky ny fahasoavanao.\nIzay rehetra nikelezan’aina\nDia nombàn’ny fitantananao\nVonona avokoa izay nilaina\nTsy mba lany ny harenanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM711', 'Indro trano efa novitaina\nHanasoavana taranaka\nHitaizàna, hanolokoloana\nIreo tanora halain-tahaka,\nIzay voafafy, antenaina\nMba hamokatra tsy tapaka;\nDia ho vanona ny firenena\nKa hitombo, hisandrahaka.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM711', 'Izany re, ry Tompo, no\nfinoana\nTananay, ka mba herezonao,\nIzahay handroso tsy hivoana,\nEo ambany fiarovanao,\nKa ny fangataham-pitahiana\nTompo ô! akarina Aminao\nNy Anaranao no iaingàna\nHoderaina ny Anaranao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM712','FFPM 712');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM712', 'Raha tsy Jehovah\nNo manao ny trano,\nDia miasa foana\nNy mpanorina.\nRaha tsy Jehovah\nNo miambina àzy,\nMiari-tory foana\nNy mpiambina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM712', 'Nahavita trano\nNy mpianakavy,\nKa mifaly, ravo\nNahatsangana\nNefa koa tsaroana\nFa Jehovah Tompo,\nFeno fitahiana,\nNo nanambina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM712', 'Mankasitraka aho,\nAry koa misaotra\nAn’Ilay Nahary\nBe fitiavana.\nIzay rehetra ahy\nDia nomen’ny Ray;\nEny, ity trano\nDia avy taminy.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM712', 'Tompo ô! tahio\nIzay miditra ato;\nDia arovy koa\nIzay mivoaka;\nMba monena ato,\nMiaraka aminay\nAnjakao ny trano,\nHiadananay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM713','FFPM 713');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM713', 'Miposaka indray ny\nmasoandro,\nNy ali-maizim-be dia tonga\nandro;\nRy foko, mba derao ny Ray\nTsitoha,\nKa dia andrandrao,\nDerao, ankalazao\nNy Rainao soa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM713', 'Ny loza marobe atý an-tany\nDia  niarovanao anay izany,\nKa zava-mahafaly no omeny,\nDia fiarovana\nSy fitiavana\nTsy hita lany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM713', 'Ry Masoandronay, mba\nmitariha\nNy dianay anio mba tsy\nhania;\nMahery Hianao ka maharara\nNy fahavalonay\nTsy hahataona anay\nHandà ny tsara.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM713', 'Ny zavatra manjo tsy\nmampanahy\nNapetraka aminao ny ahiahy,\nKa dia matoky aho, ry\nTsitoha!\nOmeo ny zanakao\nIzay heverinao\nHo mahasoa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM714','FFPM 714');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM714', 'Jehovah Zanahary,\nIzahay miderà Anao;\nNy alina nanjary\nHo firaketanao.\nMaraina izao ny andro,\nKa lao ny maizina;\nSavao, ry Masoandro,\nIzay fahoriana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM714', 'Ry Kintan’ ny maraina,\nJesosy Havanay,\nArovinao ny aina,\nTahio izahay;\nNy asanay anio\nMba hasoavinao,\nNy dianay tariho\nHo any aminao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM715','FFPM 715');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM715', 'Tonga ny maraina,\nDimbin’alina,\nKa ny Tompon’aina\nNo isaorana.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM715', 'Raha mbola nandry\nAho Tompo ô,\nHianao Mpiandry\nDia aroko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM715', 'Tano sy ampio\nNy madinikao,\nSao hanota anio,\nKa handao Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM715', 'Aoka ny anjara\nFanompoako\nMba ho vita tsara\nKa ho sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM715', 'Ary raha lany\nNy fotoako,\nIzaho hody any\nAnatrehanao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM716','FFPM 716');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM716', 'Ry Tompo ô, tahio\nIzao dianay izao;\nNy lehibe ampio,\nNy kely mba tezao.\nFa ny Anaranao\nNo iaingana anio;\nTantano sy vimbino\nAn-dalana izahay.', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM717','FFPM 717');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM717', 'Andeha raha  maraina,\nRaha antoandro koa,\nAndeha raha  hariva\nHivavaka tokoa;\nFo marina no ento,\nArio ny tahotrao,\nMiondreha ao an-trano,\nKa mivavaha ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM717', 'Tsarovy ny sakaiza,\nNy havan-tianao;\nRaha misy fahavalo,\nMifona ho azy koa,\nKa dia mangataha\nNy soa ho anao,\nJesosy Ilay Mpamonjy,\nAlao ho tokinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM717', 'Na tsy irery aza,\nFa be ny olona ao,\nKa misy hevi-tsara\nMiposaka ao am-po,\nNy hataka mangina\nVoaeritreritrao\nHo ren’ny Rainao tia,\nJehovah Tomponao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM717', 'Mba manatòna Azy\nRaha  azon’ny manjo;\nTsarovy koa raha faly\nHisaotra ao am-po;\nTsy misy hafaliana\n‘Zay mamy toy izao;\nNy fahazoantsika\nMivavaka aminy.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM718','FFPM 718');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM718', 'He torimaso mamy\nNo atolory ahy,\nRy Raiko Mpiandany,\nSy herin’ny fanahy.\nNy sandrinao mahery\nNo hiampofo ahy;\nNy masonao mijery,\nManala ahiahy.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM718', 'Ny otako androany\nKoseho, Raiko ô!\nIreo ory mitomany\nAmpaherezonao,\nNy havako rehetra\nSy ny sakaiza koa,\nTahio tsy hanjoretra\nAmpifalio tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM718', 'Ireo sahiran-tsaina\nSy mandry fotsy izao\nNy kivy, mitaraina\nVonjeo, ry Tompo ô!\nIreo marary maro\nSy ny mpitsabo koa,\nTahio, ry Mpiaro,\nArovy tsy ho voa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM718', 'Hianao no tokinay\nKa dia hatory izao\nIreto nofonay\nAm-pelatananao.\nSakano re ny ratsy\nMba tsy hamely   izao\nRy Jeso Mpiambina ahy\nSy voninahitra   ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM719','FFPM 719');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Efa lasan-davitra,\nKa hariva izao ny andro;\nHianao no Masoandro,\nRy Andriamanitra,\nMba arovinao ny aiko,\nFa atolotro Anao;\nAmpidiro ao am-poko\nIzao ny fiadananao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Raiso ny fisaorako,\nKa tondraho ranon’aina\nNy fanahy aman-tsaina,\nMba ho velona izao,\nDia hamoa voa tsara\nAmiko ny teninao,\nKa ho tiako hambara \nNy fahasoavanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Ry Andriamanitra ô!\nHitanao ny fahotako,\nFantatrao ny fahosako;\nMamindrà fo amiko;\nIzaho tsy misalasala\nMba hanatona Anao,\nFa ny Zanakao malala\nMaty noho ny otako.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Izaho ta-hatory izao,\nFa mba sasatra niasa;\nTsy heveriko ny lasa,\nFa apetraka aminao\nAoka aho mba hahazo\nFitsaharana izao;\nRaha maraina mba fohazy,\nDia hankalaza  Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Kintan’i Jakoba ô,\nSady Masoandron’aina,\nHazavao ny fo sy saina,\nMba tsy hatahorako\nNy mpanimba sy mpandoza,\nLiona mierona,\nIzay minia hampidi-doza\nAndro aman-alina.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Arosoy ny teninao,\nHazavao ny firenena,\nMba ho samy hanantena\nFamonjena aminao;\nKa ny manam-pahefana\nAoka hotarihinao,\nMba hitondra fanjakana\nAraka ny sitrakao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM719', 'Fantatrao, Jesosy ô,\nIzay rehetra mitaraina\nKa miandry ny maraina\nSy ny fahasitranana;\nNy kamboty sy mahantra\nAoka hotsarovanao;\nRy Sakaizanay Mpiantra,\nIantrao ny olonao.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM720','FFPM 720');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM720', 'Lany indray ny andro;\nHianao ry Ray,\nNo ho masoandro\nSy ampinganay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM720', 'Be ny zava-tsoa\nAzo taminao;\nSaotra aman-dera\nEntinay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM720', 'Andronay mandalo\nToy ny rivotra;\nBe ny fahavalo\nMampitahotra.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM720', 'Jeso ô, Mpiandry,\nIzaho ondrinao,\nAoka re mba handry\nEo an-tratranao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM720', 'Mpivahiny ihany\nIzahay atý,\nKa mba te-ho any\nAminao arý.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM721','FFPM 721');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM721', 'Ny andro efa lany\nMangina  izao ny tany,\nMiala sasatra;\nHeveronao, ry saina,\nFa mendri-koderaina\nNy Raiko  ao an-danitra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM721', 'Na maty masoandro,\nKa alina ny andro,\nTsy mampaninona.\nFa Jeso, Izay sakaiza,\nDia  ao fa tsy mankaiza,\nHo tena Masoandroko.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM721', 'Hatory  izao ny maso,\nRy Tompo mba andraso\nNy ondrikelinao;\nNy teny sy fanahy \nSy izay rehetra ahy\nAtolotro harovanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM722','FFPM 722');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM722', 'He alina ny andro,\nKa mba esorinao\nNy fahotako maro,\nMba tsy ho hitanao;\nReseo ny mpamely\nNy zanakao, ry Ray;\nIraho ny anjely\nHiambina anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM722', 'Raha  maizina ny tany,\nNy andro tapitra,\nTsaroanay ihany\nNy fasa-maizina;\nArovy lalandava\nIzahay, ry Tomponay,\nKa aoka ho mazava\nNy hitsangananay.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM723','FFPM 723');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM723', 'He, alina indray izao,\nJesosy Tompo ô ,\nKa aoka ny mpanomponao\n:,: Homban’ny elatrao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM723', 'Fa iza no hahita anay,\nRaha  azon-doza  izao,\nKanefa kosa aronay\n:,: Ireo anjelinao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM723', 'Ka raha hatory izahay,\nRy Rainay tsara ô!\nNy tena sy fanahinay\n:,: Dia mba arovinao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM723', 'Ka raha  haposakao indray\nNy masoandronao,\nFohazy tsara izahay\n:,: Hisaoranay Anao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM724','FFPM 724');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Mpamonjy, Masoandronay!\nFahazavan’ny alinay\nNy zavon-tany mba savao\nTsy hanakonany Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Tontolo andro Hianao\nNo anton’ny iainanay;\nRaha alina, mombà anay,\nNy faty tsy ho tahotray.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Ny aizina mba hazavao,\nTarihonao ny lalana\nHalehanay an-efitra\nHo tonga any aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Izay marary mba tsaboy,\nNy ory aza  afoinao,\nHo toy ny torin-jaza anie\nNy fiadananay izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Tahio ny hifohazanay\nHanaovanay ny sitrakao\nAmbara-pahatapitra\nNy andro ivelomanay.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM724', 'Raha mby aminao izahay,\nHahita fiadanana,\nFa ao tsy misy alina,\nHianao no Masoandronay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM725','FFPM 725');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM725', 'Alina ny andro\nKa  efa mba hatory\nNy masonay;\nHianao Jehovah ô!\nIzay tsy mety sasatra,\nNo aronay. (in-2)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM725', 'Lasa ny mazava,\nKa ny masoandro\nTsy hitanay;\nTsy matahotra izahay,\nHianao an-danitra\nMahita  anay. (in-2)', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM725', 'Fa ny kintana  eny\nEfa manazava\nNy dianay;\nKoa tsy nafoinao,\nFa nasehonao ireo\nHo tokinay. (in-2)', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM725', 'Alina sy andro\nSamy mba manaiky\nNy tendrinao;\nTonga re ny maizina,\nNefa tsy ilaozanao\nNy olonao. (in-2)', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM725', 'Eto ny mazava\nDia manam-petra;\nFa ao aminao\nTsy mba misy alina,\nFa mamirapiratra\nNy tavanao. (in-2)', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM726','FFPM 726');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM726', 'Efa hariva, Jeso tia!\nTomoera aminay;\nNy fanahinay tahio,\nFa hatory izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM726', 'Fa ny helokay ekenay,\nMahavonjy Hianao;\nNy manjo anay lazainay,\nFa miantra ny fonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM726', 'Alina maharitra ela,\nAizi-mampivadi-po,\nFa ny olona fidinao\nTsy mba takona aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM726', 'Hianao no mitahiry\nNy miankina aminao;\nVoahodidin’ny anjely\nNy mialoka  aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM726', 'Raha  anio no tapitra andro\nIzahay mpanomponao,\nAoka izahay hifoha\nAo an-dapa soanao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM727','FFPM 727');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM727', 'Andriananahary\nNikarakara   anay,\nKa nampitsiry vary\nHo fivelomanay!\nNy haninay tahio\nHo tonga tanjakay,\nNy hevitray tariho\nMba hiadananay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM727', 'Ry Rainay ao ambony\nMisaotra Anao izahay,\nFa zava-tsoa itony\nIzay nohaninay.\nNy zavatra rehetra\nDia   manantena Anao,\nFa tsy mba misy fetra\nNy fitiavanao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM728','FFPM 728');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM728', 'Atreho ny sakafonay,\nJehovah, mpanome ny soa!\nVelominao ny tenanay,\nNy sainay hatanjaho koa.\nAmen!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM729','FFPM 729');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM729', 'Ry Jehovah, Ray Tsitoha!\nMba avia hialoha\nSy hiaro ny mpandeha;\nLavi-dalana haleha,\nMba jereo ny olonao;\nSarak’olona, irery,\nSady tsy mba manan-kery,\n:,: Ka jereo, ry Tomponay! :,:\nMba tazano ny mpandeha;\n(in-3)\nHianao no herinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM729', 'Ao ny andro mamanala,\nSakambino ao an’ala;\nRaha mandeha mita rano,\nMba hazòny sy tantano,\nKa vonjeo ny olonao;\nBe ny zavatra mihatra\nIzay manimba sy mandratra,\n:,: Ka vonjeo,\nry Tomponay! :,:\nMba arovy ny mpandeha;\n(in-3)\nHianao no aronay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM729', 'Raha ory, mba tohano,\nKa vimbino sy tantano\nTsy ho reraka ny fony,\nAza afoy, fa mba hazòny,\nIantrao ny olonao;\nRaha mahantra izy any,\nOry sady mitomany,\n:,: Dia vangio,\nry Tomponay! :,:\nMba tsarovy ny mpandeha\n(in-3)\nHianao no tokinay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM730','FFPM 730');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM730', 'O! tahio ny havanay re\nIzay handeha lavitra;\nBe tokoa ny alahelo\nNoho ny fisarahana;\n:,: Manatreha :,:\nIzao veloma atao izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM730', 'Mba sakanonao ny loza\nTsy hamely azy izao,\nRaha misy mampahosa,\nAsehoy ny herinao;\n:,: Mba tantano :,:\nTsy hisaraka aminao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM730', 'Aoka mba ho tonga soa,\nTsy ho azon-tsampona;\nAoka mba hampodina\nEto aminay indray,\n:,: Ka hisaotra :,:\nNoho ny fivimbinanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM731','FFPM 731');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Enga anie ka homba anao\nJeso!\nHanadio sy hanazava\nHampahery lalandava,\nEnga anie ka homba anao\nJeso!\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Raha mitambatra ny rahona,\nKa mikimpy ny masoandro,\nRaha Jeso momba isan’andro,\nHo tantely koa ny vahona.\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Mangamanga indray ny\nlanitra\nLoharanom-pitahiana\nSady foto-pifaliana,\nJeso Zanakan’Andriamanitra\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Raha mitolona ady sarotra\nMatokia fa tsy ho irery,\nHomba anao Jeso mahery\nHomba anao tsy miady\nvarotra\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Raha hilaozana ny havana,\nSady mainty koa Jordana,\nHo mazava ny fitàna\nAo Jeso hanangana avana\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM731', 'Raha Jesosy no mitantana,\nParadisa koa ny tany,\nHasambarana hatrany,\nAo Kanana no hamantana.\nHomba anao, homba anao\nHomba anao anie Jeso\nHomba anao, homba anao\nEnga anie ka homba anao\nJeso!', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM732','FFPM 732');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM732', 'Velona indrindra,\nry havana ô!\nVelona e, mandra-pihaona;\nRy Tompo, vimbino\nan-dalana ao\nNy havana izay vao handeha;\nKa ny mifanao\nVeloma izao\nTahio, mba ho tafahaona!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM732', 'Ry Jeso Mpamonjy, tariho\nizahay\nHihaona indray ao ambony,\nHiara-pinaritra mandrakizay,\nRehefa tafita ny ony,\nHiara-manao\nNy hira vaovao,\nFa tsy mba hisaraka intsony!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM733','FFPM 733');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM733', 'Ny fihaonana an-tany,\nRy Jesosy Tomponay,\nVetivety, mora lany,\nKa mangoraka izahay;\nNamana nifankazatra\nHifanao veloma anio,\nRy Jesosy be fiantra,\nNy mpandeha mba tahio.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM733', 'Ny ho lasa mba tantano\nTsy ho voa an-dalana;\nNy hitoetra koa tohano,\nDia mba hiadana.\nNa maraina na hariva,\nNa aiza alehany etý,\nMba ombay mandrakariva\nMandra-podiny arý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM733', 'Any volana, any taona,\nNy misaraka izao\nEnga anie ho tafahaona\nRaha mbola sitrakao.\nIlay fihaonana ao ambony\nNo irinay fatratra,\nTsy hisaraka intsony\nIzahay ka sambatra.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM734','FFPM 734');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM734', 'Zanahary ô, tahio\nny Tanindrazanay\nHandroso lalandava,\nHandry fahizay.\nEnga anie hanjaka ao\nNy saina mahay miray,\nDia ho tany sambatra,\nIlay Madagasikaranay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM734', 'Ireo mpitondra anay\narovy lalandava koa\nTolory saina hendry,\nkinga sy mahay.\nKa ny marina anie no\nmba hanjaka ao tokoa,\nDia ho tany sambatra\nIlay Madagasikaranay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM734', 'Ny taranakay tahio ho\nvanona tokoa;\nIreo no solofo, dimby,\nrahatrizay\nMba ho tena mahatoky,\nFeno fahendrena koa,\nDia ho tany sambatra\nIlay Madagasikaranay.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM735','FFPM 735');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM735', 'Arovy ry Tsitoha,\nNy Tanindrazanay,\nVimbino avokoa\nIzay mitondra anay;\nIty Nosy ity tahio\nMba handry fahizay;\nTantano sy ampio\nHandroso izahay.\nNy tsara mba tohano,\nRy Zanaharinay,\nNy ratsy mba sakano,\nMba hiadananay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM735', 'Tahio ny mpitsara\nNampanapahinao,\nHahay hitondra tsara\nIzao olonao izao;\nNy lehibe rehetra\nVangio sy hafanao,\nMba hanam-po miantra,\nHatahotra Anao,\nNy tsara mba tohano,\nRy Zanaharinay,\nNy ratsy mba sakano,\nMba hiadananay!', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM736','FFPM 736');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM736', 'Mba tahionao, ry Jehovah!\nNy tanindrazanay,\nHo tsara sy hiova;\nHambininao anie!\nHo tany izay mandroso\nSy sambatra tokoa,\nKa hanjakan’i Jeso\nMpamonjy Tompo soa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM736', 'Mba tahio ny firenena\nIzay monina eto izao,\nHandroso hihatsara,\nHatahotra Anao,\nHandao ny fomba ratsy\nIzay manadala re;\nHanary koa ny sampy\nMampidi-doza è!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM736', 'Mba tahionao ny mpitondra\nNampanapahinao,\nArovy isan’andro\nMba tsy handà Anao,\nTariho lalandava\nHiankina aminao,\nOmeo fahendrena\nHanao ny sitrakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM736', 'Mba tahio koa, ry Jehovah!\nNy fiangonanao\nHandroso lalandava\nHomban’ny heerinao.\nHanerana ny tany\nItoeranay izao,\nKa isam-bazantany\nHiondrika aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM737','FFPM 737');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM737', 'Ry Ray, tahionao,\ni Madagasikara,\nIzay nohasoavinao, ka\nvoakarakara,\nKa nandefasanao ny teny\nmasinao;\nDia angatahanay \n:,: ny fitahianao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM737', 'Ny Fiangonanao,\nry Rain’ny fahazavana\nIzay natsanganao hatao\nfahazavana\nKa nodidianao hanao ny\nasanao,\nDia angatahanay\n:,: ny fitahianao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM737', 'Ny asa marobe sy izay\nfanaovan-tsoa\nMiorina eto izao, ka sitrakao\ntokoa\nNy fanjakana koa, izay\nnatsanganao,\nDia angatahanay\n:,: ny fitahianao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM737', 'Ny tokantranonay, ny tena\nsy fanahy,\nNy fivelomanay, ry Ray Izay\nMpiahy,\nIreo rehetra ireo dia iantsoana\nAnao.\nKa angatahanay\n:,: ny fitahianao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM738','FFPM 738');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM738', 'Havaozy, Tompo ô,\nNy endriky ny tany,\nNy voninahitrao hatao\nFahazavany,\nIzao aizim-pito izao\nLevoninao tokoa\nIzao ratsy be izao\n:,: esory avokoa :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM738', 'Havaozy Tompo ô,\nNy endriky ny tany,\nReseo ny rafinao,\nRavao ny fanjakany,\nAmpanjakao tokoa\nJesosy Zanakao,\nIzao rehetra izao\n:,: hanao ny sitrakao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM738', 'Havaozy, Tompo ô,\nNy endriky ny tany,\nKoa averenonao indray\nNy hatsaràny;\nFanahy Mpanavao,\nNy famelomanao\nTadiavinao izao\n:,: vitao ny asanao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM738', 'Havaozy, Tompo ô,\nNy endriky ny tany,\nNy olonao izao maniry\nIndrindra izany.\nHenoy ny sentonay\nMiakatra aminao,\nKa hafainganonao\n:,: ny fanavaozanao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM739','FFPM 739');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'Ry Jehovah Tompon’aina,\nO, tahio ny taninay!\nMba fohazy, re ny saina\nSy fanahinay hahay\nMankatò sy mankalaza\nNy Anaranao,\nMba ho fantatray mazava\nNy fitiavanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'Iantranao, ry Jesosy,\nHazavao ny Nosinay,\nKa ny fon’ny Malagasy\nDiovy re ka mba ovay,\nTsy hanompo sampy intsony\nFa hazava re,\nKa ho sitraky ny fony\nNy ho masina e!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'O, tahio ny Faritany\nMba handray ny teninao\nNa ambony na ambany\nMba tsarovy, iantrao!\nNy mpitory mba iraho,\nKa hiely anie,\nOmeo hery, hatanjaho\nHahavita be!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'O, Jehovah, Ray mahery,\nSakambino izahay,\nEny, Hianao irery\nNo mba hany tokinay;\nKa ny ratsy mba sakano\nTsy hanimba anay,\nFa ny tsara no tohano\nHiadananay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'Ao koa ny mpanao lalàna\nMba toroy ny marina,\nIreo manam-pahefana\nOmeonao sain-dalina!\nKa ny tany mba ampio\nHandry fahizay!\nO, arovy sy tahio\nNy mpitondra anay!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM739', 'Indreo ny isan-tokantrano\nMba tsidiho, hafanao,\nKa ny zanakay tantano\nSy trotroy ho olonao!\nEny, Tompo, mandrosoa,\nAnjakao izahay\nKa onenonao tokoa\nIzao ny Nosinay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM740','FFPM 740');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM740', 'He! ny tany manontolo\nMba ambinonao, ao izao,\nRy Jeso Mpanolokolo,\nTena Tompo tsy mandao,\nMba vontosy andon’aina\nMba ho lonaka tokoa,\nTsy ho tany karankaina\nFa ho vokatra tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM740', 'Mba tahio ny fanjakana\nIzay mitondra anay izao\nIreo mpitana ny lalàna\nMba omeo ny hevitrao.\nNy mpifehy isan-toko,\nNy mpikarakara izao\nAnehoy ilay vokovoko\nMba hitondra marina ao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM740', 'Ny komity sy voamiera\nRaha miady hevitra ao\nTsy hitompo hevi-tena\nFa handray ny sitrakao\nKa ny didinao hatrany\nNo mba hijoroany izao\nFa ny tetiky ny tany\nDia ho laviny tokoa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM740', 'Ry Mpanjakan’ny mpanjaka,\nMiasà mahery izao\nIreo mpitondra samihafa\nMba toroy ny sitrakao.\nIreo mpanjaka an-tany hafa,\nRevon-diadema koa,\nMba sintony re hitafa\nAminao ry Tompo soa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM741','FFPM 741');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM741', 'Jehovah Tompo ô!\nTahio sy hatsarao\nNy taninay;\nTahio ny namanay\nHo tia ny teninao,\nDia mba hazavao\nNy nosinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM741', 'Ovay ny fombanay\nHo foin’ny taninay\nNy sampiny;\nOmeo fo marina\nIzao rehetra izao,\nKa dia mba iantrao\nNy nosinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM741', 'Jehovah Tompo ô\nTahio ny olonao\nNy zanakay,\nTahio ho zanakao\nTahio ho marina\nKa dia mba ho taninao\nNy nosinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM741', 'Izay mpitondra anay\nTahio ho tia Anao,\nJehovah ô!\nOmeo sai-marina\nHanao ny sitrakao,\nKa ampanompoy Anao\nNy nosinay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM742','FFPM 742');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM742', '(Maintimolaly)', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM742', 'Zanahary no mahela\nIzay fe-taona iainanay,\nKa miantra sy mamela\nTombon’andro ho anay;\n:,: Nefa vitsy :,:\nNo ho andronay atý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM742', 'Betsaka ny andro lany\nNanaranam-po izao;\nMisy feo manontany :\nVita ve ny asanao ?\n:,: Miezaha :,:\nAvy re ny alim-be.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM742', 'Mamindrà fo, Zanahary!\nMamelà ny helokay;\nTompo! aza mba manary,\nAndrao ho very izahay;\n:,: Mihainoa :,:\nNy mifona aminao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM742', 'Ry Jehovah! manomeza\nIzay ilainay olonao;\nMitahia, mampahereza,\nMba ho tonga ao aminao,\n:,: Ka hahazo :,:\nSatro-boninahitra ao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM743','FFPM 743');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM743', 'Ny andronay mandalo\nLany foana taminay;\nNy mandrakizay no hatoninay,\nNefa adala izahay.\nRy mpanota, ifony ny\nhelokao,\nFa Jeso tia anao\nMba tsy ho very mandrakizay,\n:,: Avoty ny ainao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM743', 'Ny fiadanan-dratsy\nNo mba manadala anay\nHijanona foana atý izao\nHanadino ny Rainay,\nMba hevero ry olon-ko\nfaty e!\nTsy ela no etý;\nTsarovinao fa hody tokoa;\n:,: Antsoiny hianao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM743', 'Ny taninay havela,\nMpivahiny izahay;\nTsy maintsy hiainga hiala atý\nAny no hodianay.\nTsara sady mazava\nNy tranonao,\nMiomàna, fa hankao;\nTazano, fa mivoha izao;\n:,: Midira hianao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM744','FFPM 744');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM744', 'He! ny andro mora lasa,\nO, ry mpivahiny ô!\nTsy ho ela, kely sisa,\nDia hody hianao!\nTsy mba fantatrao akory\nIzay hahafatesanao;\nKoa aza mba matory,\nSao ho very hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM744', 'Miomàna ry sakaiza,\nAza mba tamàna atý,\nFa ny eto tsy mateza,\nMiaingà mba ho arý!\nAo ny Tomponao Jesosy,\nHampihaingo tsara anao,\nFa ny rany no mamofsy\nNy akanjo ho anao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM745','FFPM 745');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM745', 'Henoy, ry Jeso Tompo!\nNy fitarainanay,\nFa amin’alahelo \nNo ipetrahanay;\nNy fonay maniry\nHitovy aminao,\nKanefa be ny ratsy \nMasakana anay ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM745', 'Nateraky ny nofo,\nKa nofo izahay;\nNanompo tompo ratsy,\nKa very hatrizay!\nNy razanay nanota\nKa nodimbiasànay\nRy Tomponay Tsitoha,\nHavaozy izahay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM745', 'Ny asam-pamonjena\nNatolotra Anao;\nTsy hisy tsy ho vita\nIzay natombokao;\nRaha resy avokoa\nNy fahavalonao\nHiposaka tokoa\nNy tena taom-baovao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM745', 'Ny tavanao malala,\nRy Jeso Tomponay,\nHo tena masoandro,\nIzay hifalianay.\nRy nosatrohan-tsilo,\nFaingàna Hianao,\nHanangana ny maty,\nHitondra aim-baovao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM746','FFPM 746');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM746', 'Mifalia, ry sakaiza!\nFa nahazo taom-baovao,\nZanahary no mitaiza,\nKa isaory sy hajao;\nMihirà sy mihobia,\nJeso Tompo no derao;\nMiravoa, mifalia,\nVelona aina hianao.\nMifalia ry sakaiza!\nFa nahazo taom-baovao\nZanahary no mitaiza,\nKa isaory sy hajao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM746', 'Izao no andro mampifaly,\nAndro lehibe anio,\nDia hira mahafaly\nNo hatao ankehitrio;\nZanahary no mitàna,\nMifalia hianao;\nTonon-kira hoe : Hosana!\nNo hatao atý izao.\nMifalia ry sakaiza!\nFa nahazo taom-baovao\nZanahary no mitaiza,\nKa isaory sy hajao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM746', 'He! Hosana, he! Hosana\nHo Anao, ry Tompo ô!\nFihirana fiderana,\nNo asandratray izao;\nDera, saotra, hery, laza,\nHo Anao, Mpanjakanay;\nHo Anao anie ny haja,\nRaiso ho Anao izao.\nMifalia ry sakaiza!\nFa nahazo taom-baovao\nZanahary no mitaiza,\nKa isaory sy hajao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM747','FFPM 747');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM747', 'Haleloia! Sambasamba!\nHitanay ny taom-baovao;\nAvy izahay, Jehovah!\nMba hifaly aminao;\nFihirana no atao,\nSaotra, vavaka,\nNo atolotray Anao,\nRy Mpamelona!\nHaleloia! Sambasamba!\nFaly izahay izao :\nHaleloia! Sambasamba!\nHitanay ny taom-baovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM747', 'Lasana ny andro maro,\nBe ny zavatra natao,\nNa ny mety, na ny diso,\nSamy efa fantatrao;\nAoka anie ny tsininay\nHovonoinao,\nFa ny mety vitanay\nMba haharitra :\nHaleloia! Sambasamba!\nFaly izahay izao :\nHaleloia! Sambasamba!\nHitanay ny taom-baovao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM747', 'Ka ny taom-baovao, Jehovah!\nAoka hanomezanao\nFahendrena ny mpitondra,\nHahasoa ny olonao;\nKa ny Fiangonana\nHamasinonao\nMba handroso marina\nHahalala Anao:\nHaleloia! Sambasamba!\nFaly izahay izao :\nHaleloia! Sambasamba!\nHitanay ny taom-baovao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM747', 'Mitsingerina ny taona,\nFohy andro izahay,\nVetivety dia hihaona\nAminao, ry Tomponay!\nEnga ka ho hitanay\nAo an-danitra\nNy Sabata tsara izay\nTsy ho tapitra :\nHaleloia! Sambasamba!\nFaly izahay izao :\nHaleloia! Sambasamba!\nHitanay ny taom-baovao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM748','FFPM 748');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM748', 'Havaozy, Tompo ô!\nIzao rehetra izao\nKa aoka mba ho hita ao\nNy voninahitrao.\nRy Tompo Mpanasoa\nLevony avokoa\nHo fongatra tsy hisy re\nNy ratsy marobe.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM748', 'Izao taona vaovao\nDiavinay izao\nHo fanavaozan-dehibe\nNy tenanay anie!\nKa ny fiainanay\nIzay ratsy hatrizay,\nOvay hatramin’ny anio\nHo tsara sy madio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM748', 'Havaozy, Tompo ô!\nNy Fiangonanao\nO! akambanao ho iray,\nHiray mandrakizay.\nRy Tompo be fitia,\nTongava, mamangia;\nMba tanteraho aminay\nNy fanavaozanao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM749','FFPM 749');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM749', 'Ny taom-baovao dia tonga\nindray\nHo fiantsoanao anay\nMba hanoloranay Anao\nNy tenanay voavotrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM749', 'Fa maro be, ry Tomponay!\nNy zava-tsoa nomena anay\nTamin’izao taon-dasa izao,\nIzay isaoranay Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM749', 'Ny mafy izay manjo anay,\nTsy tonga foana aminay,\nFa mba ho fitahianao\nIzay miankina aminao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM749', 'Ka enga anie ny otanay,\nIzay mitambesatra aminay\nNo hibebahanay izao,\nHanaovanay ny sitrakao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM749', 'Ny taom-baovao, diavinay,\nNy taona teo, tafitanay,\nKa dia ny fitarihanao\nNo mba irinay aminao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM750','FFPM 750');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM750', 'Dera, laza, ry Mpanjaka!\nNo atolotray Anao\nNoho Hianao nitahy;\nTratranay ny taom-baovao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM750', 'Andro maro izay no lasa,\nBe ny soa hitanay;\nFitahia-mahagaga\nAzo taminao, ry Ray!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM750', 'Marobe ny ratsy vita,\nLehibe ny helokay,\nKa tsy mendrika hiantso\nNy Anaranao izahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM750', 'Miantrà, ry Zanahary!\nMamelà ny helokay,\nKa sasao ny ran’i Jeso,\nMba hadio izahay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM750', 'Aoka re ny andro sisa\nHanompoanay Anao;\nHatanjaho, ry Jehovah!\nIzahay mpanomponao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM751','FFPM 751');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM751', 'He, vaovao ny taona,\nRy Jesosinay,\n:,: Ka mba te hihaona\nAminao izahay :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM751', 'Hianao mitahy\nNy mpanomponao\n:,: Koa tsy manahy\nIzay tarihinao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM751', 'Ary izaho koa\nMba tantanonao\n:,: Dia hahita soa\nAo an-danitrao :,:', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM752','FFPM 752');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'O, ry Jesosy, ny Anaranao\nManatsika  ahy izao hanatona,\nHanolotra ny foko ho Anao,\nMpamonjy tia sy Mpamelona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'Manatona aho, ka miondrika\nHanoroka ny tongo-masinao;\nIzaho olona tsy mendrika,\nKa mba havaozy, Tompo,\nho Anao!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'Antsoiko isan-andro Hianao\nRy Toky tsara mahafatra-po,\nKa amin’ny Anara-masinao\nNo anankinako izay hanjo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'Raha io no entiko mangataka,\nHisokatra amiko ny lanitra,\nKa dia ho azoko malalaka\nNy zava-tsoa izay maharitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'Mamirifiry izao tontolo izao\nTsy misy tena fitsaharana;\nFa fiereko ny Anaranao\nKa ahitako fiadanana.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'O, ry Anaran’i Jesosiko,\nRy Paradisa atý an-tany ô!\nRy voninkazo mampifaly fo!\nRy tohan’aina ao an-dalako.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM752', 'Iriko andro aman-alina\nNy hanana Anao ho ao\nam-po,\nHo Tokiko raha mbola\nvelona\nSy amin’ny hahafatesako.\n\nNY FIVORIAN’NY TANORA', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM753','FFPM 753');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM753', 'Hiaraka Aminao aho, ô ry Jesoa Tompoko\nTsy manana olon-kafa aho,\nFa Hianao no fiainako\nHanara-dia Anao, izay no faniriako\nHifikitra Aminao aho Jesoa \nFiv: Tiako ny hiaraka Aminao\nJesoa\nNa aiza na aiza hitondranao ahy\nTiako hiaraka Aminao Jesoa\nFa Hianao no miantso ahy.!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM753', 'Hiaraka Aminao aho, ô ry Jesoa Tompoko\nHitory teny soa amin’ireo havako\nHanara-dia Anao, izay no faniriako\nHifantsika aminao aho Jesoa!\nTiako ny hiaraka \nFiv: Tiako ny hiaraka Aminao\nJesoa\nNa aiza na aiza hitondranao ahy\nTiako hiaraka Aminao Jesoa\nFa Hianao no miantso ahy.!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM753', 'Hiaraka Aminao aho, ô ry\nJesoa   Tompoko\nHo zary famonjena anie\nny fahoriako\nHanara-dia anao izay no\nfaniriako\nHifantsika Aminao aho\nJesoa!\nTiako ny hiaraka \nFiv: Tiako ny hiaraka Aminao\nJesoa\nNa aiza na aiza hitondranao ahy\nTiako hiaraka Aminao Jesoa\nFa Hianao no miantso ahy.!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM753', 'Hiaraka Aminao aho, ô ry\nJesoa   Tompoko\nHibanjina ny Ray, Tompo\nAndriamanitro.\nHanara-dia Anao, izay no\nfaniriako,\nIzay misy Anao, no hisy ahy,\nJesoa,\nTiako ny hiaraka \nFiv: Tiako ny hiaraka Aminao\nJesoa\nNa aiza na aiza hitondranao ahy\nTiako hiaraka Aminao Jesoa\nFa Hianao no miantso ahy.!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM754','FFPM 754');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM754', 'Mitsangàna, mandehana,\nRy zatovo be laolao!\nManatòna ny Mpamonjy,\nAvelao ny sitrapo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM754', 'He, tsarovy fa mahantra\nSady ory hianao,\nKa hatòny ny Mpamonjy,\nDieny mbola hitanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM754', 'Mandehana, mianara,\nMba ho hendry hianao;\nJeso Tompo no miandry\nHampianatra anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM754', 'Ry zatovo! mandehana,\nMba vitao ny asanao,\nMahereza, aza osa,\nNy Mahery homba anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM755','FFPM 755');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM755', 'O! ry tanora mba tsarovy\nIlay Tompo soa maty noho\nny helokao;\nIzy miantso anao moramora\nVohay ny fonao hidirany izao.\nNy saina sy ny safidy nomeny.\nKa mba fidio ny ho\nmpanaraka\nAn’i Jesosy, Mpanjaka\nTsitoha,\nNy fonao atolory hanjakany\nao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM755', 'O! ry tanora miambena,\nFa ny devoly dia mpamitaka\nmahay\nMaro ny fandrika ka\nmitandrema\nTsy ho tra-nenina re\nmandrakizay.\nKa ekeo anatrehan’ny Tompo,\nHandao ny ratsin’izao\ntontonlo izao.\nRaha Jeso no iankinanao\nmafy,\nIzy hiaro mba mba tsy\nhivadihanao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM755', 'O! ry tanora, mivavaha\nFa Jeso Tompo dia Mpihaino\nvavaka\nAzy irery ny hery rehetra,\nDia matokia mba ho\nafa-tahotra.\nKa raha ory sy mila ho kivy,\nDia andrandraonao Ilay\nTompo be fitia;\nNy fitarainanao dia hohenoiny\nAry ny fonao dia\nhampiadaniny.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM755', 'O! ry Jesosy, mba ampio\nIzaho mpianatrao mba ho\nmadio fo\nTantano aho, vimbino ry Jeso,\nFa sarotra ny lalana alehako;\nIriko ny ho mpandresy ny ratsy,\nIriko hahatanteraka ny soa;\nOmeo hery sy tanjaka aho.\nEfao ny asa tsara ao anatiko.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM756','FFPM 756');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM756', 'Avia ry sakaiza ô!\nAntsoin’ny Mpanjaka   izao\nHandray fiadiana\nHoentina hanafaka.\nVelona ny baikonao,\nAndrandrainay Hianao\nKa arahinay tokoa,\nRy Mpandresy ao Ziona!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM756', 'Ny sabatra atolony\nDia ny teny masina,\nAmpinga fiarovana\nMahery ny finoana.\nVelona ny baikonao,\nAndrandrainay Hianao\nKa arahinay tokoa,\nRy Mpandresy ao Ziona!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM756', 'Ny vatsy izay atolony\nDia ny ra sy tenany\nHo herintsika olony\nIzay miaramilany.\nVelona ny baikonao,\nAndrandrainay Hianao\nKa arahinay tokoa,\nRy Mpandresy ao Ziona!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM756', 'Jesosy ô, arahinay\nNy fiantsoanao anay,\nKa manampia ny olonao\nHiady sy handresy izao.\nVelona ny baikonao,\nAndrandrainay Hianao\nKa arahinay tokoa,\nRy Mpandresy ao Ziona!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM757','FFPM 757');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM757', 'Tsarovy, ry sakaiza,\nNy RAY an-danitra e,\nFa Izy no nitaiza\nSy nahalehibe;\nFa raha mbola zaza\nNampitomboiny,\nKa na ho antitra aza,\nTsy mba hafoiny.\nNy saina sy safidy\nNomeny ho anao,\nKa tiany hifidy\nNy tsara hianao', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM757', 'Tsarovy, ry tanora,\nJESOSY, avotrao,\nMahay mitondra mora,\nMitandrina anao.\nMiaraka mibata\nNy fahorina,\nKa dia mahareta\nNy hatrotrahana,\nFa Izy no miaro\nIzay mpianany\nKa dia mba fantaro\nNy fitiavany!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM757', 'Tsarovy ry zatovo,\nNy MPANAMASINA\nFa Izy no manovo\nNy rano velona,\nKa dia mba mampandro\nNy ta-hadio fo.\nLazaina isan-andro\nNy marina sy to,\nKa ny masirasira\nEsoriny aminao,\nIzay maniratsira\nNo halavironao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM757', 'Tohero, ry zatovo,\nIzay mamitaka,\nSatana ta hamono\nNy tsy miambina\nNy nofo mitsikilo\nNy voninahitrao;\nMamono ny fanilo\nIzao tontlo izao\nKa raisony ampinga\nAlao ny sabatra,\nIzany mahakinga\nNy te ho sambatra.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM758','FFPM 758');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM758', 'Tsarovy e! rankizy\nIlay Mpanao anao!\nKa tadiavo Izy!\nDieny hitanao;\nDieny mbola kely,\nTsarovy rahateo,\nKa aza manadino\nIlay Mpanao anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM758', 'Tsarovy ry zatovo\nIlay Mpanao anao!\nIlaozy ny mpanota,\nFandrao manimba anao.\nTsarovy ny Jehovah \nNamorona anao,\nMampanantena lova\nSy nahatoy izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM758', 'Tsarovy, ry sakaiza,\nJehovah Tomponao!\nFa Izy no mitaiza\nSy manasoa anao;\nKoa aza manadino\nIlay Mpanao anao;\nNy teniny araho,\nFa Izy no Rainao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM759','FFPM 759');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM759', 'Ry Sakaizan’ny tanora!\nZoky be fitia,\nSakambino moramora\nIzahay mpania.\nTompo ô! arovy\nNy madinikao\n:,: Aza afoy, fa mba tsarovy\nTano mafy ho Anao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM759', 'Ry Sakaizan’ny tanora!\nTsinjonao arý\nIzany ady tsy mba mora\nHitanay etý.\nTompo ô! arovy\nNy madinikao\n:,: Aza afoy, fa mba tsarovy\nTano mafy ho Anao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM759', 'Ry Sakaizan’ny tanora!\nTanonao izahay\nHe! fa be ny mpanakora\nRaha lavo indray.\nTompo ô! arovy\nNy madinikao\n:,: Aza afoy, fa mba tsarovy\nTano mafy ho Anao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM759', 'Ry Sakaizan’ny tanora!\nEny, sitrakay,\nIsan’andro, isan’ora\nHo Anao, izahay.\nTompo ô! arovy\nNy madinikao\n:,: Aza afoy, fa mba tsarovy\nTano mafy ho Anao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM760','FFPM 760');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM760', 'Aza mba manadino ny ray\nsy reninao;\nFa izy no nitaiza sy nanasoa\nanao,\nKa na aiza na aiza aleha\nan-tany lavitra,\nAza mba manadino ny ray sy\nreninao :\nTsara izay! tsara izay!\nEny, tsy ho hadinonay ny\nray sy reninay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM760', 'Aza mba manadino ny\nTanindrazanao,\nTsarovy ny tanàna izay nahabe\nanao.\nFadio izay tsy mety fanaony\nfahizay.\nAza mba manadino ny\nTanindrazanao :\nTsara izay! Tsara izay!\nEny, tsy ho hadinonay ny\ntanindrazanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM760', 'Aza mba manadino ireo\nmpitondra anao,\nAraho ny lalàna mba\nhiadananao.\nKa na aiza, na aiza aleha \nan-tany lavitra.\nAza mba manadino izay\nmpitondra anao :\nTsara izay! Tsara izay!\nEny, tsy ho hadinonay izay\nmpitondra anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM760', 'Aza mba manadino ny\nfivavahanao,\nAtaovy isan’andro mba\nhamonjena anao;\nMpitondra, ray, sy reny,\nny tany, tena koa,\nAza mba manadino ny\nfivavahanao :\nTsara izay! tsara izay!\nEny, tsy ho hadinonay ny\nfivavahanay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM761','FFPM 761');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM761', 'Ry Jeso, Zoky be fitia!\nAvia, mitantàna\nFandrao izahay maniasia\nAvilin’i Satana.\nRy Jeso ô! tahio izahay\nFa mbola kely saina,\nHe! tsy mba hendry, tsy \nmahay\nKa mora ambakaina.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM761', 'Maniry izahay, Jeso!\nHo zandry izay manoa,\nKa dia  ampaherezonao\nHo tia Anao tokoa.\nRy Jeso ô! tahio izahay\nFa mbola kely saina,\nHe! tsy mba hendry, tsy \nmahay\nKa mora ambakaina.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM761', 'Indreto izahay, Jeso!\nTariho hahalala\nHanaraka ny sitrakao\nIzay Zokinao malala.\nRy Jeso ô! tahio izahay\nFa mbola kely saina,\nHe! tsy mba hendry, tsy \nmahay\nKa mora ambakaina.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM762','FFPM 762');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM762', 'Modia, modia,\nFandrao very tokoa,\nFa ny efitra be\nNo diavina  izao;\nRy zanako ô!\nModia  izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM762', 'Modia, modia,\nFa miandry ny Ray\nHampandroso anao\nSady hanome soa;\nRy zanako ô!\nModia  izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM762', 'Modia, modia,\nFa nanavotra anao\nJeso ilay be fitia\nIzay nisolo anao;\nRy zanako ô!\nModia  izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM762', 'Modia, modia,\nKa ilaozy izao\nIzay ratsy natao\nNahameloka anao,\nRy zanako ô!\nModia  izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM762', 'Modia, modia,\nHovantaninao ao\nNy tranon’ny Ray\nSy ny lamba madio\nRy zanako ô!\nModia  izao.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM763','FFPM 763');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM763', 'Tanora ô!\nNy Nosin-drazanao\nMiandry   izao\nManasa   anao.\nIngao anio\nIlay fanevanao,\nO! tafio\nNy herinao.\nO! mifohaza izao,\nTafio ny herinao\nInjao ny Nosinao,\nManantena anao!\nJereo ny namanao,\nTaninin-doza izao\nO! vonjeo\nFa mitoreo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM763', 'Avia, jereo\nNy Fiangonanao;\nO! mba vonjeo\nFa mila anao.\nTanora soa\nNo mba ilaina koa\nO! avia\nHiara-dia,\nO! mifohaza izao,\nTafio ny herinao\nInjao ny Nosinao,\nManantena anao!\nJereo ny namanao,\nTaninin-doza izao\nO! vonjeo\nFa mitoreo.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM763', 'Omeo anio\nNy herinao izao,\nKa dia falio\nIreo tapakao.\nIreo didy soa\nSy baikon’ny Tsitoha,\nTanteraho\nSy hajao.\nO! mifohaza izao,\nTafio ny herinao\nInjao ny Nosinao,\nManantena anao!\nJereo ny namanao,\nTaninin-doza izao\nO! vonjeo\nFa mitoreo.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM764','FFPM 764');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM764', 'Tsy mangataka  aho, Tompo\nZava-py, harena, zo,\nFa ny tena mba iriko\nDia  izao : ny fo madio.\nFo madio izay akàny\nFeno eritreri-tsoa\nFo madio : haren-tsy lany\nSarobidy avokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM764', 'Indrisy, ny soan’ny tany\nManodoka, mora lo\nNy haren-tsy mety lany\nDia  izao : ny fo madio.\nFo madio izay akàny\nFeno eritreri-tsoa\nFo madio : haren-tsy lany\nSarobidy avokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM764', 'Na maraina na hariva,\nDia ity no hatako :\nMba ho ahy ilay soa indrindra,\nDia  izao : ny fo madio.\nFo madio izay akàny\nFeno eritreri-tsoa\nFo madio : haren-tsy lany\nSarobidy avokoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM765','FFPM 765');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM765', 'Henoy ny antson’ny Tompo;\n« Iza no ho irakay,\nVonon-kandeha sy hanompo,\nHiasa an-tany hay ? »\nAdidy sarotra hefaina\nAsa mangetana re,\nMaty handritra ny aina,\nIza no vonona re ?', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM765', 'Tsy didy miendrika baiko\nNefa mahery tokoa;\nNanindry mafy ny saiko\nNy antsonao, Tompo soa\nSatriko lavina anefa\nManery ahy hanoa,\nAny am-po no miantefa,\nNy ako, onjany koa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM765', 'Inty, ry Tompo malala\nIzaho ho irakao,\nNofo ka misalasala\nRaha toa tsy tohananao.\nNy foko  omeo fahendrena\nHanao ny sitrakao,\nNy saiko mora mivena\nFenoy ny hasoavanao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM765', 'Vonona ka hamasino\nHanefa ny irakao;\nEny, ry Tompo, vimbino\nHandia ny lalanao.\nSarotra nefa hataoko\nNy asa atolotrao,\nNy sitrapo dia  hafoiko,\nTohano ny herinao.\n\nNY HIRAN’NY ANKIZY', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM766','FFPM 766');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM766', 'Jeso Mpanjaka Malaza\nNefa sakaizan’ny ankizy koa,\nMamin’ny foko ny fitiavanao\nSintony e, ny foko ho tia anao,\nJeso malala ô! Tompo be\nfitia\nTano ny foko tsy haniasia,\nHo zaza hendry,\nhahay hanompo,\nHo tia Anao anie,\nry Tompo ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM766', 'Mamin’ny foko hotantaninao,\nTiako Jeso hiaraka Aminao\nNy foko e, arovy ho madio\nNy faniriako Tompo ô, valio!\nJeso malala ô! Tompo be\nfitia\nTano ny foko tsy haniasia,\nHo zaza hendry,\nhahay hanompo,\nHo tia Anao anie,\nry Tompo ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM766', 'Ny hazazako ry Tompo, tahio,\nEnga ho zaza tia ny madio\nHo zaza hendry, zaza\nmpankatò\nAnao Mpanjaka, Tompo\nmanan-jo,\nJeso malala ô! Tompo be\nfitia\nTano ny foko tsy haniasia,\nHo zaza hendry,\nhahay hanompo,\nHo tia Anao anie,\nry Tompo ô!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM767','FFPM 767');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM767', 'Ry Jeso, Zaza masina ô!\nIzay tonga zaza toa anay;\nNafoinao ny lapanao\nHitondra vonjy ho anay,\nRy Jeso, Zaza masina ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM767', 'Ry Jeso, Zaza masina ô!\nNanetry tena Hianao;\nNilaozanao ny lanitrao\nNoho ny fitiavanao,\nRy Jeso, Zaza masina ô!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM767', 'Ry Jeso, Zaza masina ô!\nHianao no fihavanana;\nIzahay izay nandà ny Ray\nTadiavanao ho Azy indray,\nRy Jeso, Zaza masina ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM767', 'Ry Jeso, Zaza masina ô!\nHihira ho Anao izahay,\nHianao nanondrotra anay;\nNy lapan-dRay ho azonay,\nRy Jeso, Zaza masina ô!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM768','FFPM 768');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM768', 'Endrey! endrey! Tompo ô!\nHe, ny hasoavanao,\nFa tsy tapaka hatrany\nIzany fitahianao;\nNotantananao, ry Tompo\nItony ondrikelinao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM768', 'Endrey! endrey! Tompo ô!\nHe, ny fitiavanao;\nEfa elabe tokoa no mba\nniheveranao\nIzany zaza Malagasy\nIzay irinao mba ho soa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM768', 'Anio izahay, Tompo ô!\nMankasitraka Anao,\nFa ny sandrinao mahery\nNo niaro toy izao\nTratranay mandrakariva\nNy androm-pahasoavanao!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM768', 'Tahio tokoa, Jeso ô!\nMadagasikaranay\nMba handroso ka ho tonga\nMadagasikaranao;\nIzany re no faniriana\nHo tanteraka anie!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM769','FFPM 769');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM769', 'Misy toerana voafidy\nManan-daza lehibe,\nDia saha saro-bidy,\nTena mahavokatra e!\nSaha feno fitahiana,\nMisy voka-tsoa erý;\nAo no mendrika haniriana\nSaha masina izy ity!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM769', 'Ny Sekoly Alahady,\nIo no sahanao, ry Ray\nNy Baiboly no angady\nHanasoavanao anay;\nMahavatra ny Mpamboatra,\nKa mirobona tokoa;\nVoakarakara loatra,\nKa mitombo  sy  mamoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM769', 'Midadasika ny tany,\nNefa karakaina koa;\nFa ny sahanao ihany\nNo tsy manam-paharoa.\nMisy rano tsy mba ritra\nDia Teny Masinao;\nIzay toriana eran-tany\nMikoriana lava izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM769', 'Ny ankizy sesehena\nNo mivory eto izao;\nIreo no hazo ambolena\nAo anaty Sahanao,\nRaha mirona mba tohano,\nRaha lavo, ajoroy,\nZaza osa, ka tantano,\nMbola kely ka toroy!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM770','FFPM 770');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'Hajain’ny saiko\nFototry ny aiko,\nItsaohan’ny fanahiko,\nTokana iriko,\nMalala tiako :\nHianao, Jeso Mpamonjiko!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'Mety malazo\nNy voninkazo,\nNy ahi-maintso koa re!\nFa misy lova\nTsy mba miova :\nJesosy Perla soa e!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'Ao lalandava\nNy andro mazava,\nNy kintana, ny volana;\nJesosy irery\nTompon’ny hery :\nTsy azo ihoarana.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'He, igagàna\nNy hatanorana,\nFa na mahafinaritra,\nMety mihena\nNy herin-tena :\nJesosy no maharitra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'Tsy misy fetra\nZavatra rehetra\nHianao Jesosy, Tokiko,\nAkaiky ahy,\nZoky Mpiahy,\nNy tsara indrindra amiko.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM770', 'Raha ho lasa,\nFa vita ny asa,\nTohano aho, Jeso ô!\nAmpio aho\nSy atanjaho,\nHo sambatra eo an-tratranao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM771','FFPM 771');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM771', 'Tsinjovinao ny vorona,\nFa tsy mamafy na mijinja,\nNefa ao Ilay Mpamelona\nMiahy sy mikojakoja,\nJereo ny voninkazo soa,\nFa tsy miasa na mamoly;\nIreo ahin’ny Tompo koa,\nKa velona  ao an-tanimboly.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM771', 'Isika izay malalany\nNo dia andrian’ny fony\nindrindra,\nKa mifalia, ry zanany!\nNy Zanahary no mpitondra,\nRy Tompo, Ray malalanay!\nHatoky tsy hanahy  intsony\nNy tena sy fanahinay,\nFa manana ny Ray ambony.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM772','FFPM 772');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Vakio Mat. xi 28.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Manatòna, manatòna\nAn’i Jeso izao;\nManatòna an’i Jeso izao.\n\nVakio Jao. iii. 16', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Mba minoa, mba minoa\nAn’i Jeso izao,\nMba minoa an’i Jeso izao.\n\nVakio Heb. vii. 25', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Mahavonjy Jeso Tompo\nMahavonjy izao\nMahavonjy Jeso Tompo izao.\n\nVakio Jak. v.11.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Be fiantra, be fiantra\nJeso Tompo izao,\nBe fiantra Jeso Tompo izao.\n\nVakio Jao. vi. 37', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Tsy hanary Jeso Tompo,\nTsy hanary anao,\nJeso Tompo tsy hanary anao.\n\nVakio Mat. x. 47', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Miantsoa, miantsoa\nAn’i Jeso izao\nMiantsoa an’i Jeso izao.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Fa mamaly Jeso Tompo\nFa hamaly anao,\nFa hamaly Jeso Tompo izao.\n\nVakio 1 Jao. i. 7', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Fo madio, fo madio\nNo homeny anao \nFo madio no homeny anao.\n\nVakio Apok. iii. 5', '9');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM772', 'Lamba fotsy, lamba fotsy\nNo hatafy anao,\nLamba fotsy no hatafy anao.', '10');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM773','FFPM 773');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM773', 'Hianao, ry Jehovah no\nRainay tokoa,\nKa manatona Anao izahay,\nAry Jeso no Hava-malalanay\nkoa.\nDia matoky Anao ny fonay,\nMivoria ry ondry madinika ô!\nMba ho ao am-pisokoanio;\nMihainoa ny feon’ny Mpiandry\nizao\nO, faingàna, modia hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM773', 'Eny, mamy tokoa ny mihaino\nAnao\nRy Mpamonjy mpanavotra\nAnay!\nFa Sakaiza malala tokoa\nHianao,\nTe hihaino Anao izahay,\nO! andeha, rankizy madinika\ne!\nFa miantso Jesosy erý,\nMahafaly antsika ny teniny\nHoe :\n« Avelao izy mba hankatý! »', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM773', 'O! ry Tompo tsy toha!\nTsinjovy ‘zahay,\nFa masiaka ny lion-dozabe,\nKa manenjika mba hahafaty\nanay\nSy mihaza ny ain-dehibe,\nMitsangàna, zaza \nmadinika ô!\nMandosira ny loza etý\nManatòna an’i Jeso\nMpamonjy izao,\nKa modia ho an-danitra  arý.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM774','FFPM 774');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM774', 'Fony Jeso nivahiny\nNisy zazakely koa\nTonga tao, ka notahiny\nSy noraisiny tokoa :\n:,: He, rankizy!\nHy fitiavan-dehibe :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM774', 'Manatòna, izao, rankizy!\nAn’i Jeso Tompo soa,\nFa mandray ny zaza Izy\nKa mitahy azy koa :\n:,: He, rankizy!\nHy fitiavan-dehibe :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM774', 'Maro be ny zaza faly\nAo an-dapan-dRainy ao,\nAfaka ota, afa-jaly,\nSambatra izay tonga ao :\n:,: He, rankizy!\nHy fitiavan-dehibe :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM774', 'Mihobia izao, rankizy!\nFa isika koa hankao;\nEny, mifalia, fa Izy\nHo Sakaizantsika ao :\n:,: He, rankizy!\nHy fitiavan-dehibe :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM775','FFPM 775');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM775', 'Ry Jesosy Tomponay!\nMamindrà fo aminay;\nBe ny hasoavanao,\nBe ny fitiavanao;\nZazakely izahay,\nMamindrà fo aminay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM775', 'Fony teto aminay\nHianao sakaizanay,\nTia zaza Hianao,\nZaza notrotroinao :\nZazakely izahay,\nMamindrà fo aminay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM775', 'Masina sy marina\nHianao, ry Tomponay!\nHamasino izahay\nMba ho zanakao tokoa :\nZazakely izahay,\nMamindrà fo aminay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM775', 'Be ny fahavalonay\nO! arovy izahay;\nManomeza fo madio,\nFo miankina aminao :\nZazakely izahay,\nMamindrà fo aminay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM775', 'Ary raha tapitra\nNy iainanay atý,\nEnto ny fanahinay\nHonina ao an-danitra :\nZazakely izahay,\nMamindrà fo aminay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM776','FFPM 776');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM776', 'Mba ekeo, ry Jeso Tompo,\nIzahay madinikao,\nFa maniry te-hanompo\nSy hanao ny sitrakao;\nTsy mba zaza noterena,\nNa nomena zava-tsoa,\nFa minia manolo-tena,\nHo Anao  tokoa  tokoa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM776', 'Tsy ny manan-kery ihany,\nNa ny lalin-tsaina koa\nNo mahazo miandany\nAminao, Mpamonjy soa;\nFa ny mbola zaza osa,\nKa malemy toa anay,\nIzay mba te-hidodododo\nHomba Anao, Mpanjakanay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM776', 'Maminay ny fanompoana\nIzay natolotrao anay,\nKa hataonay sasa-poana\nIzay mamily dia anay,\nFa ny hany mba ilaina,\nDia ny fanohananao;\nMba ho azonay vitaina\nIzay rehetra sitrakao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM776', 'Enga anie ny faniriana,\nIzay anananay izao,\nKa harahim-pitahiana\nSy hotanterahinao\nDia ho feno fifaliana\nNy fanahy anatinay,\nKa tsy hisy hakiviana\nHanan-kery aminay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM777','FFPM 777');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM777', 'He! zaza maro be tokoa\nArý an-danitra,\nMifaly amin’i Jeso,\nFinaritra avokoa :\nHe! mihoby mafy izy,\nKa miderà an’i Jeso!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM777', 'Moa nentin’iza izy ireo\nHo ao an-danitra ao\nNo miramirana endrika\nSy faly toy izao ?\nHe! mihoby mafy izy,\nKa miderà an’i Jeso!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM777', 'Jesosy Tompo no nandao\nNy lapa fahizay,\nKa nahatonga azy ireo\nHo aminy arý :\nHe! mihoby mafy izy,\nKa miderà an’i Jeso!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM777', 'Ny lambany novàny soa,\nDia lamba tena vao,\nNy fony nosasany koa,\nKa faly izy izao :\nHe! mihoby mafy izy,\nKa miderà an’i Jeso!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM778','FFPM 778');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Vory izahay izao\nEto anatrehanao,\nRy Jeso Tomponay!\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Saotra tsara entinay,\nDera koa atolotray\nAnao, ry Tompo ô!\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Zazakely izahay\nFohy ny fisainanay,\nTarihonao izao :\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Ela no nasianao\nSoa ny mpanomponao,\nRy Tompo be fitia!\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Ao ny ray sy reninay,\nAry koa ny havanay,\nAtaovy olonao :\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM778', 'Zaza, ray, sy reny koa\nDia hihaona avokoa\nAn-danitrao arý :\nHe! faly ny fonay,\nFaly, faly, faly,\nHe! faly ny fonay,\nAvy mba hidera Anao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM779','FFPM 779');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM779', 'Jeso Kristy, Tomponay!\nJeso Kristy, Avotray!\nAvy mba hidera Anao\nIzahay mpianatrao,\n:,: Mihainoa, ry Jeso \nTompo ô! :,:\nFa ny fonay, fa ny fonay\nMidera Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM779', 'Zazakely izahay,\nZava-bitsy fantatray,\nKoa ny mahasoa anay\nDia ankinina aminao.\n:,: Mihainoa, ry Jeso \nTompo ô! :,:\nFa ny fonay, fa ny fonay\nMidera Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM779', 'Mamindrà fo aminay,\nMamelà ny helokay,\nMba hiraisana aminao,\nFa izay no maminao.\n:,: Mihainoa, ry Jeso \nTompo ô! :,:\nFa ny fonay, fa ny fonay\nMidera Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM779', 'Mba tahionao izahay\nAry koa ny havanay\nAtsangano ho Anao,\nFa izay no sitrakao\n:,: Mihainoa, ry Jeso \nTompo ô! :,:\nFa ny fonay, fa ny fonay\nMidera Anao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM780','FFPM 780');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM780', 'He, dera, laza, hery,\nAnao, Jeso ô!\nNy zaza no hilaza\nNy voninahitrao\nHianao Mpanjaka tia,\nHianao no Tomponay\nIzay tonga ho Mpamonjy\nSy ho Mpisolonay.\nHe, dera, laza, hery,\nAnao, ry Jeso ô!\nNy zaza no hilaza\nNy voninahitrao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM780', 'Midera Anao, ry Jeso!\nAnjely marobe\nKa izahay an-tany\nTa hankalaza Anao,\nToy  izay nataon’ny zaza\nIzay tao Jerosalema,\nNitondra ny rofia\nHo fanajana Anao.\nHe, dera, laza, hery,\nAnao, ry Jeso ô!\nNy zaza no hilaza\nNy voninahitrao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM780', 'Raha mbola tsy nijaly\nHianao, ry Tompo ô!\nNidera Anao ny zaza,\nKa faly Hianao;\nKoa mbola hoderaina\nHianao ankehitrio,\nRy Jeso Tompo tia!\nMandrakizay doria.\nHe, dera, laza, hery,\nAnao, ry Jeso ô!\nNy zaza no hilaza\nNy voninahitrao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM781','FFPM 781');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM781', 'Mijere, ry ray sy reny!\nIreto sombinainareo;\nAoka tsy hirenireny,\nTano toy ny ainareo;\nAza avela ho adala\nRay sy reny ô! jereo,\nAza mahafoy malala,\nFa tezao ho anareo.\nIndro ô! indro ô!\nIndro ny zanakareo, jereo!\nJeso ô! Jeso ô!\nIndro ny zanakay mba vonjeo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM781', 'Ray sy reny! mananara,\nAza mampanaram-po;\nManomeza teny tsara,\nFa ny zaza hankatò :\nAza avela mba hanompa,\nAoka ho tezainareo;\nMampahory raha manota,\nAoka tsy hafoinareo.\nIndro ô! indro ô!\nIndro ny zanakareo, jereo!\nJeso ô! Jeso ô!\nIndro ny zanakay mba vonjeo.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM782','FFPM 782');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM782', '« Lazao, lazao rankizy!\nIzay nandaozan’i\nJeso ny fanjakany\nMba honina tetý »\n« Ry mpampianatray ô!\nHamonjy sy handio\nAntsika olom-bery\nNo nihaviany »\n:,: Mifalia izao :,:\nMisy avotra sy vonjy\nHo antsika atý.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM782', '« Rankizy ô, rankizy!\nMpitrosa hianao,\nKa inona no homenao\nHanefa trosanao ? »\n« Ry mpampianatray ô!\nNy saina amam-po\nHomenay mba ho Azy\nRaha velona izahay »\n:,: Mifalia izao :,:\nMisy avotra sy vonjy\nHo antsika atý.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM782', '« Rankizy ô, rankizy!\nHamonjy sy handray\nAnao ve Jeso Tompo \nRaha mino hianao ? »\n« Ry mpampianatray ô!\nMatoky izahay\nFa efa maty Izy\nHo avotray tokoa »\n:,: Mifalia izao :,:\nMisy avotra sy vonjy\nHo antsika atý.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM782', '« Rankizy! angataho\nNy indrafony izao »\n« Ry Jeso ô, Mpamonjy!\nMba iantrao izahay »\nRy Tompo ô! ry Tompo!\nHenoy, henoy izahay,\nNa kely na vaventy,\nIzay mitaraina izao;\n:,: Mifalia izao :,:\nMisy avotra sy vonjy\nHo antsika atý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM783','FFPM 783');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM783', 'He, maharavoravo!\nMiantso zaza e\nNy Andriamanitra avo,\nMpanjaka lehibe;\nKa andeha hanatona Azy,\nFa hoy ny Tomponao :\n“Mba avelao ny zaza\nHanatona Ahy izao.”', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM783', 'Isika mbola zaza\nKanefa tian’ny Ray,\nNa dia tsy hendry aza,\nNa dia tsy mba mahay!\nKa andeha hanatona Azy,\nFa hoy ny Tomponao :\n“Mba avelao ny zaza\nHanatona Ahy izao.”', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM783', 'Ny tahotra esory,\nNy henatra ario;\nTsy laviny akory,\nKa manatòna anio :\nKa andeha hanatona Azy,\nFa hoy ny Tomponao :\n“Mba avelao ny zaza\nHanatona Ahy izao.”', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM783', 'Manetry tena izy,\nKa saotra no atao;\nIsika mbola ankizy\nMatoky Azy izao,\nKa andeha hanatona Azy,\nFa hoy ny Tomponao :\n“Mba avelao ny zaza\nHanatona Ahy izao.”', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM783', 'He maharavoravo!\nHe, mahafaly fo!\nFa zanaky ny Avo\nIsika atý anio :\nKa andeha hanatona Azy,\nFa hoy ny Tomponao :\n“Mba avelao ny zaza\nHanatona Ahy izao.”', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM784','FFPM 784');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Jeso, be fitia!\nZaza izahay,\nAvy mitaraina;\nMihainoa anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Bodo sy adala,\nIndreo ny zanakao;\nJeso ô, malala!\nAza lavinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Mpiandry ondry mora!\nMba tarihonao;\nTano tsy hania\nNy ondrikelinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Aza avela hitady\nLaza aman-jo!\nFa Hianao irery\nNo mahafa-po.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Tianao ny zaza,\nJeso! fantatray\nKa manolo-tena\nHo Anao  izahay.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM784', 'Jeso be fitia!\nZaza izahay,\nAvy mba hidera :\nMihainoa anay.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM785','FFPM 785');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Izahay ankizy\nTe hidera Anao,\nRy Jeso Mpamonjy!\nKa henoy izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Zanaky ny Avo,\nJeso Tomponay,\nFaly sady ravo\nRaha hatoninay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Te hifalifaly\nIzahay izao;\nHira mifamaly,\nTianay hatao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Te hiravoravo\nMiaraka aminao\nNefa mavomavo\nKa antsoy izao.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Te hisoka-bava\nHankalaza Anao;\nHira lalandava\nSatrinay hatao.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM785', 'Sambatra ny zaza!\nIzay trotroinao;\nNa kamboty aza,\nTonga zanakao.', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM786','FFPM 786');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM786', 'Ny teninao, Jehovah!\nIzay ianaranay,\nDia tsara tsy miova,\nKa ifalianay,\nHe, tena manan-jara\nIzahay ankehitrio,\nFa lova tsara fara\nNo azo amin’io.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM786', 'Ireo zaza teo aloha,\nDia tsy nahita izao,\nTsy nisy hampifoha\nNatory foana tao;\nNahantra sady ory,\nNiferina aina koa,\nTsy fantany akory\nIzay tena foto-tsoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM786', 'Mamiratra indrindra\nNy masoandronay,\nMilanto sy mirindra\nNy antom-piainanay;\nNy teninao ihany\nNo nahatonga izao,\nHe! sambatra ny tany,\nFa mahalala Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM786', 'Irinay mba hihombo\nIzay ianaranay,\nAmpio koa mba hitombo\nNy saina anananay;\nHo avo zato heny\nNy voan’ny teninao,\nHiely eran-tany\nNy voninahitrao!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM787','FFPM 787');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM787', 'Izay mahakolokolo\nNo manana ny soa;\nZahao ny tanimboly,\nIzay fatratra tokoa,\nFa he ireo voninkazo\nMamerovero ao,\nToa nofy izay handazo,\nAndeha mba jereo.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM787', 'Ireo izay mahavatra,\nHandray ny voka-tsoa,\nKa tena tsy hahantra\nTsy reraka tokoa;\nJereo ireo taninketsa\nMampanantena voa,\nFa soa tsy manam-petra\nSy hanim-be tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM787', 'Izahay, ry ray sy reny,\nNo voninkazo koa,\nHamerovero any\nAn-tokantrano soa;\nTezao mba hihatsara\nNy fofo-manitray;\nMba tsy harahin-tsento\nNy toetra  anananay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM787', 'Izahay no toy ny ketsa\nHo vanona tokoa,\nHamoa tsy misy fetra,\nSy tena hahasoa;\nNy fiangonantsika\nHahita valiny,\nNy fivavahantsika\nHandroso hery koa.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM788','FFPM 788');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM788', 'Ry Jeso Sakaizan’ny zaza,\nKanefa Mpanjaka Malaza;\nMidera ny Anaranao re\nIzahay vory eto izao.\n:,: Ny saotra sy dera aman-daza\nno atolotray ho Anao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM788', 'Ry Jeso, malemy fanahy!\nManatona Anao tsy manahy\nNy zaza mivory atý izao,\nEkeo mba ho mponina arý.\n:,: Ny saotra sy dera aman-daza\nno atolotray ho Anao :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM788', 'Fahiny Hianao tonga teto\nNanala ny rofy sy sento,\nAvia mitahy anay re,\nMatoky Anao izahay.\n:,: Ny saotra sy dera aman-daza\nno atolotray ho Anao :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM788', 'Ry Jeso, Mpamonjy sy Zoky\nIzay ampy tokoa mba ho toky,\nMifaly ny manana Anao izao,\nArovy ka aza mandao.\n:,: Ny saotra sy dera aman-daza\nno atolotray ho Anao :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM789','FFPM 789');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM789', 'Zaza izahay, ry Jeso ô!\nNefa Hianao dia tia anay;\nInjany re ny feonao\nMiantso hoe : “ Avia! Avia!”\nMba raisonao re, mba\nraisonao re, ry Tompo ô!\nMba raisonao re, mba\nraisonao re izahay izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM789', 'Zaza izahay, ry Jeso ô!\nHianao tatý mba zaza koa;\nTarihonao ny hevitray\nHanahaka ny hevitrao!\nMba raisonao re, mba\nraisonao re, ry Tompo ô!\nMba raisonao re, mba\nraisonao re izahay izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM789', 'Zaza izahay, ry Jeso ô!\nNy tenanay malemy koa;\nKanefa he, ny herinao\nMiaro ny fanahinay!\nMba raisonao re, mba\nraisonao re, ry Tompo ô!\nMba raisonao re, mba\nraisonao re izahay izao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM790','FFPM 790');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM790', 'Jeso ô! Sakaiza tsara,\nBe ny fitiavanao;\nTsy mba misy voarara\nTsy hihavana aminao;\n:,: Mahagaga :,:\nNy haben’ny antranao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM790', 'Jeso ô! mba manampia\nIzao madinikao izao\nTsy hivily, tsy hania,\nFa hanara-dia Anao,\n:,: He, malemy :,:\nNefa be ny herinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM790', 'Jeso ô! Mpamonjy mora!\nManampia, mamonje,\nFa isan-andro, isan-ora\nMisy fahavalo be\n:,: ’Zay mamely :,:\nKa harovanao anie.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM791','FFPM 791');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM791', 'Tonga ny hariva,\nKa ny aizina\nEfa mba madiva\nHo mpanarona.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM791', 'Jeso ô, tsinjovy\nKa tahio izahay,\nEny, mba arovy\nHandry fahizay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM791', 'Maniraha anjely\nMba hiambina\nAhy zazakely\nRaha maizina.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM791', 'Ary raha maraina\nMba fohazy indray\nHo madio sy tsara\nEo imasonao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM792','FFPM 792');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM792', 'Misy zaza marobe\nFaly, sambatra ao ambony;\nNy devoly lozabe\nTsy mamely azy intsony,\nIzy ireo dia zazakely\nTonga naman’ny anjely.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM792', 'Mba irionao tokoa\nNy ho naman’izy ireny,\nIndro, misy zava-tsoa\nHo anao raha tonga eny,\nDia afoizo sy ario\nIzay rehetra tsy madio.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM792', 'Tompo, raiso izahay\nMba ho zanakao handova\nLapa soa rahatrizay\nLova tsy miovaova;\nManan-jara aoka izany\nIzay rehetra tonga any.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM793','FFPM 793');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Mba tsarovy re, rankizy\nAo am-piangonana,\n:,: Tsy hatory fa haniry\nMba ho zaza maotina :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Tonga ao Jesosy Tompo,\nKa mihaino vavaka;\n:,: Ny manatona hanompo\nRaisiny ho zanaka :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Mba hirao ny fiderana,\nKa ezaho mafy hoa :\n:,: “ Arahaba re, hosana!\nRy Mpanjaka lehibe ” :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Eny, Tompontsika Izy,\nTompo tsara, mora fo,\n:,: Ka hatoninao, rankizy,\nO! hatòny eram-po :,:', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Aza mba misalasala,\nAtolory izao ny fo,\n:,: Fa ny Tomponao malala\nFaly ta-hamindra fo :,:', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM793', 'Ry Mpamonjiko mahery,\nRaiso aho ho Anao,\n:,: Raiso ho Anao irery,\nRaiso re, ka anjakao :,:', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM794','FFPM 794');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM794', 'Ry Jesosy tsara\nAo an-danitra\nIzahay dia zaza\nSaro-tahotra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM794', 'Koa ny anjely\nMba irahonao\nHo anay izay kely,\nRaha sitrakao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM794', 'Dia mba tantano,\nJeso, izahay,\nAry mba fahano\nNy fanahinay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM794', 'Hianao, Mpamonjy,\nDia tianay;\nIzahay voavonjy\nTia Anao indray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM795','FFPM 795');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM795', 'Jeso ô, Sakaizanay,\nAo an-danitra aminao\nMisy zaza namanay\nMifaly ravo ao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM795', 'O, ry tia zaza ô!\nMba ampio izahay\nMba hifaly aminao\nAtý an-dasinay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM795', 'Raha mbola ho atý,\nMba tantano izahay,\nKa tariho ho arý,\nRy Zoky tia anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM795', 'Ary raha tapitra\nNy anjaranay atý\nRaisonao mba hiditra\nAo aminao arý.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM796','FFPM 796');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM796', 'Henoy izany hira vao\nErý an-danitra,\nFa teraka Jesosinao,\nKa mahafinaritra.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM796', 'Ianaronao matetika\nNy fitiavany,\nFa sambatra sy tretrika\nIzay sakaizany.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM796', 'Atero zava-manitra\nSy volamenam-po\nIlay Mpanjakan-danitra,\nMpanjakantsika koa.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM796', 'Valio fitiavana\nIlay Zoky tia  anao,\nAteronao fisaorana,\nDerao fa Tomponao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM797','FFPM 797');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM797', 'Ry Jeso Zaza masina,\nMitsaoka Anao izahay,\nAtolotray ho hasina\nNy tena kelinay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM797', 'Mihoby ny fanahinay\nMihaona aminao;\nRy Zanak’Andriamanitray,\nTsy misy toa Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM797', 'Ny zavatra anananay\nDia aoka ho Anao,\nNy tena sy fanahinay\nMba hasoavinao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM797', 'Ny lanitra nafoinao,\nNilaozanao ny Ray\nMba hanavao ny olonao\nHo velona indray.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM798','FFPM 798');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM798', 'Izahay zazakely manatona\nAnao,\nRy Jeso izay teraka androany\nFa tonga hanavotra anay\nHianao,\nKa faly izahay izany;\nMitehafa tànana\nDera no asandratra,\nMihobia, mifalia,\nFa Kristy Tompo teraka\nHo antsika!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM798', 'Izahay zazakely maniry izao\nHo tena sakaiza tokoa,\nKa avy izahay mba hanaraka\nAnao\nRy Jeso Mpanjaka Tsitoha;\nMitehafa tànana\nDera no asandratra,\nMihobia, mifalia,\nFa Kristy Tompo teraka\nHo antsika!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM798', 'Izahay zazakely mangataka\nAnao\nHamory ny zaza rehetra,\nFa be ny ankizy miandry Anao\nHo Tompon’ny tany rehetra.\nMitehafa tànana\nDera no asandratra,\nMihobia, mifalia,\nFa Kristy Tompo teraka\nHo antsika!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM799','FFPM 799');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM799', 'Zaza sambatra tokoa,\nRy Jesosy, izahay,\nFa ny Tompo Zanahary\nNo mamelona anay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM799', 'Zaza sambatra tokoa,\nRy Jesosy, izahay,\nHianao nijaly mafy\nHanavotanao anay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM799', 'Zaza sambatra tokoa,\nRy Jesosy, izahay,\nNy Fanahy Mpanadio\nManamasina anay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM799', 'Zaza sambatra tokoa,\nRy Jesosy, izahay,\nFiarovanay tsy toha\nHianao, ry Tomponay!', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM800','FFPM 800');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM800', 'Haleloia, asandratray\nHo Anao, ry Jeso ô!\nResinao ny rafinay,\nFa nitsangana Hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM800', 'Foana ny fasana\nFa tsy nahatana Anao;\nNy fahafatesana\nDia nofolahinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM800', 'Ka mihira izahay,\nFa nandresy Hianao,\nKa ho velona indray\nIzahay madinikao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM800', 'Hianao hisaoranay\nRaha hitsangana izahay\nKa handao ny fasanay,\nMba handray ny lovanay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM800', 'Dera no ventesinay\nHo Anao, ry Zokinay;\nHoby no asandratray,\nRy Mpanjaka maminay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM801','FFPM 801');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM801', 'Izaho dia zaza\nMalemy, osa fo,\nFa na izany aza,\nMba ondrin’ny Jeso.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM801', 'Arý an-danitra  Izy\nMitsinjo ahy koa,\nSatria ny ankizy\nDia tiany tokoa.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM801', 'Anefa ko akaiky\nJesosy mamiko,\nFa Izy dia manaiky\nHo eto amiko.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM801', 'Manafa-tahotra ahy\nNy tsorakazony,\nManaisotra ahiahy\nNy fitiavany.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM801', 'Izao tsy mbola hita\nNy endrik’Izy izay,\nFa raha arý am-pita\nHiahona izahay.', '5');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM802','FFPM 802');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM802', 'Misy ny fonenana\nVita re, ho ahy,\nTany ifaliana,\nMamin’ny fanahy;\nAo, tsy misy tahotra,\nAo ny Tompon’avotra,\nHira mahafinaritra\nNo ataon’ny any.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM802', 'Saotra no hataoko ao,\nFaly fa nandresy;\nHiakanjo fotsy vao,\nHaingon’ny mpandresy.\nNy anjely masina\nHiaraha-monina,\nJeso Tompo marina\nHiampofo ahy.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM802', 'Izaho voavidinao,\nRy Mpamonjy tsara,\nSady namboaranao\nLova tsara fara.\nKoa mba arovinao\nToy ny ondrikelinao\nIzaho izay fanananao\nRy Mpiandry Tsara!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM803','FFPM 803');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM803', 'Avia, ry Fanahy ô!\nHo eto aminay,\nNy fanahinay mba fenoinao\nNy hasoavanao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM803', 'Maloto ny fanahinay,\nKa mba diovinao;\nTsy mahomby re ny\nfihevitray,\nMba amboarinao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM803', 'He, zaza osa izahay,\nKa mba tantanonao,\nBe ny ratsy izay te-hitaona\nanay,\nAmpio ny olonao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM803', 'O, ry Fanahy hendry ô,\nMiandry izahay,\nManantena Anao hanadio\nny fo\nHe, zaza osa izahay,\nKa mba tantanonao,\nBe ny ratsy izay te-hitaona\nanay,\nHenoy ny hatakay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM804','FFPM 804');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM804', 'O, ry Fanahy Masina!\nIzahay ampionao,\nFa izahay madinika\nManiry ho Anao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM804', 'Ny fonay dia maizina,\nKa tsy mba fantatray\nNy tena lala-marina :\nTariho izahay.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM804', 'Koa amoròny fo vaovao\nIzahay mpanomponao;\nNy ratsy mba esorinao\nHitiavanay Anao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM804', 'O, ry Fanahy Masina!\nMangataka izahay :\nMombà anay madinika,\nHenoy ny hatakay.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM805','FFPM 805');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM805', 'Izao rehetra izao dia\nmankalaza Anao,\nRy Ray Mahery, Tomponay\ntokoa,\nNy zava-boahary no asan-\ntananao\nKa tsara  indrindra  sady  soa.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM805', 'Miondrika aminao izahay\nmadinikao\nMidera Anao, ry Rainay be\nfitia!\nAmpio izahay, ary mba\narovinao\nNy fonay mba tsy haniasia.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM805', 'Ry Rainay be fiantra, tariho\nizahay\nHo tonga zaza tia ny mazava,\nHifaly ao an-danitra ao\nrahatrizay\nHo sambatra any lalandava.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM806','FFPM 806');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM806', 'Avia ry zaza, avia izao,\nFa indro ny Tompo miandry\nanao;\nLazao an’i Jeso ny zava-\nmanjo,\nFa Izy onena ny ory am-po.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM806', 'Jesosy Mpamonjy nanavotra\nanao,\nKa zaza malalany koa hianao,\nKa dia matokia tokoa \neram-po\nFa Izy Mpanjaka mahery\nsy to.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM806', 'Jesosy no tsy manadino anao,\nTsarovy izany ka mba\nandrandrao\nNy Tompo malala Izay be\nindrafo;\nAnao re ny lova tsy mety\nho lo.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM806', 'Sasaonao ny foko,\nMpanavotra ô!\nHo tonga madio sy mendrika\nAnao\nHo sambatra aho hahita Anao,\nMpamonjiko tsara ao\nan-danitra ao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM807','FFPM 807');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM807', 'Manatòna re, rankizy,\nNy Mpamonjy avotrao,\nFa henoy, miantso Izy,\nIzao fotoana anio izao :\n« Zaza be faniasia,\nMiverena hianao;\nOndry kely, malakia,\nManaraka Ahy izao! »', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM807', 'Ny devoly andosiro,\nKa ny ota ialao,\nFa ny tsara no fikiro,\nTiavo re Jesosinao;\nMiovà ka manenena\nNoho ny ota izay natao,\nRaisonao ny famonjena\nKa hazony  hatrizao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM807', 'Miaingà ka manompoa\nAn’i Jeso Tomponao,\nTanteraho avokoa\nNy anjara asanao;\nHalaviro re ny laina,\nMiasà ka mazotoa,\nHatanjaho re ny saina\nMahareta, mandrosoa.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM808','FFPM 808');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM808', 'Eo an-tratranao, Jesosy,\nDia mahafinaritra\nFa ny hafa mampahory\nKa tsy  mahasambatra.\nRaha Hianao no aro,\nAfaka ny tahotro,\nRaiso ho Anao ny foko,\nRy Jesosy tia ô!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM808', 'Mampifaly ahy koa,\nJeso, ny fitianao;\nZara mamiko tokoa\nIzany ampofoinao;\nNa matory na mifoha;\nDia eo an-tratranao;\nRy Mpamonjy Tompo soa,\nHoderaiko Hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM808', 'Izaho tena tsy tamana,\nRaha lavitra Anao,\nFa mitebiteby lava\nIzay tsy eo akaikinao.\nEo an-tratranao, Jesosy,\nTsara hitoerako;\nEo ihany e no misy\nZava-tsoa  mahafa-po.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM809','FFPM 809');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Jeso Sakaizan’ny zaza,\nTompo koa,\nJeso Sakaiza Malaza!\nMihainoa!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Zaza izahay mitaraina\nAminao;\nMbola marefo ny aina,\nTanonao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Jeso Sakaiza malala,\nTokinay;\nAoka mba tsy ho adala\nIzahay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Jeso ô! ampianaro\nIzahay,\nJeso! avia hiaro\nNy dianay.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Zaza izahay,ka sakano\nTsy hania;\nKely izahay ka tantano\nJeso tia!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Ary ny ray aman-dreny\nRaisonao,\nAoka ny fony homeny\nHo Anao.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM809', 'Jeso Sakaizan’ny zaza,\nTompo koa!\nJeso Sakaiza malala\nMihainoa.', '7');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM810','FFPM 810');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM810', 'Tompo manampia ny\nmpianatrao,\nAry mitahia ny madinikao,\nMba ho tonga zaza sitrakao\nizahay,\nZaza mankalaza ny \nMpanavotray.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM810', 'Maminay tokoa ny Anaranao,\nSambatra avokoa re ny\nhavanao;\nManana anjara any aminao,\nRy Mpamonjy tsara ny\nmadinikao.', '2');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM811','FFPM 811');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM811', 'O, rankizy izay mivory,\nMba derao ny Tompo soa,\nKa ny fonao atolory,\nNy fanahy, tena koa\n:,: Mba venteso re ny hira,\nKa derao ny Tomponao :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM811', 'O, ry Tompo be fitia,\nMba henoy ny zanakao;\nFa miantso hoe : Avia!\nManatreha anay izao!\n:,: Izay hataonay re tahio\nHo madio sy masina :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM811', 'Mba tolory fahendrena\nIzahay madinikao,\nKa omeo ny famonjena\nHifikirana aminao;\n:,: O, tarihonao ny dia\nHahitana Anao, ry Ray! :,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM811', 'He, ny fonay manontolo,\nIzay mangetaheta re,\nDia atolotray daholo,\nAza dia lavina e!\n:,: Mba onenonao ny fonay\nHo Anao mandrakizay :,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM812','FFPM 812');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM812', 'Ry Jeso Zokinay ô!\nJeso malalanay,\nHenoy ny vavakay izao,\nFa zandrinao izahay.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM812', 'Ny batisa no nandio\nAnay ho zandrinao,\nKa dia mba tahio\nHanaraka Anao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM812', 'Ry Zokinay malala,\nArovy izahay,\nFa be ny manadala,\nManimba ny fonay.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM812', 'Ry Zokinay malala,\nTrotroy ny zandrinao,\nRehefa mba hiala\nHo any aminao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM813','FFPM 813');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Tia zaza\nTia zaza\nNy Jesosinay!\nLanitra nafoiny,\nZaza notrotroiny,\nTia zaza \nTia zaza \nNy Jesosinay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Trano tsara\nTany tsara\nNamboariny;\nTrano be anjely,\nHo anay izay kely,\nTrano tsara\nTany tsara\nNamboariny.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Voankazo,\nVoninkazo \nTsara fofona,\nTsy halazo intsony\nAo Edena ambony,\nVoankazo,\nVoninkazo \nTsara fofona.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Zazakely\nSy anjely\nSamy sambatra;\nHira no hirainy\nAo an-tranon-dRainy.\nZazakely,\nSy anjely\nSamy sambatra.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Seza tsara,\nLamba tsara\nHo antsika ao\nHiakanjo lava \nFotsy lalandava\nSeza tsara,\nLamba tsara\nHo antsika ao', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM813', 'Ento mora,\nEnto mody\nJeso, izahay,\nHo an-tranon-dRainao,\nFa ao no tranonay ô!\nEnto mora,,\nEnto mody\nJeso, izahay', '6');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM814','FFPM 814');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM814', 'Tsara re, ny lanitra\nSady mahafinaritra!\nAo ny Rainay be fitia,\nAo ny zaza tsy mania,\n:,: Ao ny fifaliam-be :,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM814', 'Ondry kely izahay,\nAry tsy mba fantatray\nNy hanjo etý an-tany,\nKa maniry mba ho any\n:,: Aminao, ry Tomponay :,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM814', 'Ry Mpiandry Tsara ô!\nAoka mba hamindra fo\nAminay izay mbola kely,\nMba iraho ny anjely\n:,: Ho mpiambina anay :,:\n\nLITANIA', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM815','FFPM 815');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM815', 'Ry Andriamanitra Rainay,\nMihainoa! (in-3)\nMiondrika eto anatrehanao\nizahay,\nFa Hianao no Andriamanitray,\nKa henoy izahay!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM815', 'Ry Jeso Kristy, Zanak’\nAndriamanitray,\nMamonje! (in-3)\nFa Hianao no Mpamonjy\nizao tontolo izao,\nAry ny Ranao no nanavotanao\nanay,\nKa vonjeo izahay!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM815', 'Ry Fanahy Masina,\nMpananatra anay!\nDiovinao! (in-3)\nFa Hianao no mahay manadio\nny fonay\nMba ho tempoly mendrika\nny hitoeranao,\nDiovinao izahay!', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM816','FFPM 816');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM816', 'Ry Zanakondry ô, Mpisolo ny\nmpanota!\nMamindrà fo aminay!\nRy Zanakondry ô, Mpisolo ny\nmpanota!\nMamindrà fo aminay!\nRy Zanakondry ô Mpisolo ny\nmpanota!\nOmeo anay ny fiadananao!\nTompo ô, mba miantrà!\nMamelà re, ny helokay\nNiara nanota izahay tamin-\ndrazanay\nKa tsy madio, fa ratsy ny\ntoetray!\nRy Tompo ô, aza ataonao\naminay\nAraka ny fahotanay\nKa aza averina aminay ny\nhelokay!\nHenoy ny hatakay,\nKa raisonao fifonanay!\nAmen!', '1');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM817','FFPM 817');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Fizarana I', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Andriamanitra Tompo ô!\nRay, Fanahy, Zanaka,\nMihainoa anay izao\nRy Telo Izay Iray!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Jeso Zanak’i Maria,\nNaka endrik’olona,\nTonga zaza toa anay :\nMihainoa, Jeso ô!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Notafian-dreninao\nLamban-jaza Hianao\nTao anaty vilona :\nMihainoa, Jeso ô!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Novangian’olona\n‘Zay niandry ondriny\nTao an-tsaham-Betlehema :\nMihainoa, Jeso ô!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Notezaina Hianao,\nNotrotroin’i Simeona,\nNotompoin’i Ana koa,\nMihainoa, Jeso ô!\n\nFizarana II', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Amin’ny avonavona,\nAmin’ny fahatezerana,\nAmin’ny fialonana :\nMamonje, ry Jeso!', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Amin’ny hevi-tsy madio,\nAmin’ny teny ratsy koa,\nAmin’ny fahasarotam-po :\nMamonje, ry Jeso!', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Hankatò ny didinao,\nHankahala heloka,\nMba ho zanakao tokoa :\nMitariha, Jeso!', '9');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Mba hazoto izahay,\nTia fivavahana,\nTsy ho resin’i Satana :\nMitariha, Jeso!\n\nFizarana III', '10');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Noho ny nahaterahanao\nNoho ny ranomasonao,\nNoho ny fahorianao :\nMamonje, ry Jeso ô!', '11');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Noho ny satro-tsilonao,\nNoho ny ra nalatsakao,\nNoho ny nitsangananao\nMamonje, ry Jeso ô!', '12');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Noho ilay Anaranao\nIondrehon’olona\nSy ny ao an-danitra :\nMamonje, ry Jeso ô!', '13');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM817', 'Noho ny herinao tsy toha\nNoho ny voninahitrao,\nNoho ny famindramponao\nMamonje, ry Jeso ô!', '14');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM818','FFPM 818');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Jeso Kristy Tomponay,\nZanaka malalan-dRay,\nNo naetry ho anay;\nMamonje anay anie.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'He! ny fahatsoranao\nSy ny fahadiovanao,\nTsy mpanota Hianao :\nMamonje anay anie.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Hianao no marina,\nMora fo sy masina,\nAry tsy mialona :\nMamonje anay anie.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Tsy niala sasatra,\nTsy nandà ny sarotra,\nFa nitondra henatra :\nMamonje anay anie.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Heloka tsy rariny,\nHianao najaliny\nTao an-tampon-Kalvary :\nMamonje anay anie.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Lasanao ny helokay,\nRaha mibebaka izahay\nTsy manao ny sitrakay :\nMamonje anay anie.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'He! ny fitsangananao,\nResy ny fahavalonao\nTamim-boninahitra :\nMamonje anay anie.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Hianao, ry Jeso ô!\nAnateranay izao\nSaotra  izay anjaranao :\nMamonje anay anie.', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM818', 'Fo, fanahy, tena koa,\nHo anao mba hahasoa\nIzay rehetra tia tokoa :\nMamonje anay anie.', '9');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM819','FFPM 819');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Rainay ô, Mpamorona!\nJeso ô, Mpanavotra,\nAry ny Mpananatra :\nMihainoa, ry Tompo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Hianao no foto-tsoa\nSy harem-panahy koa,\nHandrosoanay tokoa :\nMihainoa, ry Tompo!', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Be ny heloka natao,\nBe ny famindramponao,\nMamelà anay izao :\nMihainoa ry Tompo!', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Malahelo izahay,\nFa maditra hatrizay,\nAza mba mandao anay :\nMihainoa ry Tompo!', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Mba diovy ny fonay,\nHatanjaho ny sainay,\nAhitsio ny dianay :\nMihainoa, ry Tompo!', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Be tokoa ny indrafo\nIzay naseho ho anay,\nTena latsaka ao am-po :\nMihainoa, ry Tompo!', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Eny, famonjena re,\nHahitanay aim-be,\nNo efa vitanao tetý :\nMihainoa, ry Tompo!', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Aina, hery, andro koa\nNo atolotray tokoa,\nMba hahaizanay ny soa :\nMihainoa, ry Tompo!', '8');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM819', 'Ho Anao tsy tapitra\nHaja, dera, saotra koa\nHo Anao mandrakizay :\nMihainoa, ry Tompo!\n\n----oOo----', '9');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM820','FFPM 820');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Jeso Kristy Tomponay,\nZanaka malalan-dRay,\nNo naetry ho anay;\nMamonje anay anie.', '1');
