INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Hianao no marina,\nMora fo sy masina,\nAry tsy mialona;\nMamonje anay anie.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Tsy niala sasatra,\nTsy nandà ny sarotra,\nFa nitondra henatra.\nMamonje anay anie.', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Heloka, tsy rariny;\nHianao najaliny\nTao an-tampon’i Kalvary;\nMamonje anay anie.', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Lasanao ny helokay\nRaha mibebaka izahay\nTsy manao ny sitrakay\nMamonje anay anie.', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'He! ny fitsangananao,\nResy ny fahavalonao\nTamim-boninahitrao,\nMamonje anay anie.', '7');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM820', 'Hianao, ry jeso ô!\nAnateranay izao\nSaotra izay anjaranao;\nMamonje anay anie.', '8');
