INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Rainay ô, Mpamorona!\njeso ô, Mpanavotra,\nAry ny Mpananatra;\nMihainoa, ry Tompo!', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Hianao no foto-tsoa\nSy harem-panahy koa,\nHandrosoanay tokoa;\nMihainoa, ry Tompo', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Be ny heloka natao,\nBe ny famindramponao,\nMamelà anay izao;\nMihainoa, ry Tompo', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Malahelo izahay,\nFa maditra hatrizay,\nAza mba mandao anay;\nMihainoa, ry Tompo', '4');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Mba diovy ny fonay,\nHatanjaho ny sainay,\nAhitsio ny dianay;\nMihainoa, ry Tompo', '5');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Be tokoa ny indrafo\nIzay naseho ho anay,\nTena latsaka ao am-po;\nMihainoa, ry Tompo!', '6');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Eny, famonjena re,\nHahitanay aim-be,\nNo he, vitanao tety;\nMihainoa, ry Tompo', '7');
