INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM821', 'Ho Anao tsy tapitra;\nHaja, dera, saotra koa,\nHo Anao mandrakizay;\nMihainoa, ry Tompo\nAmena.', '9');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM822','FFPM 822');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM822', 'Nohariana mba ho tsara ny tontolo\nKa ho sambatra, ho mendrika ny Ray\nNihasimba, simban’ota dia nisolo\nFanjakan’ny haratsiana mahamay,\nNisy anefa Tompo izay nampanantena\nMba hamerina ny soa ‘zay efa very\nKristy fiainana mizara famonjena,\nTokana no azo antok’Izy irery.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM822', 'Noharina mba ho iray isika mpino\nKa hanompo Tompo tokana Tsitoha\nNdrisy anefa, fa mikipy manadino\nFa matory am-pisarahana tsy mifoha\nNisy anefa, mbola misy Tompo iray\nAzo toky fa hamory ny mania\nKristy fiainana, hanangona indray\nNy Fiangonany hiray raha toa minia', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM822', 'Tsia, tsy nisy nohariana mba hijaly\nTsia, tsy nisy voatokana ho faly\nTsy hi-fandrafy sy hiady sanatria\nNo namoronana ny olona, ô, tsia!\nFa ireny vokatry ny kihotana\nKa mamikitra, tapisaka, lovàna\n‘Reo rehetr’ireo ho levona sy foana\nRaha Kristy Fiainana no ho Tomponao.', '3');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM823','FFPM 823');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM823', 'Hoderaina tokoa\nHianao, ô ry Ray\nNoho ny teny soa,\nIzay nomenao anay\nFiv : \nTeninao ny Baiboly\nAndriamanitra Ô!\nTeny fiainana\nHo an’izao tontolo izao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM823', 'Fa ny Teny nomenao,\nTompo ô, Ray Tsitoha,\nManadio, manavao,\nMampahery ny fo!\nFiv : \nTeninao ny Baiboly\nAndriamanitra Ô!\nTeny fiainana\nHo an’izao tontolo izao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM823', 'Mitsangàna hanompo\nO! ry mino izao,\nKa ny tenin’ny Tompo\nNo torio, ambarao.\nFiv : \nTeninao ny Baiboly\nAndriamanitra Ô!\nTeny fiainana\nHo an’izao tontolo izao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM823', 'Dia tariho lalandava\nMba hiely, ry Ray,\nTeny soa hanazava\nIty firenenay!\nFiv : \nTeninao ny Baiboly\nAndriamanitra Ô!\nTeny fiainana\nHo an’izao tontolo izao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM824','FFPM 824');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM824', 'Ry Andriamanitra nahary,\nIsaoranay ny Anaranao\nNasehonao miharihary\nNy herin’ny fitiavanao:\nFiv : \nFa ny Fiangonanao najoro\nHo fiorenam-pahamarinana,\nDia vatolampy tsy hikoro\nSy andry azo ifikirana,', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM824', 'Ny teninao, Jeso Mpandresy,\nNo nifahiran-dRasalama\nTanaty memy nifanesy\nSy fiakarana malama:\n\nFiv : \nFa ny Fiangonanao najoro\nHo fiorenam-pahamarinana,\nDia vatolampy tsy hikoro\nSy andry azo ifikirana,', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM824', 'Ny tranomaizim-pijaliana,\nNampian’ny lefona mifofo,\nNanjary hiram-pihobiana\nNandresy lahatra ny nofo:\n\nFiv : \nFa ny Fiangonanao najoro\nHo fiorenam-pahamarinana,\nDia vatolampy tsy hikoro\nSy andry azo ifikirana,', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM824', 'Ilay nantsoina ho maritiora,\nFitarikandro nanazava,\nNamerovero toy ny miora,\nNandroaka aizina hisava:\n\nFiv : \nFa ny Fiangonanao najoro\nHo fiorenam-pahamarinana,\nDia vatolampy tsy hikoro\nSy andry azo ifikirana,', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM825','FFPM 825');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM825', 'Raha manjavona ny andro\nvoasarona avokoa\nNy tendrombohitra avo\nsy ny lohasaha koa\nSy ny renirano tsara izay\nmangarana madio.\nTsy hita ankehitriny\nfa manjavona anio.\nFiv : Na manjavona aza anio\nNefa ao ambony ao\nNy mazava lalandava\nTsy miova na mandao :,:\nMatokia, ry sakaiza\nAza kivy hianao.', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM825', 'Raha misava indray ny andro,\ndia ho hita avo-koa\nNy tendrombohitra avo\nsy ny lohasaha koa\nSady ao ny renirano\nka mangarana izao,\nKa afaka ny zavona\nnanarona azy tao:\nFiv : Na manjavona aza anio\nNefa ao ambony ao\nNy mazava lalandava\nTsy miova na mandao :,:\nMatokia, ry sakaiza\nAza kivy hianao.', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM825', 'Raha mbola aty an-tany\nka vahiny izahay,\nManjavona matetika\ntokoa ny andronay.\nNa dia ao ny masoandro aza,\ntakona izy ‘zao\nFa maizina ny andro,\nka tsy fantatra fa ao:\nFiv : Na manjavona aza anio\nNefa ao ambony ao\nNy mazava lalandava\nTsy miova na mandao :,:\nMatokia, ry sakaiza\nAza kivy hianao.', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM825', 'Raha tapitra ny dian’ny fanahinao aty,\nFatiny Ka lasan’Andriamanitra\nho aminy ary,\nTsy hanjavona ny andro,\nfa tsy misy rahona ao,\nHazava ery an-danitra avokoa\nny andronao.\nFiv : Na manjavona aza anio\nNefa ao ambony ao\nNy mazava lalandava\nTsy miova na mandao :,:\nMatokia, ry sakaiza\nAza kivy hianao.', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM826','FFPM 826');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM826', 'Taona tokana sarobidy\nKa isaorana Ilay Tsitoha\nTena taona mba fitadidy\nFa tsingerina mampifoha\nNy hafalian’ny lohantaona\nNo manenika izato lasy\n:,:Fa naharitra ka tsy foana\nNy Baibolin’ny Malagasy:,:', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM826', 'Ny vahoakan’ny firenena\n‘Njao mianoka fifaliana\nFa ny Tenin’ny Famonjena\nNo rnivimbina fitahiana\nKa manenika ny eran-tany\nSy manerana ny tontolo\n:,:Ary isany tamin’izany\nNy taninay ka niova volo.:,:', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM826', 'Be ny sarotra nosetraina\nBe ny sakana izay nandrara\nNisy aza famoizana aina\n‘Zay voarakitry ny tantara.\nNefa, tao Andriamanitra\nKa ny Teniny tsy mba resy\n:,:No sabatra iray maranitra\nNampahatoky sy nampandresy:,:', '3');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM826', 'Irina indrindra ho tafatoetra\nHitondrana ny firenena,\nHo filamatra, tarigetra\nIzany tenin’ny Famonjena:\nNy fitiavana hahazo laka,\nFilaminana no hiseho,\n:,:Fiadanana no hanjaka,\nNy fahantrana ho foana hatreo:,:', '4');
INSERT INTO song (author_id, category_id, reference, title) VALUES (1,1,'FFPM827','FFPM 827');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM827', 'Na mamely ny tafiotra lehibe\nSy mandrivotra fatratra\nKa efa mila hahavery saina re!\nHozakaiko fa lahatra\nJeso Tompo no amiko izao\nKa ny loza resiny avokoa\nIzy no mitondra ahy mba ho ao\nAmin-dRainy handova ny soa.\nFiv : Mandrosoa hoy ny Tompo\nFa Izaho hitondra anao\nKa hitandrina anao\nSy hanatitra anao\nAny Ziona fonenan’ny Ray', '1');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM827', 'Na dia maizina ny lalako ety,\nSady be fahavalo koa\nKelikely foana dia ho tonga ary\nKa ho tretrika ao tokoa.\nJeso Tompo no misakambina\nSy mihazona ny tanako roa,\nSady be fitia ka te-hiambina\nNy fanahy sy ny aiko koa.\nFiv : Mandrosoa hoy ny Tompo\nFa Izaho hitondra anao\nKa hitandrina anao\nSy hanatitra anao\nAny Ziona fonenan’ny Ray', '2');
INSERT INTO verses (song_reference,lyrics, reference) VALUES ('FFPM827', 'Reko re ny alon-drano lehibe\n‘Zay mamely ankehitrio;\nKa toa kivy ny fanahiko mandre,\nKanjo tsara ho ahy io.\nFa tsy tiako ny hanalavitra\n‘Lay Mpanafaka ny zava-manjo,\nRaha toa ny saiko tsy finaritra,\nKa mangovitra mafy ny fo.\nFiv : Mandrosoa hoy ny Tompo\nFa Izaho hitondra anao\nKa hitandrina anao\nSy hanatitra anao\nAny Ziona fonenan’ny Ray', '3');
